INSERT INTO `MedHelp` VALUES (1,0,0,'N','Paracetamol Overdose','Be careful you are using the right graph with the right units. \nIf in doubt and the patient has taken more than 10g, give the antidote.','ED','emerg-med','','','','Guideline','QDSH QBEH QODP QMEN aceteminophen OD ','','Background','Paracetamol is the most commonly taken drug (excluding alcohol) in acts of deliberate self harm.','','','','','','','','','','','Description','In an overdose the normal (90%) metabolism is saturated and so paracetamol is metabolised using cytochrome P450 and conjugation with glutathione. If this enzyme is induced (e.g. phenytoin, alcohol) then more of the toxic intermediate metabolite is produced.','','','','','','When the glutathione runs out, the toxic intermediate metabolite builds up in the liver, resulting in damage. N-acetyl cystiene (NAC) or methionine act as substitutes for the glutathione, enabling conjugation and excretion.','','','','','','','','','','','','Comments','The data on which the treatment graphs was based was flawed in that it used small numbers and retrospective studies, as is common in toxciology research. \nCurrent thinking is that if two lines are shown, the lower line should be considered the treatment line. If in doubt about treatment, consult a Poisons Centre for the latest advice.','Acetyl Cysteine Infusion Protocol','','','','','','Poisons Centre','#####86','','','Tests','All patients who may have taken an overdose should have a paracetamol level at 4 hours.','','','','','Treatment','Treatment is N-acetyl cysteine by i.v. infusion if indicated. Suicide risk must be assessed and the patient sent to an appropriate place.\nHospital policy is that all patients presenting with overdose should be reviewed by the multi-disciplinary Psychiatric Assessment Team.','Multi-disciplinary Psychiatric Assessment Team','#####158','','','','','Suicide Risk Assessment','#####114','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','\n','');
INSERT INTO `MedHelp` VALUES (2,0,0,'N','Hyperosmolar Diabetic Coma','Replace fluids, look for causes and complications.','ED','emerg-med','','','','Guideline','QDIA QUAD QCOL diabetes emergencies HONK HONC ketotic ','','History','A condition carrying a high mortality, it has a more insidious onset than DKA and affects more elderly patients who usually have type II Diabetes Mellitis and are taking oral hypoglycaemic drugs. \nOften precipitated by infection, usually urinary tract.','','','','','','Characterised by very high blood sugars ( may be >50mmol/l ) and high plasma osmolality (>330 mosmol/L). Acid - base disturbance is relatively minimal but water and electrolyte deficits are high','','','','','Examination','Unwell, dry and usually septic, although may not have a pyrexia. May not have an obvious focus of infection.','','','','','Tests','Estimate blood glucose and send bloods for urgent U&E, FBE and ABG\'s. Repeat U&E\'s, glucose and ABG\'s at frequent intervals. Perform septic screen (blood cultures, MSU, CXR and possibly LP). ','','','','Intravenous access','Treatment','Secure peripheral i.v. access,  and insert a CVP line. \nA urinary catheter is essential to monitor fluid balance and a nasogastric tube because of gastroparesis common in these patients.','Central line insertion','#####122','','','i.v. fluids - Normal Saline','','Fluid replacement is the most important part of therapy. Commence fluid resuscitation with normal saline as soon as the diagnosis is made. The following is a guide:\n\nGive 1000 ml stat and follow with 1000 ml over 1 hour. If initially shocked give saline as rapidly as possible until haemodynamically stable. Subsequent volume replacement is guided by the JVP/CVP, tissue turgor, urine output, correction of acidosis and correction of electrolyte abnormalities. Aim to correct the volume deficit gradually over 48 hours, allowing also for ongoing losses and maintenance. Hypotonic (0.45%) saline may be used very cautiously, bearing in mind the risk of central pontine demyelination with rapid sodium shifts. Once dehydration is corrected and plasma glucose falls to around 20 mmol/L, add 10% dextrose to the fluid regimen.','','','','Potassium','','The potassium deficit is large (up to 20% of total body potassium stores ie: 200 - 400 mmol). If there is urine output, add KCl 10 mmol to each litre of fluid after the initial litre. Less potassium is required initially because of the relative lack of acidosis. Replacement should proceed cautiously, as renal insufficiency is often present.','','','','Insulin','','Give soluble Insulin 10 units IV stat and commence an infusion initially at 3 units per hour. Saline is adequate for this - there is no need to suspend the insulin in colloid or albumin. Measure hourly blood glucose levels and adjust the insulin infusion rate to achieve a drop in blood glucose of 1-2 mmol/hr','','','','Avoid Bicarbonate','','Correction of hyperglycaemia and fluid resuscitation should eventually correct the metabolic acidosis. It is tempting to administer bicarbonate, however this should NOT be done unless the pH is less than 7 and there is myocardial dysfunction which may be partly caused by the acidaemia','','','','','','Thromboembolism is an important complication. \nOnce DIC is excluded, a prophylactic dose of heparin or LMW heparin is appropriate.','','','','','','The acute replacement of Ca, PO4, Mg etc is not required in the ED. ','','','','','Disposition','Admit all hyperosmolar non-ketotic coma patients to hospital. These patients need HDU/ ICU care.','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (3,0,0,'N','Diabetic Ketoacidosis','Rehydration is more important than the blood glucose level. \nAim to rehydrate over 24 hrs - longer in children.','ED','emerg-med','','','','Guideline','QDIA QUAD QCOL diabetes coma ketones ','','Background','DKA results from a combination of relative insulin deficiency and/or glucagon excess, often in association with other \"stress\" hormones such as growth hormone, catecholamines and cortisol. DKA may be precipitated by poor therapeutic compliance, poor management or some stressor such as infection.','','','','','','Relative insulin deficiency results in poor peripheral uptake and utilisation of glucose. Together with increased hepatic gluconeogenesis promoted by glucagon excess, this produces raised blood glucose levels and a consequent osmotic diuresis. Insulin deficiency also results in lipolysis and increased circulating free fatty acids. Glucagon promotes the hepatic oxidation of these FFA\'s to beta-hydroxybutyrate and acetoacetate (ketone bodies).','','','','','','The osmotic diuresis is profound and leads to massive losses of body water and electrolytes. \nWater deficit may be 5 - 10 litres, Na+ deficit 400 - 500 mmol and K deficit 200 - 400 mmol. \nThe combination of ketonaemia and poor tissue perfusion from dehydration leads to a profound high anion gap lactic acidosis. pH may be as low as 6.8 with correspondingly low bicarbonate. Compensatory Kussmaul (heavy sighing) breathing lowers the PaCO2. This severe metabolic acidosis results in an artificially elevated serum potassium which does not reflect the actual total body deficiency of potassium. As the acidosis is corrected with treatment, the serum K may fall precipitously. Other electrolyte losses include chloride, phosphate, magnesium and calcium.','','','','','History','Look for possible causes for this episode, especially those, such as infection, which require treatment.','','','','','Examination','Assess the patients overall condition, and look for any possible focus of infection.','','','','','','Tests','Prove the diabetes:\n- measure the blood glucose.\nProve the ketosis:\n- measure the ketones in the urine.\nProve the acidosis\n- U&E/ ABG\'s. \n- Do not perform ABGs on children or adults who look well. They are painful and do not aid the management - venous estimation of pH or Bicarb level will prove the acidosis. Use local anaesthetic if doing ABG on children.\nLook for sepsis\n- FBC, blood cultures, MSU, CXR and possibly LP). \nMonitor\n- Repeat U&E\'s, glucose and ABG\'s at frequent intervals in ill patients. ','','','','Access','Treatment','Establish i.v. access. A central line is a good idea in patient with known heart failure. A urinary catheter may be required to monitor fluid balance and a nasogastric tube because of gastroparesis common in these patients. ','','','','i.v. fluids - normal saline','','Fluid replacement is the most important part of therapy. Far more important than giving insulin. Start fluid resuscitation with 20ml/kg normal saline over 2 hours as soon as the diagnosis is made. The following is a guide:','','','','','','Give 1000 ml stat and follow with 1000 ml over 1 hour. If initially shocked give saline as rapidly as possible until haemodynamically stable. Subsequent volume replacement is guided by the JVP/CVP, tissue turgor, urine output, correction of acidosis and correction of electrolyte abnormalities. Aim to correct the volume deficit over the first 24 hours, allowing also for ongoing losses and maintenance. Once dehydration is corrected and plasma glucose falls to around 15-20 mmol/L, add 10% dextrose to the fluid regimen','','','','Potassium','','The potassium deficit is large (up to 20% of total body potassium stores ie: 200 - 400 mmol). If there is urine output, add KCl 10 - 20 mmol to each litre of fluid after the initial litre. The serum K does not reflect body potassium deficit in the presence of acidosis.','','','','Insulin','','Give soluble Insulin 10 units IV stat and commence an infusion initially at 3 units per hour. Saline is adequate for this - there is no need to suspend the insulin in colloid or albumin. Measure hourly blood glucose levels and adjust the insulin infusion rate to achieve a drop in blood glucose of 2-3 mmol/hr','','','','Avoid giving bicarbonate','','Correction of hyperglycaemia and fluid resuscitation should eventually correct the metabolic acidosis. It is tempting to administer bicarbonate, however this should NOT be done except in cases where the pH is below 7 AND may be causing significant cardiac dysfunction/ arrhythmias.','','','','','','The acute replacement of Ca, PO4, Mg etc is not required in the ED.','','','','','Disposition','Admit all DKA patients to hospital. Most of these patients will require HDU/ ICU care. \nEducation is important in newly presenting diabetics, and starts in the ED. Patients should be strongly advised to give up smoking.','Diabetes education','#####159','','','Cautions','Children may suffer cerebral demyelination (e.g. central pontine myelinolysis) if the rehydration occurs too quickly (<12 hours). This is probably due to the rapid sodium shifts. After giving the first hour\'s worth of fluid, involve the paediatricians to work out ongoing fluid requirements. Rehydration should be carried out over 48 hours.','','','');
INSERT INTO `MedHelp` VALUES (4,0,0,'N','Hypoglycaemia','Admit ALL patients on oral hypoglycaemics who present with hypoglycaemia ','ED','emerg-med','','','','Guideline','QUAD QUCH QCOL QDIA QBEH QAPP QBEH diabetes diabetic','','Treatment','Give 50mls 50% Glucose i.v. \nOR\n1 mg glucogon i.m.','','','','','','','','','','','History','Often presents as coma but bizarre behaviour may be due to hypoglycaemia. \nSearch for possible causes for hypoglycaemia in known diabetics\n- new/ changed drugs\n- unusual excercise\n- Addisons disease?','','','','','','','','','','','','','','','','','','Tests','- A BEDSIDE blood glucose.\n\nIn the rare case that you suspect the patient has been administered insulin to harm them, the serum C-peptide may be measured. Contact pathology for method of collection/ storage.','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (5,0,0,'N','Nosebleed','Blood loss may be severe particularly in the elderly','ED','emerg-med','','','','Guideline','QNOS blood nose epistaxis ENT ','','Background','1. Epistaxis can cause severe blood loss and can lead to shock\n2. Consider underlying causes - trauma (fracture, foreign body, nose picking) neoplasm, hypertension, URTI, allergy, dry air, atherosclerosis, clotting defects, drugs e.g. anti-coagulants/ aspirin.\n3. The blood supply is via the terminal branches of both carotids.\n- Internal Carotid - ophthalmic - anterior ethmoidal - posterior ethmoidal\n- External Carotid - Maxillary - Sphenopalatine.\n4. Little\'s area is the most common site of bleeding.\n5. Elderly patients - mostly posterior bleeding and therefore sphenopalatine.','','','','','','','','','','','','\n','','','','','','','','','','','','','','','','','','Treatment','1. Does the patient need resuscitation?','','','','','','2. If prolonged/ severe bleed:\n- FBC, \n- Clotting profile, \n- Group & Hold/ Cross match.','','','','','','3. Relieve anxiety with reassurance and/or morphine. \n(Morphine may well reduce hypertension and so stop the bleeding).','','','','','','4. Apply local pressure by compressing alae nari with patient lying with head elevated on pillows. Apply pressure for at least 10 minutes and in 90% of cases, the bleeding will stop.','','','','','','5. Try and locate bleeding site.  Remembering in 90% at least of younger people, the bleeding will be anteriorly. In the elderly, it is frequently posteriorly.\n\n6. Cautery of Littles Area\n- Anaesthetise the area with cocaine impregnated swab stick or cophenylcaine forte spray.\n- Once anaesthetised, apply silver nitrate stick to bleeding site for approximately 15 seconds.','','','','','','','','','','Anterior Nasal Pack','Treatment','1. Anaesthetise nasal cavity with ribbon gauze soaked in 5 mls cocaine loosely packed into nose. \nDO NOT USE EPINEPHRINE (ADRENALINE) AS COCAINE VASOCONSTRICTS. DO NOT LEAVE COCAINE IN AS A PERMANENT PACK.\n2. Wait 10 minutes - remove cocaine gauze.\n3. \'Xeroform\' or B.I.P.P. Gauze.\n- This gauze is grasped with packing forceps, about 7 cms from its end and then under direct vision the gauze is placed on the floor of the nose for an anteroposterior length of approximately 7 cms. The gauze is then packed in layers, being compressed firmly, so that nearly 1 metre is placed in the nose. Leave the tails of the pack outside the nose and tape over nose. If pack falls into the nasopharynx, it can be withdrawn back through the nose.\n- If one side of the nose is bleeding, it is not necessary to pack both sides.\n- Slight oozing may continue for minutes - hours after packing.\n- Check naso-oropharynx for loose packing and rule out persistent gross bleeding.\n- The anterior pack should be left in place for 24-48 hours and then reviewed.\n- give cefolexin/ amoxycillin.\n\n4. \"MEROCEL\" Epistaxis Pack\n- A pre-packed self-expanding anterior nasal pack is available on the ENT tray. Please follow instructions on the packaging.','','','','Posterior Nasal Pack','','1. Make sure nose is anaesthetised as above.\n2. Insert deflated Foley\'s catheter or Brighton nasal balooon through anterior nares till seen in oropharynx. \n3. Inflate distal balloon and then pull back to block posterior nasal space.\n4. Pack around catheter using B.I.P.P. gauze.\n5. Anchor Foley\'s catheter firmly around anterior nares.\n6. Antibiotic cover.\n7. ADMIT.\n(a posterior pack is irritable and patients often do not like it,  morphine can be helpful) Remember that opiates and benzodiazepines are synergistic.','','','','Indications for admission','Disposition','1. Bleeding persists despite above measures. Consult ENT surgeon early.\n2. Excessive blood loss leading to postural hypotension or shock.\n3. Associated severe condition, e.g. hypertension, leukaemia, excessive anticoagulate\n4. Rebleed after removing pack.\n5. Posterior pack required','ENT referrals','#####175','','','Advice','To prevent recurrence of epistaxis:\n- Apply vaseline to the nasal septum when dry.\n- Keep home humidity relatively high.\n- Never blow nose forcefully.\n- Open mouth when sneezing.\n- Never pick nose.\n- Keep children\'s fingernails trimmed.\n- Avoid high altitudes and extreme physical exertion for 3 to 4 days.\n- Keep a topical decongestant handy.\n\nRecurrent Nosebleed\n- Above all, remain calm.\n- Sit up or stand up straight to decrease pressure in the nose.\n- Keep the head forward to allow blood to run out the front of the nose.\n- Apply nasal spray or cotton soaked in decongestant in each nostril.','','','');
INSERT INTO `MedHelp` VALUES (6,0,0,'N','Eye Injuries- Chemical Burns','Alkali continues to burn- irrigate +++','ED','emerg-med','','','','Guideline','QEYE QBUR QFOR ','','Background','Acid burns cause damage more rapidly than alkalis but generally are less serious because they do not cause progressive tissue destruction','','','','','Examination','Use local anaesthesia -tetracaine (amethocaine) hydrochloride 1%)','','','','','Treatment','Irrigate ASAP with balanced salt solution (normal saline is OK). A Morgan lens facilitates irrigation. ','','','','','','Alkali burns must be irrigated for at least 30 minutes and all lime particles removed.\n Remember to evert eyelids to check for FB\'s','','','','','','pH of the eye can be tested with urine test strips - aim for pH around 7.0. Do not stop irrigation until this is reached: this may mean several litres of fluid.','','','','','','','Perform eye examination (see separate protocol).','Eye Examination (protocol)','#####124','','','','Follow with antibiotic ointment (Chloramphenicol 10 mg/g) and pad. ','','','','','Disposition','All cases should be discussed urgently with an ophthalmologist.','Ophthalmology Referrals','#####93','','','','','Superglue','#####8','','','','','Eye injuries','#####28','','','','','Flash burns','#####7','','','','','The red eye','#####67','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (7,0,0,'N','Eye injuries - Flash Burns','','ED','emerg-med','','','','Guideline','QEYE QBUR UV welding welder ','','Background','- Caused by intense UV radiation from an electric arc welder. - Symptoms including severe pain, blurred vision & tearing may not start until several hours after exposure.\n- The cornea may be pitted on slit lamp examination.\n- Usually settles in 12 - 36 hours.','','','','','','','','','','','','','','','','','','','','','','','Treatment','1. Use local anaesthesia (Amethocaine hydrochloride 1%).\n2. Perform eye examination.\n3. Apply antibiotic ointment (Chloramphenicol 10 mg/gm) and pad.\n4. Prescribe:\n - oral analgesic (ie Panadeine or Panadeine forte) \n - antibiotic eye ointment (Chloramphenicol 10 mg/gm) 1cm four times daily.\n5. Review in 48 hours','Eye Examination (protocol)','#####124','','','','','','Chemical burns','#####6','','','',' ','Eye injuries','#####28','','','','','Conjunctivitis','#####27','','','','','The red eye','#####67','','','','','','','','','','','Ophthalmology referrals','#####93','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (8,0,0,'N','Eye Injuries - Super Glue','','ED','emerg-med','','','','Guideline','QEYE QFOR','','Treatment','1. Immediate irrigation with normal saline.','','','','','','2. If only lashes stuck together or eyelids glued together:\n- Gently cut lashes to open eyelids\n- Perform eye examination (see separate protocol)\nIf there is evidence of involvement of the cornea or conjunctiva, start antibiotic eye ointment (Chloramphenicol 10 mg/gm) four times daily.\n- Review in 48 hours.\n- Natural history is for eyelids to open of own accord','','','','','','3. If suspected contamination of cornea/ conjunctiva, this should be discussed with an ophthalmologist.','','','','','','','','','','','','','','','','','','','','Eye examination -protocol','#####124','','','','','Ophthalmology referals','#####93','','','','','Chemical burns','#####6','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (9,0,0,'N','Abdominal Pain','Immediate life threats: AAA, Splenic rupture, Ectopic pregnancy, MI.\nBeware the elderly patient with diffuse abdo pain','ED','emerg-med','','','','Guideline','QABD QCOL QVOM QURO QDIR QABC AMI','What sort of pain is it?','Background','1. Visceral (Splanchnic) Pain\n- Crampy, colicky, gaseous, often intermittent, ill-defined and diffuse abdominal pain that results from stretching of the autonomic nerve fibres surrounding a hollow or solid viscus. Obstruction is a common cause\n- Felt in the midline, exact location dependent on the embryological origin of the intra-abdominal organ involved:\n- Foregut structures (stomach, duodenum, pancreatic-biliary tree) are classically referred in the epigastrium\n- Midgut structures (small bowel, ascending colon) are referred to periumbilical area\n- Hindgut structures (descending colon) are referred to suprapubic area or back','','','','','','2. Somatic (Parietal) Pain\n- Sharper, more constant, more precisely localised to the area of disease when pain fibres located in the parietal peritonium are irritated by chemical or bacterial inflammation.\n- Usually tenderness is localised to the area of pathology','','','','','','3. Referred Pain\n- Pain felt at a distance from the diseased organ\n- Follows certain classic patterns\n- Diaphragmatic irritation often radiates to the supraclavicular area\n- Pain of ureteric colic often radiates to the lower quadrants, genitalia, or inner thigh','','','','Pain','History','Onset, severity, timecourse\nLocation and referral, both at the onset and subsequently\nCharacter (colicky, steady, sharp, burning, tearing, gnawing, aching, etc.)','','','','Other symptoms','','Anorexia, nausea and vomiting, diarrhoea\nPresence of blood in faeces or vomit\nChronic change in bowel habits\nDysuria, frequency, or haematuria','','','','','','','Thorough gynaecological history:\nPregnancy/ menstrual history/ sexual activity/ contraception','','','','','','Cardio-respiratory symptoms:\nChest pain/ SOB/ cough/ sputum/ haemoptysis/ orthopnoea','','','','Previous history','','Previous similar episodes\nOperations\nOther illnesses\nMedications and  allergies','','','','','Examination','- General appearance especially sweating and pallor\n- Patients with visceral pain are often doubled over and tend to move about searching for a comfortable position\n- Patients with peritonitis tend to lie still and resist movement\n- Vital signs including temperature\n- Inspect abdomen for contour, scars, peristalsis, masses, distension, or pulsation\n- Auscultate for presence and character of bowel sounds\n- Palpate for tenderness, involuntary guarding, rebound, masses and organomegally\n- Murphy\'s sign, iliopsoas sign, obturator sign\n- Genital examination, check for herniae, pelvic examination, rectal examination\n','','','','Do not X-ray children\'s abdomens without a senior opinion.','Tests','An abdominal  X-ray is a lot of radiation - 0.015 mSv (a CXR is 0.0002 mSv) and should not be performed unless you are looking for something specific','','','','','','- FBE\n- U&E\n- Group & Hold / X-match\n- Urinalysis +/- MSU\n- Amylase\n- Beta HCG in any female of child bearing age\n- ECG\n- Erect CXR: look for free peritoneal air or intra-thoracic pathology\n- AXR: look for biliary or renal calculi, air in the biliary tree, abnormal vascular calcifications, abnormal gas patterns, organ and psoas shadows\n- Ultrasonography\n- CT scan','','','','Analgesia in abdominal pain','Treatment','Judicious and careful use of analgesics is humane, does not obscure the diagnosis, and may even enhance patient evaluation.','','','','','','','','','','','Remember','Beware elderly patients with diffuse abdo pain. Have they got ischaemic gut? \nAtrial fibrillation and generalised atherosclerosis are the major risk factors for this condition, which is notoriously difficult to diagnose.','Analgesia in abdominal pain','','','','','','','','');
INSERT INTO `MedHelp` VALUES (10,0,0,'N','Acute Pulmonary Oedema','Use CPAP in all but the most mild. \nDiuretics are not important in the inital treatment. \nMyocardial infarction is a common cause.','ED','emerg-med','','','','Guideline','QSOB QCOL QCHP APO CCF LVF ','Increased left atrial pressure (usually)','Background','Causes:\n1. Ischaemic heart disease\n2. Cardiomyopathy\n3. Valvular disease\n4. Acidosis \n5. Renal and hepatic failure\n6. Iatrogenic - i.v. fluid, drugs\n7. Negative pressure (post extubation with laryngeal spasm - normal LA pressure)\n8. Pulmonary capillary leakage (normal LA pressure)','','','','','','','','','','Precipitating Factors','History','1. Worsening of underlying cause e.g. new MI\n2. Arrhythmias\n3. Sepsis\n4. Anaemia\n5. Drugs\n6. Poor compliance with medications or fluid restriction\n7. Worsening renal or hepatic function','','','','','','','','','','Differentiating from other causes of acute SOB','Examination','Evidence supporting the diagnosis are: \n1. Previous history of cardiac disease.\n2. Recent history of orthopnoea, paroxysmal nocturnal dyspnoea, ischaemic chest pain or pink, frothy sputum.\n3. Signs of LVF\n- Cardiomegaly.\n- Tachycardia\n- Triple (gallop) rhythm.\n- Bilateral basal chest crackles (may be wheeze - \"cardiac asthma\")\n4. Signs of RHF.\n- Peripheral oedema.\n5. ECG findings:\n- Ischaemia\n- Arrhythmia\n- Hypertrophy\n 6. CXR findings:\n- Upper lobe diversion \n- Hilar congestion and\n- Haziness of lower lung fields.\n- Kerley B + C lines','','','','','','Tests','- ECG	- ischaemia, arrhythmia, hypertrophy\n- CXR\n- FBE - exclude anaemia, polycythaemia \n- U+E\'s - look for K+, Na+ & renal function\n- Troponin I\n- ABG\'s if patient tired','','','','','','','','','','','Treatment','1. Sit upright and reassure.\n2. Give oxygen 100% using CPAP.\n3. ECG & ECG monitoring\n4. Intravenous access and collect blood for investigations.\n5. CXR','','','','','','6. Morphine 2.5 mg (+/- metoclopromide 10mg) increments i.v. to maximum of 10 mg (omit if chronic CO2 retention, depressed mental state or hypotensive)\n7. GTN paste 2.5cm (small patient) or 5cm(average patient)\n8. Frusemide 40-120 mg i.v. (guide = total daily oral dose given i.v.)\n9. Urinary catheter','','','','GTN infusion','','If there is no significant improvement using the above regime after one hour, start GTN infusion','GTN infusion','','','','','Treat arrhythmias on but avoid negative inotropes. \nAll negative inotropic agents, sodium retaining substances, & prostaglandin synthetase inhibitors should be stopped.','','','','','','','','','','','','','','','','Other treatments','','Consider using a salbutamol nebuliser if marked bronchospasm or co-exsisting COAD, but the wheezing is usually due to the oedema (\'cardiac asthma\').\n- Dopamine 3 mcg/kg/min if unable to establish adequate diuresis, and higher inotropic doses if hypotensive (dobutamine is a suitable alternative via peripheral i.v. access)\n- ACE inhibitors\n- Nitroprusside infusion for uncontrolled BP \n- Invasive monitoring (CVC\'s, arterial lines and Swan-Ganz catheter may be used for patients with severe LVF, or those who require inotrope or vasodilator infusions)\n- Venesection is appropriate if there is renal failure or polycythaemia','','','','Intubation and ventilation','','Intubation and mechanical ventilation with PEEP is rapidly effective at treating the pulmonary oedema.\nBefore initiating this, try to find out what the patient\'s normal cardiorespiratory function is. Patients with very poor function prior to this illness are unlikely to benefit from a stay in ICU.','Rapid sequence intubation','#####134','');
INSERT INTO `MedHelp` VALUES (11,0,0,'N','Addisonian Crisis - Acute adrenal insufficiency','Most common in steriod dependant patients with intercurrent illness\nGive i.v. normal saline and hydrocortisone. ','ED','emerg-med','','','','Guideline','QCOL QUAD QDIA Addisons endocrine ','','','','Short ACTH (Synacthen) Test','#####117','','','History','1. Acute medical illness\n- Infection\n- Myocardial Infarction\n- Stroke\n- Ketoacidosis\n2. Trauma\n3. Other physiological stress\n- Childbirth\n- Operations\n4. Omission or insufficient steroid therapy.','','','','','','','','','','','Examination','- Pale, hypotensive (postural hypotension is common), vomiting.\n- Anorexia, weight loss, dehydration.\n- Abdominal Pain \n- Impaired conscious state (hypoglycaemia).\n- +/- Pigmentation or features of hypopituitarism.','','','','','Tests','The classic finding is of\n- hyponatraemia\n- hyperkalaemia\n- mild metabolic acidosis\nhowever, this picture may be obscured by other disease.','','','','','','Treatment','1. Insert IV line, administer O2 via mask, check BM\n2. Take blood for \n- U&E\n- glucose (usually low)\n- FBE (80% eosinophilia), septic screen if indicated\n- Cortisol/?ACTH. level- liase with labs as these need special treatment.\n3. Start infusion of normal Saline 1 litre over 1 hour and then 1 litre 2 hourly.\n4. Consider short Synacthen test (see references for protocol) if patient relatively well and diagnosis not established.\n5. Give 250 mg Hydrocortisone i.v. stat followed by 100 mg 4 hourly (do not wait for cortisol levels).\n6. Give 50 mls of 50% Dextrose intravenously if glucose low\n7. Treat precipitating cause, if known.\n8. Admit','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (12,0,0,'N','Alcohol Withdrawl','Give Thiamine. Large doses of diazepam may be required. \nIt is possible to be withdrawing despite having a high level of alcohol: it is the result of a relative fall in the alcohol level. ','ED','emerg-med','','','','Guideline','QFAL QFIT QCOL QAPP QBEH','','Background','- Withdrawal symptoms usually occur 6 - 8 hours after the cessation of drinking and coincide with falling blood alcohol levels.\n- Spectrum of symptoms and signs: severity is proportional to the intensity of recent bingeing.\n- Consider alcohol withdrawal in the differential diagnosis of all cases of delirium or acute brain syndrome.','','','','','','Think about other causes of delirium in the alcoholic patient. In particular:\n- Hypoxia	\n- Hypoglycaemia\n- Sepsis\n- Hepatic encephalopathy\n- Dehydration\n- Pancreatitis\n- Head injury (especially subdural)\n- Other neurological pathology','','','','','Tests','- U&E	\n- LFT\n- Chest X-ray\n- CT Scan (if ? subdural)\n- Coagulation\n- MSU\n- Ascitic tap if ascites','','','','','','','','','','Mild alcohol withdrawl','Examination','- Agitation\n- Tremulousness\n- Hyper-reflexia\n- Transient hallucinations','','','','','Moderate alcohol withdrawl','','- Agitation, confusion, aggression\n- Autonomic hyperactivity (tachyarrhythmias, sweating, GIT disturbance etc.)\n- Tremulousness, shaking, hyper-reflexia, convulsions\n- Hallucinations, especially visual\n- Convulsions','','','','Delerium Tremens','','Usually starts 2 - 4 days after the cessation of drinking\n- Fever\n- Agitation, confusion, aggression\n- Autonomic hyperactivity (tachyarrhythmias, sweating, GIT disturbance etc.)\n- Tremulousness, shaking, hyper-reflexia, convulsions\n- Hallucinations (especially visual)\n- Fluctuating level of consciousness\n- Cardiovascular collapse\nMortality of 10%','','','','','Treatment','The aim of treatment is to produce a calm state, with minimal sedation. \n- Drugs of choice are benzodiazepines (e.g. diazepam) though the phenothiazines (such as Haloperidol) may occasionally be required. Benzodiazepines increase the fitting threshold, phenothiazines reduce it.','','','','Thiamine','','Thiamine 100 mg i.v. should be given to all patients \nThese patients are often dehydrated, so a litre of Normal Saline may help.\nMultivitamin preparations (B and C) are a good idea as these patients often have poor nutrition.','','','','Diazepam','','Diazepam 10 - 20 mg po (or 5 - 10mg iv) 2 hourly, or more frequently if severe. \nDiazepam is cheap and effective and has active metabolites, reducing the risk of a rebound phenomenon.','','','','','','Haloperidol may be useful in aggressive/ paranoid/ hallucinating patients.\nThiopentone can been used in resistant cases, but should only be used by a consultant ED physician or anaesthetist.','','','','','','Avoid narcotics as there is a high risk of respiratory arrest','','','','Magnesium','','For delerium tremens there is some evidence to support the use of magnesium sulphate 20 mmol (10 mL 49.3% solution) in 5% dextrose over 2 hours','','','','If all else fails:','','ethanol infusion: 120 mL absolute alcohol in 1000 mL 5% Dextrose over 24 hours','','','','','Disposition','Always admit to hospital. \nSevere cases may need admission to ICU or HDU.','','','');
INSERT INTO `MedHelp` VALUES (13,0,0,'N','Myocardial Infarction','Soluble aspirin is as effective an intervention as thrombolysis. \nMortality increases by 0.2% for every hour until thrombolysis.\nNO patients with chest pain to be discharged from the emergency department by a junior doctor without senior review.','ED','emerg-med','','','','Guideline','QCHP QSOB QCOL QUAD QCAR AMI heart thrombolysis ','','Background','Whenever myocardial infarction is suspected, there must be no delay in assessment and time to thrombolysis. \n- All patients with chest pain are to be triaged to a monitored cubicle for ECG monitoring, have oxygen applied, IV access obtained, and an ECG performed. \n- Initial observations must include a blood pressure in both arms.\n- ECG\'s once performed must be shown to an emergency department registrar or consultant.','','','','Risk factors','History','- Previous angina/ MI \n- Family History of IHD\n- Hypercholesterolaemia\n- Smoking\n- Diabetes\n- Hypertension','','','','Symptoms','','- Characteristically a severe and crushing retrosternal pain with radiation to the arms, neck or jaw not relieved by rest or nitrates.\n- However, pain may be epigastric, radiate to the back or be absent.\n- Autonimically mediated symptoms such as sweating, nausea, dyspnoea, weakness and anxiety are have a high positive predictive value for ischaemic pain.','','','','Diabetic patients','','Diabetiic patients frequently have atypical histories - shortness of breath or abdominal pain.','','','','Aortic dissection','','Aortic dissection commonly occurs in hypertensives, presents with a sharp tearing pain between the shoulder blades. May or may not have different BPs in arms. Contrast CT is investigation of choice at this hospital. These patients may present with an inferior infarct if the dissection extends proximally and strips off the right coronary artery. This however is RARE -estimated at 2% of all dissections.','','','','','','Examination','- Pallor, sweating\n- Look for signs of LVF (hypotension, 3rd/ 4th heart sound - gallop rhythm, lung crackles)\n- Listen for an apical systolic bruit (acute mitral regurgitation caused by papillary muscle rupture) or a pericardial friction rub.\n- Look at JVP (if markedly raised & no severe LVF then think of RV infarction)','','','','','Tests','- ECG - repeat at least every hour if high clinical suspicion and/or any change to pain\n- U&E, Creatinine, Glucose\n- Hb\n- Cardiac enzymes - Troponin I\n- CXR','','','','','','','','','','Oxygen, monitor','Treatment','Oxygen 4-6 L/min via Hudson mask\nECG monitoring (treat arrhythmias as required)\nPerform ECG','','','','Aspirin','','Aspirin 300 mg soluble/ chewed \n(exceptions: allergy to salicylates, recent aspirin within 4 hours, active peptic ulcer, abnormal bleeding, glycoprotein IIb / IIIa inhibitor therapy)','','','','Analgesia','','- i.v. access\n- Take blood and organise CXR (should not delay time to thrombolysis)Relieve pain using:\n- GTN 300 - 600 mcg sublingual +/- GTN paste\n- Morphine 2.5 - 5.0 mg increments i.v.\n- GTN paste 2-5cm.\n- GTN infusion if pain despite paste.','GTN infusion','','','','','','','','','Thrombolysis','','Thrombolysis currently takes place in the emergency department for unstable patients only.\nStable patients will be transfered to the Coronary Care Unit where they will receive thrombolysis.','Thrombolysis','#####140','','','','Heparin is necessary after thrombolysis with reteplase or alteplase\n- 5000 unit bolus IV and then 1000 unit/hr infusion\nConsider glycoprotein IIb/IIIa inhibitor e.g. abciximab in patients not eligible for thrombolysis, or with non-q wave infarcts. ','','','','Angioplasty','','Urgent PTCA is increasingly seen as the gold standard in the treatment of myocardial infarction, but is of particular use in cardiogenic shock or when thrombolytic therapy is contraindicated.\nUrgent PTCA is a reasonable option when cardiogenic shock complicates MI, whether or not thrombolytic therapy has been given.','Angioplasty Referrals','#####163','');
INSERT INTO `MedHelp` VALUES (14,0,0,'N','Anaphylaxis','Don\'t be afraid of giving epinephrine (adrenaline) ( Adult dose 1mg s.c. or i.m.). \nWithholding epinephrine (adrenaline) due worries about possible side effects can result in death of the patient.          ','ED','emerg-med','','','','Guideline','QCOL QAST QBIT allergy reaction ','','Background','Anaphylactoid reactions are clinically indistinguishable from true anaphylaxis but can occur without prior exposure to the precipitating agent. Clinical management is identical and in these protocols \'anaphylaxis\' will be used to include anaphylactoid reactions.','','','','','','Reactions may be classified as mild, moderate or severe and represent aspects of a spectrum of illness. ','','','','','','','','','','Mild anaphylactic reactions','Examination','Symptoms start gradually and are not rapidly progressive. \n- localised urticaria or erythema\n- rhinorrhoea, conjunctivitis and pruritus.','','','','','Treatment','- Oral or parenteral antihistamines for a few days. \n- Simple local measures such as cold compresses give symptomatic relief of itch or \"prickly heat\". \n- Proprietary antipruritic creams such as crotamiton 10% (\"Eurax\") are often useful. \n- Patients may be sent home but warned to return if symptoms worsen.','','','','','','','','','','','Moderate anaphylactic reactions','Examination','- Urticaria more generalised \n- Facial and mucous membrane oedema may be significant. \n- Mild bronchospasm or stridor may be present. \n- The patient remains fully conscious, however, and there is no circulatory compromise.','','','','','Treatment','Intravenous cannula. \nMonitor blood pressure, pulse and ECG.\nAntihistamines: H1 and H2 blockers are synergistic - especially for skin manifestations. Give:\n- Promethazine 0.5 mg/kg IM or IV \nand for severe reactions add\n- Ranitidine 1 mg/kg IV or Famotidine 0.4 mg/kg IV.  \nNB: Occupation of mast cell H2 receptors by histamine results in the negative feedback inhibition of further histamine release. Blocking these H2 receptors may thus lead to increased histamine release. In the treatment of anaphylaxis, therefore, never give an H2 blocker without also first giving an H1 blocker.\n\nContinue oral antihistamines for 2-3 days.\n- Give nebulised beta-2 agonists if required for bronchospasm. \n- Consider small doses of adrenaline (5mcg/kg) SC or IM if the clinical picture appears to be progressive. \n\nSteroids\n- Hydrocortisone 2 mg/kg \n- followed by a 3 day course of prednisolone 1 mg/kg.\n\n- Patients in this category must be monitored for at least four hours (Resus or Acute) and are only to be discharged if there has been distinct improvement. Otherwise admit.','','','','','','','','','','Severe anaphylactic reactions','Examination','Rapid onset and progression of life-threatening symptoms and signs which may follow almost immediately after exposure to the triggering factor.\nWidespread erythematous or urticarial rash may be associated with bronchospasm, angioneurotic oedema or upper airways obstruction with stridor due to laryngeal oedema or laryngospasm.\nThe most dramatic feature is often sudden circulatory collapse and shock.','','','','','Treatment','This is a life threatening emergency. As in all emergency situations, resuscitation is directed at the ABC\'s - Airway, Breathing and Circulation. \n- Stop any suspected medication or diagnostic contrast material immediately.\n- Administer high flow O2 by face mask.','','','','Epinephrine (Adrenaline)','','5-10 mcg/kg i.m. or s.c. (= 1mg in adult) immediately OR \n1 mcg/kg i.v. if cannula is in situ.\n\n- If there has been little or no response to the initial dose of adrenaline, repeat the same dose intravenously. \n- Give further i.v. doses at five minutely intervals depending on response. \n- If the patient remains shocked, start an adrenaline infusion preferably via a central venous line. \n\nResistant cases\nSome cases may be resistant to adrenaline - usually if the patient is taking beta blocking drugs. If adrenaline in adequate doses is not improving the situation, give Glucagon 1 mg i.v. and consider changing to a noradrenaline infusion (must have CVP).','','','','','','Establish one and preferably two wide bore (16 gauge or larger) i.v. lines. Give 20mls/kg N. saline.\n\nIntubate the trachea and commence intermittent positive pressure ventilation if severe laryngospasm, bronchospasm or shock is present or if the patient is comatose.\n\nNOTE: If shocked do not use thiopentone or midazolam. If sedation is required for intubation, safest is fentanyl 100-500 mcg iv. Use suxamethonium 1.5 mg/kg only if sure of ability to intubate.','','','','','','BRONCHOSPASM\nNebulised adrenaline or salbutabol are useful.\n\nLARYNGEAL OEDEMA\nNebulised adrenaline 5mg may be tried, but do not delay intubation if upper airways obstruction is progressive.\n\nANTIHISTAMINES\n- Promethazine 1 mg/kg AND\n- Ranitidine 1 mg/kg or famotidine 0.4 mg/kg\n\nCORTICOSTEROIDS\n- Hydrocortisone 2 mg/kg i.v. or dexamethasone 0.2 mg/kg i.v.','','','','','Disposition','All patients with severe anaphylactic reaction ought to be admitted to ICU.','','','');
INSERT INTO `MedHelp` VALUES (15,0,0,'N','Abdominal Aortic Aneurysm','Do not delay theatre once the diagnosis is clear. \nGet surgical opinion before imaging if diagnosis strongly suspected.','ED','emerg-med','','','','Guideline','QABD QCOL AAA ','','Background','Mortality: \n- overall 45%,\n- if stable on admission 15-30%. (70% normotensive when first seen)\n- if unstable on admission 60-80%','','','','','History','Presentations have no set pattern:\n- Sudden onset pain (however may be present for weeks or months)\n- Severe and constant pain (however may be mild)\n- Cannot be relieved by changing position\n- May be located in the low back, flanks, periumbilical area, or pelvis\n- Pulsatile abdominal mass (however may be obscured by retroperitoneal haematoma, low blood and pulse pressure, or obesity)\n\nDiagnosis should be considered in any patient over the age of 50 with:\n- Sudden onset of abdominal or low back pain.\n- \"Renal colic\" in patients over 50 esp. with a history of hypertension.\n- Sudden onset of abdominal pain associated with an abdominal mass (whether pulsatile or not) \n- Hypotensive with an abdominal mass (whether pulsatile or not)\n- Known history of an aortic aneurysm and sudden onset of severe lower back pain and/or hypotension','','','','','','Unusual presentations:\n- Neurological deficit caused by compression of the femoral or sciatic nerve\n- Thigh, testicular, or peroneal pain\n- Bruising along the groins, scrotal sac, or peroneum','','','','CT','Tests','- shows presence or absence of an aneurysm.\n- demonstrates the extent of an aneurysm (supra/ infra renal).\n- determines whether ruptured or not.\nAlso good at picking up other pathology if it is not an aneurysm.','','','','Ultrasound scan','','- shows presence or absence of an aneurysm\ncannot reliably differentiate a ruptured from an unruptured AAA','','','','','','Treatment','Treatment must often be initiated on the basis of clinical suspicion alone.','','','','','','The goal for an expanding or ruptured AAA is to get a cross clamp accross the aorta as soon as possible.\n- The surgical registrar, vascular surgeon, anaesthetist and operating theatre should be notified as soon as the diagnosis is clear.\n- The blood pressure should be maintained at a low level (see below).','','','','','','- Two large bore i.v. (16G but preferably 14G) cannulas should be inserted ','','','','','','- Take blood for FBE, U&E, Clotting, Glucose, 6 units type specific blood/ warn pathology about need for blood. Use a fluid warmer, and keep the patient warm.','','','','i.v. fluids ','','Pre-theatre, i.v. fluid should be kept to a minimum. \nAggressive use of  i.v. fluids to acheive a normal blood pressure dilutes clotting factors necessary for haemostasis, and risks blowing the clot off the aorta.\nPatients who become unstable/ systolic <65  should be resuscitated with fluids: Aim for a systolic BP of 80.\nCatheterise if this does not delay time to theatre.','','','','','','','','','','','','','','','','','','If the aneurysm bursts, and there is not prospect of immediate surgery, resuscitation is futile. Give analgesia.','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (16,0,0,'N','Thoracic Aorta: Tears','Suspect in major deceleration injury','ED','emerg-med','','','','Guideline','QMAJ QTRU chest trauma ','','Background','Deceleration injuries result in the fluid filled heart tearing away from the aorta.','','','','','Tests','Contrast spiral CT is the most sensitive investigation. \nTrans-oesophageal echocardiography may also be used.\nA PA CXR may show increased diameter of the mediastinum, however this is not a sensitive or specific investigation, and the need for CT should be guided by clinical suspicion.','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','Treatment','Control hypertension with GTN or nitroprusside.\nControl symptomatic hypotension below 60mmHg with cautious fluids crystalloids or blood - use fluid warmer.\nOnce the diagnosis is established, contact a cardiothoracic centre for advice on further management and/ or transfer.','Cardiothoracic Referrals','#####160','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (17,0,0,'N','Thoracic Aortic Aneurysms/ Dissection\n','Chronic hypertension is a major risk factor.\nClassic presentation of tearing sensation between the scapulae.','ED','emerg-med','','','','Guideline','QCHP QCOL','Causes','Background','The common feature is weakness of the media layer of the aorta, often combined with a history of hypertension.\n- atherosclerosis\n- Marfan\'s syndrome/ collagen defects, \n- pregnancy\n- syphilis, congenital abnormalities, coarctation\n- trauma','','','','','','','','','','','','','','','','','','Lethal if untreated with mortality rates of: \n 30% at 24hrs, \n 50% at 48hrs, \n 70% in 1wk, \n 90% in 3mths.','','','','','','','','','','','Stanford classification','','Type A\n- Debakey types 1 & 2 (60%) \n- Ascending aorta involved\nType B\n- Debakey type 3 (40%)\n- Ascending aorta not involved','','','','','','','','','','','History','- Sudden onset of severe tearing pain (80%) radiating to the back, anterior chest, epigastrium, flanks, and/or extremities\n- Acute neurology (20%) due to stroke/ spinal ischaemia\n- Pain may be migratory','','','','','Examination','- Blood pressure may be high, normal or low - should be measured in both arms and one leg.\n- Extremity blood pressure differences  > 15 mmHg are significant (50%)\n- Aortic incompetence (60% type A, 10% type B)\n- Cardiac tamponade','','','','','','Differential diagnosis:\n- MI (may both be present, as dissection can track back and strip off the right coronary artery, giving an inferior infarction - but rare 2%)\n- Pulmonary embolus/ pneumothorax\n- Stroke\n- Acute abdomen\n- Limb ischaemia\n- Musculo-skeletal','','','','','Tests','Echocardiogram \n- transthoracic - low sensitivity (40% for type B) and specificity (65-95%) operator dependant.\n- trans-oesophageal echocardiogram - sensitive (98%) and specific (95%), but operator dependant.\n\nCXR\n- Widening of the superior mediastinum (65%), change on repeat CXR (50%).\n- Dilated/ abnormal aortic shadow (40%).\n- Pleural effusion/ plueral \'cap\' (L>R).\n\nContrast CT scan\n- generally easiest to arrange. \n- sensitivity 90%, specificity 98%.\n\nMR Angiography \n- limited availability, but very sensitive and specific.','','','','','Treatment','- Aim for a systolic BP of 90 mmHg \n- Arrange definitive investigation.\n- Arrange for transfer to cardiothoracic unit once diagnosis demonstrated.','','','','','','- Hypertensive patients need i.v. beta blocker e.g. propranolol and then i.v. infusion of nitroprusside or GTN. \n- Hypotensive patients resuscitated with small quantities of a crystalloid solution or blood, using a fluid warmer.\n\n- arterial line\n- urinary catheter\n- CVP line useful.\nFBC/ U&E/ Clotting/ G+S/ XMatch','','','','','Disposition','Type A (ascending) aortic dissections need emergency surgical repair.\n\nType B (descending) aortic dissections may need symptomatic surgical intervention (if persistent pain, lower extremity ischaemia, visceral or renal ischaemia, or rupture) but otherwise are managed medically.','Cardiothoracic Referrals','#####160','','','','','','','');
INSERT INTO `MedHelp` VALUES (18,0,0,'N','Stable Angina','Always give aspirin, unless very good reason not to','ED','emerg-med','','','','Guideline','QCHP QSOB ischaemic heart AMI','','History','- episodic, lasts 5 to 15 min (rarely longer than 20 min)\n- provoked & reproducible by exertion, relieved by rest or sublingual nitrates\n- autonomic features such as feeling sweaty or nauseous are associated with a high positive predictive value for ischaemia\n- retrosternal in 90%, radiation in 70% to neck, shoulders or arms\n- only 50% have ECG changes (ST depression) during the acute painful episode','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','Treatment','- unlikely to present to ED unless unstable angina\n- give sublingual nitrate with instructions\n- aspirin 150 mg daily\n- fax/ letter to GP for follow-up','GTN instructions handout','#####84','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (19,0,0,'N','Unstable Angina','Always give aspirin, unless very good reason not to.\nBeta blockers are under-used','ED','emerg-med','','','','Guideline','QCHP QSOB QCOL ischaemic heart AMI','','','','','','','3 distinct subgroups:','Background','1. angina of recent onset (4 to 8 weeks) including post-infarction angina.\n2. angina of changing character (more frequent, severe, or resistant to nitrates).\n3. angina at rest.\nGroups 2 and 3 have a higher risk for early (<28 days) infarction and death, and therefore need to be investigated and treated aggressively.','','','','','','','','','','','','','','','','','','','','','','','','Tests','- U&E, \n- Troponin I\n- glucose\n- cholesterol (if fasted)','NEJM review article(2000)','documents/unstableangina.pdf','','','','','','','','','','','','','','','Treatment','- oxygen, i.v. access, ECG monitoring\n- aspirin 300 mg soluble or chewed\n- sublingual GTN\n- Anticoagulation with a low molecular weight heparin (ie. enoxaprin 1 mg/kg s.c.) if not contraindicated \nUse morphine and/ or GTN paste/ i.v. infusion (see protocol) if pain remains\nRepeat ECGs if ongoing pain\nConsider glycoprotein IIb/IIIa inhibitor (e.g. abciximab) if ongoing pain with ECG changes and high risk patient','GTN infusion','','','','','','','','','Prinzmetal/ varient angina','Information','- occurs without provocation, often at rest & similar time of day\n- ST segt elevation with acute attacks, diagnostic dilemma distinguishing from myocardial infarction. \nUsually responds to sublingual nitrate or nifedipine 10 mg\nComplications include:- \n- tachyarrhythmias\n- BBB\n- AV nodal blocks','','','','','','','','','','','','','GTN instructions','#####84','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (20,0,0,'N','Broad Complex Tachycardia','Ischaemic Heart Disease + Broad Complex Tachycardia = treat as VT','ED','emerg-med','','','','Guideline','QCOL QCHP VT SVT ','','','','Narrow complex tachycardia','#####21','','','Background','Tachycardia in adults is defined as > 100 bpm\nHaemodynamic compromise in adults will be defined as containing any one of the following:\n- Systolic blood pressure < 90 mmHg\n- Left ventricular failure\n- Ischaemic chest pain\n- Decreased conscious state\n\n All patients should be:\n- Triaged to monitored cubicle with resuscitation facilities\n- Given oxygen 6 l/min via Hudson mask\n- ECG performed & ECG monitored\n- Have i.v. access, bloods withdrawn, & i.v. normal saline available\n- NIBP & SpO2 attached','','','','','','','','','','Is it VT, or is it SVT + aberrant conduction?','Examination','Important points to consider:\n- If haemodynamic compromise present, then cardioversion indicated either way\n- MOST patients with broad complex tachycardia have VT.\n- Any patient with a broad complex tachycardia and ischaemic heart disease has VT, until proven otherwise.\n- If you treat as SVT when it is VT, you may kill the patient.\n- If you treat as VT when it is SVT, you are unlikely to kill the patient.','','','','Use this algorithm to attempt to decide between ventricular tachycardia or aberrant tachycardia','Advice','1. No RS complex seen in precordial leads ?\n YES = VT \n2. Longest precordial RS interval > 100 msec ?\n YES = VT \n3. A-V dissociation present ?\n YES = VT\n4. V1, V2, & V6 morphology inconsistent with SVT ?\n YES = VT\nNO = Diagnosis is SVT','','','','','','Treatment','- If haemodynamic compromise present, then DC cardioversion is indicated. Call the anaesthetic and medical registrars on call.\n- Discuss with ED consultant or Cardiologist re\n- Amiodarone 5 mg/kg IV or possibly\n- Sotalol 1 mg/kg IV \n','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','\n','');
INSERT INTO `MedHelp` VALUES (21,0,0,'N','Narrow Complex Tachycardia','Ischaemic Heart Disease + Broad Complex Tachycardia = treat as VT','ED','emerg-med','','','','Guideline','QCOL QCHP VT SVT heart cardiac AF flutter ','','Background','Tachycardia in adults is defined as > 100 bpm\nHaemodynamic compromise in adults will be defined as containing any one of the following:\n- Systolic blood pressure < 90 mmHg\n- Left ventricular failure\n- Ischaemic chest pain\n- Decreased conscious state\n\n All patients should be:\n- Triaged to monitored cubicle with resuscitation facilities\n- Given oxygen 6 L/min via Hudson mask\n- ECG performed & ECG monitored\n- Have i.v. access, bloods taken, & iv N/Saline available\n- NIBP & SpO2 attached','Broad complex tachycardia','#####20','','','','','','','','Narrow Regular Tachycardia','','Exclude sinus, atrial, or junctional tachycardia secondary to fever, anaemia, heart failure, shock, thyrotoxicosis, drugs etc.\nIf p waves are present- is it all just anxiety? \n\nSupraventricular Tachycardia (SVT)\n- If haemodynamic dysfunction present, then cardioversion indicated\n- Adenosine 6 mg i.v. bolus into a large vein followed by 20mls of N/Saline, followed 2 minutes later by a further 12 mg bolus if not restored to sinus rhythum\n- Discuss with ED consultant or Cardiologist re:\n- Verapamil 5-15 mg i.v.\n- Digoxin 500 mg i.v.\n- Amiodarone 5 mg/kg i.v. \n- Sotalol 1 mg/kg i.v.','','','','','','','','','','','','','','','','','Narrow Irregular Tachycardia','','Exclude Multifocal atrial tachycardia (MFAT)\n- P waves are present but have varying morphology\n- Treat underlying cause: \n- Often elderly with decompensated chronic lung disease or cor pulmonale\n- May complicate CCF, sepsis, or be caused by methylxanthine toxicity\n- Digoxin toxicity is an unlikely cause of MFAT\nIf not MFAT, it is atrial fibrillation (AF).','','','','Atrial fibrillation - treatement decisions','','Atrial fibrillation is common, and the key management decision questions are: \n1. Is the atrial fibrillation chronc (>3 days) or acute?\n2. Is the AF paroxysmal (is the heart switching between sinus rhythm(SR) and AF)?\n3. If I return this patient to sinus rhythm, will they revert to AF? \n\nIf the patient\'s left atrium is dilated (>4cm) the chances are that they will revert to AF.\nDanger of embolisation occurs when transition occurs between AF and SR.\nSometimes AF is secondary e.g. pneumonia, hypothermia, and will resolve when the underlying condition is treated.','','','','Chronic AF','','- Causes of chronic AF include mitral valve disease, HT, IHD, cardiomyopathy, congenital heart disease (eg ASD), unreverted paroxysmal AF\n- Aim in chronic AF is to control ventricular rate (ie, < 100 bpm)\n- Digoxin 500 mg i.v. slowly to control ventricular rate, repeat 250 mg 2 hourly until rate controlled or a total of 1.25 mg is reached\n- If rate still not controlled then discuss with ED consultant or Cardiologist re:\n - Heparin 5000 units i.v. followed by infusion 1000 units/hr\n - Metoprolol 1-10 mg i.v.\n - Diltiazem 2.5-10 mg or Verapamil 5-15 mg i.v.\n - Amiodarone 5 mg/kg i.v.\n - Sotalol 1 mg/kg i.v.\n- Anticoagulation indicated when\n - Mitral valve disease\n - Cardiomyopathy\n - Enlarged left atrium\n - 1 to 3 weeks prior to cardioversion of chronic AF\n- Echocardiography is of value in assessing LV function, left atrial size, and presence of thrombus.','','','','','','','','','','Acute AF','','- Acute AF in elderly is commonly precipitated be co-existant illnesses, eg pneumonia, heart failure.\nCheck TFTs\nCheck K before digitalising\n\n- Digoxin 500 mg i.v. slowly to control ventricular rate, repeat 250 mg 2 hourly until rate controlled or a total of 1.25 mg is reached\n- If rate still not controlled nor reverted to sinus rhythum, then discuss with ED consultant or Cardiologist re:\n- Metoprolol 1-10 mg i.v.\n- Diltiazem 2.5-10 mg or Verapamil 5-15 mg i.v.\n- Amiodarone 5 mg/kg i.v.\n- Sotalol 1 mg/kg i.v. / po\n- DC Cardioversion\n\nDC Cardioversion indicated if\n- Haemodynamic dysfunction\n- Failed chemical reversion to sinus rhythum after 2 days of paroxysmal AF','','','','','','','','','','Paroxysmal AF','','The aim in paroxysmal AF is to restore the heart to SR and keep it in SR. The main danger occurs when the heart changes rhythm, which may result in embolisation from an atrial thrombus.\n\nCauses of paroxysmal AF include WPW syndrome, thyrotoxicosis, pericarditis, acute alcoholic intoxification, pulmonary embolism, MI, hypoxia, viral illness, chest injury, or idiopathic\n\nCardioversion indicated if\n- Haemodynamic dysfunction\n- Failed chemical reversion to sinus rhythum after 2 days of paroxysmal AF\n- Digoxin 500 mg i.v. slowly to control ventricular rate, repeat 250 mg 2 hourly until rate controlled or a total of 1.25 mg is reached\n- If rate still not controlled nor reverted to sinus rhythum, then discuss with ED consultant or Cardiologist re:\n- Metoprolol 1-10 mg i.v.\n- Diltiazem 2.5-10 mg or Verapamil 5-15 mg i.v.\n- Amiodarone 5 mg/kg i.v.\n- Sotalol 1 mg/kg i.v./ po\n- DC Cardioversion','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (22,0,0,'N','Asthma - Adult','Never underestimate asthma.  If in doubt or inexperienced then CONSULT.','ED','emerg-med','','','','Guideline','QSOB QAST','','','','','','','','History','Presenting episode\n- When did this episode start?  \n- Precipitating cause? (including recent URTI or LRTI) \n- Is it getting worse or better? \n- What treatment has been used? \n- How does this episode compare with previous episodes?\n\nPast Medical History\n- How long has the patient been asthmatic? \n- Type of asthmatic? Chronic, frequent episodic, infrequent episodic\n- Severity of asthma exacerbations? Hospital admissions, ICU, intubation \n- Other illnesses? \n\nMedications & Allergies\n- Current medications? \n- Timing of nebulisers, \n- Pattern of steroid use? \n- Allergies?','','','','','','','','','','','Examination','- General condition - is patient fatigued, sweaty, cyanosed? \n- Can the patient talk normally or only in single words or phrases?\n- Accessory muscle use\n- Vital signs:	HR, BP, RR, SpO2\n- Breath sounds - rhonchi may indicate moderate asthma but the relatively silent chest may indicate a very severe episode.\n- Check for pneumothorax.	\n- \"Paradox\" is difficult to measure and is not helpful.\n- Peak expiratory flow rate (PEFR) is part of the physical examination and should be measured frequently. Compare values to both the patient\'s normal readings and to the predicted values for patient\'s age, sex and height.','','','','','Tests','Spirometry:\n- If possible, measure the FEV1 and the FVC and compare to predicted values.\n\nChest X-ray: \n- Indicated in severe asthma, and in all COAD patients.\n- In milder episodes only if pneumothorax or infective aetiology suspected - if the history is strongly suggestive of a viral cause (the most common by far) then is not necessary.\n\nU&E, FBE, serum theophylline: \n- Only required in severe asthma. The K is likely to be low due to hyperventilation, and the effect of salbutamol, but usually does not need treatment.\n\nArterial Blood Gases: \n- Indicated in severe asthma, possibly moderate asthma, but not mild asthma. \n- The TREND in the blood gases is more important than a single result. \n  - An initial low pCO2 due to increased ventilatory rate may be followed by a high pCO2 later on as the patient tires and starts to retain CO2. \n  - A \"normal\" pCO2 taken in isolation may represent this deteriorating state of affairs but may not be recognised as such. \n  - Always interpret the ABG\'s in the light of the overall clinical picture.','','','','','','Treatment','- All patients should receive supplemental oxygen to maintain SpO2 > 96%\n**For mild or moderate asthma- give three nebulisers in one hour and then reasses- if the patient still has any wheeze, then they should be admitted.','','','','Mild Asthma','','1. SALBUTAMOL 1 ml 0.5% solution with 3 ml diluent by nebuliser (Paediatric 0.5 ml 0.5% solution with 3.5 ml diluent). Repeat 1/2 hourly as required.\n2. IPRATROPIUM BROMIDE (2 ml 0.025% solution) added to the first nebuliser. Repeat 2 hourly as required (Paediatric dose 1 ml)\n3. PREDNISOLONE 50mg po.\n4. MONITOR progress with serial Spirometry, SaO2 and clinically.\n5. If settling, discharge home with instructions & 3/7 prednisolone & letter for GP. Otherwise observe longer.','','','','Moderate Asthma','','1. SALBUTAMOL 2 ml 0.5% solution with 2 ml diluent by nebuliser (Paediatric 1 ml 0.5% solution with 3 ml diluent). Repeat 1/4 hourly as required.\n2. IPRATROPIUM BROMIDE (2 ml 0.025% solution) added to the first nebuliser. Repeat 2 hourly as required (Paediatric dose 1 ml)\n3. PREDNISOLONE 50mg +/- HYDROCORTISONE 100mg iv.\n4. MONITOR progress with serial Spirometry, SaO2 and clinical assessment. Serial ABG\'s may be indicated.\n5. If marked improvement, discharge home with 3 days supply of Prednisolone 1 mg/kg\n6. Ensure adequate follow up either by GP (letter) or Physician.\n7. ADMIT if clinical situation fails to improve significantly. ','','','','Severe Asthma','','1. SALBUTAMOL by nebuliser (2 ml 0.5% solution with 2 ml diluent or neat). Repeat frequently - continuous if necessary.\n2. IPRATROPIUM BROMIDE (2 ml 0.025% solution) added to the first nebuliser. Repeat 20 minutely for 3 doses, then 2 hourly as required (Paediatric dose 1 ml)\n3. Give supplemental OXYGEN between nebulisers at a flow rate sufficient to keep the SaO2 as high as possible. In acute asthma (as opposed to emphysema or chronic bronchitis) there is generally no risk of depressing breathing as these patients do not rely on a hypoxic drive to ventilation.\n4. Administer HYDROCORTISONE 3 mg/kg IV.\n5. MONITOR the patient constantly with ECG, SaO2, serial ABG\'s (eg: 1/2 hourly initially) and frequent clinical assessments.\n\n If the situation deteriorates, consider the following:\n1. INTRAVENOUS SALBUTAMOL - 4 mcg/kg bolus (Paediatric 5 mcg/kg) followed by infusion 10-50 mcg/kg/hour (Paediatric 1-5 mcg/kg/min). \n2. INTUBATION AND INTERMITTENT POSITIVE PRESSURE VENTILATION - the decision to intubate is based on clinical grounds guided by ABG\'s. A patient requiring intubation will be fatigued with the work of breathing and may be exhibiting clinical signs of hypoxia and/or hypercarbia (agitation and restlessness or cerebral obtundation). Don\'t misdiagnose agitation as anxiety or treat with sedatives. \n3. In general, if a patient is allowed to progress to frank respiratory arrest, the decision to intubate has been delayed too long. However, respiratory arrest may occur suddenly. Conversely a patient who appears in extremis may occasionally make a dramatic improvement without requiring intubation.','','','','Protocol for Asthma Intubation & Ventilation','Technique','1. Get Help.\n- have all equipment to hand \n- preoxygenate patient using a rebreathing bag\n- have an assistant to apply cricoid pressure.\n2. For oral intubation, the drug of choice is \n\nKETAMINE 1 mg/kg i.vi\n\n An alternative is \n\nFENTANYL 200 mcg + MIDAZOLAM 2 - 5 mg\n\nTHIOPENTONE (4-5 mg/kg) may be used but can release histamine. Propofol should not be used as it may cause anaphylactoid reactions.\n3. After 1 minute perform laryngoscopy. If the larynx can be readily visualised and you are confident of successful intubation, give SUXAMETHONIUM 1 mg/kg and after muscular fibrillation proceed to intubate the trachea. It is acceptable to attempt intubation without relaxant if the patient is obtunded enough but there is the risk of precipitating laryngospasm.\n4. If you cannot visualise the cords or for any other reason you are not confident of intubating successfully then DO NOT administer Suxamethonium. Summon help immediately, (ED consultant or anaesthetist).\n5. If intubation is impossible and the patient is in respiratory arrest, attempt to ventilate with bag and mask. If high airways pressure makes this impossible and specialist help is not immediately available, proceed to cricothyrotomy.\n6. Once the airway has been secured, sedate with further doses of ketamine/ midazolam/ fentanyl/ morphine and paralyse using a non-depolarising relaxant. \nVentilate initially by hand, utilising a prolonged expiratory phase to allow adequate time for the outflow of expiratory gas from constricted small airways. DO NOT ventilate rapidly as this leads to increased air trapping and over-distension of the lungs which predisposes to barotrauma (ie: pneumothorax). \nCare should be taken when setting up the ventilator to avoid airways pressures >45-50 cmH20 - hand ventilation may be better in these cases. \n7. Obtain a post-intubation CXR to check for ETT position and to exclude iatrogenic pneumothorax.','Rapid Sequence Induction','#####134','','','Disposition','- All patients with severe asthma as defined above should be admitted to ICU.\n- Registrars must be involved in the management of all asthmatic patients in the ED. Interns and HMO\'s may not discharge any asthmatic patient from the ED.\n- All asthmatic patients sent home from the ED must have a responsible adult care giver and must be given a clearly explained follow up management plan (in writing if possible). \n- Asthmatic patients must be told to return to the department if there is any deterioration or recrudescence of their asthma. \n- Ensure that all asthmatic patients have good quality long term medical care. This should be arranged for them if necessary through either the department of medicine or the department of paediatrics.','','','','','','','','','','','Comments','- i.v. AMINOPHYLLINE should only be used in the ED by consultants. \n- Never underestimate asthma. If in doubt or inexperienced then CONSULT.','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (23,0,0,'N','COAD/ COPD','Do not give more than 28% oxygen to patients on home oxygen, unless you want to intubate them!','ED','emerg-med','','','','Guideline','QSOB QAST','','Background','Classically present in two forms:\n\n1.  \'Bronchitic\' aka \'Blue Bloater\'\nPulmonary damage largely confined to the airways. The patient is hypoxaemic and hypercarbic, with fluid retention, cor pulmonale and polycythaemia.\n\n2.  \'Emphysematous\' aka \'Pink Puffer\'\nPulmonary damage includes widespread emphysema as well as airway obstruction. Dyspnoea more prominent.\n\nAlthough in reality there is a spectrum of disease. Acute on chronic bronchitis is the most common cause of acute respiratory failure in COPD. Frequently a history of a precipitating viral infection and exacerbations are more frequent in winter. Other causes include atmospheric pollution, inappropriate use of central depressants or oxygen, and surgery.','','','','','','','','','','','','','','','','','History','Presenting episode\n- When did this episode start?  \n- Precipitating cause? (including recent URTI or LRTI) \n\nPast Medical History\n- How long has the patient been asthmatic? \n- Severity of asthma exacerbations? Hospital admissions, ICU, intubation\n- Other illnesses? \n\nMedications & Allergies\n- Current medications? \n- Timing of nebulisers, \n- Pattern of steroid use? \n- Allergies?','','','','','Examination','- General condition - is patient fatigued, sweaty, cyanosed? \n- Can he talk normally or only in single words or phrases?\n- Accessory muscle use\n- Vital signs:	HR, BP, RR, SpO2\n- Breath sounds - rhonchi may indicate moderate asthma but the relatively silent chest may indicate a very severe episode.\n- Check for pneumothorax.	\n- \"Paradox\" is difficult to measure and is not helpful.\n- Peak expiratory flow rate (PEFR) is part of the physical examination and should be measured frequently. Compare values to both the patient\'s normal readings and to the predicted values for patient\'s age, sex and height.','','','','','','Tests','Spirometry:\n- If possible, measure the FEV1 and the FVC and compare to predicted values.\n\nChest X-ray: \n- Indicated in all COAD patients.\n\nU&E, FBE, (serum theophylline): \n- Only required in severe asthma. The K is likely to be low due to hyperventilation, and the effect of salbutamol, but usually does not need treatment.\n\nArterial Blood Gases: \n- Indicated in any patient with more than mild COAD. Critical factor is pCO2\n- The TREND in the blood gases is more important than a single result. \n  - An initial low pCO2 due to increased ventilatory rate may be followed by a high pCO2 later on as the patient tires and starts to retain CO2. \n  - A \"normal\" pCO2 taken in isolation may represent this deteriorating state of affairs but may not be recognised as such. \n  - Always interpret the ABG\'s in the light of the overall clinical picture.\n','','','','','Comments','1.	Oxygen\nUnless the situation is desperate, use controlled oxygen therapy with 24% or 28% Ventimask or similar. No other form of oxygen delivery (eg nasal prongs, Hudson mask) is adequate and predictable - so do not use them. Risk of depressing breathing as these patients rely on a hypoxic drive to ventilate.\nNever withhold oxygen if required -give 100% oxygen if desperately ill. \nDrive nebulisers with air\n\n2.	Associated conditions\n- Treat pneumothorax if present.\n- Treat any pulmonary oedema (CPAP/ GTN/ frusemide).\n- Treat associated infection.','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','Mild COAD','Treatment','1. SALBUTAMOL 1 ml 0.5% solution with 3 ml diluent by nebuliser. Give three nebulisers within an hour, and then re-assess: if wheeze audible - admit.\n2. IPRATROPIUM BROMIDE (2 ml 0.025% solution) added to the first nebuliser. Repeat 2 hourly as required.\n3. PREDNISOLONE 50mg po\n4. MONITOR progress with serial Spirometry, SaO2 and clinically.\n5. If settled completely (no wheeze), discharge home with instructions & letter for GP & 3 days prednisolone. Otherwise admit.','','','','Moderate COAD','','1. SALBUTAMOL 2 ml 0.5% solution with 2 ml diluent by nebuliser (Paediatric 1 ml 0.5% solution with 3 ml diluent). Repeat 1/4 hourly as required.\n2. IPRATROPIUM BROMIDE (2 ml 0.025% solution) added to the first nebuliser. Repeat 2 hourly as required (Paediatric dose 1 ml)\n3. PREDNISOLONE 1 mg/kg orally and HYDROCORTISONE 3 mg/kg IV.\n4. MONITOR progress with serial Spirometry, SaO2 and clinical assessment. Serial ABG\'s may be indicated.\n5. ADMIT, iv antibiotics if evidence of infection','','','','Severe COAD','','1. SALBUTAMOL by nebuliser (2 ml 0.5% solution with 2 ml diluent or neat). Repeat frequently - continuous if necessary.\n2. IPRATROPIUM BROMIDE (2 ml 0.025% solution) added to the first nebuliser. Repeat 20 minutely for 3 doses, then 2 hourly as required (Paediatric dose 1 ml)\n3. Give Oxygen- 100% if CO2 not elevated, otherwise 28% max.\n4. Administer HYDROCORTISONE 3 mg/kg IV and Prednisolone 50mg\n5. MONITOR the patient constantly with ECG, SaO2, serial ABG\'s (eg: 1/2 hourly initially) and frequent clinical assessments. \nAdmit to HDU - iv antibiotics - decide on an appropriate resuscitation policy, and discuss with the relatives.\n\n If the situation deteriorates, consider the following:\n1. INTRAVENOUS SALBUTAMOL - 4 mcg/kg bolus followed by infusion 10-50 mcg/kg/hour. \n2. INTUBATION AND INTERMITTENT POSITIVE PRESSURE VENTILATION - the decision to intubate is based on clinical grounds guided by ABG\'s. \n\nA patient requiring intubation will be fatigued with the work of breathing and may be exhibiting clinical signs of hypoxia and/or hypercarbia (agitation and restlessness or cerebral obtundation). Don\'t misdiagnose agitation as anxiety or treat with sedatives. \n3. In general, if a patient is allowed to progress to frank respiratory arrest, the decision to intubate has been delayed too long. However, respiratory arrest may occur suddenly. Conversely a patient who appears in extremis may occasionally make a dramatic improvement without requiring intubation. ','Rapid Sequence Induction','#####134','');
INSERT INTO `MedHelp` VALUES (24,0,0,'N','Burns - Adult','Airway Burn = Intubate EARLY','ED','emerg-med','','','','Guideline','QBUR QDIS QMUL','','','','','','','','Background','The initial assessment of a burns victim is the same as for severe trauma and follows the same approach of primary survey, resuscitation, secondary survey and definitive treatment (see Trauma Protocols).','','','','','','','','','','Airway and breathing','Examination','In the assessment of the upper airway, make allowance for the development of laryngopharyngeal oedema and be prepared to intubate prophylactically. Indications for prophylactic intubation include: circumferential (> 80%) neck burns, facial burns, carbonaceous material visualised in pharynx and larynx, significant smoke inhalation and altered level of consciousness. In addition, some patients with severe burns will require intubation to facilitate general management and analgesia, especially if they are to be transported.\n\nNasal intubation is preferred, and reinforced tubes are a good idea.\n\nRemember that toxic inhalations may be associated with burns, including carbon monoxide & cyanide. ABG\'s & carboxy-haemoglobin estimations should be part of the initial workup in severe burns and where burns occur in an enclosed area.\n\nApply cervical collar if any possibilty of trauma','','','','','','','','','','','Primary resuscitation','Treatment','All burns patients should have i.v. access established and IV morphine as required to control pain. In children, i.m. ketamine is very useful (4 mg/kg) if IV access cannot be gained readily. This is an excellent analgesic and allows the setting up of central lines etc. Burnt skin is initially sterile and it is OK to gain percutaneous venous access through burnt areas.','','','','Fluid replacement formulae','','Treat shock with crystalloid fluid challenges (20 ml/kg) initially or colloid if persistently shocked despite crystalloid. Otherwise fluid replacement is calculated at the rate of 3 ml/kg per percentage surface area burnt over the first day plus maintenance. Ignore areas of simple erythema when calculating surface area burnt but include all areas of partial and full thickness burns. For areas > 50%, calculate as for 50%. Half of the calculated fluid deficit is given in the first 8 hours (calculated from the time of the burn) and the other half in the following 16 hours. NOTE: All formulae are GUIDES only. Monitor resuscitation with urine output (aim for 0.5 - 1 ml/kg/hour), BP, pulse & JVP/CVP and modify resuscitation accordingly. In the ED, unless the patient is shocked, all fluid replacement is to be Hartmann\'s.','','','','Secondary survey','','Look for associated injuries.\n- ankle/ lumbar fractures if jumped.\n- blast injury.\nPerform an accurate reassessment of types of burns and surface area involved. \nUse Lund and Browder charts. \nCXR if there is any chance of inhalational toxicity. \n','','','','Further management','','Large doses of  i.v. analgesia may be required. \nSaline packs initially to all burnt areas followed by SSD and Melolin to partial & full thickness burn areas (NOT face). \nAvoid hypothermia due to prolonged contact with wet towels especially in children. N/G tube if > 25% TBSA burns. \nGive Tetanus prophylaxis as required. \nAntibiotics are NOT given prophylactically. \nDo not attempt to remove burnt plastic or bitumen but split them if they are constricting blood flow to a limb.','','','','Hydrofluoric acid','','Call the consultant. These burns penetrate deeply into the tissues as the F ion complexes with Ca and Mg ions. Decontaminate the patient (remove clothes if necessary and shower). Apply 2.5% calcium gluconate gel to the skin. If pain persists inject 10% Ca gluconate (not chloride) into the skin (0.5 Ml per cm2 (may need to perform digital nerve block first if fingers are involved). For large HF burns there may be systemic toxicity, in particular marked hypocalcaemia and renal failure. These patients require monitoring and frequent biochemical assessment and may require Ca gluconate IV to correct hypocalcaemia. Intra-arterial injection of Calcium gluconate has also been used successfully, but should be administered by a consultant.\nConsult the poisons centre for advice','','','','Electrical burns','','Underlying muscle necrosis means that the extent of the burn is not apparent on the surface and fluid replacement may therefore be underestimated. \nPatients with electrical burns involving > 5% TBSA are to be admitted. Note also the possibility of other injuries sustained during the patient\'s contact with current (eg: tetanic contracture can lead to bone fractures). There may also be associated haemolysis and myoglobinuria (check CK and urine). Treat as for crush syndrome with mannitol and bicarbonate. \nCardiac arrhythmias are a potential problem at the time of injury but if the patient has been in sinus rhythm since the time of injury, there is minimal risk of so called \"delayed\" arrhythmias. A troponin level can be used to screen for significant myocardial damage. \n','','','','Criteria for transfer to regional unit','Disposition','Adults with burns > 15% TBSA. \nChildren & elderly with burns > 10% TBSA. \nAny burns requiring grafting (ie: Full thickness burns > 2% TBSA). \nBurns to the hands or feet. \nCircumferential burns. \nAssociated inhalational injury. \nBurns to difficult areas (eg: genitalia).\nBurns > 20% TBSA generally should be admitted to ICU. \nRule of thumb:  If age + % burn > 100 = death (therefore   do not transfer v.elderly patient with >50% burn)','Regional burns unit','#####162','','Criteria for admission','','Analgesia\nAssociated other injury or illness. \nLack of care giver at home. \nThe very elderly or the very young. \nIf there is any suspicion of child abuse.','','','','Outpatient management of burns','','The burns should be initially assessed and charted. There are many different ways of treating burns. Here are two we commonly use:\n\nMelolin method\nMelolin is applied to the area and left in place for five days. The melolin supports the skin and blister and allows the developing skin underneath time to mature.\nThe night before review, soak the melolin in vegetable oil, and then leave overnight. The next day it should pull off easily without damaging the skin.\n\nSSD method\nWounds should be dressed daily with SSD (NOTE: No SSD to face). Hands can be treated with SSD and a plastic glove - but any significant hand burn should be admitted. After two to three days of dressings with SSD, one can usually switch to an absorbing gel dressing (e.g. Duoderm) which can be redressed every 4 to 5 days.','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (25,0,0,'N','Cardiogenic Shock','Urgent angioplasty or CABG give the best outcomes - consult with regional centres sooner rather than later.','ED','emerg-med','','','','Guideline','QCOL QCHP QCAR','Clinical features','Background','1. Shock caused by heart disease\n2. Systolic arterial BP < 90 mmHg\n3. Evidence of reduced blood flow as shown by:\n- Urine output < 20 ml/hr\n- Impaired mental function\n- Peripheral vasoconstriction with a cold, clammy skin\n4. LVF and/or RVF\n5. Systolic Murmur ?\n6. Exclude other causes of shock','','','','Causes','','1. Myocardial Infarction\n2. Myocardial contusion\n3. Reduced systemic blood flow from left ventricular contraction\n - Ruptured interventricular septum\n- Acute mitral regurgitation\n- Acute aortic regurgitation\n- Left ventricular aneurysm\n 4. Obstruction to flow\n- Myxoma\n- Hypertrophic obstructive cardiomyopathy\n5. Cardiomyopathy\n6. Myocarditis','','','','','','','','','','','','','','','','','','','','','','','General supportive measures','Treatment','- Oxygen, CPAP, ETT, ventilation +/- PEEP as required\n- Analgesia (Morphine)\n- Correct severe acid-base or electrolyte disturbances\n- Treat cardiac arrhythmias','','','','Monitoring','',' - Intra-arterial BP\n- CVP +/- PCWP\n- CO via thermodilution\n- ECG\n- CE\'s\n- ABG\'s\n- Lactate\n- FBE\n- U&E\'s\n- Echocardiography','','','','Optimising cardiac function','',' The overall prognosis should be carefully considered before starting invasive monitoring and aggressive support, especially in patients with large myocardial infarcts without a correctable lesion and in patients with severe cardiomyopathy.','','','','PCWP < 18','','- Plasma volume expansion\n- Correct anaemia with blood, otherwise use repeated fluid challenges.\n- NB In patients with predominantly RV infarction, fluid loading may produce a CVP of 30 mmHg or more\n \n \n \n ','','','','PCWP > 18','','- The treatments available include drugs and mechanical circulatory assistance','','','','Drug therapy','','- Inotropes including Dobutamine, Dopamine, Adrenaline, Noradrenaline\n- Vasodilators including GTN, Sodium nitroprusside','','','','Mechanical circulatory assistance','','- Intra-aortic counter-pulsation balloon pump (IABP)\nIndications:\n- Potentially reversible cause of cardiogenic shock\n- Shock after cardiac surgery\n- Shock after chest trauma\n- Patients suitable for cardiac transplant\nContraindications:\n- Aortic regurgitation','','','','','','','','','','Specific Treatment','Disposition','- Angioplasty +/- CABG\'s\n- Heart transplantation\nContraindications to transplantation:\n+ Age > 55 years\n+ Widespread vascular disease\n+ High pulmonary vascular resistance\n+ Diabetes mellitis\n+ Recent pulmonary infarction\n+ Active infection\n+ Neoplastic disease','Angioplasty Referrals','#####163','','','','','','','');
INSERT INTO `MedHelp` VALUES (26,0,0,'N','Chest Pain','Patients with chest pain have a significant illness until proven otherwise. \nA patient who presents with chest pain is not to be discharged from the Emergency Department unless the case has been reviewed by a registrar or consultant.','ED','emerg-med','','','','Guideline','QCOL QCHP QUAD Heart cardiac lung pulmonary oesophag reflux stomach gastritis heartburn','','','','','','','Primary treatment - the first five minutes','','Triage as category 2 or 3.\nThe patient should be placed in a monitored bed with oxygen on 4l/min \nA 12 lead ECG  should be performed immediately and shown to a doctor. \nAspirin should be given to  all cases thought to be cardiac in origin, unless contraindications','','','','A good history of the pain is the most important investigation','History','- Sudden or gradual? \n- What brings the pain on?\n- What were you doing when the pain started?\n- What time did the pain start? \n- Is the pain constant, fluctuating, getting worse or better?\n- 1/10 = very mild, 10/10 = worst imaginable\n- Crushing, aching, tearing sensation, burning, sharp? \n- Patient may describe \"chest discomfort\" rather than \"chest pain\"\n- Worse with moving or deep breathing?\n- Position of the pain\n- Radiation?\n- Associated symptoms - sweating/ feeling short of breath/ nausea& vomiting/ fainting.\n\nAutonomic disturbance indicated by these associated symptoms has a high positive predictive value for ischaemic pain.','','','','Risk factors','','- Previous ischaemic heart disease\n- Family history\n- Smoking\n- Diabetes\n- Cholesterol\n- Hypertension','Chest pain review article 2000 NEJM','','','','Examination','- Temperature\n- Breathing - rate, pain\n- Pulse - rhythm, rate, volume\n- BP in EACH arm. If there is > 20 mm Hg diffence, consider aortic dissection.\n- Heart sounds (4th HS, new murmurs)	\n- JVP\n- Lungs - air entry, crackles, wheezes				\n- Abdomen (especially epigastrium)\n- Other signs of cardiac failure, DVT		\n- Spine and ribs (musculoskeletal causes)','','','','','','','','','','','','Tests','- 12 lead ECG - repeat at least every 30 minutes if ongoing pain\n- U & E \n- Troponin I or CKMB \n- Chest X-ray (portable if ongoing pain, otherwise departmental)','Thromboembolism - DVT and PE','#####45','','','','','Angina - Stable','#####18','','','','','Angina - Unstable','#####19','','','','','Myocardial Infarction','#####13','','Elderly and diabetic patients','Advice','Elderly or diabetic patients with ischaemia are more likely to present with :\n- atypical chest pain or no pain.\n- non-specific symptoms eg shortness of  breath.','','','','Diagnosistic dilemmas','','The tools we have to diagnose critical ischaemia are imperfect, and their strengths and weaknesses need to be understood if your patients are going to benefit from their use.\n\nA normal ECG does not exclude myocardial ischaemia. More than 50% of patients with acute angina have no ECG changes. Similarly 50% of patients with Acute Myocardial Infarction have no initial ECG changes. ECG changes may evolve in the Emergency Department\n \nNormal cardiac enzyme titres do not exclude myocardial infarction. 30% of acute AMI\'s may have both normal enzymes and a normal ECG\n\nThe diagnosis of myocardial infarction or unstable angina cannot be excluded even if the ECG remains \"normal\" and the enzymes are not elevated.\nIf in any doubt ADMIT','','','','False positive ECGs','','Acute chestpain associated with hyperventilation may causes ECG changes, typically ST segment depression and T-wave inversion, especially in young females.','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (27,0,0,'N','Conjunctivitis','Never pad a discharging eye','ED','emerg-med','','','','Guideline','QEYE','','Background','The red eye is often difficult to diagnose. \n - Use the books in the department  eg the ABC of Eyes\n - Ask','The red eye - NEJM review article 2000','documents/redeye.pdf','','Bacterial','','- Redness and feeling of grittiness in the eyes. \n- Initially unilateral; rapidly becomes bilateral due to cross contamination (fingers). \n- Mucopurulent discharge. \n\nTreatment\n- Eye toilet - regular rinsing with clean water\n- Antibiotic eye ointment (chloramphenicol 10 mg/gm) qid  for 5 days.','','','','Adenovirus','','- The commonest cause of conjunctivitis\n- May be associated with a preauricular rash. \n\nTreatment\n- Difficult to distinguish viral from bacterial conjunctivitis so treat as for bacterial, although chloramphenicol eyedrops may be used.','','','','','','','','','','Herpes zoster (shingles)','','Shingles affecting the nasociliary branch of the trigeminal nerve - if the tip/ side of the nose is affected, the conjunctiva and cornea will also probably be affected. Sometimes there appears to be conjuctivitis is a Ramsey- Hunt syndrome (facial nerve), although this may be due to the exposure of the eye due to the facial nerve palsy.\n\nTreatment\n- All cases should be discussed urgently with an ophthalmologist.\n- Acyclovir may be indicated (topically, orally or IV). \n- Steroids are sometimes used, but only on the direct orders of an ophthalmologist.','','','','','','','','','','','Herpes simplex (dendritic ulcer)','','- Painful ulcer\n- Appears as a branching pattern on fluorescein staining. \n\nTreatment\n- Antibiotic ointment (Chloramphenicol 10 mg/gm) and drops (Chloramphenicol 0.5%) to prevent secondary infection. \n- Steroid drops should only ever be given on advice from an ophthalmologist. \n- All cases should be discussed urgently with an ophthalmologist.\n- Acyclovir may be indicated (topically, orally or IV). ','','','','','','','','','','','','','','','','','','','','','','Allergic','','- The eye is red and itchy, previous history of atopy\n- Conjunctiva is frequently oedematous. \n\nTreatment\n- Eye drops with topical vaso-constrictors & antihistamines. \n- Steriods may be required in more chronic cases, but these should be seen by an ophthalmologist.','','','','','','','','','','Should I use drops or ointment?','Comments','If the patient has a reasonable expectation of being able to use the eye use drops, for anything more serious, use ointment.\nOintment is better as it provides a film of grease over the eye, protecting it and lubricating it. The antibiotic therefore stays in the area for longer. However it makes the vision \"smeary\".','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (28,0,0,'N','Eye Injuries','If in doubt, get someone more senior to review within the next 12 hours. \nMake sure that the eye exam is fully documented','ED','emerg-med','','','','Guideline','QEYE QHIN','','','','Eye Examination','#####124','','Corneal Abrasions','','Minor trauma but can be distressingly painful.  \nTreatment:\n1. Antibiotic ointment \n2. Oral analgesia\n3. Eye pad\n4. Review in 48 hours','','','','Foreign bodies','','Conjunctival foreign bodies often embed under the upper eyelid\nAlways evert the upper eyelid to inspect for FB\'s\n\nManagement\n1. Perform eye examination (see separate protocol)\n2. Use local anaesthesia (e.g. tetracaine (amethocaine) 1%)\n3. Remove superficial foreign bodies with 25 gauge needle or dental burr. \n4. Stain with fluorescein check for traumatic corneal lacerations or ulcers. \n5. Antibiotic ointment (chloramphenicol 10 mg/gm) and pad for 4 hours\n6. Consider tetanus prophylaxis\n7. Prescribe:\n- Antibiotic eye ointment (chloramphenicol 10 mg/gm) qds\n- Oral analgesia if required. \n8. Review in 48 hours at which time residual rust rings can be removed following softening of the surrounding cornea.','','','','Intraocular foreign bodies','','- X-ray (eyes-up & down)\n- Discuss urgently with an ophthalmologist\n- Anti-emetics i.v.\n- i.v. antibiotics\n- Tetanus prophylaxis','','','','','','','','','','','Blunt trauma to the orbit','','Critical questions:\n1. Is the globe intact\n2. Is there a hyphaema?\n\nRuptured Globe\n- Usually ruptured 5 mm from the limbus (the outer rim of the iris). \n- Visual acuity is reduced. \n- Possible enophthalmos\nManagement\n1. Analgesia \n2. Antiemetics. \n3. All cases should be discussed urgently with an ophthalmologist.\n\nBlow-out fractire of orbit\n- Usually floor and medial wall. \n- Contents of the orbit may prolapse downwards and entrapment of the inferior rectus muscle leads to diplopia and pain on looking upwards. \n- Test Infraorbital nerve sensation in cheek and upper gum (numb gum syndrome).\nManagement\n1. Analgesia \n2. Antiemetics. \n3. Antibiotics\n4. All cases should be discussed urgently with a Maxillofacial or Plastic Surgeon.\n\nHyphaema\n- All cases should be discussed urgently with an ophthalmologist.\n \n Traumatic Dislocation of the Lens\n- Visual acuity markedly reduced. \n- All cases should be discussed urgently with an ophthalmologist.\n \n Traumatic Detachment of the Retina\n- Vitreous haemorrhage following trauma should alert to this diagnosis. \n- See separate protocol (Sudden Loss of Vision).\n \n Traumatic Mydriasis\n- Due to selective neuropraxia of parasympathetics innervating the iris preventing constriction of the pupil. \n- Usually temporary but refer all cases to an ophthalmologist.\n \n Traumatic Iritis\n- Red painful eye with photophobia and constricted pupil. \n- Cells may be seen in the anterior chamber with slit lamp. \n- All cases should be discussed urgently with an ophthalmologist re treatment with mydriatic drops and steroid drops.','','','','','','','','','','Penetration trauma to the eye','','- Suspect if there is an appropriate presenting history or there is penetrating injury to the eyelid.\n- Signs of perforation include reduced visual acuity, soft globe, vitreous haemorrhage and irregular pupil. \n- Prolapsed intra-ocular contents (black tissue) may be incarcerated in the wound. \nManagement\n1. Analgesia\n2. Sedation\n3. Adequate doses of antiemetics \n4. Nurse upright if possible. \n5. Apply a rigid eye shield (ie eye cone) \n6. All cases should be discussed urgently with an ophthalmologist.\n','','','','','','','','','','Eyelid lacerations','','Two types of eyelid lacerations:\n1. Simple lacerations of the eyelids \n- Repair with 6.0 Nylon\n2. Complicated lacerations are:\n- those that involve the lid margin, tear duct \n- full thickness injuries\n- significant tissue loss or very untidy wounds\n\nAll complicated lacerations must be referred to an ophthalmologist for definitive management ','','','','','','','','','','Subconjunctival haemorrhage','','Usually alarming but trivial\n\nIf no posterior limit to the haemorrhage then think about possible fracture of the anterior cranial fossa- CT is the appropriate investigation.','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (29,0,0,'N','Fractures','Open fractures need urgent operations','ED','emerg-med','','','','Guideline','QLIM QPOP QMUL QDIS QLIC break bone ','','','','','','','','History','A = Allergies\nM = Medications\nP = Past history\nL  = Last ate/ drank\nE  = Events: how & why did it happen? Other associated injuries? Child abuse??','','','','Describe the fracture','Examination','1. Open or closed\n -  Open = \"compound\" ie: overlying soft tissue defect\n\n2. Type\n - Hairline\n - Buckle/ Greenstick\n - Avulsion	\n - Transverse\n - Oblique (Spiral)\n - Compression (Crush)\n - Impacted 	\n - Comminuted\n - Segmental\n - Pathological\n\n3. Site\n - midshaft, metaphysis, proximal third etc\n - articular surfaces involved? step?\n\n4. Bone\n\n5. Displacement & Angulation\n - of distal fragment\n\n6. Neurovascular integrity\n - including any evidence of compartment syndrome','','','','','','e.g. \"This patient has a closed, oblique fracture of the midshaft of the left femur with considerable lateral displacement. The distal pulses and sensation are intact.\"','','','','','','','','','','','','','','','','','Epiphyseal injuries (Salter Harris) - 5 types','','- Types 1 and 2: the epiphyseal plate is intact but is displaced. \n- Types 3,4 and 5: there is also damage to the epiphyseal plate itself. \n- In Types 2 and 4 a fragment of metaphysis is displaced along with the epiphysis.\n- Type 5 involves crushing of the epiphysial plate\n- Type 2 is the most common','','','','','','','','','','Analgesia, splinting and fluids','Treatment','- Morphine 2.5 - 5 mg i.v. (children 0.1 mg/kg) as per protocol AND/ OR\n- Ketorolac 30mg i.v. / i.m. \n- Consider indomethacin 100mg p.r. - gives good ongoing analgesia\n- Consider local anaesthesic block e.g. femoral nerve block for fractured shaft of femur/ intratrochanteric fracture.\n \nSplint and elevate\n- All fractured limbs s must be supported and elevated, preferably in a splint (such as a Plaster of Paris back or volar slab). \n- Elevation is important as it reduces swelling, reducing neurovascular problems and aids reduction of the fracture.\n \ni.v. fluids	\n- Especially in lower limb fractures. In fractured femur there may be 1-2 litres of blood loss.\n- If the patient not going to theatre for several hours, will need fluid replacement','Femoral nerve block','#####166','','Open fractures: 	','','i.v. antibiotics\n- Cephalexin 1 - 2 g. i.v.\n- if heavily contaminated, add penicillin and metronidazole.\nTetanus prophylaxis\nSaline irrigation followed by iodine soaked packs to the wound','','','','Grossly angulated fractures / fracture dislocations','','If grossly displaced or angulated there may be significant compromise to distal blood supply, peripheral nerves and the overlying skin. Therefore reduce in the emergency department .\nUse \n- An opiate (fentanyl and/or morphine)\nand \n- A sedation agent and (nitrous oxide or midazolam)\nAn alternative, particularly for children, is 3mg/kg of ketamine.','Regional intravenous anaesthetic','#####120','','','','','Haematoma block','#####167','','','','','','','','','Disposition','All X-Rays ordered for possible fractures must be seen by a Registrar or Consultant before the patient is discharged.\n \nDisposition will depend on fracture\n \nPatients with certain orthopaedic injuries may be allowed home to be admitted within the next couple of days for surgical repair. Such injuries may include:\n- fractures of phalanges, metacarpal or metatarsals\n- simple forearm fractures\n- fractured shaft or surgical neck of humerus\n- relatively undisplaced uni- or bi-malleolar ankle fractures\n- Achilles tendon rupture etc.\nAny patients sent home must have the injury properly splinted and supported and adequate analgesia must be provided.\n \nAll plaster of paris splints and casts must be reviewed by a registrar or consultant prior to the patient being discharged.\n \nConditions which may not be sent home include:\n \n- All open fracture / dislocations (ie: \"compound\" injuries)\n- Supracondylar fractures of the humerus\n- Fractures of the lower limb long bones\n- Intra-articular fractures involving a major joint\n- In any case where there has been neurovascular compromise\n\nAll these, and any other serious cases must be admitted to hospital. \n\nIf in doubt, don\'t let out!\n\nIf patient is going home, then remember:\n\n1. Check X-ray post reduction &/or after applying a plaster.\n2. Sling or crutches\n3. Elevation\n4. Physiotherapy\n5. Plaster advice sheet and POP check the next day by GP\n6. Appropriate referral either to the fracture clinic, an orthopaedic surgeon or GP.','Plaster instructions','#####81','','','','','','','');
INSERT INTO `MedHelp` VALUES (30,0,0,'N','Sexual Assault','Do not take legal samples unless you have had forensic training.','ED','emerg-med','','','','Guideline','QASS QSEX rape ','','','','','','','','Treatment','Treat any relevant medical or surgical condition requiring immediate care, but investigation and treatment of sexual assault is carried out by the sexual assault team.','Sexual Assault Investigation / Support Team','#####157','','','','','','','','','','','Morning after pill','#####116','','','','','Body fluid exposure','#####126','','','','','','Sexual health clinic','#####168','','','','','Domestic violence','#####92','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (31,0,0,'N','Vaginal bleeding in pregnancy','Any female of child bearing age has an ectopic pregnancy until proven otherwise.\nRemember Rhesus status.\nRuptured ectopic = immediate laparotomy.','ED','emerg-med','','','','Guideline','QPRG QGYN ectopic PV bleed haemorrhage ','Differential diagnoses','Background','1. Ectopic pregnancy\n2. Abortion\n3. Antepartum haemorrhage\n4. Postpartum haemorrhage','','','','','','','Criteria for giving anti-d','#####164','','','Examination','1. High triage priority if patient is:\n- syncopal\n- hypotensive\n- anaemic or \n- has significant pain.\n\n2. If actively bleeding or otherwise hypovolaemic:\n- insert i.v. cannula (16 G or larger)\n- resuscitate with appropriate fluids','','','','','Remember','Young patients can lose a lot of circulating volume before their BP drops, therefore heart rate is a more sensitive indicator of blood loss.','','','','','Examination','3. SPECULUM VAGINAL EXAMINATION: \n- Gently remove clots (gauze swabs on sponge holder). \n- Products of conception may be seen in the cervix - remove gently using the sponge holders (this can reverse vagally induced hypotension).  \n- Determine if the cervical os is open or closed (may be unreliable sign). \n- Assess size of uterus and carefully palpate the fornices for adnexial masses and/or tenderness.\n\n4. PATHOLOGY INVESTIGATIONS: \n- FBE\n- Serum bHCG\n- Group & hold or cross match 4 units depending on clinical condition. \n** Check Rhesus Status **\n\n5. PELVIC ULTRASOUND may give additional information but may be diagnostically unreliable if gestation is < 6 weeks. Patients should only be sent for ultrasound if:\n- the serum bHCG is positive\n- there is no haemodynamic instability\n- the os is closed. \n \n NOTE: Patients actively bleeding or haemo-dynamically unstable should NOT be sent for ultrasound (they need surgery, not tests).','','','','','','','','','','','','','','','','','Ectopic pregnancy','','Any female of child bearing age with pelvic pain or bleeding potentially has an ectopic pregnancy until proven otherwise. \n\nRisk factors include previous tubal surgery\n \nDenial of sexual activity does not exclude pregnancy.\n \nPAIN is usually the first symptom when an ectopic pregnancy ruptures. Bleeding may or may not follow later & sometimes may occur without pain. Pain is initially mainly unilateral and colicky, later becoming more generalised with +/- shoulder tip pain. \n \nIf stable, confirm diagnosis with ultrasound (confirms empty uterus but may not see ectopic pregnancy). \nIf signs of shock, immediate laparotomy.','','','','Abortion','','BLEEDING is the key symptom - initially painless with the later development of crampy pain similar to dysmenorrhoea','','','','Septic abortion','','Usually the result of illicit TOP and hence now uncommon. Occasionally complicates legal TOP\'s and rarely may complicate incomplete spontaneous abortion. A medical emergency. Wide range of organisms including anaerobes, gram negative rods and Clostridium welchii. Take swabs, blood cultures. \nLook for and treat septic shock (fluids, inotropes). \nAntibiotics: Penicillin + Ceftriaxone/cefotaxime + Metronidazole +/- Gentamicin.','','','','Complete abortion','','The bHCG becomes negative after 2 weeks. The entire conceptus is expelled. Do ultrasound.','','','','Inevitable abortion','','The cervical os is open. Admit for suction curettage. ','','','','Incomplete abortion','','The bHCG may become negative after 2 weeks. The cervical os may be open in which case admit for suction curettage. If closed, perform ultrasound to exclude a viable intrauterine fetus and admit for D&C.  NOTE: may not require a D&C if the pregnancy is less than 8 weeks and bleeding has eased.','','','','Threatened abortion','','The os is closed and the bHCG remains positive. \nUltrasound confirms presence of a viable intrauterine fetus. Patient may be sent home after counselling. Enforced bed rest or progestagens are of no benefit.','','','','Missed abortion','','The bHCG may become negative after 2 weeks. There may a brownish PV discharge (infrequently bleeding) and little or no pain. Ultrasound will exclude a viable intrauterine fetus. Discuss with Gynaecology Registrar re admission for D&C.','','','');
INSERT INTO `MedHelp` VALUES (32,0,0,'N','Pelvic/ vaginal symptoms','Exclude ectopic pregnancy','ED','emerg-med','','','','Guideline','QGYN QPRG PV ','','','','','','','','','','Vaginal bleeding in pregnancy','#####31','','Pelvic pain','Background','Differential diagnosis \n1. Appendicitis\n2. Ectopic Pregnancy\n3. Miscarriage\n4. Ovarian pathology including cysts\n5. Mittelschmerz\n6. Dysmenorrhoea\n7. Inflammatory Bowel Disease\n8. PID\n9. Endometriosis\n10. UTI\n11. Urinary tract calculi.\n \nCareful clinical examination, MSU and bHCG in all cases. White cell count is not specific and a normal white count does not exclude any of the differential diagnoses. Pelvic ultrasound may be useful. PID and endometriosis can only be confirmed by laparoscopy. If in doubt, admit.','','','','','','','','','','Vaginal discharge','','Take swabs for microscopy and culture including gonococcus, chlamydia, trichomonas and candida. \n- If ? thrush, treat with nystatin, miconazole or econazole vaginal cream or pessaries. \n \n- If ? trichomonas treat patient plus partner with either metronidazole (400 mg tds for 1/52) or Tinidazole 4 X 500 mg tablets orally as a single dose. \n \n- If ? STD, treat speculatively to cover gonococcus (Amoxil 3 G + Probenecid 1 G orally OR Ceftriaxone 250 mg IM) and chlamydia (Doxycycline 100 mg bd for 10 days). Attempt to treat sexual partner(s) similarly.','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (33,0,0,'N','Minor Head Injury','Hypotension and hypoxia kill head injured patients','ED','emerg-med','','','','Guideline','QHIN QMUL QASS QBEH QCOL QHED QNEK QVOM QDIS trauma skull CT ','','Cautions','These protocols are concerned with the management of head injury only. It is assumed that in all cases a full primary and secondary survey is performed and that there is appropriate management of co-existing conditions.\nIn ALL CASES:\n - Remember the ABC\'s\n - Protect the cervical spine\n - Don\'t neglect other injuries ','','','','','','','','','','','History','- Time and mechanism of injury. \n- Trends of patient\'s level of consciousness. \n- Concomitant symptoms and other medical conditions (especially epilepsy, diabetes). \n- Alcohol or drugs?','','','','','Examination','Head and Neck\n- Examine scalp and skull for clinical evidence of compound or depressed fracture. \n- Check ears and nose for bleeding or CSF leaks (fractured base of skull). Note that Battle\'s sign & raccoon eyes are LATE signs of fractured base of skull.\n- Examine facial bones including orbits, middle third. \n- Check the cervical spine for local tenderness, deformity and abnormal neurology.\n \nNeurological Assessment\n- Glasgow Coma Scale - repeat often - the motor component is the most important.\n- Assess whether alcohol or other CNS depressants likely.\n\nEyes\n- Pupils - size and reactivity (unequal pupils are probably insignificant if the patient is GCS 15 but of grave significance in the deeply comatose)\n\nSpinal cord\n- Look for lateralising neurological long tract signs . Assess power, tone, reflexes and all sensory modalities. Compare right side vs left, upper body vs lower.\n- Check for priapism and anal tone \n- There may be anaesthesia below the level of a spinal lesion therefore look for facial grimacing in response to a painful stimulus above the clavicles as this may be the only indication of spinal injury.\n- Low BP and inappropriately low pulse rate indicates cervical sympathetic disruption in spinal injury, but look for hidden causes of bleeding. \n \n Up to 15% of comatose head injured patients have an associated spinal injury','','','','Skull X-rays','Tests','Skull X-Rays are not sensitive or specific for significant head injury and NOT to be performed routinely. They should ONLY be ordered for the following :\n - Suspected compound fracture	\n- Possible intracranial foreign body\n- Possible depressed fracture	\n- Suspected child abuse','','','','','Computerised tomography','','Indications\n- Major head injury\n- Minor head injury (see below)\n- Prior to theatre for multiply injured patients. However, if immediate lifesaving surgery is required, CT is delayed until after theatre.\n\nThe timing of CT depends on clinical circumstances. Unless clinical decisions are immediately dependent on the result, the scan can wait until the following day. ','CT rule in minor head injury (NEJM)','documents/CTrule.pdf','','1. Trivial head injury','Treatment','There has been no loss of consciousness or amnesia. GCS = 15.\n- Most of these patients may be discharged home after careful clinical examination. \n- If there is headache, dizziness or vomiting, admit and reassess after 6 hours. \n- CT scan is not indicated unless clinical problems are persistent or deteriorating.','','','','2. Minor head injury','','There has been definite LOC or significant post traumatic amnesia. GCS is 13, 14 or 15 on presentation to the ED. There may be vomiting, dizziness and mild headache but no other abnormal clinical symptoms or signs.\n- Treatment depends on whether there are associated complicating factors. \n- Minor head injuries have the potential to become major head injuries and the fundamental principle of management is repeated meticulous clinical examination (particularly neurological).\n- There is a significant rate of CT abnormalities in this group and CT scanning is now indicated in all patients in whom there has been loss of consciousness or significant post traumatic amnesia. Thus in general the principle to be followed in this group is\n \nCT scanning followed by selective admission.\n \nADMIT: \n \"Moderate Risk\" Group = Minor Head Injury + Alcohol, Progressive Headache, # Base Of Skull, Facial #\'s or Convulsions.\n \"High Risk\" Group = Minor Head Injury + Deteriorating Level of Consciousness, Palpable Depressed Skull #, Compound Skull #.','','','','3. Major head injury','','Definition: The GCS is less than 13 on presentation to hospital.\n\nOxygen should be administered to all head injured patients.\n- If GCS <9, needs rapid sequence induction and ventilation. \n- Urgent CT.\n- Inform surgeons and ICU.\n \n Rising intracranial pressure \n- This is a neurosurgical EMERGENCY and must be recognised and managed urgently. \n- The important CLINICAL SIGNS are:\n- Deteriorating GCS\n- Unequal pupils - larger pupil is ipsilateral to an expanding haematoma. The pressure on the IIIrd nerve is due to the uncus herniating through the tentorium cerebelli.\n- Abnormal respiratory pattern - The exact pattern does not matter but recognition that breathing is abnormal IS important. (Exclude obstructed upper airway or chest trauma).\n- Cushing\'s reflex - High BP is needed to maintain cerebral perfusion (as the blood has to overcome the intracerebral pressure). Lowering the blood pressure (i.e. hypotension due to too much induction agent) kills the patient by stopping cerebral perfusion. \n\nMonitoring TRENDS in clinical signs is important.\n \nNOTE: Despite the urgency of this condition, always obtain a CT prior to theatre. Blind burr holes are only indicated if there is a significant delay in obtaining CT.\n\nIf CT shows an operable lesion, urgent transfer is indicated, unless the patient has a \'classic\' extradural with rapid deterioration when drainage will be done before transfer..','','','','Intubation and ventilation','','Patients with head trauma and a GCS of 8 or less must be intubated and ventilated. In addition intubation may be required for indications independent of the head injury.  All head injured and ventilated patients require CT scan ASAP.\n\nExcept in the moribund patient who is multiply traumatised, NEVER INTUBATE WITHOUT DRUGS. Even in comatose patients, laryngoscopy and intubation without adequate sedation may raise the intracranial pressure significantly for several hours. This may make the difference between a good and poor outcome.\n\nA rapid sequence induction with cricoid pressure is used but one should still aim to induce anaesthesia and to intubate as smoothly and as gently as possible. If the patient is not hypovolaemic, use \n- Fentanyl 1.5 mcg/kg followed by \n- Thiopental (thiopentone) 4 mg/kg and \n- Suxamethonium 1.5 mg/kg. \nMaintain neuromuscular blockade with Rocuronium 0.5 mg/kg initially and thereafter with 0.25 mg/kg increments prn. Maintain sedation with increments or infusions of fentanyl (100 - 300 mcg/hour) or morphine (4 - 6 mg/hour). Supplement as required with midazolam (2 - 5 mg/hour) or propofol (100 - 200 mg/hour). \n\nAll doses should be reduced in the elderly or hypovolaemic patient.\n\nIt is VITAL to avoid hypotension, therefore in the hypovolaemic or otherwise hypotensive patient, use fentanyl as the sole induction agent or together with markedly reduced doses of thiopentone. Note that Ketamine is contraindicated in head injuries.\n\nVENTILATION\nVentilate adequately but DO NOT HYPERVENTILATE initially unless there are signs of rising intracranial pressure (vide supra). Aim to maintain a PaCO2 of around 35 mmHg and ensure good oxygenation. Do not add PEEP unless absolutely necessary to maintain PaO2. An adequate starting regime is a MINUTE VOLUME of 100 mL/kg at a RATE of 10/minute. Check the ABG\'s after 5 - 10 minutes.\n\nHyperventilation is the main treatment of raised intracranial pressure prior to getting the patient to theatre, but is of only temporary benefit as compensation of cerebral blood flow to hypocarbia occurs after a few hours. Thus hyperventilation should be held in reserve until it is actually needed.','Rapid Sequence Induction','#####134','','Mannitol','','Mannitol 20% should only be given on the advice of a neurosurgeon.','','','','Discharge','Comments','The decision to discharge home a head injured patient\nA patient to be discharged home must be under the supervision of a responsible adult care giver. Head injury instructions are to be given to the care giver in writing. The care giver must have immediate access to transport. If any of these conditions cannot be fulfilled, admit the patient to hospital.\n\nJunior medical staff should not discharge a head injured patient without first seeking the advice of a registrar or consultant','','','','The combative patient','','Combativeness may be due to head injury, hypoxia, hypercarbia, alcohol etc. Control must be gained but a combative, non lucid patient must not be forcibly fought and restrained. Sedative drugs have little role as they confuse the clinical signs of head injury. Be prepared to anaesthetise and intubate (but then obtain CT scan ASAP).','','','','Analgesia','','Head injury is NOT a contraindication to analgesia.\nA patient who is awake enough to be distressed by pain needs analgesia which must NOT be withheld. Narcotic analgesia should be titrated i.v. as usual.','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (34,0,0,'N','Heat Stroke','In a young person, ask about drugs (? MDMA - ecstasy)','ED','emerg-med','','','','Guideline','QCOL QUAD hot','','','','','','','','','','','','','','Background','Condition caused by excessive heat storage brought about by either:\n- too much heat produced and/or\n- not enough heat lost and/or\n- failure of the thermo-regulatory system \nduring exposure to heat stress.','','','','Risk factors','History','- Dehydration\n- Lack of acclimatisation\n- Obesity\n- Infection\n- Alcoholism\n- Mental illness\n- Drugs (phenothiazines, diuretics, anticholinergics)','','','','3 signs to look for','Examination','1. Severe CNS disturbance\n2. Hyperpyrexia (core temperature 41-43 C)\n3. Hot, dry skin, which is pink or ashen depending on the circulatory state. Sweating may be profuse or absent.\n\nCNS\nConfusion, aggressive behaviour, delirium, convulsions, pupillary abnormalities, ataxia, dysarthria, hemiplegia, coma.\n\nCVS\nHR  10 bpm/C\nSVT/ ST depression, T-wave changes\nCardiac output initially elevated, but then drop','','','','','','','','','','','','Tests','Renal, Fluid & Electrolyte Abnormalities\nDehydration & electrolyte deficiencies (Na, K, Ca, phosphorus, Mg) from excessive sweating\nAcute tubular necrosis\nRhabdomyolysis\n\nInitial respiratory alkalosis later combined with a metabolic acidosis\n\nCoagulation Abnormalities\nBleeding diathesis, thrombocytopenia, DIC, hepatic damage','','','','','','','','','','Cooling and supportive care','Treatment','Cooling\n1. Remove all clothing\n2. Ice packs wrapped in towels to groins/ axillae\n3. Air conditioning, fan + wet sheet\n4. Peritoneal lavage\n5. Cease cooling measures at 39 C\n\nSupportive care\n1. Oxygen, ETT & ventilation if indicated\n2. Correct hypovolaemia & dehydration cautiously as guided by urine output & CVP\n3. Correct electrolyte abnormalities\n4. Treat hypoglycaemia\n5. Mannitol may be required to promote renal blood flow (NB Frusemide will precipitate myoglobins into renal tubules)\n6. Dialysis if anuria, uraemia, hyperkalaemia\n7. Anticonvulsants as indicated\n8. Phenothiazines to suppress shivering','','','','','','','','','','','Disposition','Admit all cases that need active cooling. HDU/ ICU as necessary.','','','','','','','Malignant hyperthermia','#####39','','','','','Neuroleptic malignant syndrome','#####42','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (35,0,0,'N','Hyperkalaemia','','ED','emerg-med','','','','Guideline','QCOL QUAD potassium renal kidney','','','','','','','','Background','- Hyperkalaemia is a dangerous when serum potassium rises to greater than 6.5 to 7 mmol/l.\n- The rate of change is important in the development of symptoms','','','','','','','','','','Causes','','1. Decreased renal potassium excretion\n- Acute or \"END STAGE\" renal failure.\n- Potassium sparing diuretics: Amiloride, Spironolactone.\n- Mineralcorticoid deficiency eg: Addison\'s Disease, or 2ndry Hypoaldosteronism.\n2. Secondary to massive cell damage\n- Burns, Massive Trauma, Rhabdomyolysis\n3. Increased extracellular shift of potassium\n- Acidosis, Periodic paralysis, Hyperosmolarity, Digoxin overdose.\n4. Excessive intake of K+ \n- Excess i.v. K+ ','','','','','Examination','- Muscular weakness and lassitude progressing to flaccid paralysis.\n- Cardiac arrythmias which may become life threatening when hyperkalaemia is severe (> 7.5 mmol/l)\n- ECG changes\n- Peaked T waves.\n- Diminished P wave amplitude.\n- Widened QRS.\n- Atrial asystole.\n- Intraventricular conduction abnormalities producing a broad QRS that when K+ is > 7 mmol forms a \"sine wave\" pattern.\n- Finally ventricular asystole may occur (7.5 - 8.0 mmol/l).','','','','','Mild (< 6.5 mmol/l)','','- Rehydration +/- diuretics.\n- Ion exchange resins may be sufficient (resonium 15-30gm qds orally or pr)\n- STOP additional input drugs/ solutions containing K','','','','Severe   (> 6.5 mmol/l)','','- Calcium chloride 10% 10 ml i.v. over 10 min (stabilises the myocardium).\n- Sodium bicarbonate 50 mmol i.v. (alkalosis reduces K+ ions)(optional)\n- Glucose 50% 50mls i.v. + soluble insulin 10 units i.v.\n- Dialysis may be required to achieve actual potassium loss, if renal function is poor.','','','','','','','','','','Cardiac arrest','','Suspect hyperkalaemia as cause in patients with conditions such as:\n- Renal failure \n- Potassium sparing diuretics\n- Mineralcorticoid deficiency\n- Burns\n- Massive trauma \n- Rhabdomyolysis\n- Acidosis\n- Periodic paralysis\n- Hyperosmolarity.\n- Receiving excess i.v. K+\n- ECG changes preceding such as atrial asystole, broad QRS with peaked T Waves, \"Sine Wave\" pattern.\n\nUse\n- Calcium chloride 10% 10 ml i.v. over 10 min\n- Sodium bicarbonate 50 mmol i.v.','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (36,0,0,'N','Hypothermia','You are not dead until you are warm and dead. Use a low reading thermometer. ','ED','emerg-med','','','','Guideline','QCOL QMUL QFAL cold ','Definition : CORE temperature < 35 C','Background','Mild hypothermia 32-35 C\nModerate hypothermia 28-32 C\nSevere hypothermia <28 C\n\nStandard ear temperature is not accurate below 35 C','','','','','','','','','','Causes','History','1. Accidental\n - Immersion, environmental exposure, immobility (eg #NoF), poor living conditions\n2. Drug induced\n - Ethanol (vasodilation, disinhibition, exposure)\n - phenothiazines(reduced hypothalamic sensitivity to heat)\n - barbiturates/ antidepressants/ benzodiazepines/ anaesthesia (increased risk of exposure)\n3. Infections\n - Pneumonia, sepsis\n4. Nutrition\n - Protein-calorie deficiency/malnutrition\n5. Cardiovascular\n - CCF, AMI, PVD, PE\n6. CNS\n - CVA, Head injury, Cerebral neoplasm, Progressive mental deterioration\n7. Renal\n - Uraemia\n8. Endocrine\n - Hypopituitarism, Myxoedema, Hypoglycaemia, DKA, Hypoadrenalism','','','','','Examination','Diagnosis requires reliable temperature measurement (low reading thermometer or electronic rectal or oesophageal probe)\n\nRespiratory system\n- Initial reflex stimulation, then ventilation is progressively depressed\n- Impaired protective airway reflexes \n- Hb-O2 dissociation curve shifted to the left\n\n CVS\n- Mild hypothermia -> peripheral vasoconstriction, tachycardia, increased cardiac output\n- As hypothermia progresses -> fall in HR, cardiac output & BP\n- ECG changes include bradycardia, prolongation of all phases of the cardiac cycle, conduction abnormalities, T-wave inversion, \"J\" wave, AF common at < 30 C, VF at < 28 C (may occur earlier if diseased myocardium or stimulae such as ETT or CVC insertion)\n\nLook for other associated injuries e.g. neck injuries in immersion, back/ foot injuries in a fall.','','','','','','','','','','','','','CNS\n- Generalised cerebral depression\n- LOC & Mydriasis at 30 C\n- Shivering is gradually replaced by muscular rigidity at 33 C\n\nMetabolic System\n- Respiratory & Metabolic (lactate & other acid metabolites) acidosis\n- Hyperglycaemia initially, followed by hypoglycaemia\n\nRenal System\n- Decreased renal perfusion\n- Cold-induced diuresis\n- Hypokalaemia\n\nGIT\n- Ileus at < 34 C','','','','','','','','','','','Tests','- Glucose\n- ABG\'s \n- ECG \n- CXR \n- FBE\n- U&E\'s\n- Amylase\n- LFT\'s\n- TFT\'s\n- Blood & urine cultures','','','','','','','','','','General Measures','Treatment','1. Careful monitoring of temperature, vital signs & fluid balance\n2. Excessive handling may precipitate VF (antiarrhythmic drugs and defibrillation are ineffective at low temperatures)\n3. Adequate i.v. access & prewarm all i.v. fluids\n4. Patent airway & optimal oxygenation (ETT & Ventilation may be necessary)\n5. Correct hypoglycaemia\n6. Bradycardia may require atropine, or cardiac pacing\n7. Consider bicarbonate if profound acidosis (pH < 7.05) despite hyperventilation\n8. Correct electrolyte imbalances with care\n9. Antibiotics if infection likely','','','','','','','','','','>32 C - Passive rewarming','','- Warm room, warm blankets, \"Bear Hugger\" warming blanket, warm i.v. Fluids\n- Rewarming is gradual - aim for 0.5 C/hr','','','','<32 C - Active rewarming','','ADD\n- Inhalation of heated inspired gases\n- Peritoneal dialysis with warm fluids\n- Thoracic irrigation with warm fluids \n- Extracorporeal blood rewarming is the gold standard. If the patient has a cardiac output, then CAVH rewarming is feasible in a hospital without bypass facilities.','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (37,0,0,'N','Jellyfish','Victorian jellyfish stings rarely severe','ED','emerg-med','','','','Guideline','QBIT','','','','','','','Local species','Background','Jellyfish stings in Victoria are rarely severe. The predominant stinging species in Port Phillip Bay are bluish in colour and may be up to 10-13 cm in diameter with longer tentacles. However, a wide range of other species may occur, the most significant of which is Physalia physalis (\"Portuguese Man o\' War). The life threatening box jellyfish of tropical Australia (Chironex flexeri and Irukandji) have never been found south of Queensland. Most stinging jellyfish become prevalent after extended periods of hot weather in late summer. They will typically swarm in large groups in relatively calm ocean conditions, including near beaches.\n\nAll jellyfish are coelenterates and have in common millions of small stinging capsules or nematocysts which inject toxin through the victim\'s skin.','','','','','','','','','','','Examination','Jellyfish inflict stings which may vary from local irritation to severe localised burning pain with erythema and occasionally wheal formation. There may be associated mild systemic symptoms including headache, myalgias, abdominal pain, nausea and vomiting. The duration of symptoms in most Victorian jellyfish stings is self limiting (a few hours).','','','','','','','','','','','','Treatment','Treat each case on its merits. Flooding the skin with VINEGAR is a standard remedy for box jellyfish but its efficacy in Victorian jellyfish is unproven. It works by inactivating nematocysts which may be still adherent to the skin. COLD PACKS provide soothing relief. HOT PACKS may work by inactivating the toxin (beware the danger of burning the patient). An antipruritic or analgesic cream such as PAXYL or EURAX is often beneficial.  \n\nIntravenous analgesia is occasionally required. Antihistamines may be useful and their sedating and antiemetic effects are also of benefit in children. \n\nVictims of jellyfish stings can usually be discharged from the department after a period of observation which varies with the severity of the sting. Most should be observed in the Observation Ward after initial treatment in the Acute Care or General Care Area. It should be rarely necessary to admit to hospital.','','','','','','','','','','','','','','','','','','','','','','','','','','','','Portuguese Man o\' War (Physalia physalis)','Background','Characterised by a large bluish gas filled sac (pneumatophore) which acts as a sail and drive the animals towards shore when there is an onshore wind. Long tentacles up to 10 metres in length are responsible for stings.','','','','','Examination','Severe pain followed by a dull ache involving the joints. The sting site develops a red line with white punctate lesions which may resemble a ladder like pattern. Small wheals may develop and resemble a string of beads. A systemic syndrome lasts for up to 24 hours and comprises hypotension (sometimes shock), tachycardia, chills, muscle cramps, nausea and vomiting, irritability and confusion. Deaths have been reported from respiratory failure.','','','','','Treatment','Mainly supportive. Intravenous analgesia and antiemetics as required. ABC\'s and Advanced Cardiac Life Support measures if necessary. Local steroid creams (Betnovate, Diprosone) reduce inflammation. Admit either to Obs Ward, Inpatient Ward or ICU depending on severity of the systemic syndrome.','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (38,0,0,'N','Sudden visual loss','Do not discharge without senior review','ED','emerg-med','','','','Guideline','QEYE ','','','','','','','Causes','Background','Vascular: retinal artery occlusion, retinal vein thrombosis, vitreous haemorrhage.\nCNS: CVA/TIA, migraine\nToxic: methanol\nInflammation: optic neuritis, endophthalmitis, iritis\nStructural: glaucoma, retinal detachment\nTrauma: blunt, penetrating\nPsychiatric: hysteria','','','','','','','','','','Retinal Artery Occlusion','','- Sudden, painless loss of vision in one eye. \n- The eye is normal in appearance but is sightless. \n- The retina is very pale and the retinal arteries may not be visible. \n- Treatment must be instituted without delay & is aimed at mobilising atheromatous plaque or thrombus & promoting blood flow by reducing intraocular pressure.\nManagement\n1. Massage the globe of the eye and have patient rebreathe into a paper bag.\n2. Give Acetazolamide (Diamox) 500 mg IV. \n3. Obtain urgent ESR and if elevated (>50) give Hydrocortisone 250 mg stat. \n4. All cases should be discussed urgently with an ophthalmologist re possible AC paracentesis.','','','','Retinal Vein Thrombosis','','- Gradual, painless diminution of vision in one eye. \n- The retina is congested and blood streaked. \nManagement\n1. There is no effective acute treatment. \n2. Refer to ophthalmologist.','','','','','Methanol Ingestion','','(See separate protocol)\n- Admit for ethanol infusion.','','','','Optic Neuritis','','- Loss of central vision. \n- Optic disk is pale. \n- Associated with MS in 25% of cases. \nManagement\n1. All cases should be discussed urgently with an ophthalmologist re admission for ? retrobulbar steroid injection. ?i.v. Methylprednisolone','','','','Glaucoma','','- Acute angle closure glaucoma is due to blockage of drainage of aqueous humour through the Canal of Schlemm. \n- Patients susceptible have shallow anterior chambers \n- Glaucoma is often precipitated by dilation of the pupil (eg: going from bright sunlight into darkened room, use of mydriatic eye drops). \n- Clinical features include pain, hazy or lost vision, haloes around lights and nausea and vomiting. \n- The eye feels tense, the cornea is cloudy and the pupil is fixed and semi-dilated. \n- Treatment must be instituted immediately. \nManagement\n1. Administer PILOCARPINE 4% drops every 5 minutes for 1 hour (to both eyes). \n2. Give ACETAZOLAMIDE 500 mg IV. \n3. Give adequate analgesia and antiemetics. \n4. All cases should be discussed urgently with an ophthalmologist re admission for peripheral iridectomy.','','','','Retinal detachment','','- May be spontaneous or associated with trauma. \n- Myopic (short-sighted) are predisposed. \n- Patient may experience flashing lights and floaters followed some time later by the sensation of a curtain coming down across the visual field. \nManagement\n1. Nurse flat if the detachment is inferior (ie loss of superior visual field) or head up if the detachment is superior (ie loss of inferior visual field).\n2. Antiemetic IV\n3. All cases should be discussed urgently with an ophthalmologist re admission\n','','','','Hysteria','','- The patient is inappropriately calm about what should really be a catastrophic event. (NB a similar presentation can occur in Multiple sclerosis)\n- Eye examination is NAD including pupillary reflexes. \nManagement\n1. Refer for urgent psychiatric assessment.','','','','Iritis','','- Autoimmune inflammation. \n- Symptoms include blurred vision, photophobia and dull but severe ocular pain which may be referred to the temporal area. \n- The sclera is red and the pupil may be constricted and irregular. \n- Cells may be seen in the AC. \nManagement\n1. All cases should be discussed urgently with an ophthalmologist re treatment with mydriatic and steroid eye drops.','','','','','','','','','','','','','NEJM red eye review article','documents/redeye.pdf','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (39,0,0,'N','Malignant Hyperpyrexia','Involve a consultant anaesthetist at the first suspicion of MH. \nIf you wait for the pyrexia, it\'s probably too late. ','ED','emerg-med','','','','Guideline','QCOL heat hot ','','','','','','','','Background','Pharmacogenetic disorder characterised by acute hypercatabolic reactions in skeletal muscles, triggered by certain drugs and stresses.','','','','Triggering drugs','History','- Inhalational anaesthetic agents\n- Suxamethonium\n- Amide local anaesthetics\n- Caffeine\n- Halogenated X-ray contrast media\n- Strenuous exercise\n- Massive skeletal muscle injury','','','','Early signs','Examination','1. Rigidity of jaw muscles\n2. Tachycardia & cardiac arrhythmias\n3. Unstable BP (HT early, hypotension late)\n4. Marked  in CO2 production leading to tachypnoea\n5. Cyanotic colour of skin','','','','Late signs','','1. Pyrexia, rate of rise variable (1 C/hr to 1 C/5 minutes)\n2. Acute pulmonary oedema\n3. DIC\n4. Other complications:\n- Muscle swelling & pains\n- Severe neurological damage\n- Haemolysis\n- Myoglobinaemia\n- Myoglobinuria with acute tubular necrosis','','','','','','Tests','ABG\'s PaCO2 up, PaO2 down, mixed respiratory & metabolic acidosis\nU&E  K rise early on followed by a prolonged & marked fall\nGlucose \nCardiac enzymes Troponin, CK, AST, LDH\nMyoglobin in blood & urine\nHaemolysis in blood & urine\nCoagulation	DIC\nLactate','','','','','Treatment','1. Terminate stimulus (anaesthesia) as soon as possible.\n2. Hyperventilation with O2 through a vapour free circuit\n3. Dantrolene sodium 1 mg/kg/min given into a fast running IV in a large vein until reduction in HR, muscle tone, & temperature occur, or a total dose of 10 mg/kg has been given\n4. Malignant hyperthermia may recur- if so repeat dantrolene 1 mg/kg/min as above\n5. Repeat a prophylactic dose of dantrolene 2.4 mg/kg after 10-12 hours\n6. Consider sodium bicarbonate if pH < 7.10 despite hyperventilation & dantrolene\n7. Control hyperkalaemia with glucose & insulin, but beware that hypokalaemia may supervene\n8. Mannitol to help reduce cerebral & muscle oedema, and prevent acute renal failure (NB Frusemide will precipitate myoglobins into renal tubules)\n9. Control arrhythmias with Procainamide (maximum dose 7 mg/kg). Repeated doses of Propranolol 1 mg IV (0.015 mg/kg) may assist in lowering the HR (NB Verapamil should not be used simultaneously with Dantrolene because of a marked myocardial depressive interaction)\n10. Cooling with:\n - Ice packs\n- Cold i.vi solutions\n- Peritoneal lavage\n- Extracorporeal cooling\n11. Chlorpromazine increases heat loss by correcting peripheral vasoconstriction & inhibiting shivering\n12. Consider steroids (? benefit)\n13. Contraindicated drugs include:\n- Drug triggers\n- Cardiac glycosides (Digoxin)\n- CaCl2\n- Vasopressors\n- Belladonna alkaloids (Atropine)\n14. Minimise movement and handling of patient as may precipitate VF\n15. Monitor in ICU with supportive care','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','Neuroleptic malignant syndrome','#####42','','','','','Heat Stroke','#####34','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (40,0,0,'N','Migraine','Could this be sub-arachnoid haemorrhage/ a warning bleed? \nBeware drug seekers.','ED','emerg-med','','','','Guideline','QHED headache ','Types of migraine','Background','Migraine is CHRONIC and episodic. It is characterised by a variety of neurological phenomena believed to be due to cranial vasoconstriction, and headache which may be caused by vasodilation and sensitisation of pain pathways mediated by changes in levels of cerebral neurotransmitters and peptides.\nMigraine may be triggered by stress, emotion, exercise, hunger, sleep deprivation and red wine. Whether the vasodilation is the cause or the effect of the symptoms is not understood.','','','','','','\"Classic\" migraine is the exception rather than the rule. A prodromal neurological complex lasts for  to 1 hour and is followed by a pounding headache which is typically unilateral but may be global. The prodrome characteristically includes flashing lights and jagged lines across the visual fields (\"fortification spectra\") and transient scotomata. Other neurological symptoms and signs may be confused with TIA\'s or strokes and include aphasia, hemiplegia, confusion and altered conscious state. Nausea & vomiting are common, as are photophobia and drowsiness. \n\n\"Common\" migraine is the headache without neurological abnormities, (though photophobia and nausea etc are usually present) contrasting with \"Migraine equivalents\" in which the typical neurological and other prodromal symptoms are not followed by headache.','','','','','','','','','','','History','Exclude other causes of new acute headache - importantly meningitis and intracranial haemorrhage (spontaneous or post-traumatic) including subarachnoid haemorrhage. \n\nNEVER diagnose an acute headache as \"migraine\" without a supporting history.','','','','','','','','','','','','Treatment','Nurse the patient in a quiet darkened room. There is no specific treatment for the prodromal phase other than observation and antiemertics if required.\n\nAsk the patient what works - there are many therapeutic treatments for migraine headache and patients will often know what works best for them.\nNEVER GIVE PETHIDINE ','','','','','','Minor migraines may be given Panadeine Forte \n\nFor all others give 1 litre of N/Saline iv over 1 hour, together with 12.5 mg chlorpromazine, followed by a further 12.5 mg chlorpromazine half an hour later if still having symptoms.\n\nIf the above fails to relieve headache after 45-60 minutes, try one or more of the following:','','','','Dihydroergotamine','','(potent vasoconstrictor). \n- Dose = 10 micrograms / kg  IV to a maximum of 1000 mcg ( 1 mg) per dose. Dilute in 10 mL of Normal Saline and administer slowly over 5 minutes. May be repeated 8 hourly (to a maximum of 6 mg total). Maxalon or Stemetil should be given 10 - 20 minutes before DHE if chlorpromazine has not been used.\n- Contraindications: Ischaemic heart disease, uncontrolled hypertension and the recent or proposed use of SUMITRIPTAN. Being a vasoconstrictor it should be avoided if neurological abnormalities are present. \n- Adverse Effects: Nausea and vomiting Neurological effects (confusion, slurred speech, seizures and hallucinations), Hypotension.','','','','Sumatriptan','','(Serotonin analogue)\n- Consultant authority is required. As a general rule sumatriptan will only be authorised if the patient has previously responded to the drug and/or has failed to respond to other measures.\n- Dose: 6 mg subcutaneously \n- Contraindications: Ischaemic heart disease, uncontrolled hypertension and the recent or proposed use of DHE. It is a vasoconstrictor so should be avoided if neurological abnormalities are present. \n- Adverse Effects: Nausea and vomiting. Chest pain may be severe and may mimic angina.','','','','Ketorolac','','- Dose: 30 mg i.m. (i.v. is effective, and is used in other countries but is not licenced in Australia)\n- Relative contraindications: asthma, renal failure, active peptic ulcer disease, age > 65','','','','Lidocaine (lignocaine)','','- Dose: 1 mg/kg diluted in 10 mL N Saline over 2 minutes. If successful it may be followed by an infusion: 4 mg /minute for 1 hour, then 3 mg/minute for 1 hour and 2 mg /minute thereafter. Use only with consultant approval, and full ECG monitoring','','','','i.v. opiates','','- Not to be given routinely in migraine and only after discussion with a consultant.\nNever use pethidine','','','','','','','','','','','Disposition','Most migraine patients can be managed in the Emergency Department. Those not responding quickly to treatment may be admitted to the Observation Ward.\n\nSevere intractable cases may require admission, especially cases of status migrainus where the headache can last for several days. The diagnosis may need to be re-evaluated in some of these cases.','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (41,0,0,'N','Hypothyroidism','Treat sepsis, give steriods, beware myocardial ischaemia','ED','emerg-med','','','','Guideline','QCOL myxoedema ','','','','','','','Causes','Background','1. Primary - intrinsic thyroid disease\n2. Secondary - failure of TSH secretion\n3. Tertiary - hypothalamic dysfunction','','','','Precipitating Factors','History','- Hypothermia\n- CNS depressant drugs\n- Infections\n- Trauma\n- CCF\n- CVA\n- Drugs with antithyroid actions\n - Antithyroid drugs\n - Lithium\n - Iodine\n - Amiodarone','','','','','Examination','Triad of:\n1. Coma due to a combination of\n - hypothermia\n - hypercarbia & hypoxia\n - cerebral oedema\n - Hypoglycaemia\n - Hyponatraemia & low serum osmolality\n - Hypotension & bradycardia\n2. Hypothermia\n3. Clinical features of hypothyroidism\n - Cold intolerance, decreased energy, muscular weakness, bradykinesia, dementia, delayed tendon reflexes\n - Dry yellowish skin, hoarse voice, coarse facial features, lateral eyebrow thinning, periorbital oedema, brittle hair\n - Constipation (paralytic ileus), urinary retention, weight gain, pleural & pericardial effusions, IHD, anaemia','','','','','','','','','','','','Tests','- ECG\n- U&E/ LFTs\n- Glucose\n- Serum osmolality\n- FBC\n- TFT\'s\n- Plasma Cortisol','','','','','','','','','','','','','','','','','Treatment','Goals:\n1. Assessment & management of complications\n2. Assessment & management of precipitating factors\n3. Appropriate administration of thyroid hormone\n\nSupportive Measures\n- ETT & ventilation & provision of warm humidification\n- Treat shock with usual principles together with thyroid hormone & corticosteroids\n- Treat hyponatraemia with water restriction (hypertonic saline if Na+ < 110 mmol/l)\n- Treat hypoglycaemia with 50 mls 50% glucose i.v.\n- Treat hypothermia\n- Treat precipitating factors\n\nCorticosteroids\n- Hydrocortisone 100 mg i.v. 6 hourly\n\nThyroid hormones\n- Initial low doses with gradual escalation of hormone replacement\n- More rapid replacement is associated with sudden death due to arrhythmias or myocardial infarction\n- Dosage, route & preparation controversial - discuss with endocrinologist','','','','','Disposition','Admit to HDU/ ICU','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (42,0,0,'N','Neuroleptic Malignant Syndrome','Most common in first weeks after starting neuroleptic drugs (eg chlorpromazine, haloperidol) but may occur later.','ED','emerg-med','','','','Guideline','QCOL QUAD phenothiazine ','','','','','','','','Background','- Idiosyncratic response to neuroleptic drugs (eg Phenothiazines, butyrophenones, thioxanthines, & miscellaneous antipsychotic agents)\n- Probably due to impaired hypothalamic temperature regulation & sustained muscular contraction','','','','','','','','','','','History','The syndrome may occur at any time during treatment with neuroleptic medication, frequently within two weeks of institution of therapy or when the dosage is increased.\nSymptoms of NMS usually progress over 1-3 days:','','','','','','','','','','','','Examination','- Hyperthermia (around 40 C)\n- Autonomic dysfunction (tachycardia, labile BP, & sweating)\n- Muscle rigidity\n- Resting tremor\n- Confusion / Coma\n- Disorders of speech & swallowing','','','','Differentiation from malignant hyperthermia','','- Slow onset compared to MH\n- Moderate CK rise\n- Few associated metabolic changes\n- Lack of family history\n- Different triggering agents\n- Patient tolerance to anaesthetic agents','Malignant Hyperpyrexia','#####39','','','Complications','- Acute renal failure from dehydration and/or myoglobinuria\n- Pulmonary embolism with cardiac arrest\n- AMI with pulmonary oedema\n- Persisting neurological sequelae with parkinsonism, dyskinesia, dementia & ataxia','','','','','Tests','Renal function\nCK','','','','','','','','','','','Treatment','1. Immediate withdrawal of the offending agent\n2. Supportive therapy\n- Cooling procedures as in Malignant Hyperthermia (See separate protocol)\n- Treatment of cardiovascular stability\n- Mechanical ventilatory support if necessary\n- Treatment of dehydration with fluid therapy to maintain renal function\n3. Specific therapy\n- Bromocriptine & Dantrolene','','','','','','','','','','','Disposition','HDU/ ICU','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (43,0,0,'N','Fractured Neck of Femur','Do not discharge potential fractured NoF without senior review','ED','emerg-med','','','','Guideline','QLIM QCOL #nof ','','','','','','','','','','','','','','','','','','','Fracture classified by anatomy:','Tests','Intracapsular\n- Subcapital \n- Transcervical\n\nExtracapsular\n- Intertrochanteric (Basal)\n- Pertrochanteric (often comminuted)','','','','Fracture classified by Garden\'s classification system','','- Garden Type I  - Incomplete fracture, lower cortex intact.\n- Garden Type II  - Complete fracture, no angulation or displacement\n- Garden Type III - Complete fracture with rotation/ angulation.\n- Garden Type IV - Displaced fracture','','','','','','','','','','','','History','- Mechanism of injury\n- Mobility before this event\n- Other illnesses and medications\n- Did some other problem cause the fall in the first place?','','','','','Examination','- Lower limb on the injured side may be shortened and externally rotated - but these classical signs may not be present. \n- Hip is invariable locally tender to palpation and passive movement produces pain.\n- Look for other injuries.','','','','Analgesia','Treatment','Often surprisingly stoical. Administer intravenous morphine as required - doses need to be adjusted for the elderly and morphine is drug of choice - pethidine causes dysphoria and hypotension in the elderly.\nLow femoral fractures (e.g. Intratrochanteric fractures) may get analgesia from a femoral nerve block.','Femoral nerve block','#####166','','Fluid resuscitation','','- Although these patients are usually elderly and possibly prone to cardiac failure, they still have fluid deficits due to (1) bleeding in to the fracture site (2) prolonged time until found as well as (3) preoperative fasting. It is easy for patients with fractured NoF\'s to be under resuscitated to the point of oliguria by the time they get to theatre.\n- Although care should be taken to avoid precipitating pulmonary oedema in the susceptible, as a general rule, patients with fractured NoF\'s should receive:\n\n- 1 litre of normal saline over 1 hour in the ED\n- This should be followed by 8 hourly litres of N/saline.\n\n- This fluid regimen should be commenced as soon as the diagnosis of fractured NoF is made.','','','','','Tests','- U&E\n- FBE\n- Group and hold\n- ECG\n- Chest X-ray\n- X-ray should be reviewed by a registrar or consultant. ','','','','','','','','','','','Disposition','Definite #NoF\n- Admit orthopaedics and inform orthopaedic registrar. Write up for regular paracetamol\n\nNot definite #NoF\nLook for #pubic rami, #femur\nIf not able to weight bear, will need admission under medical unit for rehab/ ?MRI if fracture strongly suspected.','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (44,0,0,'N','Overdose','ABC, then reduce toxic load and general supportive measures','ED','emerg-med','','','','Guideline','QDSH QODP QUAD OD ','','Treatment','Intubate if:\n - GCS < 9\n - The patient cannot maintain his own airway (do not rely on the gag reflex)\n - Hypoventilation\n - Hypotension\n - Life threatening arrhythmias. \n - Treat hypotension (systolic BP < 90 mmHg) with intravenous fluids +/- vasopressors.\n - Treat arrhythmias, electrolyte disturbance, acid-base disorder etc as required\n - Monitor arterial oxygen saturation, end tidal CO2 and temperature. Constant ECG monitoring is required until the nature of the overdose is established and is continued if the patient has altered level of consciousness or if the overdose includes tricyclics, chloral hydrate, theophylline, anticonvulsants, amphetamines, cocaine or plants such as magic mushrooms, oleander etc. \n - If the patient is ventilated, consider gastric lavage.','Rapid Sequence Induction','#####134','','\"Have you taken an overdose?\" ','History','WHAT was ingested and how much? Ingestions of multiple substances common and alcohol may modify the clinical picture. Obtain containers if possible. Consult poisons centre.\nWHEN was the ingestion? Single or multiple ingestions?\nWHY? - may give a clue to suicidal intent or \"cry for help\". Especially in children and the elderly the ingestion may have been accidental.\nWHERE? - at home with doors locked? In a car in a remote area? Enclosed areas exacerbate effects of inhaled toxins. ','Poisons Unit','#####86','','','Examination','- Especially cardiovascular and neurological systems. \n- Identify toxic syndromes (\"toxidromes\"). Needle tracks?\n- Assess the mental state (see notes on SUICIDE).','Suicide risk assessment','#####114','','','Tests','- serum paracetamol (at 4 hours post ingestion) in all patients. \n- Monitor specific drug overdoses with base line and progressive drug plasma levels (eg: theophylline, anticonvulsants, iron, paracetamol, salicylates).\n- Other tests may be ordered as appropriate - in particular U&E\'s, liver function, serum osmolality and ABG\'s (acid base disturbance).\n- Routine drug screens of serum and urine are of little value and are NOT be ordered by junior doctors.\n- Chest X-ray (aspiration pneumonitis, ingested foreign bodies, iron ingestion) or abdominal X-ray (iron ingestion, foreign bodies including \"body packing\").','','','','','','','','','','','Reduction in toxic load/ decontamination','Treatment','- Clinical outcome studies demonstrate NO reduction in morbidity or mortality when gastric decontamination procedures are employed.\n- These procedures have significant complications and the risk:benefit ratio is often unacceptable. \n- Gastrointestinal decontamination may be performed only in specific situations (see below). \n\nGastric Lavage \n\n- Gastric lavage is not to be used for overdoses which are unlikely to cause serious long-term sequelae (eg: benzodiazepines) or for which specific antidotes are available (eg: paracetamol). \n- It is to be limited to the following scenarios:\n\n1. Substance is significantly toxic AND Ingestion < 2 hours AND there is no specific antidote OR\n2. Substance is significantly toxic AND is likely to be retained in the stomach (eg: Fe tablets) OR\n3. Substance is extremely toxic (+/- lethal) AND there is no specific antidote (eg: paraquat). \n - This is the only circumstance where lavage may be tried several hours post ingestion but is probably useless. \n\nIf the patient is already intubated and ventilated, have a lower threshold for performing gastric lavage.\n \nDuring lavage the airway must be protected and this means rapid sequence induction if the patient is uncooperative or has a depressed level of consciousness.\n \nSyrup of Ipecac \n \n- Causes vomiting after about 30 minutes and prolonged nausea. \n- As a rule, no adult (ie: person > 12 years) should be given Ipecac.\n\nMay be used in children (1 mL per kg in orange juice) ONLY if:\n1. The ingestion occurred < 1 hour previously\n2. The ingested substance is not caustic or corrosive\n3. There is absolutely NO chance of sedation or fitting\n\nIt follows that Ipecac is contraindicated in all ingestions of sedatives (including benzodiazepines, antihistamines, tricyclics and alcohol). A child who appears OK initially may become drowsy or start to convulse just as he starts vomiting - a potentially lethal situation.\n\nActivated Charcoal \n\nThe treatment of choice, especially in overdoses of tricyclics, salicylate and theophylline. \nCharcoal adsorbs free toxin in the stomach and \"gastrointestinal dialysis\" may remove toxin from the blood back into the bowel. \nCharcoal will not adsorb alcohols, aldehydes and metals (including lithium)\n - 1 grams per kg \n - Repeat 0.5 gram per kg 2 hourly until charcoal stools are produced.\n - A cathartic (sorbitol) is given with the first dose only.\nCharcoal is contraindicated if:\n- the patient is actively vomiting\n- consciousness is depressed to the extent that regurgitation and aspiration are a risk.\nCharcoal may be swallowed or administered down a nasogastric tube.  Most patients, including children, will drink charcoal with a bit of persuasion. Mixing charcoal with ice-cream is often successful. Artificial flavours are adsorbed by the charcoal and don\'t improve the taste very much. Whichever method is chosen, it is advisable for staff to wear plastic aprons as the mess can be considerable.\n \nOther Means of Decontaminating the G. I. T:\n\nWhole bowel irrigation with polyethylene solutions (GoLytely etc.) is good for significant poisoning e.g. Fe in children. It may be given by nasogastric tube if unco-operative (Adult dose 250 mL every 15 minutes). Give until clear fluid comes out the other end. This is a messy and time consuming procedure, and may be best carried out in ICU, if recommended by the Poisons Centre.','','','','\"Doing nothing\"','','This does not mean doing nothing, but it is often appropriate to make no attempt at G.I.T. decontamination.\nMost ingestions are best managed conservatively, while making sure full supportive care i.e. airway management etc and the use of specific antidotes where indicated. Most drugs taken in overdose do not result in death or significant long term morbidity. Even when dangerous drugs have been taken, there has usually already been significant systemic absorption by the time the patient gets to hospital and it is too late to successfully remove the drug.','','','','Elimination of absorbed toxin from the body','','Drug clearance can be accelerated. Forced diuresis (with i.v.fluids and the careful use of frusemide) and alkalisation (using bicarbonate infusions) is occasionally used in Intensive Care to promote the clearance of acids such as barbiturates and salicylates (See link below). There is a potential danger of inducing cerebral oedema and hypokalaemia and this treatment must be reserved for the critically ill. \n \nSimilarly the administration of ammonium chloride produces an acidic urine in which bases such as amphetamines and phencyclidine are ionised and \"trapped\". \n \nPeritoneal or haemodialysis accelerates the clearance of lithium, salicylates, methanol and ethylene glycol, whilst charcoal haemoperfusion is useful in theophylline overdose and is tried in paraquat toxicity.','Forced diuresis','#####118','','Supportive care','','- Constant ECG monitoring is required until the nature of the overdose is established. \n- Monitoring must be continued if the patient is unconscious or if the overdose includes arrhythmogenic drugs such as tricyclics, chloral hydrate, theophylline, anticonvulsants, recreational drugs including amphetamines & cocaine.','','','','Pharmacological treatment of specific drug effects','Cautions','\"First do no harm\" \n- Specific pharmacological treatment of toxic effects may be tried but is potentially hazardous.\n- Consideration must be given to the risk of drug interactions and the patient\'s medical history.\n- For example, if beta blockers are used to treat the tachycardia of theophylline overdose, extreme caution must be exercised; if the patient is asthmatic (he may have overdosed on his own medication) beta blockers are contraindicated.\n- Other examples of where pharmacological treatments may be useful include:\n- ATROPINE (in large doses) in the cholinergic syndrome (organophosphate insecticides toxicity) or \n- HALOPERIDOL or DIAZEPAM to treat acute psychosis induced by certain street drugs and poisonous plants.\n \nCocaine overdose\nDo NOT treat the tachycardia pharmacologically with beta blockers alone. In cocaine toxicity there is reduced reabsorption of endogenous catecholamines and unopposed adrenergic alpha effects are unmasked by beta blockade leading to uncontrolled hypertension and myocardial ischaemia. Alpha blockers (eg: phentolamine 0.5mg repeated 5 minutely) or GTN or Nitroprusside infusions may be required. Haloperidol is also contraindicated in cocaine toxicity (use DIAZEPAM if the victim is agitated).\n \nSpecific antidotes \n \n These are available for a number of toxic substances.','','','','Flumazenil - why don\'t we use it?','','While flumazenil is effective for benzodiazepine overdose, it is not used as:\n(i) the benzodiazepines may be masking the undesirable effects of a tricyclic overdose. \n(ii) the half life of flumazenil is shorter than that of the benzodiazepines, leading to potentially dangerous rebound\n(iii) benzodiazepine overdose (on its own) is rarely fatal.\n(iv) it is expensive.','','','','','','','Deliberate self harm','#####59','','','Disposition','All patients with significant toxic ingestions must be observed for at least 6 hours. \n- Patients with significant or potential clinical disturbance should be admitted directly to a medical ward or ICU (or occasionally CCU for monitoring).\n- A patient may be admitted directly to the Psychiatry if there is no risk of late adverse sequelae. \n- If there is any suggestion of genuine suicidal intent, the patient must be admitted to hospital. If the patient refuses admission and there is a genuine risk of repeated self destructive behaviour, he/she should be recommended under the mental health act.\n \nPatients allowed home\n \n- Certain patients may be allowed to go home from the ED \n- If the overdoes was deliberate, the patient must first, if possible, be interviewed by a social worker and/or Psychiatric Community Assessment Team (CAT) or psychiatric registrar. \n- NO PATIENT IS TO BE DISCHARGED WITHOUT SUCH ARRANGEMENTS BEING MADE AND DOCUMENTED IN THE MEDICAL RECORD.\n- Any patient allowed home must be accompanied by a responsible adult who will be staying with the patient.','Psychiatric Assessment','#####158','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (45,0,0,'N','Thromboembolism: pulmonary embolus and deep venous thrombosis','Difficult to diagnose: have a high index of suspicion. ','ED','emerg-med','','','','Guideline','QSOB QLIM QCHP PE DVT ','','','','','','','','Background','90% of all pulmonary emboli result from frequently asymptomatic thromboses from deep veins of the lower limbs, pelvis and inferior vena cava (proximal DVT), and rarely (10%) from thromboses in the upper limbs, right atrium or ventricle.\n\nThromboses limited to calf veins (distal DVT) will not give a significant PE, but progession to a proximal thrombus & direct embolisation from a distal DVT is possible.\n\nPredisposing factors = Virchow\'s triad:\n1. Stasis of blood flow\n2. Damage to vessels\n3. Alterations in coagulation mechanism','','','','Symptoms of  PE','History','- Dyspnoea of sudden onset (85%)\n- Substernal or pleuritic chest pain (70%)\n- Apprehension (60%)\n- Non-productive cough (60%)\n- Syncope (14%, if massive PE)\n- Haemoptosis and pleuritic pain(10%, late & only if infarction)\n\nRisk factors:\n1. Heart failure\n2. Cancer (often an early indicator)\n3. Immobilisation\n4. Obesity \n5. Pregnancy, oestrogenic drugs\n6. Hip fracture\n7. Age > 65 years\n8. Previous history of DVT or PE\n9. Inherited coagulation deficiencies or abnormalities','','','','','','','','','','','Examination','There may be no helpful clinical signs \nand many of the signs may be transient\n Those present are usually non-specific and include:\n\n1. Respiratory\n- Tachypnoea (80%)\n- Cyanosis (massive PE)\n- Pleural effusion & rub (if infarction)\n\n2. Lower limbs\n- Clinically DVT (only 30%)\n\n3. Other\n- Mild fever 38 C (45%)\n- Sweating (30%)\n\n4. CVS\n- Tachycardia (bradycardia ominous ?poor LA filling)\n- Loud P2\n- Widened splitting H2\n- Systemic hypotension & shock (massive embolism)\n \nDifferential diagnoses\n\n1. Myocardial infarction\n2. Acute LVF\n3. Aspiration pneumonitis\n4. Acute pneumonia\n5. Fat embolism\n6. Pneumothorax\n7. Dissecting aortic aneurysm','','','','','Diagnosing DVT','Tests','If highly suspicious of DVT, heparinise prior to doppler U/S \n\nDoppler ultrasonography\n - investigation of choice for DVT\n- detects flow changes in veins\n- sensitive for obstruction of popliteal & more proximal veins\n- interpretation subjective\n\nContrast venography\n- most accurate diagnostic technique but invasive, painful, expensive and actually causes a low incidence of DVT in itself, but still the \'gold standard\'\n- visualisation of external & common iliac veins may be inadequate in some patients\n- indicated if doppler ultrasound indeterminant','','','','Diagnosing PE','','Blood\n- WCC may be elevated (> 15,000 x 106 cells/L)\n- Fibrinogen degredation products may be elevated\nNegative d-dimers (ELISA, not latex test) can be used to exclude thromboembolism, but only in patients with a low risk of thromboembolism (low pre-test probability).\n\nCXR\n- most patients with PE have some CXR abnormality (though not specific nor diagnostic)\n \nECG\n- Most commonly sinus tachycardia\n- Deep S-wave in lead I, Q-wave in lead III, and inverted T-wave in lead III (S1Q3T3)\n- Inverted T waves V1, V2\n- More commonly right ventricular strain pattern (non-specific ST depression & T-wave inversion in the anterior leads)\n- Occasionally persistent P pulmonale, RBBB, and atrial arrhythmias (if PE massive)\n- Helps to exclude myocardial infarction','','','','','',' ABG\'s\n- 20% patients with PE have a normal PaO2 on room air\n- normal alveolar-arterial oxygen gradient adjusted for age & normal PaCO2 is unusual in PE\n \n CT Angiography (CTA)\n If highly suspicious of PE, heparinise prior to CTA \n- CTA is a specific (a positive result rules in a PE) non-invasive test which should be performed whenever a PE is suspected\n- Usually clot can be detected down to 3rd order pulmonary vessels (3 mm diameter). \nIf a patient with a very good history for a PE has a negative CTA, consider a V/Q scan.','','','','Other tests for PE','',' Ventilation / perfusion lung scans\n- V/Q lung scan is a sensitive (a negative result rules out a PE) non-invasive test but has poor specificity compared to CT angiography\n- Should be reserved for patients allergic to IV contrast or with an equivical CTA but a strong clinical suspicion for PE.\n- propability of PE may be deduced from V/Q lung scans as being high, intermediate, or low from which general management guidelines can be based\n\nHigh probaility\n- with significant risk factors reliably establishes the diagnosis of PE\n- with low risk factors and normal invasive tests for DVT needs a pulmonary angiogram for confirmation\nIntermediate probability\n- discuss with ED Consultant\nLow probability\n- with a high clinical index of suspicion warrents pulmonary angiography\nVery low probability\n- discuss with ED Consultant\nNormal\n- Virtually rules out significant PE\n\nPulmonary angiography\n \n- The pulmonary angiogram catheter may be left in situ for measurements of pulmonary arterial pressures, direct infusion of thrombolytic drugs and repeat angiography\n\n- Indications:\n1. High probability V/Q scan with low risk factors and normal invasive tests for DVT\n2. Low probability V/Q scan with a high clinical index of suspicion\n3. In some cases of intermediate and low probability V/Q scans after discussion with ED Consultant\n4. Confirmation of PE in a patient at increased risk fo bleeding from anticoagulants\n5. Massive PE to decide choice of thrombolytic, embolectomy, or IVC interuption therapy','Chest Pain','#####26','','','','','Chest Pain review article (NEJM)','documents/chestpain.pdf','','','','','Pneumothorax','#####46','','','','','','','','Treatment of DVT','Treatment','1. High flow oxygen\n2. Maintain right heart filling pressures with IV fluids\n3. Consider isoprenaline infusion as an inotrope and pulmonary vasodilator when massive PE\n4. Heparin therapy (if highly suspicious  heparinise prior to V/Q scan)\n5. Thrombolytic therapy - only by Consultant\n\n- Indications:\nExtensive proximal DVT\nPE with haemodynamic instability\n> 1 lobe proximal perfusion defect\nPE with RV strain on Echocardiogram\n\n- IV Regimen for Streptokinase:\nCease heparin\nCommence SK when APTT < 2 times normal\n250,000 units over 30 minutes followed by 100,000 units/hr for 24 to 120 hours\nMonitor APTT 4 hourly (between 2-4 times normal desired)\nIf APTT < 2 times normal recommence Heparin infusion\nIf APTT > 4 times normal then halve SK infusion for several hours\n\n- Pulmonary arterial catheter Regimen for Streptokinase:\nInfuse SK at 30,000 units/hr for 3 hours\n\n- IV regimen for Alteplase\nCease heparin\nTotal dose should not exceed 1.5 mg.kg in patients with a body weight < 65 kg\n10 mg bolus\n90 mg infused over 2 hours\nRecommence Heparin infusion when APTT < 2 times normal\n\n6.	Inferior Vena Cava Filter\n- Indications:\nRecurent PE despite adequate anticoagulation\nInability to tolerate anticoagulation\nLarge free-floating thrombus in the ileo-femoral veins\nFollowing pulmonary embolectomy\n\n7.	Surgical Embolectomy\n- Indicated if SK therapy contraindicated or unsuccessful, and there is persistent hypotension, oliguria, hypoxia, & metabolic acidosis, with radiological confirmation of > 50% occlusion of the pulmonary arterial tree','','','','Treatment of PE','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (46,0,0,'N','Pneumothorax','','ED','emerg-med','','','','Guideline','QSOB QAST QMUL QTRU ptx tension ','','Background','TYPES OF PNEUMOTHORACES\n1. Spontaneous\n2. Iatrogenic\n3. Traumatic (see separate protocol)\n \nCAUSES OF SPONTANEOUS PNEUMOTHORAX\n1. Rupture of a subpleural bleb (commonly male, <40 yo, tall)\n2. Asthma or COPD\n3. Pulmonary infection (Staphylococcal pneumonia, Klebsiella pneumonia, Tuberculosis, Pneumocystis carnii pneumonia)\n4. Pulmonary carcinoma\n5. \"Honeycomb\" lung disorders (tuberous sclerosis, Histocytosis X)\n6. Pulmonary fibrosis\n7. Marfan\'s & Ehler\'s-Danlos syndromes\n8. Idiopathic (40%)\n\nCAUSES OF IATROGENIC PNEUMOTHORAX \n1. CVC insertion\n2. Mechanical ventilation\n3. Intercostal or supraclavicular nerve blocks\n4. Thoracocentesis\n5. Percutaneous lung biopsy\n6. Bronchoscopy','','','','','','','','','','','History','Chest pain: sudden, sharp, pleuritic, anterior but may radiate to the neck or back\nDyspnoea, tachycardia, & tachypnoea if pulmonary function compromised\nMay be a cough, occasionally productive of blood-streaked sputum\nPast history: Smoker, asthma, COAD, pneumothorax\nPneumothorax should always be suspected when there is \nclinical deterioration in a COAD patient','','','','','','','','','','Simple pneumothorax','Examination','Clinical findings may be subtle\n- Subcutaneous emphysema\n- Dyspnoea, tachycardia, & tachypnoea\n- Ipsilateral decreased breath sounds\n- Ipsilateral hyper-resonance to percussion\n- Ipsilateral decreased tactile fremitus & audible resonance','','','','','Tension pneumothorax','','- hypotension, cyanosis, marked respiratory distress, contralateral tracheal & mediastinal deviation\n\nTension pneumothorax is a clinical diagnosis, not radiological, \n& requires urgent decompression with 14G needle thoracostomy','Needle thoracostomy','#####130','','','Tests','CXR inspiratory & expiratory films\n(NB Bullae & cysts have concave inner margins & rounded edges)','NEJM review article','documents/pneumothorax.pdf','','','','','','','','Pleural aspiration','','Pneumothorax involving < 30% of the hemithorax needs drainage by using pleural aspiration, and then serial CXR\'s\n6 hours after first CXR in ED, then 24 to 48 hourly as an outpatient.','Pleural aspiration','#####131','','Intercostal catheter (chest drain)','','Pneumothorax involving > 35% of the hemithorax needs an intercostal catheter.\nIntercostal catheter if:\n- Pneumothorax is increasing\n- Mechanical ventilation\n- General anaesthesia contemplated','Intercostal catheter (chest drain)','#####129','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (47,0,0,'N','Psychiatric problems','You have a duty of care to the patient, and to the community','ED','emerg-med','','','','Guideline','QBEH QDSH QMEN QODP commit certify recommend','','','','','','','','Background','Acute psychiatric emergencies are common in the Emergency Department. Many patients are difficult to assess unless one knows their background.\n\nIt is important for the ED to have a good relationsip with the psychiatry department, Requests for a consultation go through the psyciatry triage nurse. \n\nThe psychiatry triage nurse usually arranges a review of patients by the Multi-disciplinary Psychiatric Assessment Team comprising 1 doctor, 1 psychiatric nurse and 1 social worker. These teams are often familiar with patients attending the ED and are able to give advice as to the most appropriate way of dealing with them and/or arrange follow up.','Multi-disciplinary Psyciatry Assessment Team','#####158','','','','','','','','Mental State','Examination','Only an abbreviated mental state examination is required in the ED setting and comprises an assessment of \n1. Thought content\n2. Intellectual or cognitive processes \n3. Mood or affect.\n\nThought disorder is characteristic of schizophreniform illnesses and may be manifest by feelings of thought insertion and control, ideas of reference, passivity feelings, paranoia, delusions and hallucinations (usually auditory, third person) which are usually freely admitted and may be frightening.\nLong term chronic or severely disturbed individuals apart, schizophrenic patients maintain normal cognitive processes, ie: preservation of literacy, numeracy and memory. \n\nWhen a patient does show evidence of intellectual dysfunction and in particular memory deficit, an underlying organic cause should be suspected and a reversible medical condition should be sought.','','','','Overdoses','','Patients who have taken an overdose, but who do not need admission may be reviewed by the Psychiatric Assessment Team, and discharged, with appropriate follow-up.','','','','','Personality disorders','Comments','This group of patients is the difficult to deal with, as they can masquerade as other sorts of psychiatric illness e.g. depression, anxiety, schizophrenia.\n\nA number of labels are applied to these people and are really just descriptive of maladaptive behaviour. Thus a patient may be described as having a paranoid, cyclothymic, schizoid, passive-aggressive, explosive, sociopathic, obsessive -compulsive, asthenic, narcissitic, antisocial, borderline, inadequate or histrionic personality disorder.\nThese labels do not imply psychotic illness, even though some of the terminology is similar.\nNo consistent treatment strategy has proved effective for personality disorders, which is one of the reasons why psychiatrists try hard to avoid admitting them, as they are often extremely disruptive. \n\nPeople with PD\'s can be extremely demanding and are usually manipulative. Drug seeking behaviour is common.\nExperienced staff in ED\'s know the local individuals with personality disorders and do not let themselves be manipulated. ','','','','','','','','','','','','','','','','','','','','','','Acute psychosis','','If acute intervention is required in the ED, the drug of choice is \nhaloperidol, usefully administered together with diazepam on a 1:1 basis to achieve rapid sedation. The dose is anywhere between 2 and 20 mg i.v.\n\nNB: There is enormous variation in patients\' responses to haloperidol. Give doses in increments and wait to ascertain the effects of each increment. Too large a dose leaves the patient obtunded for several hours and makes subsequent psychiatric assessment difficult.','','','','The violent patient','','Occasionally patients are violent and uncontrollable. These patients are not necessarily psychotic but more commonly have sociopathic personality disorders. Several strong people may be required to restrain such people and often pharmacological restraint with i.m. neuroleptics and/or benzodiazepines are indicated. \n\nRecommended i.m. doses: \nhaloperidol 10mg\ndroperidol 10mg\nmidazolam 5mg\n\nThe use of limb restraints is to be employed only as a last resort and the need for same clearly documented in the notes and signed by the doctor.','','','','','','','','','','Admission to the psychiatric ward','Treatment','Voluntary admission usually require the authorisation of the consultant psychiatrist or registrar on call. ED medical staff should liaise with the psychiatry registrar or the multii-disciplinary psyciatric assessment team. It may be necessary to communicate directly with the consultant. A medical examination is mandatory prior to patients going to the psychiatry ward. In the ED it is only necessary to screen out any significant medical illness which is either coexistent with or contributory to the psychiatric condition. Occasionally it is not possible to medically examine the patient. The reasons for this must be recorded in the notes. ','','','','Dealing with the unco-operative patient','','Sometimes a patient refuses treatment which is deemed necessary on medical grounds. This may include the management of drug overdoses or the administration of medications. The law is unclear on the issues involved for medical staff. \nA doctor performing an invasive or restraining procedure against a patient\'s expressed wishes may be liable to charges including assault and battery or trespass against the person. The question is whether the patient is mentally competent to rationally give or withhold consent. It is likely (but not certain) that a doctor will be protected in law if a procedure is performed in good faith in order to prevent likely significant morbidity, injury or death. \n\nThe converse may also arise - a doctor may be liable if he fails to administer necessary life saving medical treatment if the patient was not mentally competent to give or withhold consent. A prudent course of action, therefore, is to proceed with treatment if it is absolutely necessary to prevent death or significant morbidity. This last statement does not apply to blood transfusions in adult Jehovah\'s Witnesses.\n\nIt is essential to have very good documentation in these circumstances and if at all possible, a second medical opinion must be obtained and also written into the notes. If the patient is uncooperative due to a drug induced delirious state, the fact that the patient is not lucid and therefore not in a condition where he/she is mentally capable of giving or refusing informed consent should be clearly indicated in the notes. This should also be corroborated by another doctor if possible.\n\nA significantly suicidal or acutely psychotic patient must be regulated under the Mental Health laws. Again, a decision whether to proceed with medical treatment against a regulated patient\'s wishes is unclear in law. If the patient\'s psychotic state is such that he/she cannot give or withhold informed consent, document the fact in the notes and have another doctor corroborate it if possible. Then use all reasonable means to proceed with necessary treatment. If, however, he is otherwise lucid and refuses treatment, it is advisable to seek the advice of the consultant psychiatrist on call before proceeding with invasive or restraining procedures and to notify the medical administrator on call.','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (48,0,0,'N','Psychiatric vs organic Illness','','ED','emerg-med','','','','Guideline','QBEH QDSH QMEN QODP QUAD','','Background','It can sometimes be difficult to distinguish between psychiatric and organic causes of abnormal behaviour \n- Organic causes are excluded by a process of elimination which requires a comprehensive history and examination.\n- Doctors working in psychiatry may refer patients for a medical review to exclude an organic cause for their symptoms, particularly new patients, or sudden changes in old patients.\n- Keep an open mind even if many factors suggest a psychiatric cause. Patients with schizophrenia also take overdoses, develop meningitis, and sustain head injuries.','','','','','','','','','','','','','','','','','','','','','','','Tests','Be guided by your clinical suspicions but usually involves:\n- FBE, U&E, Glucose, Calcium\n- ECG (patient over 40)\n- CXR (patient over 40)\nOther tests that may be appropriate include:\n- Urine dipstick \n- Septic screen - urine / blood / CSF\n- VDRL\n- Vitamin B12\n- Thyroid function tests \n- CT scan','','','','','','','','','','','','Disposition','Try to arrange the tests quickly and thoroughly. \nIf the patient seems well, it is usually appropriate for the patient to be admitted to the psychiatric unit, and for them to follow up the blood results.','Multi-disciplinary psychiatry team','#####158','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (49,0,0,'N','Patients with anorexia','Involve the most senior doctor after you have assessed the patient.','ED','emerg-med','','','','Guideline','QDSH QMEN QODP QUAD','','','','','','','','','These patients are often very difficult to manage, because by the time they reach the emergency department, they often have an agenda which involves admission to the [medical] hospital.\nThis is rarely appropriate.\nThese patients may be manipulative, and may have aggressive/ concerned carers, who feel that medical admission will solve the problem. \nUnnecessary medical care tends to re-inforce the belief that there is a medical problem, rather than a psychiatric one.','','','','','','','','','','','','Contact the psychiatry department to see if the patient attends an eating disorders clinic or has any other psychiatric diagnoses.\nIf there is a care plan for acute attendances, use it.','','','','','','','','','','','','','These patients may have a low potassium due to purgative/ diuretic abuse. This rarely needs treatment. If you are concerned about this, then an ECG may be performed looking for U waves.','','','','','','','','','','','','When you are satisfied that there is no immediate danger to the patient\'s health, contact the psychiatry department multi-disciplinary assessment team to come and review the patient. They will also be able to arrange follow-up.','Psychiatry multi-disciplinary assessment team','#####158','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (50,0,0,'N','Chronic back pain','NEVER give pethidine to a patient with chronic back pain. \nNSAIDs, paracetamol/ codeine combination analgesics may be prescribed. Be sympathetic but firm. Refer them to see their GP.','ED','emerg-med','','','','Guideline','QBAK sciatica ','','','','','','','','','','','','','','Background','Patients with exacerbations of chronic back pain are common in the ED. They do have pain, and this must be acknowledged, however, the ED is rarely the appropriate place for their treatment.','','','','','','','','','','Is the leg pain or the back pain predominant?','History','The important point are:\n- is there leg pain?\n- is there back pain?\n- which is worst?\n\nThe significance of the leg pain which is the main problem, is that this points to significant neural pressure, presumably from a herniated intervertebral disc.','','','','','','','','','','','','Examination','Do a full neurological examination of the legs, but particularly\n- power of all muscle groups\n- sensation\n- reflexes\nCompare both sides, and record your findings carefully. Any abnormal findings should be discussed with a senior doctor, or the orthopaedic registrar','','','','','Tests','Plain XR of the lumbar spine rarely gives any useful information, and is the equivalent of nearly 100 chest XRs.','','','','','','','','','','','','','','','','','','','','','','','Disposition','If the patient is to be discharged, then a clear plan of who if following up, and when is important.\nA letter/ fax/ telephone call to the GP is a important, as it lets them know that the patient has been seeking help elsewhere. The GP should be the person who co-ordinates any further investigation or treatment of chronic conditions,','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (51,0,0,'N','Renal colic','Beware \'renal colic\' in patients over 50 - is it AAA?','ED','emerg-med','','','','Guideline','QABD QURO UTES UABC kidney','','Background','Renal tract calculi (85% radiopaque) are common and are usually associated with typical pain which is often self limiting. May, however, be complicated by haemorrhage, obstruction (acute renal failure, hydronephrosis) and infection (pyelonephritis)','','','','','History','- Severe \"loin to groin\" pain - may radiate from loin to scrotum/labia or inner thigh\n- Pain is colicky - patient is unable to obtain a comfortable position\n- Associated nausea & vomiting\n- May be dysuria, frequency, haematuria\n- Fever, sweats, rigors are suggestive of pyelonephritis\n \n REMEMBER: \"Renal colic\" is a great mimicker of AAA','','','','','','','','','','','Examination','- Temperature and vital signs\n- Palpate abdomen for tenderness in the loin and anterior abdomen (no rebound or rigidity).\n- Examine specifically for AAA in patients > 50 years old.\n- Check urine for blood or signs of infection.','','','','','','','','','','','','Tests','- Urgent Abdominal Ultrasound/ CT if any possibility of AAA. [Inform surgical registrar if you think AAA likely, and see AAA guidelines]\n- Ward test urine (RBC\'s in 95%). MSU if evidence of infection (protein, WBC\'s, nitrites)\n- FBE & Blood cultures if likelihood of pyelonephritis\n- U&E\'s and creatinine\n- CT scan or IVP are the imaging options. They both involve a significant amount of radiation and/or exposure to i.v. contrast. \n- Stand alone \"KUB\" X-rays are a waste of time in the diagnosis of renal calculi - do not do them.','AAA','#####15','','','','','','','','','Treatment','1. i.v. access & fluids for dehydration\n2. Analgesia\n - p.r. indomethacin 100mg for all patients (rapid onset, long acting, as effective as opiate analgesics, and reduces recurrence of colic) OR \n - i.v. or i.m. ketorolac 30mg (does not last as long)\nPLUS i.v. morphine titrated to pain if necessary.\n3. Antibiotics if evidence of infection.','Analgesia in renal colic: pethidine vs NSAID','http://www.ncbi.nlm.nih.gov:80/entrez/query.fcgi?cmd=Retrieve&db=PubMed&list_uids=9928687&dopt=Abstract','','','','','Analgesia in renal colic: pethidine vs NSAID','http://www.ncbi.nlm.nih.gov:80/entrez/query.fcgi?cmd=Retrieve&db=PubMed&list_uids=7827834&dopt=Abstract','','','Disposition','Admit if pain is recurrent, there is super-added infection, signs of obstruction on IVP/ CT, or stone in a patient with a solitary kidney.\n- Otherwise discharge home if pain-free 4 hours after last i.v. analgesia with instructions to return of pain recurs and is unrelieved by oral agents (ibuprofen 400mg p.o. for 5 days has been shown to reduce the recurrence of symptoms).\n- Organise a CT scan or an IVP for the next in hours radiology session and review results in the ED.\n- The urology unit are happy to be consulted if there are any doubts about management.','Recurrence of renal colic - 5 days of NSAID','http://www.ncbi.nlm.nih.gov:80/entrez/query.fcgi?cmd=Retrieve&db=PubMed&list_uids=8529732&dopt=Abstract','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','\n','');
INSERT INTO `MedHelp` VALUES (52,0,0,'N','Septic shock','Usually gram negative organisms- consider in elderly patients who look more unwell than you expect - eg from UTI.  ','ED','emerg-med','','','','Guideline','QUAD QUCH QURO QCOL UTI','','','','','','','','Background','CLINICAL PRESENTATION\nWide spectrum\n \n\"Warm shock\" (Classic presentation):\n- Fever\n- Vasodilation\n- Tachypnoea\n- Hyperdynamic circulation despite a lowered BP\n- Urine output low, normal, or high\n\n\"Cold shock\" (Late presentation)\n- Hypotension\n- Vasoconstriction\n- Peripheral cyanosis\n- Normothermic or hypothermic','','','','','','','','','','','Treatment','1. ABC - adequate oxygenation & ventilation\n- Oxygen via mask, CPAP, ETT & ventilation. PEEP will reduce venous return and should be avoided.\n\n2. Clinical monitoring \n - HR & rhythm\n- ECG\n- Intra-arterial BP\n- Temperature\n- CXR \n- SpO2\n- Urine Output\n- CVP, PCWP, SVR, CO\n- Oxygen delivery & consumption\n \n3. Intervention\n- Fluid challenge give a blind fluid challange of 500ml. Use invasive monitoring (CVP/ PCWP) to guide fluid and ionotropes.\n- Further fluid loading beyond this level should only be used if improvement in CO can be demonstrated & respiratory deterioration does not occur\n- When fluid loading produces an unacceptable rise in PCWP without the desired rise in CO, inotrope support is then considered (dopamine, epinephrine, norepinephrine, metaraminol)\n- Maintain urine output > 0.7 ml/kg/hr with appropriate fluids, dopamine, mannitol, furosemide as indicated\n\n\n 4. Laboratory monitoring\n- ABG\'s\n- Lactate (needs to be on ice)\n- U&E\n- Glucose\n- FBE\n- Coagulation profile\n- LFT\'s\n- Blood cultures\n- Gram stain & culture from possible sites of infection\n\n5. Antibiotics - see antibiotic guidelines, but a third generation cephalosporin and gentamicin would be normal, unless toxic shock syndrome\n\n6. ?Surgical drainage. Remove tampon if toxic shock syndrome.','Central line','#####122','','','','','Arterial line','#####119','','','','','','','','','','Complications','1. Metabolic Acidosis\n- Consider sodium bicarbonate if pH < 7.10 despite adequate hyperventilation & oxygenation\n\n2. Hyperglycaemia\n- If severe, commence low dose insulin infusion\n\n3. Coagulopathy\n- Disseminated intravascular coagulation may occur\n- Management:\n - Reversal of shock\n -  Removal of the septic source\n -  Platelets, FFP, & other factors as indicated\n\n4. GIT Bleeding\n- Prevent with antacids & H2-receptor blockers (ranitidine)\n\n5. Other organ failures\n - Myocardial failure\n- Acute respiratory distress (including ARDS)\n- Acute renal failure\n- Cholestatic jaundice\n- Hepatocellular dysfunction & damage\n \n- Aclaculous cholecystitis\n- Gastric atony\n- Ileus\n- Pancreatitis\n- Toxic confusional state\n- Hypercatabolic state','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (53,0,0,'N','Snake bite','Call an emergency physician if any physiological disturbance','ED','emerg-med','','','','Guideline','QUAD QUCH QBIT QIRR QLIM QCRY QWOU','','','','','','','','Background','1.	Snake bites are relatively painless and there are usually few local changes.\n2.	Immature snakes (<15 cm) or those which leave a semi-circular row of fang marks are unlikely to be dangerous. Venomous fang marks are usually paired but may appear as multiple random marks, as a laceration or surface abrasion, or may not be visible at all.\n3.	Venom spread is chiefly via the lymphatics. In less than a quarter of all bites is enough venom introduced to cause significant effects.\n4.	The effects of envenomation are variable and fluctuant but may include regional lymphadenopathy, headache, nausea and vomiting, abdominal pain, impairment of conscious state and later paralysis of facial and pharyngeal muscles, large limb muscles and ultimately respiratory muscles. Hypoxia and death may result.\n5.	In the case of massive envenomation, a critical illness may develop in minutes rather than hours.\n6.	The effects of envenomation, including coagulation problems, will be reversed by adequate doses of the correct antivenom.\n7.	The anaphylactoid reaction rate to polyvalent antivenom  is much higher (20-25%) than that occurring when the smaller volume monovalent antivenoms are used (3 - 15%). Thus, specific antivenoms are preferred.\n8.	Recurring signs and symptoms require further antivenom.','','','','Effects of venom','','1. Neurotoxic.\n2. Anticoagulant.\n3. Myotoxic.\n4. Haemolytic\n5. Local - pain, oedema, LA\n6. Anaphylaxis - (if bitten before)','','','','','Examination','Presentation is variable and often signs and symptoms will fluctuate. Therefore, Patients may appear to recover but then rapidly deteriorate.\n Bite Site \nvariable in appearance - usually limbs. Can be classic paired fang marks but frequently single or multiple marks or linear laceration. Immature snakes (<15 cm) or those that leave semi-circular row of fang marks are unlikely to be dangerous. Australian snakes generally have little local reaction (overseas snakes often have local necrolysis) therefore difficulty to find. Snakes bites relatively painless.\n\nRegional Lymph Nodes \nTender often. These are a common feature of some less venomous snakes with no systemic illness.\n\nSystemic Effects\nMay commence with headache, nausea and vomiting, abdominal pain, hypotension, decreased conscious state. Abdominal pain may be severe due to a combination of factors e.g. lymph node involvement, direct effect on gut muscle/abdominal muscle, haemorrhage and changes in the excretory activity of the kidneys.\n\nNeurotoxic - usually first seen in cranial nerve with ptosis, blurred/double vision leading to facial and pharyngeal paralysis. Also widespread voluntary muscle weakness with diaphragmatic paralysis.\n\nEffects on erythrocytes and coagulation may dominate with haematuria/haemoglobinuria, haemorrhage/menorrhagia, bleeding from bite site / IV sites, possible intracerebral haemorrhage\n\nRhabdomyolysis especially if antivenom delayed or inadequate. Myalgias, rigors, myoglobinuria. Many late deaths due to renal failure following myoglobinaemia occur. Some cases now suggesting that common brown snake venom has a direct nephrotoxic effect.','','','','','Treatment','The Critically Ill Patient\n1. Avoid/treat hypoxia - oxygen/ ETT/ ventilation\n2. Establish intravenous access.\n3. Obtain samples for investigations.\n4. With resuscitative drugs and apparatus on hand and following a suitable pre-medication, administer undiluted antivenom, i.v. with caution.\n5. Catheterise patient; obtain urine samples; commence fluid balance chart.\n6. Give i.v. fluids as needed to maintain blood pressure.\n7. Admit to ICU.\n\n Real or Suspected Victim who is Not Critically Ill\nIf first aid is inadequate or inappropriate on presentation\n1. Swab the bite site (using venom Detection Kit - V.D.K.)\n2. Apply pressure over the bite site using a (crepe) bandage as firmly as to a sprained ankle and then bandage the rest of the limb beginning proximally.\n3. Immobilise the affected limb with a splint.\n\nIf first aid is adequate and no obvious signs or symptoms\n1. Leave bandages/splinting intact.\n2. Obtain a clear history - NB identification of snakes by appearance and colour is unreliable.\n3. Check antivenom supplies.\n4. Get Venom Detection Kit - V.D.K.\'s indicate not the type of snake which has bitten but rather the type of antivenom required.','','','','','','Tests',' FBE, Electrolytes and urea, Coagulation screen, Enzymes (CK, LDH), Sample for V.D.K.\n- ABG\'s\n- Urine\n Sample for V.D.K.\n Examine for the presence of haemoglobin and myoglobin\n- ECG - mandatory in older patients\n\nVenom detection kit (VDK)\n(cost =$300!)\nswab from unwashed wound is the best for detecting. \nurine and blood not nearly as good. \nbest to use only in patient who is significantly unwell.\ncan waste a **lot** of time, and usually results are inconclusive.\ndo not get distracted from looking after the patient. ','','','','','','','','','','','Treatment','6. Commence an infusion of saline or Hartman\'s Solution and begin a fluid balance chart.\n7. Ensure that resuscitative drugs and apparatus are on hand.\n8. Examine the patient closely checking for systemic signs of envenomation (ptosis, blurred vision, facial and pharyngeal muscle paralysis, weakness of large limb muscles or respiratory muscles).\n9. Remove all restrictive bandages and examine the bite site and regional nodes. Obtain a swab from the bite site if this has not been done.\nBy this stage a decision will have been made to either give antivenom or adopt a wait-and-see policy.\n','','','','','','Indications for Antivenom\nAntivenom is indicated if there is clinical or laboratory evidence or systemic spread of venom.\nRegional lymphadenopathy indicates envenomation, but is not an indication for antivenom unless the snake involved is known to be dangerous.\nThe potential benefit of antivenom administration should be carefully weighed against the risk of anaphylaxis.\n\n Premedication Prior to Antivenom\n1. IV Hydrocortisone should be given if the patient has been previously exposed to equine proteins or has a history of allergy.\n2. Antihistamine, minimising sedation.\n3. Adrenaline is no longer indicated as a premedication to antivenom because of the risk of intracerebral haemorrhage in snake-bite\n\nAdministration of Antivenom\nAntivenom should be diluted 1:10 in saline or Hartman\'s solution and infused slowly over 15-30 minutes. The initial dosage is 3 ampoules of antivenom and is the same for both a child and an adult. Should anaphylaxis occur, give Adrenaline and hydrocortisone prior to cautiously continuing the infusion.\n\nSecondary Management\n1. Intravenous fluids as required.\n2. Muscle relaxants for restlessness or to facilitate assisted ventilation.\n3. Analgesia/tetanus prophylaxis/antibiotics if indicated.\n4. Care of the bite site\n5. Catheterise; commence fluid balance chart; observe for signs of renal failure.\n6. Repeat appropriate laboratory tests at frequent intervals until the patient is stable.','','','','','','','','','','','Disposition','At an appropriate time, all definite bite victims should be transferred to ICU where hourly head injury observations should be continued for 24 hours. If there is a definite bite site and no clinical features, observation for 12 hours is generally adequate.\n\n','','','','','','','Poisons Centre','#####86','','','','','','','','','','','','','','','Comments','SEQUELAE\n1. Most snake bite victims with evidence of systemic envenomation take several weeks to fully recover. General malaise, night seats, weight loss and slowly resolving neurological signs are the usual features.\n2. Whenever antivenom has been given, delayed serum sickness may occur. Symptoms of fever, generalised lymphadenopathy and urticaria may become evident several days to as late as 14 days after exposure. Patients should be informed of the possibility prior to discharge and advised to return promptly for treatment should symptoms develop. The administration of steroids (and perhaps antihistamines) over 3 - 5 days is the treatment of choice.\n\n SNAKE HANDLERS\nThis group poses special problems:\n1. Allergy to venom: persons who have received a number of snake bites (even from immature snakes) may suddenly collapse after a further bite, due to anaphylaxis rather than the toxic effect of the venom. Hypotension, urticaria and bronchospasm are the common features. Apart from standard treatment of anaphylaxis (IV Adrenaline, ventilation and CPR if necessary) a rapid infusion of antivenom should receive absolute priority.\n2. Previous reaction to antivenom: though a patient has suffered a severe reaction to antivenom at one time, when antivenom is given at a later date, no reaction may occur. Thus, there is no reason to withhold antivenom with appropriate precautions, if a history of previous reaction is obtained.\n3. Bites by exotic snakes: antivenoms can be obtained through Commonwealth Serum Laboratories (C.S.L.).\n','','','');
INSERT INTO `MedHelp` VALUES (54,0,0,'N','Dog and cat bites','','ED','emerg-med','','','','Guideline','QBIT QWOU','','','','','','','','','All animal bites are contaminated (ie: class 2 or 3) irrespective of the time of injury and must NOT be closed primarily except on the face. \nGive oral cefalexin or co-amoxiclav, and add an i.v. or i.m. injection of penicillin to more severe cases.  \nPerform surgical debridement and scrub. Allow to heal by granulation with follow up by Plastic Surgeon. \n- Cat bites (Pasteurella multocida) and Human bites are the most prone to complications. Arrange follow up review as further debridement/ i.v. antibiotics may be necessary.','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','See also - wound care, tetanus prophylaxis','Suturing a wound','#####139','','','','','Tetanus prophylaxis','#####142','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (55,0,0,'N','Human bite','','ED','emerg-med','','','','Guideline','QWOU QBIT QEXP QASS','','','','','','','','','Human saliva contains a menagerie of particularly unpleasant bacteria - all wounds should could be covered with a broad spectrum antibiotic - cefalexin or co-amoxyclav.','','','','Knuckle bites','','A special form of animal bite, often incurred under the influence of alcohol, and usually resulting from the juxtaposition of the patient\'s closed fist and the biter\'s teeth, the latter taking a passive rather than active role in the infliction of the bite.\n\nThe degree of contamination may be underestimated unless it is realised that the extensor tendon sheaths retract when the fist is relaxed and the fingers extended, drawing the inoculum of human saliva proximally into the hand. \n\nIf there is evidence that the wound extends into the tendon sheath, these patient should be admitted to hospital for exploration, irrigation and i.v. antibiotics (commence in the ED with cefalexin).','','','','','','','','','','','','','','','','','','','','','','','','','','Suturing a wound','#####139','','','','','Tetanus prophylaxis','#####142','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (56,0,0,'N','Spider bite','Spider bites are usually painful. Snake bites generally are not.\nRedback bites most common - localised sweating','ED','emerg-med','','','','Guideline','QUAD QUCH QBIT QIRR QLIM QCRY QWOU red back white tailed funnel ','','','','Poisons Centre','#####86','','','','','','','','Redback Spider','Background','1. Mature, female red-back spider bite is the most common cause of potentially serious envenomation in Australia. Males and immature spiders of the species are not dangerous.\n2. The mature female has a black body (approximately 10 mm across compared with the male- approximately 3 mm.) with a bright red or orange dorsal stripe.\n3. The bite is usually felt as a sharp pin-pricking pain. Within minutes, intense local pain, erythema and sweating develops.\n4. Subsequently, clinical signs and symptoms are extremely variable. Typically, regional lymphadenopathy is followed by remote limb or abdominal pain and then malaise, nausea and vomiting, headache, profuse sweating, hypertension and muscular rigidity. Bizarre manifestations including tingling teeth, tetanic spasms, haemoptysis and priapism have been reported.\n5. A serious illness is unlikely to develop in less than three hours.\n6. In an apyrexic child or infant, when an acute illness develops with sudden onset of severe pain, regional skin changes and marked tachycardia, red-back spider bite should always be considered.\n7. In adults the diagnosis is usually clear-cut.','','','','','','','','','','Redback - the critically ill patient','Treatment','1. If envenomation is severe, dilute the antivenom 1:10 and administer slowly i.v. following epinephrine (adrenaline).\n2. The reaction rate to antivenom is very low (0.5%) though non-fatal anaphylactic reactions may occur.\n3. Assisted ventilation is occasionally required.','','','','','Redback - real or suspected victim who is not critically ill','','No specific first-aid to the bite site is recommended. Rest and ice packs may be useful. Torniquets and constrictive bandaging are contraindicated.','','','','Indications for antivenom','','Antivenom is indicated if:\n1. The culprit spider has been positively identified and there are significant local effects.\n2. The culprit spider has not been identified but significant local changes and regional lymphadenopathy and/or systemic effects have occurred.','','','','','','','','','','Administration of antivenom','','With resuscitative drugs and apparatus on hand, give one ampoule of red-back spider antivenom i.m. Repeat in two hours if there has been no improvement.\n\nSecondary management\n1. Mild analgesics or sedatives may be required. Diazepam is useful for sedation and reduction of muscle spasm.\n2. Tetanus prophylaxis should be given if indicated.\n\nAnaphylaxis may occur in victims previously bitten.','','','','Funnel web spider','Background','1. It is the male rather than the female of fenus Atrax that is potentially lethal to man. The most common species is Atrax Robustus (found within 160 km. of Sydney).\n2. The bite of the male is extremely painful due largely to the direct trauma of the large, strong fangs. Surrounding erythema and localised pilo-erection and sweating rapidly develop.\n3. In most cases, little venom is injected and no illness occurs. However, symptoms of systemic envenomation may develop within 10-15 minutes. ','','','','Funnel web - indicators of serious envenomation','','- Muscle fasciculation of the involved limb, tongue or lips\n- Marked salivation or lacrimation\n- Significant tachycardia or hypertension in a previously normotensive individual (late hypotension may occur)\n- Dyspnoea\n- Disorientation, confusion or deteriorating conscious state','','','','','','','','','','Funnel web - treatment','Treatment','Real or Suspected Victim\n1. Ensure airway, breathing and circulation are maintained.\n2. Set up a well-secured IV infusion\n3. If first aid measures are adequate on presentation, they should not be removed since sudden release of the venom any precipitate a critical illness. Apply pressure/immobilisation first-aid if this is inadequate of has not already been done.\n\nIf appropriate, prepare for mechanical ventilation under relaxant anaesthesia, and antivenom administration.','','','','Funnel web - antivenom','','Antivenom is indicated where an effective bite from a dangerous species has produced any signs or symptoms of significant envenomation.\n\nAdministration\n1. Premedication with an antihistamine and a steroid parenterally is recommended. \n2. Epinephrine (adrenaline) should not be given because of the widespread catecholamine release produced by the venom.\n3. At a starting dose of 2-4 ampoules, depending on severity, infuse antivenom i.v., very slowly initially. Repeat in 15 minutes if there is no improvement.','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (57,0,0,'N','Wasp and bee sting','','ED','emerg-med','','','','Guideline','QBIT QWOU','','','','','','','','Background','A life-threatening illness may result from:\n1. Massive envenomation in \"swarm attacks\".\n2. Anaphylaxis in individuals previously bitten. The extent of allergies usually progresses from mild to severe with subsequent stings, so that anaphylaxis can usually be anticipated. The extent of allergy may disappear over a number of years if no further exposure occurs.\n3. Upper respiratory tract obstruction when a bee or wasp enters an opened can of beer or soft drink and then stings inside a person\'s mouth or pharynx.','','','','','','','','','','','Treatment','1. The management of anaphylaxis and upper respiratory tract obstruction are discussed elsewhere.\n2. Stings should be scraped off. Pressure/immobilisation should then be applied (iced water may produce some relief of local pain).\n3. Antihistamines and steroids are useful for the treatment of urticarial and pruritic effects','Anaphylaxis','#####14','','','','','Upper airway obstruction','#####111','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (58,0,0,'N','Australian paralysis (bush) tick bite ','','ED','emerg-med','','','','Guideline','QUAD QUCH QBIT QCOL','','','','Poisons Centre','#####86','','','Background','1. The salivary secretions of ticks contain a potent neurotoxin which produces local and general paralysis of the host.\n2. Ticks are potentially lethal, especially to children.\n3. Apart from the discovery of an embedded tick, enlargement of regional lymph nodes is the most common finding.','','','','','','','','','','','Treatment','1. Measure the Forced Vital Capacity for monitoring. Assist ventilation if necessary (severe, late cases of poisoning).\n2. If significant paralysis is present, such as the involvement of respiratory or oropharyngeal muscles, administer tick antivenom IV following suitable premedication.\n3. Remove the tick by dousing it with turpentine or kerosene, and then levering it out with slightly opened pointed scissors. Avoid squeezing the tick as more toxin my be injected into the victim.\n\nIn individuals previously bitten, allergy to the toxin may occur and produce a life-threatening anaphylactic reaction. As with such reactions to other venoms, the cornerstones of management are adequate ventilation and the administration of adrenaline/ epinephrine as the drug \"par excellence\".','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (59,0,0,'N','Deliberate self harm','Beware the lonely, depressed, middle aged male.','ED','emerg-med','','','','Guideline','QDSH QODP QMEN QBEH suicide parasuicide ','','','','Suicide risk assessment','#####114','','','','Suicide is the 8th leading cause of death overall and the 3rd leading cause of death in the age group 15-25 (four fold increase in this age group since 1960).','','','','','','','','','','','Treatment','1. Medical & Surgical Treatment\n- Includes the medical management of drug overdose and the surgical repair of self inflicted wounds.\n- Attempted suicide is part of the differential diagnosis of the unconscious patient.\n \n2. Assessment of Mental State\n- Helps determine whether the patient has significant psychotic illness or major depression, both of which are associated with a high risk of future suicide.\ni. Thought Content:\n- Bizarre thought processes, ideas of reference, thought insertion, paranoid ideas and auditory hallucinations (especially if these \"command\" the patient) are evidence of psychosis. \nii. Intellectual Function: \n- Memory loss and the inability to perform simple arithmetic and memory tasks suggest an organic aetiology such as multi-infarct dementia or Alzheimer\'s dementia in which depression is common, especially in its early stages. \niii. Mood & Clinical Features of Depression: \n- Mood fluctuations in response to changing life circumstances are normal but depression becomes pathological when it is protracted (greater than 6 months) or is unrelated to a specific causal event. \n- Severe depression may be manifested by: sadness, lack of interest, inability to concentrate, fatigue, lack of energy, inactivity, neglect of personal hygiene and grooming, sleep disturbance, change in appetite, feelings of low self-esteem, worthlessness and guilt, frequent suicidal ideation.\n\n3. Assessment of future suicide risk\n[see seperate protocol for SADPERSONS score]\nMany people who successfully kill themselves have previously presented to hospitals with suicidal attempts (\"parasuicide\") or \"gestures\". Patients who have frequent or intense thoughts of suicide are at great risk as are those who \"act out\" their suicide either in fantasy or reality. Ask the patient how s/he would kill her/himself. Patients who have developed elaborate suicide scenarios may well go on and use them. Sometimes a suicide is meticulously planned over a long period of time before being carried out. When such a planned attempt is unsuccessful, the individual is severely at risk of successfully completing suicide in the future.\n \nMore commonly victims usually suffer an underlying depression which culminates in an impulsive self-destructive act ie:	\n\nDepression + loss of impulse control = potential suicide \n\nExamples of \"at risk\" groups include:\n- Adolescents whose characteristic emotional lability is often coupled with immature coping mechanisms and impulsive behaviour\n- Depressed patients whose control of impulsive behaviour is compromised by drugs or alcohol\n- Psychotic patients experiencing auditory command hallucinations.\n \n Suicidal depression is usually associated with:\n- a sense of loss: of a relationship, health, job, money, self esteem or honour\n- chronic organic illnesses: especially if there is chronic pain or loss of personal dignity. \n- long term medications: may cause depression, as does substance and alcohol abuse.\n- Mental illness : 10% of schizophrenics eventually take their own lives.\n- Above all beware the lonely, depressed, middle aged male.','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','Disposition','All patients with self destructive behaviour must be seen by an experienced psychological health care professional and follow-up organised. An episode of \"parasuicide\" may be a \"cry for help\" and is an opportunity for effective crisis intervention. In such cases formal psychiatric care may be unnecessary but effective social support networks must be available for the patient and an empathetic general practitioner often has a major on-going role to play. If the clinical situation allows it, these patients may be allowed to go home - but only under the direct supervision of a responsible care-giver.\n \n NOTES:\n- All patients with significant toxic ingestions must be observed for at least 6 hours. \n- Patients with significant or potential clinical disturbance following overdose should be admitted to a medical ward or ICU (or occasionally CCU for monitoring).\n- A patient may be admitted to the Psychiatry Ward if there is no risk of late adverse sequelae. \n- If there is any suggestion of genuine suicidal intent, the patient must be admitted to hospital. If the patient refuses admission and there is a genuine risk of repeated self destructive behaviour, he/she should be recommended under the mental health act.\n \n Patients allowed home\n \n- Certain patients may be allowed to go home from the ED.\n- The patient must first, if possible, be interviewed by the Psychiatric Community Assessment Team (CAT) or psychiatric registrar. \n- If this is not immediately possible, arrangements should be made for adequate follow up, either by the Department of Psychiatry or by the patient\'s own GP.\n- NO PATIENT IS TO BE DISCHARGED WITHOUT SUCH ARRANGEMENTS BEING MADE AND DOCUMENTED IN THE MEDICAL RECORD.\n- Any patient allowed home must be accompanied by a responsible adult who will be staying with the patient.\n\n\n	Predicting future suicidal behaviour is often problematic, and if there is any doubt\n	as to the patient\'s future behaviour, s/he must be admitted to an acute psychiatric\n 	ward or at least have follow-up up organised by a community psychiatric team.\n','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (60,0,0,'N','Hyperthyroidism -  thyroid storm','Very rare indeed','ED','emerg-med','','','','Guideline','QUAD QCOL','','','','','','','','Description','Represents a state of decompensated thyrotoxicosis.\nCharacterised clinically by:  \n- high fever\n- hyper-dynamic circulation\n- altered mental state\n- precipitating event\n','','','','','','','','','','','Comments','Occurs mostly in untreated or under-treated thyrotoxicosis. Very rare in the developed world \n[I worked for a professor of endocrinology who said that he had never seen one- TCH].\n','','','','','','','','','','','','History','Usually precipitating event\n- Infection\n- Trauma\n- Surgery\n- Uncontrolled diabetes mellitus\n- Labour\n- Eclampsia\n- Radio-iodine, iodides, haloperidol in unprepared patients\n- Thyroxine OD\n- Any other major medical illness may trigger a storm.\n ','','','','','Examination','Cardinal features are:\n1. Fever \n- often >41 C, lower in the elderly.\n- often unresponsive to conventional cooling measures.\n2. Altered mental state\n- anxious and agitated, later acute brain syndrome and finally coma.\n- sometimes produces apathy, especially the elderly.\n- degree of disturbance parallels the fever.\n3. Cardiovascular effects\n- tachycardia, Atrial fibrillation\n- warm and sweaty\n- later arrythmias, hypotension, shock and death.\n4. Other manifestations\n- muscle weakness\n- vomiting and diarrhoea','','','','','Tests','Not specific nor diagnostic test\n- FBE 		- WCC often normal or down\n- TFT 		- almost always raised. Not necessarily higher than in a thyrotoxicosis.\n- CORTISOL 	- sometimes decreased','','','','','','','','','','','Treatment','General measures 	\n- Cooling (avoid aspirin)\n- Careful attention to fluids, electrolytes, glucose, thiamine\n - Treat precipitating cause\n- Treat complications eg; arrhythmias\n \nBeta-Blockers\n- Atenolol 1 mg increments IV to a total of 10 mg\n- Careful use in patients with COPD, Asthma, CCF\n \nCorticosteroids\n- Hydrocortisone 100 mg IV 6 hourly\n\nAntithyroid agents\nPeroxidase inhibitors\n- propylthiouracil is quickest acting.\n- acts on thryroid peroxidase and by decreasing peripheral conversion\n- loading dose 1 gm orally - maintenance 200 mg qid\n\nLugols Iodine (1 drop = 130 mg total iodine) \n- Delay giving for at least 1 hour post propylthiouracil \n- acts via blocking hormone release\n- usual dose 3 drops orally qid\n- If allergic to iodine - use lithium 500 - 1500 mg/day (monitor levels)\n\n','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','\n','');
INSERT INTO `MedHelp` VALUES (61,0,0,'N','Toxidromes','','ED','emerg-med','','','','Guideline','QUAD QUCH QODP QDSH QMEN toxicology cholinergic anti- cholinergic sympathomimetic narcotic extrapyramidal haemoglobinopathy metal fume fever\n','','','','Poisons Centre','#####86','','','Background','Toxidromes are recognisable symptom complexes and include the following\n1. Cholinergic\n2. Anti-cholinergic\n3. Sympathomimetic\n4. Narcotic\n5. Extrapyramidal\n6. Haemoglobinopathies\n7. Metal fume fever\n\n\n','','','','','','','','','','','','\nCholinergic Toxidrome\n\nSubstances\n- organophosphate & Carbamate insecticides\n- Acetylcholinesterase inhibitors, Pilocarpine\n- Mushrooms (certain species), Betel nut\n\nSymptoms	\nMuscarinic\n\n Defaecation		\nUrination		\nMiosis			\nBradycardia		\nBronchorrhoea\nEmesis\nLacrimation\nSalivation / Sweating\n \nNicotinic\nMuscle fasciculations / paralysis\n\nAnticholinergic Toxidrome\n\nSubstances\n- Antihistamines, TCA\'s, Scopolamine\n- Plants - Datura Lilly, Belladonna\n- Mushrooms - certain species\n- Over the counter sleep medications\n\nSymptoms\nOpposite to Cholinergic Muscurinic Toxidrome\n Sympathomimetic Toxidrome\n\nSubstances\n- Theophylline, caffeine\n- LSD, phencyclidine\n- Amphetamines, cocaine, ephedrine\n\nSymptoms\nCNS excitation, convulsions\nHT, tachycardia\n\nNarcotic\n\nSubstances\n- Heroin, pethidine, morphine\n- codeine, lomotil\n\nSymptoms\nCNS depression\nHypoventilation\nMiosis\nHypotension\n\nExtrapyramidal Toxidrome\n\nSubstances\n- Phenothiazines\n- Butyrophenones\n\nSymptoms\nOculogyric crisis, rigidity, tremor\nTorticollis, opisthotonos\n\nHeamoglobinopathies\n\nSubstances\nCO, Methaemoglobin\n\nSymptoms\nHeadache, N&V\nFatigue, respiratory distress\nAltered level of consciousness\n\n Metal Fume Fever\n\nSubstances\n- Fumes of copper, iron, brass, mercury, etc\n\nSymptoms\nHeadache, N&V\nFatigue, Respiratory distress\nChills, fever, muscular pain','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (62,0,0,'N','Trauma','There are absolutely NO contraindications to analgesia, which should be intravenous morphine.','ED','emerg-med','','','','Guideline','QMUL QTRU QLIM QDIS','','','','','','','','Background','Optimal clinical management in the first hour after injury has a major bearing on a severely injured patient\'s subsequent outcome. Aggressive resuscitation and accurate assessment in the Emergency Department are of vital importance and depend on an efficient and coordinated trauma team and a structured approach to clinical assessment and treatment.\n\nThese protocols are a guide to local acute trauma management policies. For details of procedures and specific clinical situations consult other relevant protocols and texts.\n\nTRIAGE \n\nSeverely injured patients are triaged category 1 or 2 and are treated in the Resuscitation area.','Trauma team','#####153','','','','','Major head injury','#####152','','','Treatment','PRINCIPLES OF TRAUMA MANAGEMENT \n\nAssume the spine is damaged until proven otherwise and protect the neck with a semi-rigid cervical collar (eg: \"Stifneck\") +/- sandbags. Log roll patient when turning (see SPINAL INJURIES protocols).\n\nFOUR phases of assessment and treatment are followed. Nothing is to be omitted or performed out of sequence.\n\n(1) PRIMARY SURVEY		(2) PRIMARY RESUSCITATION \n(3) SECONDARY SURVEY	(4) SECONDARY (and DEFINITIVE) TREATMENT\n\n1. Primary Survey\n\n- Performed rapidly by the team leader (should take approx. 1 minute).\n- The Primary Survey is based on the acronym \"A B C D E \" where:\n \n- A = Airway, B = Breathing, C = Circulation, D = Disability and E = Exposure\n \n A = Airway\n- Rapidly assess patency of upper airway. This takes precedence over everything else.\n \n B = Breathing\n- Assess adequacy and symmetry of air entry into the lungs. \n- Assess chest wall for flails, sucking wounds or other mechanical impediment to ventilation.\n- Check for pneumothorax. \n- Note the pattern of breathing (spinal patients may exhibit purely diaphragmatic breathing).\n C = Circulation\n- Blood pressure, pulse rate and volume, skin colour, temperature and sweating. \n- Decide if patient is shocked or imminently shocked and if so, quickly look for signs of tension pneumothorax or cardiac tamponade.\n \n D = Disability\n- Make a rapid initial assessment of CNS and Spinal disability. \n- Assess level of consciousness with \"A V P U\" ( not Glasgow Coma Score at this stage):\n 		 A = Alert	 V = Responds to Voice\n 	 P = Responds to Pain	 U = Unresponsive\n- Look for signs of spinal injury - movement, bradycardia, priapism, vertebral tenderness.\n \n E = Exposure\n- Get all the clothes off the patient and check the back.\n \n','','','','','','','','','','','','',' 2. Primary Resuscitation\n \n Resuscitation mirrors the ABC\'s of the primary survey and occurs simultaneously with ongoing clinical assessment.\n \n Airway Management (takes precedence over everything else)\n- Position patient and clear mouth and pharynx manually and with suction. Gently extend the head (REMEMBER THE CERVICAL SPINE) and perform jaw thrust or chin lift. \n- If indicated, intubate the trachea using rapid sequence induction and cricoid pressure.\n- If endotracheal intubation is initially unsuccessful, ventilate with bag and mask and high flow O2, preferably with cricoid pressure maintained and the patient in the left lateral position. Reattempt intubation using introducer or bougie or try blind nasal intubation (contraindicated in base of skull fracture).\n- If still unsuccessful, decide if situation is controllable with bag and mask until more expert help can be summoned. If not, proceed to CRICOTHYROTOMY.\n- The neck should be protected as much as possible. The cervical collar may be removed during intubation if an assistant manually immobilises the head in a neutral position. In extreme situations, securing the airway is more important than protecting the cervical spine.\n\nINDICATIONS FOR ENDOTRACHEAL INTUBATION IN MAJOR TRAUMA\n\n1. Obstructed (or potentially obstructed) upper airway \n2. Mechanical impediment to ventilation not correctable by posturing patient or clearing mouth & pharynx\n3. Persistent circulatory shock\n4. Hypoxia despite supplementary O2 \n5. Major multiple injuries requiring large amounts of sedation and analgesia, especially if patient requires transportation.\n6. Excessive combativeness or other inability of patient to cooperate\n7. Glasgow Coma Score < 9\nBreathing\n- Treat mechanical impediments to breathing:\n- Correct PNEUMOTHORAX. If ? under tension, insert 21 gauge needle into 2nd intercostal space in midclavicular line. Insert 32 Fr intercostal catheter in 4th or 5th intercostal space in the midaxillary line and connect to underwater seal drainage system. (See Protocol on PNEUMOTHORAX).\n- Treat SUCKING CHEST WOUND: Cover wound with sterile dressing (eg: Opsite) and then immediately insert an intercostal catheter at another site on the same side.\n- Intubate and ventilate the patient. If breathing is still inadequate as judged on clinical assessment, SaO2 and ABG\'s,\n \n Circulation\n- At least 2 large IV cannulae (16 gauge or larger) or use ARROW rapid infusion cannulae.\n- If percutaneous peripheral IV access cannot be achieved proceed to CUTDOWN (antecubital fossa, long saphenous vein above medical malleolus) or cannulate the FEMORAL VEIN or insert a CENTRAL VENOUS LINE.\n- Do not cannulate veins in the lower limb unless absolutely necessary (risk of DVT) and certainly not if there is pelvic or abdominal trauma involving large venous plexuses.\n- Connect dual IV pump sets or use pressure infusion bags. Blood filters are not necessary in the Emergency Department during emergency transfusion.\n- Commence fluid resuscitation with Normal Saline and/or Haemaccel depending on degree of hypovolaemia. 5% Albumin solution is NOT indicated in routine resuscitation. \n- Do not underestimate fluid losses. Use BP, pulse rate and JVP (CVP if available) as indicators of haemodynamic target points. \n- In general aim for a systolic BP of 100 mmHg and a pulse rate < 100 but do not overtransfuse. Allow for effects of anxiety and pain on these parameters. \n- Urine output is also a useful indicator of the adequacy of fluid resuscitation (aim for > 0.5 -l/kg/hour). \n- If shock is not rapidly reversed, do not hesitate to commence uncross-matched O negative blood transfusion.\n \n','Rapid sequence induction','#####134','','','','','','','','','Comments',' CHILDREN\n- Remember that children maintain BP until relatively late and then crash. \n- Commence fluid resuscitation in children with 20 ml/kg using either Haemaccel or Normal Saline and then reassess. If still shocked, repeat 20 ml/kg fluid. (SEE PAEDIATRIC RESUSCITATION PROTOCOLS).\n \n PREGNANCY\n- In the third trimester shock may be difficult to diagnose. Normal BP may be around 100 mmHg and resting pulse rate may be normally around 100. \n- Remember that trauma to the uterus may result in concealed bleeding and that fetal distress is often undetectable without cardiotocography. \n- In the 3rd trimester particularly, it is important to intubate and ventilate early if there is any doubt as to respiration, conscious level or the state of the circulation. \n \n','Paediatric major trauma','#####110','','','','','','','','','Treatment',' 3. Secondary Survey\n \n This is the definitive examination of the patient and comprises physical examination, X-rays, pathology tests and special diagnostic procedures. It is performed by the team leader once the patient has been initially stabilised.\n \n PHYSICAL EXAMINATION\n \n This should be done \"head to toe\" in a methodical and systematic manner. \n \n Neurological\n- Glasgow Coma Score\n- Assessment of spinal function\n \n Head and Neck\n- Check scalp and cranium for lacerations, depressed or compound fractures. \n- Check eyes including pupils (unequal pupils are of prognostic significance only if the patient is unconscious). \n- Look in ears for local trauma or haemotympanum (indicating # base of skull). Manipulate the maxilla to exclude # middle third of face. Palpate zygoma and orbital margins. Assess infraorbital nerve. \n- Check inside mouth for tongue or other trauma and note the state of the dentition. \n- Inspect the neck for penetrating injuries. Palpate both carotid arteries. Assess the degree of filling of the external and internal jugular veins. \n- Palpate the cervical spine. No localised midline tenderness in a fully conscious patient probably means there is no significant spinal injury. Feel for a bony step. \n \n Chest\n- Inspect for contusions, lacerations, entry and exit sites. \n- Palpate clavicles, sternum, ribs and scapulae.\n- Palpate for subcutaneous emphysema including supraclavicular fossae. \n- Assess adequacy and symmetry of air entry and auscultate for crackles and rhonchi.\n \n Abdomen & Pelvis\n- Inspect for bruising, penetrating injuries and degree of distension (serial measurements).\n- Palpate abdomen for generalised or local tenderness. \n- Perform per rectum examination in order to assess 3 things: (1) High riding prostate (in ruptured urethra) (2) Blood coming from higher up the GIT and (3) Anal tone.\n- Palpate the pelvis for bony tenderness..\n \n Genitalia\n- Inspect for presence of meatal bleeding. If present suspect ruptured urethra and DO NOT CATHETERISE.\n- Consider per vaginum examination in women especially if any possibility of pregnancy.\n Limbs\n- Assess for soft tissue and bony injuries. Consider compartment syndromes.\n- Check peripheral circulation and motor and sensory function.\n X-RAYS\n- X-rays of the CHEST, CERVICAL SPINE and PELVIS are mandatory. \n- Other X-rays are ordered according to the findings of the physical examination. \n- Routine skull X-rays are NOT indicated unless there is the possibility of depressed # skull, compound # skull, cranial foreign body or child abuse. Head trauma associated with depressed levels of consciousness requires CT scan. (See HEAD INJURY PROTOCOLS).\n \n PATHOLOGY TESTS\n- Send blood for U&E, FBE, cross match. \n- Arterial blood gases to assess ventilatory and pulmonary function and degree of shock (hypoperfusion leads to metabolic acidosis).\n\nSPECIAL INVESTIGATIONS\n\nIntravenous Pyelogram (IVP)\nIndications for emergency IVP: 1. persistent macroscopic haematuria 2. major intra-abdominal injury 3. severe localised loin tenderness 4. severe direct blunt trauma to the renal angle. (NOTE: Microscopic haematuria alone is not an indication for IVP). Use 50 ml of ULTRAVIST 320 (very large patient: 75 ml, child : 30-40 ml). \n\nCystourethrogram (retrograde)\nIndicated whenever there is a suspicion of ruptured urethra. Use 20 ml of ULTRAVIST 320 initially via a catheter placed just inside the meatus. If there is extravasation of contrast, urethral catheterisation is contraindicated and the bladder must be drained suprapubically.\n\nArteriograms\nMay be indicated in peripheral limb trauma - consult with vascular surgeon. \nArch aortogram was until recently the gold standard in the diagnosis of ruptured aorta (suspect in severe blunt chest trauma associated with widened superior mediastinum > 8 cm and/or fractured 1st rib and/or multiple rib, sternal fractures). CT chest gives false negatives.\n\nComputerised Tomography\nCT scan of head is indicated in all head injuries where there has been loss of consciousness or amnesia or in an intubated patient with multiple trauma where there is any possibility of associated head injury. Don\'t assume a depressed level of consciousness is due to intoxication just because a patient smells of alcohol. See HEAD INJURY protocols.\n\n		  If in doubt - scan the head\n\nCT scan of chest and abdomen may be indicated if visceral damage is suspected. However, other tests such as ultrasound should also be considered.\nUltrasound\nVery useful in assessing abdominal trauma - especially the integrity of the spleen and liver. \n\n Echocardiography\nMay be useful in detecting pericardial effusion or haemopericardium or major traumatic damage to the heart. Not much use in suspected myocardial contusion. Transoesophageal echo (TOE) is useful in the investigation of suspected ruptured aorta however, is not available at this hospital as an emergency procedure. \n\nDiagnostic Peritoneal Lavage (DPL) \nIndications: 1. abdominal tenderness following trauma 2. penetrating abdominal trauma    3. severe non contiguous trauma to body areas above and below the abdomen 4. blunt trauma to the abdomen and the patient cannot be assessed for tenderness because of depressed level of consciousness (including intoxication), spinal injury or he is intubated. CT Abdomen now preferred in most cases.\n\nIf the blood pressure is unstable and abdominal injury is suspected, then emergency laparotomy is indicated and time should not be wasted performing either DPL or CT. \n\n\n4. Secondary & Definitive Treatment\n\nAccording to the findings of the secondary survey, the definitive treatment of the patient can be arranged once the initial resuscitation of life threatening conditions is underway and the patient is reasonably stable.\n\nIf primary resuscitation fails to control the situation the patient must be transferred immediately to the operating suite. Inform anaesthetists and surgeons early.\n\nIn less critical situations the patient may be held in the Emergency Department pending transfer to the operating suite or may be sent to a ward or the intensive care unit. The EM registrar or consultant should liaise with the ICU registrar or consultant.\n\nFractures should be splinted in the ED. Joint dislocations must be reduced and splinted (especially ankle, knee and elbow). Lacerations should be cleaned and sutured if appropriate, otherwise sterile dressings should be applied. Major lacerations and soft tissue defects should be covered with saline or Betadine soaked combine. Burns to the body (not face) may be covered with SSD cream.\n\nAdminister IV antibiotics and appropriate tetanus prophylaxis. \n\nEnsure patient is pain free - perform local anaesthetic blocks (eg: femoral nerve block for # shaft of femur) and give increments of IV morphine as required. With gross injuries general anaesthesia may be induced in the Emergency Department remembering the implications for diagnosis (especially in head injury and abdominal trauma) that this entails. \n\nThere are absolutely NO contraindications to analgesia, which should be intravenous morphine.','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (63,0,0,'N','Oesophageal varices','','ED','emerg-med','','','','Guideline','QGIB liver hepatic failure alcohol ','','','','','','','','History','Profuse haematemesis. usually a history of portal hypertension, alcoholism, Chronic active hepatitis etc','','','','','','','','','','ABC\'s','Treatment','- Intubate and ventilate if profoundly shocked or airway compromised\n \n- 2 large bore cannulae, blood warmers\n \n- Fluids: Crystalloid, colloid (Haemaccel), uncrossedmatched blood ( O positive or negative in men, O negative only in females)\n \n- Call the gastro-enterologist with responsibility for acute haematemesis','Rapid sequence induction','#####134','','','','Sedation in these patients needs to be done carefully, as they are very sensitive to opiates, and their likely combination of hepatic and renal impairment means that metabolism and excretion is slow. Start with small doses of benzodiazepines','Sedation','#####135','','','','','','','','','Octreotide infusion','','Octreotide reduces the splanchnic venous blood pressure, and is an effective treatment for variceal bleeding. \n \n- 500 micrograms in 100 mL N saline. Infuse @ 100 micrograms/hour (20 ml/hr) for the first 30 minutes, then reduce infusion rate to 50 micrograms/hour (10 ml/hr)','','','','','','','','','','','','','','','','Balloon tamponade','Equipment','- Indicated only if patient is exsanguinating and endoscopy is either unavailable, delayed or unsuccessful.\n\n- The patient must be adequately sedated and the airway protected. If there is any question about the patient\'s airway protection, it is likely that they will need relaxant general anaesthesia and endotracheal intubation. If inserted in an awake patient, sedation will be required.\n\n- The Sengstaken-Blakemore Tube has a distal gastric balloon and a proximal oesophageal balloon. The Minnesota tube is a variant which has 4 lumens which allows for the aspiration of gastric/oesophageal contents. The tubes should be kept in a fridge to increase their rigidity, which makes them easier to use.\n\n- The tube is passed (sometimes with an guide). The operator\'s fingers form a guide to aid passage of the tube through the pharynx. During this procedure the endotracheal tube cuff should be temporarily deflated.\n \n- When located in the stomach, the distal gastric balloon is inflated first (150 - 200 mL of air).\n \n- The tube is pulled back gently until the gastric balloon lodges in the cardia of the stomach. \n \n- The tube is now taped to patient\'s face.\n \n- If bleeding continues, the oesophageal balloon is now inflated with air to a pressure of 30 - 40 mm Hg (using a sphygmomanometer to check the pressure).\n \n- Lumen is clamped.\n \n- Check position with X-rays. ','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (64,0,0,'N','Meningitis','If the child is more unwell than you would expect - do an LP\nIf the child is fitting or has focal neurology or is semi-conscious, do not do an LP','ED','emerg-med','','','','Guideline','QCOL QUAD QUCH QCRY QIRR','','','','','','','','Background','Infection of the CNS can be potentially life threatening & must be excluded. \nInfections elsewhere do not exclude the presence of meningitis. \nThe younger the child, the less specific the presenting signs & symptoms\n\n- the most common causative organisms in children are :\n- Neisseria meningitidis\n- Haemophilus influenzae type B (v.rare since immunisation)\n- Streptococcus pneumoniae\n- in neonates think also of : Escherichia coli, group B streptococci & listeria monocytogenes\n- patients with VP shunts may present with meningitis due to S. aureus\n\n- as the signs & symptoms of meningitis are often non specific, often the only way to exclude meningitis in febrile unwell infants & toddlers is by performing a lumbar puncture to obtain CSF\n- often an acute or fulminating illness with symptoms developing over hours rather than days\n- specific treatment is primarily appropriate broad spectrum antibiotics, the antibiotics of choice currently are third generation cephalosporins\n- penicillin is still first line for meningococcal disease\n- the use of steroids remains controversial, currently only validated for steptococcal disease, before antibiotics given.','','','','','','','','','','','History','- non specific symptoms include :\n - fever / hypothermia\n- irritability / lethargy\n- dehydration\n- vomiting\n- anorexia\n- respiratory distress\n- seizures\n- bulging fontanelle\n - specific symptoms (more likely to be present if child is older) include headache, photophobia & neck stiffness\n- ask about health of immediate family members, pets, recent illness contacts & travel, immunisation status, current medications & presence of immunosuppression','','','','','Examination','- note general appearance, activity, skin perfusion & colour, vital signs & weight\n- look for rash - may indicate meningococcemia\n- perform thorough & complete physical examination including ENT & neurological examination\n- look for photophobia, nuchal rigidity, Kernig\'s sign & Brudzinski\'s sign, check fundi for papilloedema','','','','','','','','','','','','Treatment','Ensure that senior medical staff are aware of and involved actively in the management of any child with meningitis or suspected meningitis. \n Involve the Paediatric unit early. Treatment should be prompt & aggressive\n \n General Treatment & Supportive Measures -\n \n- ALWAYS ASSESS & SECURE ABC FIRST\n- provide oxygen via face mask\n- obtain secure intravenous access early\n- if the child is shocked, treat for shock with 10-20ml/kg boluses of fluid until circulation is restored\n- after treatment of shock, restrict IV fluids to 2/3 calculated maintenance requirement\n- elevate head of bed by 30o\n- perform frequent (half hourly initially) clinical monitoring : BP, PR, RR, conscious state, pupils & coma score\n- check blood glucose (dextrometer) & treat hypoglycaemia as appropriate\n- treat seizures as appropriate with diazepam, use phenytoin for prolonged or recurrent seizures\n \n Specific Treatment -\n \n Do NOT delay administration of antibiotics pending collection of specific investigations such as lumbar puncture or blood culture if these are going to be delayed\n \n- Antibiotic Therapy :\n- in older children & infants :\n- Ceftriaxone 100mg/kg IV daily\n- Benzylpenicillin 60mg/kg IV \n- for neonates use :\n- benzylpenicillin & gentamicin\n- if there is any suggestion that the illness may be a viral (usually HSV) encephalitis also give acyclovir intravenously; dose : if less than 2yo give 10mg/kg/dose 8 hourly; if older than 2 give 500mg/m2 body surface area/dose (use nomogram in Paediatric Pharmacopoeia)','','','','','','','','','','','Tests','- the following investigations should be performed :\n- FBE, WCC, differential & film\n- CRP\n- electrolytes\n- +/- acid base status\n- blood cultures\n- collection of urine for urinary antigens\n- lumbar puncture :\n- contraindicated in the presence of \ncoma, \ngrossly abnormal conscious state, \nfocal neurological signs, \nany evidence of increased intracranial pressure\nbleeding diathesis\n\n- note that a normal CT scan does not exclude high intracranial pressure\n- CSF should be sent for protein, glucose, cell count, microscopy, antigen testing & culture\n- microscopy & gram stain results may allow a presumptive identification of the organisms within one hour\n- if in any doubt as to the clinical status of the child, treat for meningitis & OMIT the lumbar puncture\n- CT scanning :\n- not done in all cases, indicated if diagnosis in doubt, focal signs or signs of raised intracranial pressure, suspicion of space occupying lesion of cerebral abscess\n- discuss need for CT scan & logistics (infants may need sedation or anaesthesia for scan) with duty consultant','','','','','','','','','','','','','','','','','','','','','','','Disposition','- liaise EARLY with the duty paediatrician\n- most children with uncomplicated meningitis can be managed locally.\n\nIndications for transfer include :\n- meningococcemia\n- cerebral oedema\n- septic shock not responding to fluid loading (inotrope dependant)\n- need for intubation & ventilation\n- cerebral abscess or empyema on CT scan\n\n- as always, the need for transfer, the preferred referral hospital & the logistics of transfer must be discussed in detail with the duty consultant (Emergency Medicine & Paediatric)\n- transfer must not commence until the child is stable and has been appropriately resuscitated','Paediatric and neonatal retrieval services','#####156','','','','Remember that meningococcal disease is notifiable.','Notificatiable diseases','#####148','','','','','','','');
INSERT INTO `MedHelp` VALUES (65,0,0,'N','Foreign body in airway','','','emerg-med','','','','Guideline','QSOB QSOC QFOB QWOR FB ','','Background','Most likely in 1-4 age group, although older children, particularly those with intellectual impairment are also likely to put things in their mouth.','Upper airway obstruction','#####111','','','','Obstruction of the upper airway due to foreign body aspiration should be suspected in the following circumstances :\n- Suggestive history\n- Sudden onset of respiratory distress with wheeze, stridor, coughing or gagging\n- Inability to ventilate a non breathing child where the airway remains obstructed despite adequate positioning\n \n If foreign body obstruction is present and subtotal :\n- Encourage child to continue coughing and breathing efforts as long as the cough is forceful\n \n Signs of total airway obstruction include :\n - ineffective cough (loss of sound)\n- increased respiratory difficulty\n- stridor\n- cyanosis\n- loss of consciousness','','','','','','','','','','','','','','','','','','','ENT referrals','#####175','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (66,0,0,'N','Radiation','Be aware of how much radiation you are using. \nDo not Xray young women\'s abdomens or lumbar spine without a very good reason.','ED','emerg-med','','','','Guideline','XRay AXR CT CXR','','','These are the radiation guidelines from the Royal College of Radiologists.','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (67,0,0,'N','The red eye','Visual acuity is the single most important assessment','ED','emerg-med','','','','Guideline','QEYE','','','','','','','','','This is a good description of the common causes of the red eye and their treatment','NEJM article on diagnosis and treatment of the red eye','documents/redeye.pdf','','','','','Eye examination','#####124','','','','','Chemical burns','#####6','','','','','Flash burns','#####7','','','','','','Superglue','#####8','','','','','Eye injuries','#####28','','','','','Conjunctivitis','#####27','','','','','Ophthalmology referrals','#####93','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','\n','');
INSERT INTO `MedHelp` VALUES (68,0,0,'N','Funnel web spider','','','','','','','Guideline','QBIT','','','','','','','','Background','1. It is the male rather than the female of fenus Atrax that is potentially lethal to man. The most common species is Atrax Robustus (found within 160 km. of Sydney).\n2. The bite of the male is extremely painful due largely to the direct trauma of the large, strong fangs. Surrounding erythema and localised pilo-erection and sweating rapidly develop.\n3. In most cases, little venom is injected and no illness occurs. However, symptoms of systemic envenomation may develop within 10-15 minutes. In suspected cases, any of the following suggest serious envenomation:-\n- Muscle fasciculation of the involved limb, tongue or lips\n- Marked salivation or lacrimation\n- Significant tachycardia or hypertension in a previously normotensive individual (late hypotension may occur)\n- Dyspnoea\n- Disorientation, confusion or deteriorating conscious state','','','','','','','','','','','Treatment','Real or Suspected Victim\n1. Ensure airway, breathing and circulation are maintained.\n2. Set up a well-secured IV infusion\n3. If first aid measures are adequate on presentation, they should not be removed since sudden release of the venom any precipitate a critical illness. Apply pressure/immobilisation first-aid if this is inadequate of has not already been done.\n\nIf appropriate, prepare for mechanical ventilation under relaxant anaesthesia, and antivenom administration.','Poisons centre','#####86','','','','','','','','','Antivenom','','Indications for Antivenom\nAntivenom is indicated where an effective bite from a dangerous species has produced any signs or symptoms of significant envenomation.\n\nAdministration of Antivenom\n1. Premedication with an antihistamine and a steroid parenterally is recommended. \n2. Adrenaline should not be given because of the widespread catecholamine release produced by the venom.\n3. At a starting dose of 2-4 ampoules, depending on severity, infuse antivenom IV, very slowly initially. Repeat in 15 minutes if there is no improvement.','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (69,0,0,'N','Gastroenteritis - child','','ED','emerg-med','','','','Handout','QUCH QDIR QVOM QWOR QABC','What is Gastroenteritis?','','Gastroenteritis (\'gastro\') is a bowel infection causing diarrhoea and sometimes vomiting. Diarrhoea means runny, watery bowel motions. The vomiting may settle quickly, but the diarrhoea can last up to ten days. In most cases no medicines are needed. Babies under 6 months can become ill very quickly with gastro because of the loss of fluids.','','','','','','','','','','Treatment','','Children with mild gastro can be looked after at home. The main treatment is to keep your child drinking fluids which are needed to replace fluid lost due to the vomiting and diarrhoea. It is important for the fluids to be taken even if the diarrhoea seems to get worse.\nDo not give medicines to reduce the vomiting or diarrhoea. They do not work and may be harmful.\nGive small amounts of clear fluid often. A mouthful every 15 minutes is best if your child is vomiting a lot.','','','','','','','','','','Key points to remember about gastro-enteritis','','Young babies and children can become dehydrated very easily - they need small amounts of fluid often.\n- babies under 6 months with gastro may need to be checked again by your doctor after 6-12 hours.\n- offer babies a drink every time they vomit. \n- Keep breast feeding. - If bottle feeding, do not stop formula for more than 12-24 hours \n- give older children one cup (150-200ml ) of fluid for every big vomit or case of diarrhoea\n- continue to give food if your child wants to cat. Do not stop food for more than 24 hours \n- your baby or child is infectious so wash your hands well with soap and warm water, particularly before feeding and after changing dirty nappies \n- keep your child away from other children as much as possible until the diarrhoea has stopped. ','','','','','','','','','','','Care at home','','Infant Feeding\nIf you are breastfeeding, continue to do this but feed more often.\nYou can give Gastrolyte as well. If bottle feeding, give Gastrolyte or clear fluids for the first 12 hours, then give normal formula in small, but more frequent amounts.\n\nClear Fluids\nYour child must keep drinking clear fluids. Castrolyte and Repalyte are different types of oral rehydration fluid which replace fluids and body salts. They can be bought at the chemist but if not available, give your child the other clear fluids listed below. For a baby up to nine months cooled boiled water should be used to dilute the drinks listed.','','','','','','Warning: The drinks must be diluted with water as they contain too much sugar. Too much sugar for a young baby which can make the diarrhoea worse.','','','','','','','','','','Food','','Your child may refuse food at first. This is not a problem as long as clear fluids are taken.\nDoctors now suggest there is no need to restrict food. Generally, if your child is hungry at any time, give them the food they feel like eating. DO not stop food for more than 24 hours.\n\nGo back to your doctor or hospital if:\n- your child is not drinking and still has vomiting and diarrhoea\n- your child has a lot of diarrhoea (8- 10 watery motions, or 2 or 3 large motions per day) or diarrhorea continues after 10 days\n- your child is vomiting frequently and seems unable to keep any fluids down\n- you think your child is dehydrated eg. not passing urine, pale and lost weight, sunken eyes, cold hands and feet, or hard to wake up\n- your child has bad stomach pain\nOR you are worried for any other reason. ','','','','','','','','','','','',' \n','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (70,0,0,'N','Gastro-oesphageal reflux - baby','','ED','emerg-med','','','','Handout','QUCH QVOM QWOR QABC QIRR QCRY','','','','','','','','','Reflux is very common in infants. It is caused by stomach contents spilling back into the gullet (oesophagus). Children with reflux usually, but not always, vomit after meals or bottles. The vomiting is usually forceful.','','','','','','','','','','','','Most babies with reflux are happy and thriving, despite vomiting. Some babies will have pain, similar to heartburn in adults, and be unsettled.','','','','','','','','','','','','','The aim of treatment is to reduce the amount of food or milk going back into the gullet. Smaller, thickened feeds given more often may help (see over). Changing from one formula to another hardly ever works. Sometimes your doctor may suggest a special position for feeding and sleeping.','','','','','','','','','','When to contact your doctor','','-	If your baby stops gaining weight.\n-	If vomiting increases or becomes forceful after every feed.\n-	If your baby appears unsettled and in pain.\n- 	If vomiting is bile stained (green), or has specks of blood in it.','','','','','','','','','','','','Most babies with reflux improve with age as solids are introduced and they begin to spend more time in an upright position.','','','','','','','','','','Thickened feeds: breast-fed babies','','Carobel\nAdd 1/2 to 1 scoop with 20ml cool boiled water or expressed milk and give before and during the feed.\n\nInstant Food Thickener\nMix 2 teaspoons to a paste with 20ml cool boiled water or expressed breast milk and give before, during and after feed.\n\nInfant Gaviscon Powder\nMix 1/2 to 1 teaspoon Infant Gaviscon Powder with 20m] cool boiled water or expressed breast milk and give either before, during or after the feed.','','','','Thickened feeds: bottle-fed babies','','Cornflour\nStep 1:\n3 teaspoonsof cornflour to each 600ml or one teaspoon to each 200mlof formula. Mix cornflour to a paste with a little cold water. Take half the amount of water to be used for the formula and heat. As the water heats, stir in the cornflour paste. Continue stirring while the mixture comes to the boil. Simmer and stir until thick.\nStep 2:	\nAdd remainder of water to cornflour mixture. Cool. Use cornflour water to prepare formula.\nStep 3:	\nMay need to enlarge the hole in the teat.\n\nCarobel\nUse 1/2 to 1 scoop per 100ml of formula in a bowl or jug. Mix in with a whisk.\nInstant Food Thickener\nUse 2 level teaspoons per 100ml of formula. Add to formula in bottle and shake well.\n\nInfant Gaviscon Powder\nUse 1/2 to 1 teaspoon Infant Gaviscon Powder for each 120mi of formula - add to the formula in the bottle and shake well.\nDue to the salt content in Infant Gaviscon, it is more acceptable to use cornflour and Carobel for young infants.','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (71,0,0,'N','Eczema - child','','ED','emerg-med','','','','Handout','QRAS QWOR','','','','','','','','','Eczema is a common itchy skin condition. The cause is not known, but it is more likely that there is a family history of eczema, asthma or hayfever. Most children grow out of eczema before 5 years of age, some have episodes later for short periods.','','','','Guidelines for treatment','',' ','','','','','','','','','','Anti-inflammatory/ anti redness creams','','1.	Cortisone cream (e.g. hydrocortisone, betamethasone) comes in different strengths, and if used carefully and sparingly is safe, as cortisone is a natural body hormone. Weak hydrocortisone cream is suitable for the face. Cortisone creams should be used intermittently, e.g. 2 days on, 2 days off.\nNOTE: If any creams irritate the skin or cause blisters, stop their use, apply plain moisturisers, and contact your doctor. This irritation is usually a flare up of eczema, not allergy. Sometimes a change of the cream which is white to an ointment base which is greasy will help this irritation.\n\n2.	Tar-based cream (e.g. Ichthammol) - this cream is usually used at night, under bandages for eczema on limbs.','','','','','','','','','','','Control the itch','','This is important as scratching damages the skin and may increase the likelihood of infection. It also becomes a strong habit even when the itch feeling is slight.\n\n1 .	Heat increases itch. Avoid overheating, particularly in bed. Cotton or satin sheets and cotton one piece pyjamas with mittens are best.\n2.	Keep moisturising cream in fridge, for soothing application when itch begins. Apply gently.\n3.	Apply wet or cool compresses over itchy areas. First cover with moisturiser, then compress, hold in place for 5-10 minutes. Re-apply more cream and compress, leave 2-4 hours, or more frequently if necessary.\n4.	Scratching often gets worse if a child is crying, stressed or angry. Try to distract your child, and ignore the scratching as much as possible. Never scratch or rub the child\'s skin for him or her.','','','','Control the dryness','','1.	Moisturising creams (e.g. sorbolene, paraffin) treat dry skin and may be applied frequently. A cream that is cheap and effective, which any pharmacist can make up is 50% liquid paraffin, 50% soft paraffin. Keep it in the fridge!\n2.	Bathe (preferably shower) once daily or less in cool water for 5 minutes at the most. Do not use soap: bath oils will clean as well as moisturise. If your child\'s skin is very dry, use moisturiser before and after the bath, as well as bath oil in it. If your child swims, apply oil/moisturiser before and after.\n3.	If the scalp is dry, shampoo only when necessary, using a bland baby shampoo or if scaly, an anti-dandruff shampoo diluted 1:5 parts with water.\n4.	Eczema can worse in winter due to the reduced humidity and dryness of a heated house. Keep the bedroom window open at night to increase humidity.','','','','','','','','','','Situations which make eczema worse','','1 .	Infections, particularly skin infection -antibiotics may be necessary and are sometimes needed urgently.\n2.	Dummies irritate eczema around the mouth.\n3.	Teething seems to cause eczema to flare up.\n4.	Washing detergents should be avoided. Use pure soap and rinse thoroughly twice.\n5.	Diet may have an effect on some children in early months. There are no general guidelines, each child must be assessed individually by your doctor. Breast feeding should be continued for as long as possible.\n6.	Sleeping may be interrupted and restless if your child becomes hot and itchy at night. Use moisturisers and cool compresses before bed, avoid bathing in warm water prior to bedtime, do not use too many bedclothes. A sedative may be prescribed by your doctor when eczema is severe, do not use all the time.','','','','','','','','','','Immunisation','','Your child should complete the course of triple antigen injections and polio medicines. If your child is allergic to egg, or has never had egg, discuss this with your doctor before the measles/ mumps/ rubella injection is due at 12-15 months.','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (72,0,0,'N','Nappy rash','','ED','emerg-med','','','','Handout','QWOR QUCH QIRR QCRY','','','','','','','','','Nappy rash is usually caused by prolonged skin contact with urine or faeces. To make the rash better and prevent it occurring again:\n\n1 . Keep the nappy area dry by frequent changing of wet or soiled nappies. Many people find that disposables are better in this respect.\n\n2.	At every change wash the area with warm water, pat dry, and put on the prescribed cream/ a heavy barrier cream/ paste.\n\n3.	Leave the nappy off several times a day. Fresh air on bare skin helps with healing.\n\n4.	Avoid the use of plastic pants and powders. If you are using disposable nappies, try a different brand. Plastic pants should not be worn at night.','','','','','','','','','','','','','','','','Care of  Cloth Nappies','','1.	Rinse used nappies immediately in cold water. If bleach or disinfectants are used, rinse out thoroughly before washing.\n\n2.	Wash nappies in hot water, using soap powder or liquid, and normal wash cycle on your washing machine. Take care not to over pack the washing machine.\n3\n.	Ensure the nappies are rinsed well and dried thoroughly.\nIf the rash does not improve within 5 days, please return to your doctor.','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (73,0,0,'N','Impetigo','','ED','emerg-med','','','','Handout','QRAS QWOR','','','','','','','','','Impetigo or school sores are caused by an infection of the skin. It is highly infectious, but if you follow these instructions the sores will clear up in a few days. ','','','','','','','','','','Treatment','','1.	Wash the crusts from the sores every 4 hours with the soap or the lotion suggested.\n2.	After each wash, pat dry and then apply ointment to the sores.\n3.	Give the antibiotic medicine or tablets as directed by your Doctor.','','','','','','','','','','','','','','','','','','','','','','','Preventing Spread','','1.	Washing hands after contact with sores.\n2.	Discourage your child from touching the sores by covering with clothes or a gauze dressing, (not bandaids).\n3.	Wash your child\'s bed linen and clothing separately.','','','','','','','','','','','','','','','','School','','Your child can go back to school if treatment has been commenced and the sores are covered.','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (74,0,0,'N','Scabies','','ED','emerg-med','','','','Handout','QRAS QWOR','','','','','','','','','Scabies is caused by itch mites which burrow just beneath the surface of the skin.\nThe itch mites cause an allergic rash and make the skin very itchy, especially at night. Scabies is very infectious (contagious) and is usually spread by skin-to-skin contact. The mites do not live for very long outside the human body. Scabies is not due to poor hygiene.\nYour child is contagious until the itch mites and their eggs are killed by treatment,\nand must not go to day care/ kindergarten/ school until the treatment is complete. You must tell the day care centre/ kindergarten/school that your child has scabies so that they can check the other children for scabies.','','','','','','','','','','Treatment','','All family members should be treated at the same time.\n1.	It is best to have a shower/bath before starting treatment. Use a clean flannel and towel and allow the skin to dry and cool before applying the lotion or cream ordered by the doctor.\n2.	Cover all the skin surface from the neck down to tips of toes with the lotion/cream ordered by the doctor. Make sure areas such as under the nails and genitals are treated. It is very important that you are very thorough, and cover the skin completely. (if you use a paint brush to apply the lotion, it is best to use one paint brush per person and then throw it away after use). Put on clean clothes.\n3.	Make sure the person who is being treated does not wash their hands after the treatment, and be careful not to let them rub their eyes.\n4.	All clothes, bed linen and soft toys used in the past 48 hours will need to be washed if possible. All items that cannot be washed should be placed in a plastic bag, sprayed with an insect repellent and tightly closed for 48 hours. This will kill any eggs or mites. It is best to also vacuum the house carpets, any floor rugs, and mattresses.\n5.	DO NOT have a wash/shower/bath for 24 hours after applying the lotion or cream.\n6.	After 24 hours wash in the usual way.\n7.	TREATMENT IS NOW COMPLETE.\n8.	DO NOT repeat the treatment again without medical advice.\n9.	It usually takes about 7-10 days for the allergic itch to settle after treatment. This does not mean that Scabies is still there.','','','','','','','','','','','','','','','','','Go back to the doctor if','','the itchiness continues after 2 weeks or happens again.\nsores and/or boils develop where the itchy areas were.','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (75,0,0,'N','Middle ear infection - otitis media','','ED','emerg-med','','','','Handout','QUCH QWOR QVOM QIRR QCRY','','','','','','','','','','','','','','Background','Middle ear infections (otitis media) are among the commonest illnesses of childhood. It is not unusual for children under school age to get three or four ear infections each year.\n\nEar infections usually follow coughs and colds. The child will often start with a runny nose or cough, and then develop earache, fever, irritability, or discharge of fluid from the ear. Sometimes ear infections are only diagnosed when the doctor is examining the ears for other reasons.','','','','','','','','','','','','','','','','','Medicine','Treatment','Most of these infections will get better on their own, as they are caused by blockage of the Eustacion tube (the tube connecting the ear with the throat) by swelling\n\nA recent article suggested that you have to treat 18 children with antibiotics to reduce the pain for one child for one day. Therefore giving out antibiotics to everybody costs a lot of money, and doesn\'t help the children much, and makes the real bugs resistant to antibiotics when we need them.\n\nTherefore unless the ear is very red and sore, the doctor will usually not give antibiotics, but would keep an eye on it. This may mean going back to your doctor if it is getting worse. \n\nIf the ear infection is treated with antibiotics, it is important that the child take at least a 5 day course to make sure the infection has been treated properly, even if the child is better after a day or two. \n\nDecongestant medications are sometimes recommended, but are of limited help. \n\nAntibiotic drops can be used if there is also an infection in the outer ear canal.\n\nParacetamol can be given for pain or fever - check the dose with the pharmacist if your child still has pain, as the dose on the bottle is often lower than the most effective dose.','','','','Other','','Sometimes a hot water bottle wrapped in a towel placed against the ear also helps relieve pain.\n\nThe child should not go swimming or place his/her head under water until the ear infection has been treated.\n\nDon\'t try to clean out the ears with cotton buds, even if there is discharge from the ear. What you can\'t wipe away with a face cloth should be left alone.','','','','','','','','','','Follow Up','','Parents should call the doctor if their child\'s symptoms are not improved within 72 hours after starting treatment; a more serious infection may be developing.\n\nOne of the main problems with ear infections is that fluid builds up behind the eardrum, and sometimes this fluid persists even after the infection has been treated. Fluid in the ears affects hearing, and if hearing loss persists for long periods it can affect the child\'s speech development and behaviour.\n\nWe recommend that your child\'s ears be checked again by your doctor six to eight weeks after the ear infection is diagnosed. \n\nThose children who have persistent fluid in their ears for three or more months should be referred to an Ear Nose and Throat specialist.','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (76,0,0,'N','Asthma - child','','ED','emerg-med','','','','Handout','QSOC QUCH','','','','','','','Background','','Asthma is a common condition in which there is narrowing of the small air passages (bronchial tubes) in the lungs. The narrowing is caused by tightening of the muscle in the wall of the bronchial tubes and by an increased production of mucus. This reduces the flow of air in and out of the lungs and results in wheezing, cough, and difficulty breathing. The narrowing of the bronchial tubes may be triggered by factors which vary from child to child. \nColds, changes in the weather and exposure to cigarette smoke, dust and some plants and animals can all bring on an attack. Most children with asthma only have occasional episodes of mild wheezing and about half will \"grow out\" of the condition as they get older. With proper treatment almost all children with asthma should be able to participate in sports and lead normal lives.\nMost medicines used to treat asthma work by opening up the narrowed bronchial tubes. Other medicines work by preventing the narrowing from occurring in the first place. Most children with asthma will need to take their medicines for 2-3 days until their wheezing settles; others will need to take medicines every day to prevent attacks; a small number may need treatment for their asthma every day.','','','','','','','','','','Medicine','','Asthma medicines come as:\n1.	Solutions to be inhaled as a mist from a hand held inhaler (metered dose inhaler, sometimes used with a spacer), or from a nebulizer driven by a pump.\n\n2. Dry_powders to be inhaled from a hand held, inhaler (spinhaler or rotahaler). \n\n3. Liquids, tablets or sprinkle to be swallowed.\n\nCombinations of medicines are often necessary. Inhaled medicines are more effective. Most children over the age of 3 years can be taught to use one of the hand held inhaler devices.\n\nAntibiotics and antihistamines are not helpful in treating asthma in children. ','','','','','','','','','','','REMEMBER:','','1.	Make sure you and your child understand how to take the asthma medications - how much, how often, and the correct way to use the inhaler - if you are not sure ask your doctor.\n\n2.	Children with asthma may not be very good at judging the severity of their symptoms. Often they say they feel fine even though their asthma is poorly controlled and may be severe. Children over the age of 6 or 7 years with troublesome asthma should have a peak flow meter at home. This is a hand held device the child blows into which measures how narrow the air passages are.','','','','','','','','','','Your child needs to be checked by a doctor and may need a change in treatment if:','','a.	wheezing, breathlessness or cough persists or worsens despite medication.\nb.	inhalations are needed more often than every 3-4 hours, or 1-2 inhalations do not immediately give good relief.\nc.	he or she is unable to exercise or play normally, or can\'t keep up with other children.\nd.	sleep is frequently disturbed because of cough or wheeze.\ne.	medication is needed immediately on waking in the morning or can\'t wait until after breakfast.\nf.	medication requirements are increasing.\ng.	peak flow measurements are less than 60% of the best he or she can normally do, and do not return to normal after an inhalation treatment.','','','','','','','','','','School','','Let school teachers know about your child\'s asthma and its treatment. Sport and exercise should be encouraged, not limited or avoided. Some children benefit from taking inhaled medicine just before exercise to prevent wheezing.','','','','','','','','','','Other','','Some asthma medicines may make your child a little over-active or jittery (eg. salbutamol) while other medicines may cause nausea, vomiting or irritability (eg. theophylline). These symptoms should be reported to your doctor if they persist -do not stop the medicine without telling your doctor.\n\nAvoid smoking. Keep pets outdoors if the child is sensitive to them.\n\nFood allergies are a rare cause of asthma. Foods should be removed from your child\'s diet only after careful testing by a specialist and with advice from a dietician.','','','','','','','','','','','','IF YOU HAVE ANY QUESTIONS ABOUT YOUR CHILD\'S ASTHMA,\nMAKE SURE THAT YOU ASK YOUR CHILD\'S DOCTOR.','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (77,0,0,'N','Bronchiolitis','','ED','emerg-med','','','','Handout','QSOC QUCH QIRR','','','','','','','','','Bronchiolitis is a common infection in young children. It occurs mainly in babies. It is caused by a virus. This virus usually causes a cold, but sometimes affects the small breathing tubes in the lung, causing bronchiolitis.\n\nThe illness begins as a cold. After a day or so, the baby begins to cough, and the breathing gets rapid and sounds wheezy. This problem with breathing may result in feeding difficulties. Sometimes children may need to be admitted to Hospital because of breathing or feeding difficulties.\n\nMedicines do not usually help babies with bronchiolitis. They need to rest, and to take small amounts of fluid (i.e. milk or milk and water) frequently, so they don\'t get too tired when feeding. \n\nParacetamol may be used for fever, which is usually not high. If the breathing gets very rapid and the baby seems very tired, or if you are worried for any other reason, you should consult your doctor or take the baby to your local hospital. \n\nIf the baby also becomes very pale and sweaty, do not delay in seeking help.\n\nBabies with bronchiolitis are usually sick for 3-5 days, then recover over 2-3 days. However, the cough may continue for 2-3 weeks.\n\nBronchiolitis is an infectious disease, and contact with other babies should be avoided.','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (78,0,0,'N','Croup','','ED','emerg-med','','','','Handout','QSOC QUCH QIRR','','','','','','','What is Croup?','','Croup is a viral infection of the voice box (larynx) and windpipe (trachea). It usually affects children up to 5 years of age. Croup often begins like a normal cold followed by a harsh, barking cough, described as \'croupy\'. This often occurs at night when the air is cooler.\n\nYour child\'s voice may be hoarse and develop a noise when breathing in, called \'stridor\'.\n\nCroup may last for 3-4 days. Some children have repeated attacks of croup. There is no way of preventing croup as it is caused by a number of viruses.','','','','','','','','','','Care at home','','fever and is irritable give paracetamol. Antibiotics do not help as croup is caused by a viral infection. A mild attack of croup will sometimes settle by nursing your child in a warm room.\nSome parents find it helpful to take their child into the bathroom, and turn the hot water tap on to let the room warm and steam up. (Do not leave your child alone in the bathroom with the hot water tap on).','','','','','','','','','','','Key points to remember about croup','','there is no specific treatment for croup and it usually gets better in 3-5 days	\na short course of steroids may help reduce the swelling in the larynx, and does not give any of the side effects of long term steroids.\ncroup can get worse quickly\nin a severe attack your child needs to be seen by doctor and observed in a hospital','','','','','','','','','','','','Doctors are not convinced that breathing in steam, or using vaporisers helps croup. However, this treatment is used by many parents and does not cause any harm as long as the room is well ventilated. Other parents keep their child calm by sitting quietly or watching a video and seeing if the croup settles.\n\nCroup often becomes worse at night, so your child may be more settled if someone stays with them. Your child may also breathe more easily if they are sitting up or lying against 2-3 pillows for support. (Do not leave an infant under 2 years unsupervised with pillows). \n\nIf the croup attack is severe it will need to be managed in hospital. Most children do not need any other specific treatment once they are being closely watched in hospital.','','','','','','','','','','Go back to your doctor or hospital if:','','- your child\'s breastbone sucks in when breathing in\n- your child is struggling to breathe\n- your child has stridor (the noise made when breathing in) when at rest\n- your child looks very sick, becomes pale and drowsy, or their lips are blue in colour. In this case call an ambulance immediately. \nOR you are worried for any other reason.','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (79,0,0,'N','Infections','','ED','emerg-med','','','','Handout','QSOC QUCH QIRR QCRY QVOM QDIR QLIM','','','','','','','What causes infections?','','Infections are caused by a large number of different germs; the most common are viruses and bacteria.\n\nViruses are smaller than bacteria and cause most of the infections in children. They cause \"colds\", \"flu\", sore throat, gastroenteritis and many other infections. There are no medicines available yet to cure these viral infections- However children do get better themselves because their body fights the infection.\n\nBacteria also cause many infections. These include some ear infections, urine infections, tonsillitis, pneumonia and blood infections. For these infections doctors prescribe antibiotic medication.\n\nThese medications may take 24-48 hours to have an effect and are taken for 5- 10 days. During this time your child may still be unwell.','','','','Antibiotics are not used for viral infections because they do not work.','','Many young children will get a viral infection when they start mixing with other children at child care or pre-school. This means they might have on average about 8- 10 infections each year.\n\nThese will usually be:\n-	colds (runny nose, fever, etc.) which do not need antibiotics, or\n-	tonsillitis or ear infections where antibiotics may be prescribed by your doctor.','','','','','','','','','','Key points to remember about infections','','-	viral infections like a \"cold\" or \"flu\" are not treated with antibiotics\n-	if the doctor thinks your child has a bacterial infection and gives you antibiotics, it is important to finish the whole course of medication or the infection may return.','','','','','','','','','','','Care at home','','If your child has an infection try:\n- to make your child more comfortable\n- to give your child lots to drink - clear fluids (e.g. water or diluted cordial or fruit juice) are best. Give small amounts often. Do not worry if the child refuses to eat at this time\n- if your child has a fever over 38.5\'C and has other symptoms such as irritability, earache or headache, give your child paracetamol.\n\nGive every four hours in the prescribed dose. Do not give paracetamol for more than 2 days without seeing a doctor\n- have the child rest as much as they want to\n- return your child to a well balanced diet when they are better.','','','','','','','','','','Go back to your doctor or hospital if:','','- your child refuses to drink\n- your child becomes pale and sleepy\n- your child is vomiting\n- your child has not improved in 48 hours\n- your child has pain which is not improved with paracetamol\n- your child has difficulty breathing.\nOR you are worried for any other reason.','','','','','','','','','','','','','','','','','','','','','','\n','',' If your child\'s condition gets worse or changes suddenly bring them to a hospital Emergency Service near your home.','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (80,0,0,'N','Febrile convulsions','','ED','emerg-med','','','','Handout','QFIT QIRR QUCH fit seizure ','','','','','','','What is a Febrile Convulsion?','','When a child has a convulsion they become unaware of their surroundings, jerk or twitch, may appear to have difficulty in breathing, and become unconscious. Convulsions are also known as fits or seizures. \n\nAbout 3% of young children will have a febrile convulsions at some time. They are brought on by a high fever which is usually caused by a viral infection. Not all fevers will cause a febrile convulsion. It is the sudden rise in temperature, not how high it is, which causes the convulsion.\n\nAfter a convulsion the child will be sleepy for a while and then return to normal.\nA convulsion can be a frightening event for parents but it is important to remember that your child will not be harmed. It will not result in brain damage, epilepsy or death.\n\nEven though convulsions are uncommon, it is helpful to know what a convulsion is in case your child has one.\nSometimes a convulsion happens when parents are not aware their child has a fever.','','','','','','','','','','Key points to remember about febrile convulsion','','- they are more common in children between 6 months and 4 years old\n- they do not result in brain damage, epilepsy or death\n- they often happen when parents are not there to see it\n- some children may have more than one convulsion\n- not all fevers will cause a convulsion.','','','','','','','','','','','If your child has a convulsion','','Try and stay calm.\n\n1 .	Lie your child on their side and stay with them. Call out for help. Do not lie your child on their back.\n\n2.	Call an ambulance (telephone 000). A convulsion usually lasts a few minutes and sometimes up to 15 minutes. After the convulsion has stopped your child will be drowsy for some time. Stay with your child and keep them resting on their side.\n\n3.	Go to your doctor or nearest hospital as soon as possible after the convulsion has stopped. This is important to check that there is not something serious causing the fever. Do not wait until the next day.','','','','','','','','','','','','','','','','Go back to your doctor or hospital if your child shows signs of illness such as:','','your child looks sicker than before\nyour child complains of a stiff neck or light hurting their eyes\nyour child has difficulty breathing\nyour child refuses to drink anything\nyour child is vomiting a lot\nyour child is drowsy\nyour child has not improved in 48 hours\nyour child is in pain.\nOR you are worried for any reason in the next few days.','','','','','','','','','','','','','','','','','','','','','','','',' If your child\'s condition gets worse or changes suddenly bring them to a hospital Emergency Department','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (81,0,0,'N','Plaster instructions','','ED','emerg-med','','','','Handout','QPOP QLIM QLIC pop ','','','','','','','Why have I got a plaster?','','A plaster cast helps to keep injured bones protected and in the correct position while healing takes place. \nAfter the plaster has been put on it can take up to two days to dry completely so it needs to he handled with care. \nAsk your doctor exactly what physical activity you/ your child can do once the plaster has been put on.','','','','','','','','','','Care at home','','On the first two days (48 hours) it is helpful to :\n-	move their fingers or toes on the injured limb\n-	Raise (elevate) the arm or leg on pillows above the level of the heart when sitting or lying down. This helps reduce the pain and swelling.\n-	Take paracetamol/ painkillers prescribed for pain relief if needed every 4 hours, and rest.\n\nThe day after the plaster has been applied, go to your local doctor for a plaster check. It is very important that you keep this appointment to make sure the plaster is setting well and not too tight.','','','','Swelling/ numbness/ blueness','','If there is swelling, numbness or blueness of fingers or toes, raise the plaster above the level of the heart (chest) for 20-30 minutes. \nIn the case of an arm, raise it above the head. In the case of a leg, raise it when lying down. Swelling, numbness or blueness of fingers or toes, may mean the plaster is too tight. \nIf the symptoms do not go away after 30 minutes then it is important to see your doctor immediately.','','','','','Specific Instructions','','Plastered arm - when sitting down, support the arm on a number of pillows or on the arm of a chair. When walking around in the first 48 hours, a sling should be worn for support. The hand should not be below the level of the elbow while in the sling.\n\nPlastered leg - sit or lie with the leg raised up on pillows. Small children are not safe on crutches and will need to be carried or pushed in a stroller or wheelchair.','','','','Key points to remember about plasters','','- the plaster can take up to 2 days (48 hours) to dry\n- if the plaster does get damp, dry with a hair dryer on a low setting\n- exercise the fingers or toes	\n- itching may be a problem but do not scratch by putting anything under the plaster.\n- keep the cast dry and out of water	\n- when washing cover plaster with a plastic bag to prevent splashing','','','','','','','','','','Go back to your doctor or hospital if there is:','','- swelling or blueness of fingers or toes\n- pain which doesn\'t go away when given paracetamol or when the arm or leg is raised for 20-30 minutes\n- difficulty with easily moving fingers or toes\n-numbness or loss of feeling in fingers or toes\n- a bad odour (smell) is coming from inside the plaster\n\nOR if the plaster breaks, cracks or softens.\nOR you are worried for any reason.','','','','Your Next Appointment','','\n\nYou will be seen at...................................................Clinic\n\n\n\nOn................................day..........................................month\n\n\n\n\nArrive at .........................................................................time','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (82,0,0,'N','Crying and unsettled babies','','ED','emerg-med','','','','Handout','QUCH QIRR QCRY QWOR colicky unwell ','','','','','','','','','\"Colic\" has been the common word used to describe regular times of crying and not settling in a baby. It is now more widely understood that \"colic\" refers to the normal range of unsettled behaviour in many babies. \n\nThis can be very demanding and exhausting for parents. \nThis crying and fussing can happen at any time, but often occurs in the late afternoon and evening, especially in babies between 2 weeks and 4 months of age. It is very common for young infants to have crying and unsettled times. ','','','','What causes the crying?','',' Sometimes there is a medical reason for the baby\'s crying and this may need to be checked by a doctor or nurse. However, in most babies no medical cause is found. \n\nYoung babies cry as a normal response to any sort of discomfort or stress. Sometimes the causes of the discomfort may be a wet nappy, being too hot or too cold, wind, hunger, or tiredness. \n\nThis crying is a normal part of their growth and development. The temperament of some babies makes them more likely to cry for longer periods and to be more difficult to settle. These babies seem more tense when there are minor irritations or changes and they are difficult to settle into a predictable routine. \n\nSome babies seem to cry more than others this does not necessarily mean that there is anything wrong, rather that all babies respond differently. \n\nParents also worry that crying is caused by something they have done or not done, and this can sometimes affect their confidence in handling their baby. Parents should be reassured that a number of things can help them with a difficult baby. The most important is to get support from the family and talk to a health professional such as a maternal and child health nurse or doctor.','','','','','','','','','','KEY POINTS TO REMEMBER ABOUT CRYING & UNSETTLED BABIES','','being unsettled and crying is very common in young babies up to 4 months old \nthe temperament of some babies makes them more likely to cry for longer periods and be more unsettled\nsometimes there is a medical reason for the baby\'s crying	\ntry and have breaks from your child, or have an afternoon nap before the early evening\ncomfort your baby if they seem distressed','','','','','','','','','','','Care at home','','Let your baby suck at the breast or bottle. It may help them to settle for a short period your nurse or doctor can advise you on feeding and the amount of milk your baby needs.\nGently rock or hold your baby in your arms or in a baby carrier or sling.\n\nContinue to speak softly to your baby - your voice and presence may help soothe them, as may soft music.\nTry giving a warm bath.\nUse a dummy - it may provide comfort sucking to help your baby settle.\n\nThe demanding evening time may be easier if you plan around it. e.g. carry the baby in the evening and eat earlier.\nSoften the lighting - some babies are distressed by looking up into harsh lights.\nTry baby massage - this may calm the baby and also help you relax.\n\nIf possible try and get support from family and friends and have a break from the baby so you can relax.\nIf your baby is crying for most of the day then it is important to get support and talk to a health professional during this difficult time.\nTalk with other parents about things that have helped them.\nRemember, you cannot spoil your baby by too much cuddling or feeding.','','','','','','','','','','Medication','','Medication is not recommended as it calms babies and makes them sleepy. Medication should be used on the advice of a doctor and then only for a short period of time.','','','','','','','','','','Go back to your doctor if:','','you would like the doctor to check there is no medical cause for the crying\nyour baby is refusing feeds or is having less than half their normal feeds\nyour baby does not seem to settle with any of the things you are trying\nyour baby continues to cry for long periods\nyou feel you are not coping\nOR you are worried for any reason.','','','','','','','','','','Other support','','For more general information see your local Maternal and Child Health Nurse.','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (83,0,0,'N','Head injury - child','','ED','emerg-med','','','','Handout','QMUL QHIN QTRU brain ','','','','','','','What is a head injury?','','An injury to the head can be caused by a bump, fall, or blow to the head or result from a sporting or a car accident. When a child sustains a head injury, they may or may not have lost consciousness during this time. They may vomit and appear drowsy, confused, and unaware of their surroundings.\nConcussion is usually defined as any loss of consciousness. Concussion can lead to your child being confused and not being aware of their surroundings. It is usually not serious, but a child who has had concussion needs to be checked carefully by a doctor.\nThe main concern is to identify if the injury to the head has affected the brain. An ordinary skull x-ray to check for a break or crack in the bone in the head is usually not required.\nInternal damage such as swelling or bruising of the brain cannot be detected by an ordinary x-ray. Some children may need a CT scan (a special x-ray that looks at the brain) to help assess their injury.\nMost children with a minor head injury make a full recovery.','','','','','','','','','','Key points to remember about head injury','','Most children with minor head injury make a full recovery\nAny injury to the head needs careful observation to check if the injury has affected the brain - even in a minor way\n\nTo prevent head injury\n- use child restraints/seat belts in cars\n- closely supervise toddlers and children near heights and on stairs and playground equipment\n- encourage children to wear helmets when cycling, skateboarding, snowboarding, roller-blading, or horse riding.','','','','','','','','','','','What problems does head injury cause? ','','Headache \nYour child may he in discomfort. Give paracetamol every 4-6 hours to relieve pain. If your child\'s behaviour is very different to their normal behaviour, or the pain does not go away, go back to your doctor. \n\nVomiting \nYour child may vomit two or three times in the first hour or two after the injury. If the vomiting continues, go back to your doctor.\n \nDrowsiness \nImmediately after the head injury your child may be sleepy. There is no need to keep your child awake if they want to sleep. If your child goes to sleep, wake them every to check their condition, and their reaction to familiar things. ','','','','','','','','','','','','','','','','Care at home','','Some problems which may result from a minor head injury can be hard to detect at first. In the next few days parents may notice irritability, mood swings, tiredness or concentration problems in their child. Their behaviour may be different from behaviour before the injury.\nTalk to your doctor if you are worried about any of these signs. Most children with minor head injury make a full recovery.','','','','','','','','','','What do I do if my child has a convulsion?','','A fit, or convulsion is when a child suddenly jerks or twitches and may appear to have difficulty breathing and becomes unconscious. A fit or convulsion occasionally happens after a head injury. If this happens:\n1. Try and stay calm. Lie your child on their side with their head lower than their body. Put something soft under their head to rest on. Do not put anything in you child\'s mouth.\n2. Stay with your child until the fit is over. Telephone an ambulance and have your child checked by a doctor as soon as possible.','','','','','','','','','','Go back to your doctor or hospital immediately if','','- your child has unusual or confused behaviour\n- your child has severe or persistent headache which is not relieved by paracetamol (irritability in a baby)\n- your child has frequent vomiting\n- your child has bleeding or discharge from the ear or nose\n- your child has a fit or convulsion, or spasm of the face or arms or legs\n- your child has difficulty in waking up\n- your child has difficulty in staying awake.\nOR you are worried for any reason.','','','','','','','','','','','',' \n\n','','','');
INSERT INTO `MedHelp` VALUES (84,0,0,'N','Angina medication','If the pain doesn\'t go away, call an ambulance','','','','','','Handout','QCHP QCOL heart MI cardiac drug GTN anginine spray nitrate ','','','','','','','','','','','','','What is angina ?','','Angina is the feeling that you get in the chest, a discomfort or pain, which is caused by insufficient blood/ oxygen getting to the heart muscle.','','','','','','','','','','What does it feel like ?','','Different people get different feelings (symptoms) when they are having angina. More common features are:\n- Squeezing, pressing (like a heavy weight), or burning chest pain . The pain may go to the arms, throat, jaw, back or shoulders.\n- It can be brought on by excitement, large meals, exertion, or cold air.\n- A feeling of shortness of breath. This may be the only indication, particularly in people with diabetes.\n- Palpitations, dizziness, or feeling faint.\n- Sweating, or clammy skin.\n- Nausea (feeling like you want to be sick) or vomiting. ','','','','','','','','','','','What should I do when I feel my angina come on ?','','1. Sit or lie down. Rest and stay calm\n2. Always carry either fresh GTN (nitrate) tablets or spray. The tablets lose their strength after about one month of the bottle being opened, so need to be replaced. The spray has a much longer shelf life.\n3. Put half or one whole tablet under your tongue or in the side of your mouth until it dissolves/ spray under your tongue. Chewing the tablet can speed up the effectiveness. The tablet does not work if swallowed. If the tablet is giving you a bad headache, spit it out or swallow it.\n4. Take the tablet or spray as soon as you get the symptoms. Do not wait until the pain is severe. If you know that you are going to get the pain e.g. you are going to climb stairs, it is better for your heart to take it before starting.\n5. If you still have symptoms in five minutes, take another tablet/ spray.\n6. If you still have the symptoms after another five minutes, take a third and final tablet/ spray.\n7. It is important to leave only five minutes between each tablet to give a strong burst of medication into the bloodstream.\n8. If you still have symptoms after the third tablet, then telephone an ambulance:\nIn Australia, dial 000.\nIn the UK, dial 999.\nIn the USA and Canada, dial 911.','','','','','','','','','','How can I  prevent angina attacks ?','','1. Take your tablet/ spray before doing any exercise.\n2. Regular mild exercise helps the heart grow new blood vessels, which can increase the oxygen that the heart can get.\n2. Tell your doctor. Your doctor can prescribe medicines which can help prevent angina attacks. The drugs called beta blockers are still the best for this, and there are some newer drugs which may also help. Taking half an aspirin talbet a day helps prevent heart attacks and strokes.','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (85,0,0,'N','About these guidelines and protocols','','ED','emerg-med','','','','Information','','','Information','These guidelines and protocols are maintained by the emergency department senior medical staff. They also include handouts, ECGs, X-rays, video. \nTo submit/ suggest changes to a page, send an email to the web maintainer.','','','','What is the difference between a guideline and a protocol?','','A guideline is a set of principles which is designed to help you deal with most situations, most of the time. They are not mandatory, but if you do not choose to take their advice, you should be able to defend your reasoning.\n\nA protocol is more rigid/ prescriptive. It is a description of \"the way we do things around here\". A protocol is a set of actions which should take place in response to a closely defined stimulus e.g. would be the ATLS protocol.','','','','','','Pictures up to 500 kilobytes can be loaded into the database. Pictures should not generally be larger than 150 kilobytes, and should be in jpg, gif or png format.','','','','','','Other types of file can be linked to, by putting them in the \"documents\" file, and then linking to them e.g. \"documents/yourfilename.pdf\" for an adobe acrobat file or \"documents/yourfilename.mpg\" for video.','','','','','','Internet links are easy to set up - just remember to use the http://www part of the address.','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
