INSERT INTO `MedHelp` VALUES (88,0,0,'N','Journals - general medicine','Don\'t waste time absorbing poor quality information.','ED','emerg-med','','','','Information','nejm bmj lancet jama','','Advice','The yield of useful information from journals is very variable.\n\'How to practice and teach Evidence Based Medicine\' (Sackett et al) gives this useful table of where good information is likely to be found','New England Journal of Medicine','www.nejm.org','','','','','Lancet','www.thelancet.com','','','','','Journal of the American Medical Association (JAMA)','','','','','','British Medical Journal (BMJ)','www.bmj.com','','','','','Annals of Internal Medicine','','','','','','','EBM book','documents/ebm/EBMTOC.PDF','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
