INSERT INTO `MedHelp` VALUES (93,0,0,'N','Ophthalmology referrals','Penetrating injury is an emergency- antibiotics and urgent ophthalmic review are necessary','ED','emerg-med','','','','Information','QEYE QFOB QWOU eye injury FB ','','Background','The ophthalmologists are contactable by phoning the eye clinic in Marion House (StJoG).','','','','','Comments','Out of hours, they can be extremely hard to find. This is partly because they are not paid to be on call.\nStart with the phone number given from the Marion House answer machine, Try their home number, but don\'t waste a lot of time.','','','','','','If no success, consult the on-call/ emergency Registrar at The Eye and Ear Hospital in Melbourne.','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
