INSERT INTO `MedHelp` VALUES (96,0,0,'N','Bronchiolitis','Admit all with O2 sat less than 91%, or who the parents are not coping, for whatever reason','ED','emerg-med','','','','Paediatric Guideline','QSOC QAST QUCH QWOR ','','','','','','','','History','- pre-existing disease\n- level of activity\n- oral intake - number of wet nappies\n- progress : is child stable, improving or deteriorating ?\n','','','','','Examination','- cough\n- fever\n- signs of respiratory distress : grunting, nasal flaring, tachypnoea, retractions & wheeze\n- cyanosis & decreased oxygen saturation\n- dehydration secondary to decreased oral intake\n','','','','','','','','','','','Tests',' Nasopharyngeal Aspirate :\n- For viral isolation\n- Generally performed in all children admitted with bronchiolitis\n \nChest Xray :\n- Generally not indicated\n- Consider chest Xray if :\n- atypical history\n- suspicion of bacterial pneumonia\n- severe illness\n- age less than 6 weeks\n \nArterial Blood Gases :\n- Not a routine investigation, perform only if infant is severely ill\n \nOther Blood Tests :\n- As a rule, blood tests are not indicated & not useful\n- FBE, CRP & blood cultures may be performed if suspicion of bacterial lower respiratory tract infection or if severely ill.\n \n','','','','','','','','','','','','Treatment',' Treatment Guidelines :\n- Treatment is generally supportive with provision of oxygen for hypoxia and maintenance of hydration\n- Infants with mild bronchiolitis can generally be managed at home with review by the local medical officer\n\n- Parents should always be given guidelines as to when to return :\n- increasing respiratory difficulty\n- lethargy\n- decreased oral intake\n- any parental concerns\n - Even if degree of respiratory distress is mild, consider admission for observation if :\n- age less than 6 weeks\n- pre-existing underlying cardiorespiratory disease\n- Admit all infants with moderate to severe bronchiolitis\n- Treatment in these infants is supportive :\n- administer oxygen to maintain oxygen saturation > 91%\n- carefully monitor fluid intake\n- if fluid intake severely reduced, commence IV fluid replacement at 2/3 normal maintenance rate\n- antibiotic treatment is not indicated','Bronchiolitis handout','#####77','','','Disposition',' Indications for transfer to tertiary hospital (for PICU) :\n \n An infant with severe bronchiolitis may require transfer if :\n- the required FiO2 to maintain adequate oxygen saturation exceeds 50%\n- there is evidence of frequent periods of apnoea or hypoventilation\n\nTransfer of the severely ill infant with bronchiolitis should be undertaken by an appropriately qualified medical escort and should only be undertaken after the infant has been stabilised. If intubation is required, this must be done prior to transfer.\n','Paediatric Retrieval Service','#####156','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (97,0,0,'N','Croup','Observe closely with minimal interference. \nO2 saturation does not drop until pre arrest, so not helpful\nAdmit all with stridor at rest, or if parents unable to cope. ','ED','emerg-med','','','','Paediatric Guideline','QSOC QUCH QWOR','','Background','Severe upper airway obstruction is a medical emergency\n- A child who is already cyanosed is critically ill (pre arrest)\n- As a child becomes physically exhausted, signs such as stridor, retractions & air entry may decrease\n- All children with stridor must be reviewed by the Emergency Department registrar or consultant prior to discharge or ward admission\n- Children at risk of increased obstruction include those with pre-existing upper airway narrowing (eg. subglottic stenosis) or Down Syndrome\n- Do not separate child from caregivers\n- Allow child to take up position of comfort\n- Observe closely with minimal interference','','','','','','','','','','','Examination','- constitutional state ( fever, toxicity, pulse and respiratory rate)\n- stridor\n- drooling\n- cough\n- speech\n- tachypnoea\n- tracheal tug\n- intercostal, subcostal and supraclavicular retractions\n- asynchrony of chest and abdominal wall movements\n- cyanosis\n\nStridor, only heard when the child is crying/ distressed is mild croup.\nIf stridor is present at rest, the child has moderate or severe croup.\nIf the child is tired, it is severe croup.','','','','','','','','','','','','','','','','','Mild croup','Treatment','Can usually be managed at home\n- Explain condition to parents\n- Reassure and provide printed information or advice sheets\n- Give clear and if necessary written guidelines as to criteria for return :\n- decreased fluid intake\n- increasing distress / agitation / dyspnoea\n- increasing stridor\n- persistent stridor\n- any concerns by parents\nConsider admission if :\n- parental anxiety\n- lack of adequate supervision at home\n- poor social circumstances\n- lengthy distance between childs home and hospital','Croup handout','#####78','','Moderate croup','','All children with stridor at rest should be admitted to hospital.\n- Carefully observe fluid intake and respiratory status\nGive steroids :\n- prednisolone orally 2mg/kg OR\n- dexamethasone IMI 0.6mg/kg\nWatch for signs of deterioration including :\n- rising pulse & respiratory rate\n- increasing stridor and retractions\n- the appearance of restlessness and / or agitation\n\nConsider the use of :\n- nebulised adrenaline (1:1000) : 0.5ml/kg,maximum 5ml\n- The decision to use nebulised adrenaline is to be made by the ED consultant or registrar on duty or the paediatrician on call\n- No child who receives nebulised adrenaline is to be discharged within 4 hours.','','','','Severe croup','','- If there is an initial response to nebulised adrenaline, but a further dose is needed later, this child has severe croup.\n\n- Discuss all such children with the paediatrician on call & ensure that the senior doctor in the ED is aware\n- Such children may need to be transferred to a hospital with PICU cabability\n- The necessity for transfer, treatment required prior to transfer & logistics of transfer should be discussed with the duty paediatrician & the duty ED consultant\n\nGeneral measures :\n- Avoid further distressing the child or the caregivers\n- Observe in a fully equipped resuscitation area\n- Give oxygen if tolerated (allow parent to administer)\n- Be prepared to manage the airway in the event of sudden, total obstruction.\n- Do not use nebulised saline\n\nImportant note :\n- Oxygen is used only to treat hypoxia\n- It is not a substitute for the relief of the airway obstruction\n- Continually monitor for signs of obstruction while on oxygen. Oxygen saturation drops late, and signifies imminent total obstruction- do not be re-assured by a normal saturation.\n\nNebulised adrenaline :\n- Use adrenaline 1:1000 : dose 0.5ml/kg, max 5ml\n\nSteroids\n- prednisolone orally 2mg/kg OR\n- dexamethasone IMI 0.6mg/kg ','','','','','','\n\n Management of Severe Croup :\n\n','','','','Intubation','','- Airway control should be by the most experienced person available\n- Gaseous induction of anaesthesia and endotracheal intubation in theatre is the best option.\n- i.v. access is necessary for an i.v. induction (obviously) but distress may provoke obstruction. Therefore if gaseous induction is possible and imminent, hold off.\n- If total obstruction supervenes occurs in ED (this is rare in croup) :\n- Bag valve mask ventilate, using a CPAP circuit if one available.\n- If unable, briefly try orotracheal intubation\n- Use ETT 1/2 to one size smaller than that normally used for child according to age/weight.\nIf \n- Ketamine 1mg/kg i.v. may be used for induction\n- Suxamethonium 1.5mg/kg i.v. if the cords can be seen\n- If unable to intubate OR bag valve mask ventilate, needle cricothyrotomy may provide a temporary airway\n- After airway is secure, specialist retrieval may be accessed via the regional paediatric retrieval service, which should be called early for consultative advice regarding children requiring transfer','Rapid sequence induction','#####134','','','','','','','','','','','Paediatric and neonatal retrieval services','#####156','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (98,0,0,'N','Dehydration','If unwell, give 20mls/kg iv N/Saline bolus, and then reassess, and look for causes','ED','emerg-med','','','','Paediatric Guideline','QUCH QDIR QVOM QWOR QCRY QIRR','','','','','','','','Background','- accurate assessment of the degree of dehydration is difficult and at best approximate, dehydration is often overestimated\n- an accurate weight at presentation is of extreme importance\n- when compared with the child\'s most recent known weight, this is one of the best & most reliable indicators as to the degree of dehydration\n- note that starvation produces no more than 1% of bodyweight loss per day. Any weight loss in excess of this is due to water loss\n \n- in the clinical assessment of water balance, an accurate history provides useful information on sites of fluid loss, duration, nature & severity.\n- physical signs of dehydration (or of overhydration) occur when the total body water changes sufficiently to alter the body weight by 3-5% or more','','','','','','','','','','','','','','','','','','','','','','','Electrolyte Depletion','Comments','- significant disturbance of electrolytes, particularly sodium often accompanies dehydration\n- assessment of electrolyte status requires :\n- appraisal of degree of dehydration\n- serum electrolyte estimation\n- knowledge of likely losses & shifts between extracellular and intracellular fluids in various disease processes\n- with regard to serum sodium, useful points to note are :\n- sodium deficit can be calculated by the following formula :\n- sodium deficit = (135 - [Na+] ) x 0.6 x body weight\n- [Na+] = measured serum sodium\n- 0.6 = sodium distribution volume in litres\n- 135 = desired serum sodium\n\nHyperglycaemia produces a dilutional hyponatremia, in the presence of hyperglycaemia, the measured sodium needs to be corrected using the formula :\ntrue sodium = measured sodium + 0.3 x (glucose - 5.5)','Paediatric Fluid Management','#####144','','','','','','','','Isotonic Dehydration','','- most common\n- loss of electrolytes is in proportion to water loss','Paediatric Blood sampling','#####143','','Hypotonic Dehydration','','- loss of sodium is proportionately greater than water loss\n- plasma sodium concentration is low\n- severe hyponatremia may cause fitting & coma\n- hyponatremia may be exacerbated by use of fluids containing low concentrations of sodium or by iatrogenic fluid overload during rehydration','','','','Hypertonic Dehydration','','- water loss is proportionately greater and the serum sodium is high, despite this there is still often a total body deficit of sodium\n- because of osmotic shifts these children may actually be more dehydrated than they clinically appear\n- the skin of infants with hypertonic dehydration is said to have a doughy feel\n- children with hypertonic dehydration are at great risk of fitting and severe neurologic sequelae if rehydration is not carried out appropriately, ideally, after resuscitation for shock, this should be done over 48 hours','','','','','','','','','','','Treatment','- if the child is shocked , immediate intravenous access should be obtained and volume resuscitation commenced with a bolus of 20ml/kg of fluid ( normal saline or Hartman\'s solution)\n- the bolus should be repeated until circulation is restored, this may take up to 80ml/kg\n- if intravenous access is not immediately available in the collapsed child, use the intraosseous route.\n- senior medical staff MUST be involved in the management of such children\n \n- after shock has been treated then calculate and add the following volumes :\n- estimated fluid deficit\n- normal maintenance fluid requirement\n- volume of ongoing losses\n- fluids to replace the existing deficit are generally given over 24 hours, but in the case of hypernatremic or hyponatremic dehydration, deficits should be corrected more slowly over 48 to 72 hours\n- the type of fluid used is dependant on the type of fluid lost and should be individually chosen for each situation\n- when choosing intravenous fluids for children, the rate & type of fluid should be discussed with senior medical staff first - this includes the duty ED consultant or registrar &/or the duty paediatrician/registrar','','','','','','','','','','','','','Gastroenteritis handout','#####69','','','','','','','');
INSERT INTO `MedHelp` VALUES (99,0,0,'N','Febrile convulsion','Normal in 3% children - associated with rapid rise in temperature\nDoes not mean that child is epileptic','ED','emerg-med','','','','Paediatric Guideline','QUCH QFIT QWOR fit epilepsy ','','','','','','','','History','- the diagnostic criteria for simple febrile convulsions are :\n- generalised tonic clonic seizure\n- brief duration (less than 15 minutes)\n- child aged between six months & five years\n- no previous afebrile seizures\n- no progressive neurological condition\n- no evidence of CNS infection\n- full recovery is evident with no residual neurological signs\n- seizure occurs in the setting of an acute febrile illness\n- the child with a febrile convulsion must be evaluated carefully in order to detect underlying serious bacterial or neurological illness.','','','','','','','','','','','','','','','','','Treatment',' Management of the fit :\n \n Most febrile convulsions are brief and do not require specific treatment.\n \n If a convulsion occurs in the Emergency Department :\n  Initial Management :\n- clear & maintain the airway\n- position child to prevent aspiration of vomitus (semi prone or left lateral position )\n- administer oxygen via face mask\n- prevent further injury\n \n If fit continues after 5 minutes :\n- continue airway care & oxygen\n- involve senior medical staff at this point (ED consultant & duty paediatrician)\n- obtain intravenous access\n- give anticonvulsant : diazepam : 0.2 mg/kg intravenously\n- if intravenous access is delayed, give diazepam rectally in a dose of 0.5 mg/kg\n- the dose of diazepam can be repeated after 3-5 minutes\n- be prepared to manage respiratory depression associated with diazepam\n \n Convulsions persisting despite diazepam :\n- phenytoin 18mg/kg by slow intravenous injection over 15-30 minutes\n- carefully monitor blood pressure & ECG during administration\n \n If convulsion STILL persists :\n- thiopentone 3-5mg/kg slowly until fitting ceases\n- be prepared to intubate & ventilate : have senior medical staff in attendance\n- have ETT of appropriate size open & ready\n- have suction on\n- monitor BP, ECG and pulse oximetry\n- after stabilisation, arrange transfer via paediatric retrieval service.\n \n For any prolonged fitting :\n- liaise early with paediatrician','','','','','','','','','','','','','','','','','','','','','','','','Disposition',' After the fit :\n \n Observe all children for a period of four hours post convulsion & give paracetamol for fever control\n Further action depends upon :\n- the general appearance of the child\n- the presence of a clinically obvious infective focus\n- the presence of any atypical features','Febrile convulsion - handout','#####80','','','','','Fever management','#####101','','','','','Paediatric retrieval service','#####156','','','','','Fever','#####100','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (100,0,0,'N','Fever','Beware fever + rash\nDo not send a child home with ongoing fever. Treat the fever and check that they are better. \nGive a handout and clear instructions when to re-present','ED','emerg-med','','','','Paediatric Guideline','QUCH QIRR QWOR QCRY QRAS temperature ','','','','','','','','Background','The acutely ill, febrile child requires careful evaluation to exclude serious systemic disease. After evaluation & treatment, close follow up & observation is essential\n\nHigh fever is more likely in bacterial infections, a low fever does not mean it is not bacterial. Viral infections are much more common, and can also give high fever.\nA good response to paracetamol does not rule out bacterial infection.\n\nIn any child : the child\'s general appearance & behaviour are the single best indications of whether serious underlying disease is likely.','','','','','','','','','','','History','- general health status\n- immunisation record (specifically Hib immunisation)\n- length of illness & treatment given to date\n- allergies, past health & presence of immune dysfunction\n- feeding & urinary output\n- activity level, lethargy or irritability (behavioural changes)\n\nNB : vomiting in a young child is a non specific symptom and does not equate with infectious gastroenteritis.','','','','','Examination','Vital signs and temperature:rectal or tympanic\n- general appearance, rash\n- lethargy / irritability \n- consolability / distractibility\n- eye contact, speech & cry\n- physical examination inc. ENT\n\nA sensitive indicator used by experienced paediatricians is interactivity. A sick child does not interact with their surroundings.\n\nDiscuss with the duty ED consultant or registrar if child looks unwell.','','','','','','','','','','','Less than one month','Treatment','- admit all such children & commence empiric antibiotic therapy\n- full septic workup is indicated - this includes :\n- FBE, CRP, blood culture & CXR\n- urine m,c &s (catheter specimen or SPA)\n- Lumbar cuncture\n- if inexperienced in managing infants, allow paediatric staff to perform these investigations in the ward, provided that there is not an undue delay involved\n- if investigations are to be performed in the ED, this should be under the direct supervision of the duty ED consultant or the paediatrician\n- the antibiotics of choice are :\n- benzylpenicillin 30mg/kg i.m. or i.v. AND\n- gentamicin 4 mg/kg i.m/i.v.','lumbar punctue','','','One to three months','','Full septic workup :\n- FBE / film, CRP & blood culture\n- Lumbar Puncture\n- urine m, c & s (catheter specimen or SPA)\n- CXR if RR up/ Oxygen sat down/ no obvious focus. (auscultation is unreliable in this age group)\n\nConsider discharge if :\n- WCC less than 20,000\n- CSF, urine and CXR are clear\n- child looks completely well\n- adequate supervision at home & good access to transport\n- adequate follow up within 24hrs is assured.\n\nIf any of the above conditions are not met, admit the child for observation and/or empiric antibiotics:\n- ceftriaxone 75mg/kg i.v. OR i.m.','SPA','','','','','','Fever management','#####101','','','','','Infections - parent handout','#####79','','Three months to three years','','a) Temperature > 39C & clear focus of Infection\n- treat as clinically indicated if child looks well\n- if child looks unwell :\n- investigate with FBE, CRP, blood cultures & other specimens as appropriate for clinical focus\n- admit for treatment\n- use antibiotics appropriate for the clinical focus\n \n b) Temperature > 39C & NO focus of infection\n \n Management of these children is to a large extent guided by general appearance.\n If there are any doubts, it is better to discuss with the ED consultant or the duty paediatrician & admit the child for observation.','','','','','','','Febrile convulsions','#####99','','','','','','','','','','if still needed for diagnosis, the LP can be performed when the child is clinically more stable\n \nALL unwell looking children with fever & no clinical focus require admission\n- empiric antibiotic therapy = ceftriaxone 75mg/kg daily','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (101,0,0,'N','Fever management','','ED','emerg-med','','','','Paediatric Guideline','QUCH QIRR QWOR QSOC QCRY temperature ','','Background','Current opinion is that the fever provides some benefits, in that it drives they body in a high metabolic rate, increasing the rate of activity of the neutrophils, and disadvantaging the reproduction of some viruses and bacteria.\nAgainst this must be set the child\'s comfort, sleeping and the parent\'s wishes.\nThe best solution is to allow the parents to make the decision about whether to give anti-pyretics. If an anti-pyretic is to be given, make sure it is at a therapeutic dose (e.g. 20mg/ kg  of paracetamol)','','','','Definition','Description','- rectal temperature above 38 degrees\n- oral temperature above 37.8 degrees\n- axillary temperature above 37 degrees','','','','Temperature measurement ','','- rectal thermometry remains the gold standard\n- oral & axillary thermometry can be unreliable in small children\n- tympanic thermometry has been shown to be acceptable but care needs to be taken to ensure correct technique, thus avoiding error\n- in children younger than six months, rectal thermometry should still be used\n\n- fever is a symptom, not a disease & the cause should always be sought\n- fever is thought not to be harmful in itself & may be beneficial in promoting some components of the immune response, however :\n- in some children fever will precipitate febrile convulsions\n- extreme elevation of temperature can be harmful metabolically (producing rhabdomyolysis) & neurologically','','','','','Treatment','The management of fever primarily involves diagnosis and treatment of the underlying cause.','','','','','','','','','','','Drug treatment','','- indicated in the febrile child who is miserable & uncomfortable\n- the analgesic action of paracetamol is an added advantage\n- antipyretics should also be used early in the course of a fever in children with a history of febrile convulsions\n - the antipyretic used most commonly is paracetamol :\n- usual dose 20mg/kg orally every 4-6 hours\n- a single higher oral dose of 20-30mg/kg may be given in the emergency setting. This is safe, highly effective in lowering temperature and has an 8 hour duration of effect.\n- this higher dose should be a \"once only\" dose and should NOT be recommended to parents for home use or ongoing use\n \nAspirin is not routinely used because of the association with Reye\'s Syndrome\n \nIbuprofen may be used instead of paracetamol.','','','','','','','Infections handout','#####79','','Non- drug treatment','','- keep clothing minimal\n- apply cool flannel\n- tepid sponging, cold baths & fans do not lower core temperature & may cause shivering thus are not currently recommended routinely.','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (102,0,0,'N','Gastroenteritis','','ED','emerg-med','','','','Paediatric Guideline','QUCH QDIR QVOM QWOR QABC diarrhoea vomit d and v','','','','','','','','History','Ask specifically about : \nduration of illness, frequency & severity of diarrhoea & vomiting, oral intake, urinary output, behaviour','','','','','Examination','- examination must include : accurate weight, vital signs & general appearance, assessment of hydration status & complete general examination\n \n Accurate weight is of extreme importance. Recent change in body weight provides the most reliable indication of the degree of fluid depletion & management is dependant upon the degree of hydration.','','','','','','','','','','1. No Dehydration','Treatment','- can be managed as an outpatient\n- continue breast feeding\n- extra fluid will be required & suitable fluids include : fruit juice drinks diluted one in four with tap water or glucose 2 teaspoons in 240ml boiled water.\n- reintroduce food within 24 hrs, even if diarrhoea not settled','','','','','2. Mild to Moderate Dehydration (3-6%)','','Oral rehydration will almost always succeed\n- fluid deficit = % dehydration x body weight in kilograms\n- add this to maintenance requirement & give over 24 hours\n- the commonest oral rehydration fluid is Gastrolyte\n- if fluid refusal is a problem, a nasogastric tube can be used to give fluids\n- admit those with moderate dehydration, children with mild dehydration can be managed at home if review can be arranged for 12-24 hours','','','','3. Moderate to Severe Dehydration (>7-9%)','','If child is not shocked then a trial of oral rehydration is acceptable, aim to replace deficit quickly by giving total fluid intake over the first six hours of 50ml/kg in older children & 100ml/kg for infants\n- if child tires or cannot keep up with losses, give nasogastric fluids & aim to restart breast feeding within six hours\n- if child is shocked then obtain rapid intravascular access & commence volume replacement with 20ml/kg of crystalloid or colloid, this should be repeated until circulation is stable\n- after resuscitation calculate deficit & maintenance requirements\n- aim to replace deficit over 24 hours if serum sodium normal, in children with hypernatremic or hyponatremic dehydration, much more caution is required & rehydration should be over 48-72 hours','Paediatric i.v. cannulation','#####146','','','','','Intraosseus needle','#####145','','','','','Paediatric fluid balance','#####144','','','','','Gastoenteritis - handout','#####69','','','Tests','- faecal microscopy & culture may help to identify cause but illness is usually self limiting & information is of little value as antibiotics not often used even in bacterial colitis\n- electrolytes, acid base studies & full blood count are not routine but should be done if there is: prolonged diarrhoea with severe dehydration, disturbance of conscious state, any child less than 3 months, any child requiring i.v. rehydration','','','','','','','','','','','Disposition','Admission Criteria -\n- severe illness\n- moderate or severe dehydration\n- age less than 6 months, unless not dehydrated\n- high risk patients eg with intercurrent major illness\n- diagnosis in doubt\n- family unable to cope\n- for all patients discharged, ensure that : the parents are given instructions as to care of the child & criteria for return & that there is a review arranged for within 12-24 hours by GP','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (103,0,0,'N','Glomerulonephritis','','ED','emerg-med','','','','Paediatric Guideline','QURO QUCH QRAS QABC renal kidney ','','','','','','','','Background','- presents with haematuria, proteinuria, oedema, hypertension & renal insufficiency\n- most common cause is acute post streptococcal glomerulonephritis\n- other causes include :\n- Henoch-Schonlein purpura\n- IgA nephropathy\n- Alports Syndrome\n- SLE','','','','','Comments','Post streptococcal glomerulonephritis :\n\n- onset 2-3 weeks after group A haemolytic streptococcal skin or throat infection\n- pathophysiology involves activation of complement & deposition of antigen-antibody complexes in the glomeruli\n- histopathology : neutrophil infiltration, proliferation of mesangial & endothelial cells, crescent formation\n- immunofluorescence shows immunoglogbulin & complement deposits\n- presentation :\n- school aged child\n- macroscopic haematuria : smoky or tea colored urine\n- oedema\n- headache\n- lassitude, fever & loin pain\n- Henoch-Schonlein purpura :\n- petechial or purpuric rash\n- arthritis\n- haematuria\n- abdominal pain\n- the nephritis is often mild & prognosis is good, less than 5% progress to chronic renal failure','','','','','','','','','','','Treatment','Early liaison with the duty paediatrician is mandatory.\n \n- initial evaluation must be meticulous & must include weight, blood pressure & urinalysis\n- admit all\n- management centres around careful management of the renal failure & hypertension\n- treat with bed rest\n- strict fluid balance & daily weight\n- test & measure all urine\n- fluid restrict\n- treat hypertension as follows :\n- mild : fluid restriction & frusemide 2-4mg/kg/day\n- moderate : oral prazosin or nifedipine\n- severe : may need parenteral hydralazine or diazoxide\n- commence oral penicillin - continue for 10 days\n- if renal insufficiency present : restrict protein, salt & potassium intake\n- monitor electrolytes & renal function closely','','','','','','','','','','','','Tests','- urea, electrolytes & creatinine\n- urine microscopy\n- FBE\n- serum complement levels\n- anti streptolysin O titre\n- anti streptococcal DNase B\n- 24 hour urine collection','','','','','','','','','','','Disposition','Indications for transfer :\n \n- make this decision via discussion with the duty paediatrician\n- indications include :\n- hypertensive encephalopathy\n- left ventricular failure\n- acute renal failure\n- in the event of transfer, discuss patient directly with BOTH the admitting officer AND the receiving renal physician at the referral hospital','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (104,0,0,'N','Intussussception','','ED','emerg-med','','','','Paediatric Guideline','QUCH QWOR QABC QIRR QCRY','','','','','','','','History','- classic symptoms : acute onset of pain & screaming fits with flexion of the legs occurring at 5 - 20 minutely intervals associated with vomiting & passage or \"red currant jelly\" stools ( only present in less than 50% of cases)\n- child\'s appearance after screaming episode - limp, pale & exhausted\n- duration of symptoms','','','','','','','','','','','Examination','- check vital signs, general appearance, hydration status +/- presence of shock\n- abdominal distension & sausage shaped mass may be present\n- always do rectal examination\n- look for signs of peritonism','','','','','','','','','','','','Treatment','ABC if required\n- treat shock if present by intravenous volume resuscitation as appropriate- 20ml/kg. These children can be shut down and intraosseus access is sometimes necessary for initial resuscitation.\n- keep child nil orally\n- assess degree of dehydration & correct dehydration with intravenous fluids\n- perform erect & supine abdominal Xrays\n \n Definitive Treatment:\n- gas or barium contrast enema will confirm diagnosis & may be therapeutic as reduction can often be achieved with this procedure\n- enema is contraindicated in the presence of : signs of peritonism, bowel obstruction or free abdominal gas on plain Xrays, an unstable child with shock or acidosis - such children will need early laparotomy','Intravenous cannulation','#####146','','','','','Intraosseus needle','#####145','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','Disposition','- admit all children with suspected or proven intussusception\n- liaise early with the paediatrician & the paediatric surgeon - at the time of referral a decision as to need for transfer will be made','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (105,0,0,'N','Meningococcaemia','Give antibiotics first, ask questions later','ED','emerg-med','','','','Paediatric Guideline','QUCH QDIR QVOM QWOR QFIT QCOL QUAD QCRY QIRR meningitis ','','','','','','','','Background','Neisseria meningitidis bacteraemia which is potentially life threatening, often presenting in a fulminant form\n- the rash of meningococcemia is classically a petechial or haemorrhagic rash, but beware, up to 15% of patients with acute meningococcemia may have no rash or a pink macular rash resembling that of a viral exanthem.\n \nTreatment must be prompt & aggressive.\n Suspect menigococcemia in ANY patient with severe illness, fever & rash.\n \n- as well as supportive & resuscitative measures, antibiotic treatment must be given EARLY & should NOT be withheld in order to obtain cultures\n- the antibiotic of choice is penicillin and should be given as early in the course of the disease as possible\n- if a local doctor refers a child with suspected meningococcemia, request that antibiotics be given prior to sending the child (IMI penicillin)\n- the use of steroids is still controversial in adults but is currently recommended for children & high dose steroids should be given prior to antibiotics if possible (if there is delay in obtaining steroids - do not withhold antibiotics)','','','','','','','','','','','Treatment',' The child with suspected meningococcemia is a critically ill child. Treatment & resuscitation must be performed in a timely manner as soon as the child enters the Emergency Department\n \n \n For any child with suspected meningococcemia :\n- inform duty consultant (or registrar if after hours) immediately if any child is thought to have meningococcemia as senior medical staff must be involved in assessment & management as early as possible\n- early liaison with the duty paediatrician (consultant) is mandatory\n- transfer to a tertiary centre with PICU capability is likely and PETS retrieval service & tertiary hospital should be informed as soon as practicable\n \n Initial action on identifying child with suspected meningococcemia :\n- move to fully equipped resuscitation area\n- obtain brief history whilst making rapid assessment of child\'s physiological status & commencing resuscitation\n- obtain vital signs & establish monitoring : pulse oximetry, non invasive BP, ECG\n \n Resuscitation :\n \n Airway & Ventilation :\n- if airway is patent & ventilation is adequate :\n- provide oxygen via face mask, use high flow oxygen\n \n- if airway compromised & ventilation inadequate :\n- clear airway with suction\n- maintain airway by head tilt or jaw thrust\n- apply high flow oxygen via close fitting face mask\n- assist ventilation if necessary by bag valve mask ventilation\n- definitively secure airway by endotracheal intubation only if adequately trained to do so, if not continue bag valve mask technique until more senior help arrives\n \n Circulation :\n- obtain secure intravenous access as early as possible\n- if child is collapsed and intravenous access is difficult obtain intraosseous access \n- in the shocked child, restore intravascular volume by giving :\n- 20ml/kg of fluid (crystalloid, NSA or Haemaccel)\n- repeat bolus if no response\n- children in septic shock may require large volumes of fluid resuscitation\n- after 60ml/kg, consider commencing inotropes, always liaise with paediatrician &/or tertiary centre in this instance\n- the adequacy of volume resuscitation is indicated by heart rate, peripheral perfusion, conscious state, BP & urinary output.','Paediatric intravenous cannulation','#####146','','','','','Intraosseus needle','#####145','','','','Tests','In the ideal situation, blood cultures and baseline investigations should be obtained before antibiotic therapy BUT treatment should not be delayed purely because a blood culture cannot readily be obtained.\n \n The appropriate investigations are :\n- FBE\n- Urea & Electrolytes\n- Blood Cultures\n- Blood Gases\n- CRP\n- urine, if available should be sent for microscopy & culture & bacterial antigens\n \n Lumbar Puncture is contraindicated in the acutely unwell child with fulminant sepsis &/or altered conscious state.\n If needed this can be obtained once the child is more stable.\n \n Specific Treatment :\n This should be given as early as possible, ideally give concurrently with the initial resuscitation.\n Specific treatment is :\n- high dose corticosteroids :\n- dexamethasone 2mg/kg IVI stat\n- ideally should be given before antibiotics are started\n- antibiotics :\n- benzylpenicillin : 60mg/kg IVI four hourly\n- & ceftriaxone : 100mg/kg IVI\n \n Do not delay administration of antibiotics in order to await results or obtain investigations if these are delayed','','','','','','','','','','','','','','','','','Disposition','- most, if not all, children with meningococcemia will require transfer to a tertiary hospital with a paediatric intensive care unit\n \n Contact tertiary receiving hospital as early as practicable','','','','','','','','','','','Comments','Proophylaxis is indicated for houshold contacts, immediate family members & mouth kissing contacts within the last ten days\n- immunoprophylaxis consists of :\n- Rifampicin : \n- children : 10mg/kg orally twice daily for 2 days\n- adults : 600mg orally twice daily for 2 days\n OR\n- Ceftriaxone 50 mg/kg IMI single dose\n \nsingle dose ciprofloxacin 500mg (adult) is an alternative\n- if uncertain as to the need for or the type of prophylaxis to use discuss with ED consultant or infectious disease specialist','Prophylaxis For Contacts','','','Notification','','Meningococcal disease is notifiable.','Notifiable diseases','#####148','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (106,0,0,'N','Nephrotic syndrome','','ED','emerg-med','','','','Paediatric Guideline','QURO QUCH QRAS QABC renal kidney ','','','','','','','','','- a condition presenting with oedema, proteinuria, hupoalbuminemia & hyperlipidaemia\n- incidence in children is 2-4 per 100,000\n- major pathological lesions giving rise to nephrotic syndrome :\n- minimal change glomerulonephritis (80%)\n- focal segmental glomerulosclerosis\n- mesangial proliferative glomerulonephritis\n- membrano-proliferative glomerulonephritis\n- membranous glomerulopathy\n- congenital nephrotic syndrome\n- the most common presentation is that of generalised oedema\n- macroscopic haematuria is rare, microscopic haematuria in 30% of cases\n- blood pressure often normal\n- oedema & hypoalbuminemia may result in :\n- pleural & pericardial effusions\n- ascites\n- hypovolemia & shock with decreased renal perfusion\n- major complications include :\n- infection (gram positive & gram negative sepsis)\n- hypovolemia & oliguria, leading to acute renal failure\n- thromboembolism (venous & arterial) : hypercoaguable state due to haemoconcentration & depletion of antithrombin III\n- CCF\n- relapse is common, but the frequency of relapses decreases by 16 years of age','','','','','','','','','','','History','- weight gain, poor urine output, swelling, abdominal distension & discomfort\n- check for history of preceding URTI or diarrhoea','','','','','Examination',' Examination :\n- obtain vital signs including blood pressure & accurate weight \n- confirm presence of oedema : may be subtle\n- assess for hypovolemia\n- look for other complications','','','','','','','','','','','','Treatment',' Admit ALL children with nephrotic syndrome, liaise EARLY with duty paediatrician as to treatment schedule, possible referral to tertiary centre & specific investigations. Consult usual treating physician immediately in cases of relapse.\n \n- assess & secure ABC if needed in all cases\n- treat hypovolemia & shock as needed :\n- secure IV access\n- cautious infusion of 20% albumin : 5ml/kg\n- watch for pulmonary oedema & hypertension\n- give frusemide with caution : refer to consultant before using\n- commence strict fluid balance chart & weigh patient daily\n- test all urine for protein & blood\n- allow free oral fluids\n- commence high protein, low salt diet\n- oral penicillin 12.5mg/kg twice daily\n- aspirin 10mg/kg alternate days\n- commence corticosteroids early (induces remission in 90% of cases) : prednisolone initial dose is 2mg/kg/day','','','','','','','','','','','Tests','- urinalysis for proteinuria\n- commence 24 hour urine collection for quantification of proteinuria (this can be commenced on the ward)\n- take blood for :\n- urea, electrolytes & creatinine\n- glucose\n- albumin, globulin & total protein estimations\n- FBE\n- renal biopsy is not routine & is reserved for those who do not respond to steroids or in whom there are atypical features','','','','','','','','','','','Disposition','- all are admitted\n- the duty paediatrician will indicate whether management will be undertaken locally or whether transfer to a tertiary centre is required','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (107,0,0,'N','Pyrexia of unknown origin','Foreign travel','ED','emerg-med','','','','Paediatric Guideline','QUCH QUAD QIRR QCRY PUO fever ','','','','','','','Definition','Background','temperature greater than 38C which has persisted for more than one week\n- there are no localising signs & preliminary investigations such as FBE, urine microscopy & culture or CXR fail to identify a possible source\n- if the child is unwell with the fever, he or she should be admitted to hospital for further investigations, otherwise investigations can be performed on an outpatient basis\n- most children with pyrexia of unknown origin will eventually be found to have some sort of infection, but many other conditions can present in this way\n\n- Emergency Department management centres around a thorough history & examination and appropriate referral.\n- if referring for outpatient investigation, it will often be helpful to liaise with the duty paediatrician before the child leaves the ED as some investigations may be performed prior to review & to discuss the timing of the review.','','','','','','','','','','','History','Include specific enquires about :\n- current health of the immediate family, close relatives and/or neighbours\n- occupation of parents\n- housing, social conditions of child\n- pets in the home & their health\n- community epidemics\n- ethnic group\n- travel, immunisations & use of malaria prophylaxis in travel to malarious areas\n- recent surgery\n- weight loss\n- congenital conditions\n- family history','','','','','','','','','','','','Examination','- this should be particularly thorough.\nEvidence of lymph node or splenic enlargement should be sought carefully','','','','','','','','','','General Principles','Advice','- admit all unwell looking children with PUO\n- discuss early with duty paediatrician, especially if considering outpatient investigation.','','','','','','','Fever management','#####101','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (108,0,0,'N','Pyloric stenosis','Suspect in neonates 3-6 weeks old with post prandial vomiting. Projectile vomiting is not always present.','ED','emerg-med','','','','Paediatric Guideline','QVOM QUCH QIRR QCRY','','','','','','','','','','','','','','','','','','','','History','Always ask about :\n- nature, duration & frequency of vomiting : bile stained vomiting should lead to suspicion of malrotation\n- oral intake, urinary output, recent weight, weight loss & feeding pattern\n- prior health & family history\n- other symptoms','','','','','','','','','','','','Examination',' Pay particular attention to -\n- general appearance, vital signs & current weight\n- hydration status & degree of dehydration (some infants may present in frank hypovolemic shock)\n- presence of \"pyloric tumour\" on palpation of the abdomen - a hard mobile mass palpable in the epigastrium, about the size if the terminal phalanx of the little finger\n- peristaltic waves passing from the left costal margin to the right hypochondrium','','','','','','','','','','','Treatment',' Resuscitation :\n- attend to ABC in all patients\n- if infant is shocked :\n- rapidly obtain intravenous access\n- give bolus of 20ml/kg normal saline\n- repeat bolus as necessary until circulation restored\n \n If infant is shocked always involve senior medical staff in management early.\n \n Rehydration :\n- calculate fluid deficit :\n- deficit = % dehydration x body weight\n- after correction of shock, if present, replace the remaining deficit over the next 12 hours\n- if severely dehydrated :\n- use normal saline initially\n- maintenance fluid can be given after replacement of deficit as 0.18% saline 4% dextrose\n- add potassium to IV fluids as soon as urine output is established, use concentration of 30-40mmol KCl per litre \n- frequently reassess fluid, electrolytes & acid base status\n- if minimally dehydrated, 0.45% saline 2.5% dextrose with potassium replacement is a suitable hydration fluid\n- monitor urinary output for all patients & maintain strict fluid balance','paediatric i.v. cannulation','#####146','','','','','intraosseous needle','#####145','','','Tests','For all infants with suspected pyloric stenosis :\n- FBE\n- urea & electrolytes (often there is hypokalemia & hypochloremia)\n- acid base status ( hypochloremic metabolic acidosis)\n Radiological Investigation :\n- ultrasound - shows a thickened pylorus\n OR\n- barium meal - shows dilated stomach and narrow attenuated pyloric canal, the \"string sign\"','paediatric fluid balance','#####144','','','Treatment',' Definitive Management :\n- operation should not proceed until the child has been rehydrated & metabolic abnormalities have been corrected.','','','','','Disposition','- admit all children with pyloric stenosis or suspected pyloric stenosis\n- early involvement of the duty paediatrician & paediatric surgeon is mandatory\n- uncomplicated cases should be able to be managed locally.\n- the paediatric surgeon will indicate if transfer is desirable & this can be coordinated with him at the time of referral if necessary.','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (109,0,0,'N','Sudden infant death syndrome','Keep an open mind. Record anything unusual. \nDebriefings can be helpful for some, but not everyone.','ED','emerg-med','','','','Information','QDOA SIDS ','','','','','','','','Background','- the sudden death of an infant or child which is unexpected by history and in which a thorough post mortem fails to demonstrate an adequate cause of death.','','','','','','','','','','Management of SIDS in the Emergency Department:','Comments','- if possible have a room or private space ready\n- allocate a staff member to care for the family\n \n If Resuscitation is to be Initiated or Continued :\n- take parents to a private room\n- ensure that they get frequent reports about events\n- if parents wish to view resuscitation & staff are comfortable this should be encouraged\n- medical staff to speak to parents after ceasing resuscitation, explain that their baby has died & explain SIDS\n- allow parents to spend time with their baby\n \n If Resuscitation is not required :\n- escort parents into private area\n- medical staff to examine child & tell parents that their baby has died\n- if parents do not arrive with the child, keep child in the ED until they arrive','','','','','','','','','','',' Care of the grieving family ','','Allow parents to hold their child & say goodbye in their own time - there is no hurry\n- offer to remain with parents, if this is not wanted, stay nearby\n- allow other family members or close friends to be involved if the parents wish, include them in discussions\n- listen to the parents, ask questions in a non-blaming manner\n- always use the baby\'s name\n- avoid cliches\n- consult parents & respect their wishes, respect cultural mourning practices\n- be generous with your time\n- explain that an autopsy is required by law - if objections, notify coroner immediately\n- explain that the police will visit and that an event scene investigation will occur','','','','Practical help','','- offer drinks & access to a telephone\n- offer to make mementos :photographs, hand & foot prints, lock of hair\n- reassure parents that funeral arrangements can be made at their own pace\n \nSiblings/ Twins\n- a surviving sibling/ twin is thought to be at increased risk for various reasons, refer to paediatrics\n \n When Parents are Ready to Leave :\n- ensure that they have someone to take them home\n- obtain address & telephone \n- explain that they will be contacted by the State Coroners Office the next day\n- give copies of information booklets\n- Notify the Sudden Infant Death Research Foundation of the baby\'s death if you have not already done so\n- complete the necessary forms, notify the Coroner & arrange for transport of the infant to the Coronial Services Centre','','','','','','','','','','','','Take care of yourself - the death of a child can be a traumatic and draining experience for all involved\n- take a break if possible before continuing other duties\n- make use of workplace arrangements for support & debriefing','','','','','','','','','','SIDS organisations/ contact details','','SIDRF offers debriefing, information and support to anyone affected by SIDS, including emergency responders and can be contacted 24 hours a day on 9822 9611','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (110,0,0,'N','Paediatric major trauma','The order & priorities of assessment & management of the injured child are essentially similar to those in adult trauma','ED','emerg-med','','','','Paediatric Guideline','QTRU QMUL','','','','','','','','Background','When notified regarding arrival of a paediatric trauma victim :\n- organise trauma resuscitation team (medical & nursing)\n- prepare resuscitation room\n- ensure triage nurse aware\n- ensure that senior medical staff are aware as they must be involved in management.\n- inform radiology & pathology as appropriate','','','','','','','','','','','Treatment',' On arrival of patient :\n- Manage in fully equipped resuscitation area\n- Team leader to meet ambulance & take ambulance handover\n- AMPLE history : Allergies, Medications, Past History, Last Meal & Events / Environment related to Injury\n- Perform Primary Survey & commence resuscitation\n- Secure airway & ventilation\n- Ensure cervical spine control\n- Establish reliable, wide bore vascular access\n- Commence volume replacement & control visible external haemorrhage\n- Obtain blood for group & cross match\n- Perform detailed secondary survey (head to toe)\n- Initial Xrays include : lateral cervical spine, chest Xray and pelvis, arrange others as appropriate\n- Involve surgical team and / or tertiary referral centre as early as practical','','','','Airway & Ventilation','','a) Oral Airway -\n- gently depress the tongue forward and direct the oral airway into the oropharynx under direct vision\n- note that using an airway that is too large or using incorrect insertion technique may lead to complete airway obstruction\n b) Orotracheal Intubation -\n- use uncuffed tubes in children up to the age of 12\n- the size of the endotracheal tube can be gauged by the formula :\n- age/4 + 4 = internal diameter in mm\n- if inserted orally, the endotracheal tube should be inserted to the length :\n- 2 x (ETT size) + 4 = length in cm\n- nasotracheal intubation should not be used in the child with suspected basal skull fracture\n- adequate immobilisation of the cervical spine in a neutral position should be maintained during intubation\n- the position of the endotracheal tube should be periodically checked\n \n c) Surgical Airway -\n- use only when airway access & control cannot be accomplished by bag valve mask ventilation or endotracheal intubation\n- some indications are complete upper airway obstruction due to severe facial trauma or foreign body obstruction\n- in children younger than 12 years, needle cricothyroidotomy is the preferred method for obtaining a surgical airway\n \n d) Ventilation -\n- ventilate children at a rate of approximately 20 breaths per minute, infants at a rate of 30-40 breaths per minute with tidal volume of 10 ml/kg','Rapid sequence induction','#####134','','','Circulation','','- secure, reliable intravascular access should be obtained as soon as possible\n- two sites should be accessed and the largest possible cannula should be used\n- if secure intravenous access cannot be obtained in the shocked child within one minute then :\n- obtain intraosseous access if child is less than 6 and there are no lower limb injuries on the side selected\n- try venous cutdown : median antecubital vein, long saphenous vein\n \n Fluid Resuscitation -\n- initial bolus of crystalloid (normal saline or Hartmanns solution) give 20 ml/kg\n- repeat bolus if no response\n- if still no response, commence blood replacement (O negative, type specific or fully cross matched ) use 10 ml/kg boluses which can be repeated\n \n Failure to obtain haemodynamic stability following the first bolus mandates early surgical involvement & signifies ongoing blood loss.\n \n Thermoregulation :\n- children have a higher body surface area to weight ratio, thus body heat is lost easily\n- hypothermia can result in acidosis & may compound haemodynamic instability\n- rectal temperature should be monitored & heat loss minimised by limiting exposure, use of warmed fluids & considering use of overhead warmers','Paediatric intravenous cannulation','#####146','','','','','Intraosseous needle','#####145','','','','','Paediatric fluid management','#####144','','Secondary Survey','','- detailed & thorough secondary survey should be performed, including log roll & rectal examination\n- the aim is to identify injuries in all regions of the body\n- nasogastric tubes & urinary catheters should be placed\n- injuries should be investigated & treated as appropriate','Major head injury','#####152','','','','','Fractures','#####29','','','','','','','','','Comments','- always bear in mind the child\'s developmental status & the contribution that fear & anxiety may have on acute assessment\n- approach the conscious child in a calm, non threatening manner & gain his or her trust\n- family members, if present may be helpful in allaying fear & anxiety.','','','','Criteria for Transfer to a Tertiary Centre','Disposition','Major paediatric trauma generally will require transfer to a tertiary referral centre for ongoing management\n- transfer should always take place in a co-ordinated manner AFTER the child has been appropriately resuscitated & stabilised : this may need to include laparotomy for major bleeding eg with splenic rupture\n- early communication with the receiving hospital & paediatric surgeon is desirable\n\nCommonly used criteria for transfer:\n- any child requiring intubation & ventilation\n- moderate & severe isolated head injuries\n- multisystem injury\n- paediatric trauma score less than 8\n- major single region trauma\n\nThe urgency & logistics of transfer should be discussed in detail with the receiving surgeon & hospital\n- adequate documentation, X-rays & pathology results must accompany the child \n- ensure that airway & ventilation are secure, there is adequate IV access and that all major life threatening problems (eg tension pneumothoraces ) have been dealt with prior to transfer\n- all tubes & lines placed must be secured & obvious fractures should be splinted prior to transfer','','','','','','','Paediatric/ Neonatal retrieval','#####156','','','','','Arterial line','#####119','');
INSERT INTO `MedHelp` VALUES (111,0,0,'N','Upper airway obstruction','Upper airway obstruction is a medical emergency. However, by distressing the child you may make it worse, so go gently.','ED','emerg-med','','','','Paediatric Guideline','QFOB QSOC FB foreign body ','','','','','','','','Examination','Signs of upper airway obstruction include stridor and respiratory distress:\n- constitutional state - is the child interested in its surroundings?\n- stridor\n- drooling\n- cough\n- speech\n- tachypnoea, cyanosis and nasal flaring\n- tracheal tug\n- intercostal, subcostal and supraclavicular recession','','','','','Comments','- The differential diagnosis includes many conditions such as :\n- croup (most common)\n- epiglottitis\n- bacterial tracheitis \n- inhaled foreign body\n- angioneurotic oedema\n- retropharyngeal abscess\n- congenital stridor eg floppy larynx, laryngomalacia','Croup','#####97','','','','','Foreign body in airway','#####65','','','','','Epiglottitis','#####155','','','','','','','','','','Treatment',' Irrespective of the cause of upper airway obstruction, the primary concern in management is to make certain that the airway is secure\n- The most common causes of upper airway obstruction in children is croup and epiglottitis: epiglottitis is now very rare, thanks to Hib immunisation.\n- Useful points in differentiating these two conditions can be summarised in the following table : ','','','','','','','','','','','','','','','','','Advice','Severe upper airway obstruction is a medical emergency\n- A child who is already cyanosed is critically ill (pre arrest)\n- As a child becomes physically exhausted, signs such as stridor, retractions and air entry may decrease.\n- All children with stridor must be reviewed by the Emergency Department registrar or consultant prior to discharge or ward admission','Rapid sequence induction','#####134','','','','','','','','','Treatment','Observe all children closely with minimal interference\n- Do not separate from caregivers\n- Remember that oxygen treats hypoxia but does not relieve the obstruction\n- Intravenous access or painful needle procedures should be deferred until the airway is secure\n- Lateral neck Xrays do not assist in management and may be dangerous\n- Identify likely specific cause and treat as appropriate \nMore detailed guidelines are available for the treatment of :\n- croup\n- epiglottitis\n- foreign body obstruction\n- If specific cause cannot be identified and there is severe obstruction, secure the airway by artificial means\n- Liaise early with paediatrics and anaesthetics\n \nNotify the ED duty consultant or registrar immediately of any patient with upper airway obstruction','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (112,0,0,'N','Urinary tract infection- paediatric','NEVER send a bag specimen for culture. \nA positive bag specimen means a clean sample is needed.\nFollow up and further investigation is necessary','ED','emerg-med','','','','Paediatric Guideline','QUCH QDIR QVOM QWOR QFIT QCRY QIRR QABC UTI ','','','','','','','','History','The history is often non-specific, especially in infants- always ask about :\n- fever\n- irritability\n- lethargy\n- oral intake\n- urinary output\n- vomiting\n- abdominal pain\n- dysuria\nIn general, older children may be able to give a suggestive history of fever, urinary frequency & dysuria, but do not rely on this.\n- often the child presents as a fever without obvious clinical focus\n- some infants may present as failure to thrive','','','','','Examination','- may be normal apart from fever\n- always assess vital signs, general appearance & hydration status:\n- initial blood pressure measurement should be performed\n- abdominal pain or loin tenderness may be elicited but is only a reliable sign in the older child with pyelonephritis\n- signs of sepsis or shock may be present & this must be recognised & managed aggressively - involve senior medical staff with all such patients','','','','','','','','','','Confirming the diagnosis','Tests','UTI is confirmed by culture and microscopy of urine. The urine sent for culture must be collected in a sterile fashion. \nBag urine is used to rule out a UTI. If the bag specimen is suggestive of UTI, a definitive sample needs to be taken and sent for culture','','','','','Methods of urine collection','','- Acceptable methods are catheter specimens, suprapubic aspiration, midstream urine (older, co-operative children) & \"clean-catch\" urine','Suprapubic aspiration','#####113','','','','','','','','','','','','','','','Treatment','Children who are obviously shocked or dehydrated, resuscitate appropriately & involve senior medical staff early ( ED consultant & duty paediatrician)\n- management otherwise is dependant on the child\'s age and degree of illness\n \n Specific Treatment :\n Intravenous Antibiotics -\n- The antibiotic of choice is gentamicin 4 mg/kg i.v. daily\n- If shocked or gram positive cocci are seen on microscopy add amoxycillin 25-50mg/kg i.v. eight hourly pending culture results to cover enterococcus.\n- check culture results & antibiotic sensitivities as soon as practicable and modify antibiotic therapy accordingly.\n- continue intravenous antibiotics until afebrile for 24 - 48 hours; then, if tolerating oral medication, change to an appropriate oral antibiotic\n- re-culture urine after several days to confirm the success of therapy\n \n Oral Antibiotics -\n- appropriate empiric oral antibiotic therapy consists of :\n- amoxycillin 15mg/kg orally every eight hours OR\n- co-trimoxazole (200/40 mg per 5ml) 0.3ml/kg orally bd\n- continue oral therapy for one week & modify according to results of culture\n- again, therapy should be modified according to results of culture & antibiotic sensitivities; repeat urine culture to confirm success of therapy','','','','','','','','','','','','','','','','','','','','','','Admission criteria','Disposition','- Children with UTI are admitted for intravenous antibiotics if :\n- age less than 12 months\n- unwell looking\n- evidence of dehydration\n- older children if evidence of sepsis or pyelonephritis','','','','Discharge criteria','','- well child, older than 12 months with no evidence of sepsis, pyelonephritis or dehydration & able to tolerate oral fluids & antibiotics','','','','Further Investigations','','Admitted children :\n- other investigations should include FBE, renal function & electrolytes, blood culture & CRP\n \n All Children with First Episode of UTI :\n- renal ultrasound\n- micturating cysto-urethrogram if less than 5 years old\n- DTPA scan if evidence of collecting system dilatation on initial radiology\n \n Follow Up :\n\n- all children with first episode of proven UTI should be followed up by a general paediatrician\n- appointment should be timed after radiological investigation so that results are available and decisions regarding further management can be made\n- after acute treatment, oral antibiotic prophylaxis should be maintained until the results of further investigations are known\n- antibiotic prophylaxis : co-trimoxazole (200/40 mg per 5ml), 0.15ml/kg po daily','','','');
INSERT INTO `MedHelp` VALUES (113,0,0,'N','Supra-pubic aspiration','Easy, safe and guaranteed to give uncontaminated urine. Explain to the parents first, though!','ED','emerg-med','','','','Practical','QUCH QDIR QVOM QWOR QFIT QCRY QIRR QABC SPA ','','','','','','','','Indications','- sterile collection of urine for microscopy & culture in children with suspected UTI\n- investigation of the child with fever and no obvious focus\n- if bag specimen is suggestive of UTI on dipstick testing (positive nitrites & leucocytes)','Urinary Tract Infection','#####112','','','Contraindications','- age > 2 years (unless bladder palpable or percussible)\n- coagulopathy\n- empty bladder or less than 30 minutes since last void','','','','','','','','','','','Equipment','- dressing pack\n- alcohol swab\n- 2 or 5ml syringe\n- 23 gauge needle\n- sterile container for collection of urine','','','','','','','','','','','','Preparation','Ensure that you have adequately explained the procedure to the child\'s parents (including the reason that SPA is necessary) & obtained their consent.\n \n Allowing parents to be present for the procedure is an individual decision.','','','','','Technique','- wait at least 30 minutes after the last void\n- if time permits, you may apply topical anaesthetic to the site (EMLA) but this needs to be on for at least one hour, and does not stop it hurting\n- use full aseptic technique\n- position patient supine with legs straight or bent in the \"frog-leg\" position\n- have a sterile bottle open and handy for a clean catch in case the child voids\n- ensure that you can palpate or percuss the bladder above the symphysis pubis\n\nIdentify the site of entry :\n- in the midline at the level of the skin crease above the symphysis pubis\n- attach 23 gauge needle to 2 or 5ml syringe\n- prep skin with alcohol swab\n- insert needle at site perpendicular to the abdominal wall or directed slightly caudally\n- aspirate while advancing needle\n- success will be indicated by aspiration of urine into the syringe\n- if unsuccessful, withdraw needle to skin while aspirating (do not remove needle completely) and advance needle again after changing angle\n- place urine in sterile bottle and send for microscopy & culture\n \nIn the event of obtaining no urine, either :\n- obtain urine by catheterisation\n- repeat SPA after one hour, allow child to drink freely & place a urine bag on child so that you know whether the child has voided before proceeding with a further SPA','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (114,0,0,'N','Suicide risk assessment','Very high risk is indicated by a score > 8','ED','emerg-med','','','','Protocol','QDSH QODP QMEN SADPERSONS','','Background','The SAD PERSONS score is a validated suicide risk assessment tool, but should be interpreted with caution: it is a guide only. \nIt is particularly valid for the very high risk category ( >8 out of a possible 15).','','','','','','S Sex: male=1 female=0','','','','','','A Age: <19yrs or >45 yrs = 1','','','','','','D Depression: symptoms such as early morning waking, poor sleep, mood disturbance = 2','','','','','','P Psychiatric history: previous suicide attempts or psychiatric history = 1','','','','','','','E Excessive Drug Use: history of drug or alcohol abuse = 1','','','','','','R Rational thinking loss: severe depression/ psychosis or similar acquired brain syndrome = 2','','','','','','S Seperated/ single/ widowed/ divorced = 2','','','','','','O Organised attempt: evidence of planning = 2','','','','','','N No life supports: social/ interpersonal isolation = 1','','','','','','S States future intent: intention to repeat attempt = 2','','','','','',' ','','','','Who to contact?','','If in doubt, ring the multi-disciplinary psychiatry community liaison team for advice.','Multi-disciplinary communit liaison team','#####158','','','','','Discharge against medical advice','#####133','','','','','','','');
INSERT INTO `MedHelp` VALUES (115,0,0,'N','DVT treatment by Hospital In The Home','','ED','emerg-med','','','','Protocol','QHIH QLIM deep venous thrombosis  pe HITH','','','','','','','','','','','','','','Indications','No contra-indications to hospital in the home.\nDVT proximal to calf but distal to sapheno-femoral junction on duplex ultrasound scan.','Hospital in the home','#####165','','','Contraindications','Previous episodes > 1 / Active bleeding / Active peptic ulcer / Familial bleeding disorder / Symptoms or signs of PE / \nPregnancy / Non-compliance / iv drug user / \nDVT proximal to sapheno-femoral junction / Axillary vein thrombosis','','','','','','','','','','','','Cautions','- Active malignancy\n- Paralysis\n- Recent immobilisation\n- Plaster cast\n- Recent surgery (type)\n- Obesity (esp. females)\n- Pregnancy, oestrogen Rx\n- Age > 65 years\n- PHx DVT or PE\n- Heart failure\n- Inherent coagulation deficiencies or abnormalities','','','','','','','','','','Low molecular weight heparin','Treatment','- 5 days minimum\n- Enoxaparin 1 mg/kg s.c. daily','','','','Warfarin','','- day 2 to approx. 3 months\n- Warfarin 10 mg orally on evening of day 2 & 3','','','','Investigation','','- If DVT has occurred in absence of apparent risk factors, take blood pre-therapy for deficiency of antithrombin III, protein C or Protein S\n- INR day 4 (aim INR between 2 to 3) will determine subsequent warfarin dosing\n- Platelet count day 4 to look for heparin induced thrombocytopenia.','','','','','Disposition','Instruct patient to return to ED for Medical Registrar review if:\n - bleeding complication\n- failure of resolution of DVT at day 5\n- Respiratory symptoms develop\n- failure to reach target INR by day 5','','','','','','Contact GP/ anticoagulation clinic to manage ongoing warfarin dosing.','','','','','','Organise medical outpatient appointment for review and to determine length of warfarin therapy','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (116,0,0,'N','Morning after pill','','ED','emerg-med','','','','Protocol','QGYN QPRG QSEX Contraception  pregnant pregnancy','','Background','Requests for the \"morning after pill\" should be handled sympathetically. Many countries are allowing pharmacists to give the MAP without a prescription.','','','','Standard regime','Indications','The current regimen is 2 high dose combined oral contraceptive pills to be taken within 72 hours of unprotected intercourse with the same dose repeated 12 hours later. Each OC pill should contain 50 mcg ethinyl oestradiol (these are the older \'high dose\' pills).\n\nAn antiemetic should be taken1 hour before the pills, as nausea is common with the high dose of oestrogen. Prepacked MAPs usually contain an antiemetic - check with the patient that these do not give side effects.\n\nExplain to the patient that she should experience a withdrawal bleed but that the method is not 100% successful in preventing unwanted pregnancy (the sooner it is taken, the better the success rate in preventing pregnancy).\n\nIf patient has had previous DVT, consult with Gynaecology Registrar regarding the use of \n- Damazol (400 mg 12 hourly for 3 days) or \n- an IUCD, or \n- a progesterone only pill regime.','','','','Alternative regime','Advice','High dose progesterone has been shown to be as effective as the above regime, with less nausea. However until a specific preparation is approved, it means swallowing almost a whole month\'s worth of pills.','RCT- levonorgestrel versus normal morning after pill - Lancet (1998)','http://www.ncbi.nlm.nih.gov:80/entrez/query.fcgi?cmd=Retrieve&db=PubMed&list_uids=9708750&dopt=Abstract','','Routine contraception','','Not provided by the Emergency Department.\nRequests for prescriptions should be pleasantly but firmly directed elsewhere, as we do not follow up patients, and cannot assume responsibility for their ongoing care. Either a Family Planning clinic or a General Practitioner should provide this service.','','','','','','','','','','','','','','Family planning clinic','#169','','','','','Sexual health clinic','#168','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (117,0,0,'N','Short tetracosactrin test','','ED','emerg-med','TCHCOMPAQ, at  200.168.0.50','TCHCOMPAQ, at  200.168.0.50','','Protocol','QDIA Addison Tetracosactrin synacthen ','','','','','','','','Indications','Suspected hypo-adrenalism','','','','','','','','','','','Technique','1. Take blood for baseline Cortisol levels (< 400 nmol/l with marked stress suggestive of insufficiency), other hormone (ie. ACTH, aldosterone) and electrolyte estimates','','','','','','2. Give Tetracosactrin 250 micrograms (Synacthen) iv\nIf you want to give steroids, give dexamethasone 10 mg i.v. as this does not interfere with the test (hydrocortisone and prednisolone do interfere)','','','','','','','3. Take cortisol levels at 30 minutes (cortisol levels > 700 nmol/l rule out adrenal insufficiency)','','','','','','4. Corticosteroid treatment needs to be continued - see Addison\'s guidelines','','','','Low dose regime','','Sometimes a very low dose regime may be used - check with local endocrinology policy.','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (118,0,0,'N','Alkaline diuresis','','ED','emerg-med','','','','Protocol','QODP QDSH aspirin overdose OD asprin ','','Background','Rarely used, but useful in severe aspirin overdose\nShould only be used after consultation with a Poisons Centre - check their regime protocol','Poisons centre','#####86','','','Technique','1. Normal Saline hydration until good urine output','','','','','','2. NaHCO3 1 meq/kg until arterial pH 7.5','','','','','','3. Continuous infusion of 5% dextrose 1000 ml with NaHCO3 100 mmol & KCl 40 mmol at 3 times maintenance rate','','','','','','4. Monitor:\n- urine pH -> more KCl\n- serum K & Na\n- blood pH -> more NaHCO3\n- fluid balance -> frusemide','','','','','','Complications','Danger of fluid overload and/or severe electrolyte imbalance','','','','','Disposition','Anyone treated with this regime should go to ICU','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (119,0,0,'N','Arterial line','The cannula site must be visible at all times','ED','emerg-med','','','','Protocol','QCOL QDIA QCAR QGIB QMUL QTRU QODP QSOB QUAD','','Indications','- Continuous blood pressure monitoring\n- Frequent blood sampling','','','','','Contraindications','Positive Allen test, indicating that only one artery supplies the hand:\n- Occlude both arteries at wrist, then release the ulnar artery and check the hand perfusion.\nInfection or cellulitis over proposed puncture site\nBleeding diathesis (relative contraindication only, for radial line)','','','','','Complications','- Arterial laceration\n- Haematoma\n- Distal ischaemia / embolus\n- Infection\n- Exsanguination (disconnected lines can be rapidly fatal)','','','','','Background','Use either a 20 Gauge cannula or a specific arterial cannula with a built- guide wire.\ninsert at 45 degrees and then either transfix the artery (go through the other side) or thread the wire/ cannula when you see  a flashback.','','','','','','- Make sure that the cannula is visible at all times.\n- Maintain pressure bag at 300 mmHg\n- Use sterile technique when withdrawing blood, flushing line, changing bags\n- Flush line after taking blood samples or zeroing monitor\n- Discard 5 ml blood prior to blood sampling\n- Ensure no air in line','','','','','','','','Video: standard technique','documents/artlinestd.mpg','','','','','Video: transfixion technique','documents/artlineTF.mpg','','','Equipment','Dressing pack x1\nSkin prep.\nLidocaine 1% 5 ml x1\nSyringe 5 ml x1\nNeedle 25G x1\nBlunt drawing up needle x1\nArrow arterial cannula or 20G Jelco x1\nTransparent occlusive dressing (large) x1\nJ loop x1\nNormal saline 500 ml x1\nInflatable pressure bag x1\nPressure monitor & cable x1\nTransducer & tubing x1','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (120,0,0,'N','Intravenous regional anaesthesia','Do not let the cuff down until at least TWENTY MINUTES after the anaesthetic has been injected','ED','emerg-med','','','','Protocol','QLIM iv i.v. anaesthetic beer Bier\'s block local','','Indications','Intravenous regional anaesthesia (aka Bier\'s Block) of the upper limb is indicated for the closed reduction of forearm or hand fractures and certain soft tissue procedures which can be completed within half an hour. \nIt can be used in co-operative children above the age of 6','','','','','Background','Intravenous regional anaesthesia may only be performed by doctors who have first demonstrated proficiency in the technique to an Emergency Medicine Consultant and have been accredited by the Director of Emergency Medicine.\n\nHMO\'s must not embark on this or any other major local anaesthetic technique without first discussing the case with the registrar or consultant.\n\nThe doctor performing the block must not be responsible for the surgical procedure for which the block is indicated.\n\nWritten consent for both the surgical procedure and the local anaesthetic block must be obtained. Consent for children (age < 18) must be obtained from the legal guardian. \n\nAll regional anaesthetic blocks are to be performed in either the ED Treatment Room. Full resuscitation facilities (oxygen, suction,  and high pressure air for the cuff) must be available and monitoring should include BP, ECG and SaO2.','','','','','','','','','','','','','','','','','Technique','1. Insert an i.v. cannula (18 G in adults) in the contralateral arm.\n \n2. Insert an i.v. cannula (20 G is adequate) in the injured limb. Any vein will do, including those proximal to the fracture.\n \n3. Apply and secure the pneumatic cuff to the upper arm of the affected side. Test gas supply, valves and gauges.\n \n4. Measure the patient\'s systolic BP.\n \n5. Elevate the injured arm for a couple of minutes to drain venous blood from the limb.  \n \n6. Inflate the pneumatic cuff.\nDo not use systems of blowing up one cuff and letting the other down - one day you will get it wrong. \nBlow both cuffs up to at least 100 mmHg above the systolic BP, and then leave alone.\n \n7. Inject PRILOCAINE (Citanest) 0.5% via the i.v. cannula (dose = 2.5 mg/kg ie: 0.5 mL of solution per kg) of the injured limb. \nSolutions containing adrenaline or bupivacaine are CONTRAINDICATED. \nCall radiographer to book XR for 15 minutes.\n \n8. Wait: anaesthesia is maximal in 10 - 15 minutes.\n \n9. If the pneumatic cuff accidentally deflates, reinflate immediately and observe patient for signs of toxicity.\n \n10. At the conclusion of the procedure (maximum 40 minutes) release the pneumatic cuff. There is no need to intermittently release and reinflate the cuff.','','','','','','','','','','','','','','','','','','Complications','The major systemic complications of block are related to cuff failure.\nNeurological disinhibition followed by convulsions and possible respiratory arrest, cardiac arrhythmias and methaemaglobinaemia. \nThe first indication of toxicity is often the feeling of tingling around the mouth.\nConvulsions should be treated with i.v. diazepam and/or thiopentone +/- intubation if necessary to protect the airway.\n \nThe cardiovascular toxicity of local anaesthetics generally requires higher blood levels than for CNS toxicity (exception is bupivacaine, due to high tissue binding). \nVentricular arrhythmias are difficult to treat (don\'t use lignocaine!!). \nDC cardioversion should be tried early. Give magnesium or beta blockers for torsades.\nMethaemaglobinaemia is treated with methylene blue in ICU.','Rapid sequence induction','#####134','','','','','','','','','Disposition','Observe in the ED for at least 1 hour following the completion of the procedure.\nA patient may only be discharged if he has regained full sensation and movement (within the limits of his injury) in the anaesthetised limb.','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (121,0,0,'N','Cardiac arrest','ABC and early DC reversion are the keys to survival','ED','emerg-med','','','','Protocol','QCOL QDIA QCAR QGIB QMUL QODP QSOB QUAD Heart Respiratory CPR ','','','','','','','','','','','','','1997 Cardiac Arrest Protocol - ILCOR (International Liason Committee on Resuscitation)','','Advanced cardiac life support (ALS) comprises Basic Life Support (BLS) which is performed in all cases of cardio-respiratory arrest, and specific therapies to restore spontaneous ventilation and circulation.','','','','Basic Life Support (BLS)','Treatment','1. Confirm diagnosis of cardiac arrest:                       \n\nAbsent carotid or femoral pulse, spontaneous respirations, response to verbal or noxious stimuli.\n[Note that the BLS algorhythm for the general public no longer includes this step, as there was reasonable evidence that the general public could not asses whether or not a pulse was present] \n\n2. Establish the airway\n\nTilt head, jaw thrust, clear mouth and pharynx, ventilate with self inflating bag and mask with high flow O2. Intubation may be performed at a later stage if necessary.\n\n3. Commence cardiopulmonary resuscitation(CPR)\n\nChest compressions - 100 per minute with a compression : relaxation ratio 1:1.\nHyperventilate - 2 breaths to 15 compressions','Video of Basic Life Support (BLS_','documents/BLS.mpg','','','','','Video of Basic Life Support - treatment of choking','documents/BLSchoking.mpg','','','Advanced Life Support (ALS) - core treatments','','Only oxygen, defibrillation and epinephrine (adrenaline) have any real weight of evidence to support their use.\n\nAs VF/ pulseless VT is by far the most survivable cause of cardio-respiratory arrest, defibrillation is the most important step to master, and the most important question to ask yourself is \"is it VF or pulseless VT?\"\nDefibrillate early if indicated, with energies shown below.\n\nEpinephrine (adrenaline)/ Vasopressin\n\nIf there has been no response to initial CPR or defibrillation, give 1 mg adrenaline i.v. stat and continue other measures. This dose of adrenaline should be repeated every 3 minutes if there is no response. Vasopressin (ADH) is an alternative, with theoretical advantages, however there is no current (2002) evidence of superiority, only equivalence.\nHigh dose epinephrine e.g. 100 mcg/kg (5 mg)  has been associated with an increased rate of successful resuscitation, but no change in the survival to discharge.\n\nIntravenous fluids  \n\nLarge bore cannula in antecubital fossa or CVP. Run in 1000 ml Normal Saline stat. DO NOT give dextrose unless arrest is known to be secondary to hypoglycaemia. Colloids are expensive, offer no advantages, and may be harmful, so should be avoided.','Video of Advanced Life Support','documents/ALS.mpg','','Is it pulseless VT or VF?','','DC SHOCK immediately 200 Joules. If unsuccesful follow with another shock at 200 Joules and thereafter select 360 Joules (children 3-4 J/kg). Repeat DC shocks frequently (whenever rhythm is VF).\n\nContinue CPR and 3 minutely adrenaline 1 mg\n\nConsider:	 AMIODARONE 5 mg/kg, LIGNOCAINE 1.5 mg/kg, MgCl2 10-20 mmol, KCl 10-40 mmol IV, SOTALOL 1 mg/kg','','','','If not pulselesss VT or VF','','The diagnosis is either \n- Asystole / agonal bradycardia OR\n- Electro-mechanical dissociation','','','','Asystole','','Check ECG leads. If rhythm is in doubt, DC shock 200-360 Joules.\n\nContinue CPR and 3 minutely adrenaline 1 mg, CONSIDER high dose adrenaline\n\nGive ATROPINE 3 mg i.v.\n\nConsider PACING (transcutaneous or transvenous)','','','','Electro-mechanical dissociation','','Identify and treat:\n- hypovolaemia, \n- tension pneumothorax or \n- pericardial tamponade if present.\n\nContinue CPR and 3 minutely adrenaline 1 mg, CONSIDER high dose adrenaline','','','','Other measures','Comments','High dose adrenaline (single dose 5-10mg in adults)\n\nHas been shown to improve the rate of return of return of spontaneous circulation in adults with asystole, but no actual survival benefit. It is integrated into the Advanced Paediatric Life Support  (APLS) algorhythm.\n\nSodium bicarbonate\n\nDo not administer routinely. Give 50 - 100 mmol i.v. only if there has been\n> 20 minutes of continous cardiac arrest OR \nthere is a pre-existing metabolic acidosis (eg: septicaemia).\n\nCalcium chloride or gluconate\n\nRarely helpful unless likely\n- calcium channel blocker toxicity, \n- hyperkalemia or \n- pre-existing documented hypocalcaemia. \nDose is 10 ml of 10% solution    \n\nIsoprenaline\n\nAvoid. Use external pacemaker.\n\nArterial blood gas\n\nABG\'s give NO meaningful information during cardiac arrest - therefore pointless - and are NOT to be performed until several minutes following the return of spontaneous cardiac output.\n\nEndotracheal administration of drugs\n\nIf an i.v. line is not yet established, epinephrine (adrenaline) (2 mg) and lidocaine (same dose as i.v.) may be given down the ETT. Other drugs should not be given by this route.\n\nStopping resuscitation\n\nConsider stopping after 20 - 30 minutes. Go on for longer if young patient/ hypothermic immersion/ drug overdose/ electrocution.','','','','','','','','','','Medical team','Staff','- 1 Team leader\n- 1 Airway doctor\n- 1 or more procedure doctors.\n \nNursing team\n\n- 1 Senior nurse\n- 1 Airwau nurse\n- 1 Scribe\n \nMEDICAL TEAM LEADER\n \n This is the most senior ED doctor or another doctor delegated by him/her.\n \nResponsibilities\n \n- Be responsible for the overall running of the resuscitation.\n- Make all medical decisions\n- Give instructions to other doctors and to nursing staff.\n \n Note: Ideally the team leader should have no procedural responsibilities though in practice it is often necessary for him to take responsibility for the airway or difficult IV lines.\n \nSENIOR NURSE\n \n Responsibilities\n \n- Direct the nursing team\n- Administer drugs\n- Prepare equipment including IV lines and fluids. \n- Perform closed chest compression as required. \n- Assist doctors performing procedures. \n \n AIRWAY DOCTOR\n \n Responsibilities\n \n- Clear and maintain the upper airway. \n- Ventilate with bag and mask using high flow oxygen.\n- Perform endotracheal intubation and hyperventilate with 100% O2. \n- Coordinate ventilations with the person performing chest compressions (1:5) \n \n AIRWAY NURSE\n \nResponsibilities\n \n- Be responsible for assisting the airway doctor until the airway is secured and the airway doctor no longer requires continuous assistance.\n \n Note: Until the airway is secured, the airway nurse must have no other responsibility other than to help the airways doctor.\n \n PROCEDURES DOCTOR\n \n Responsibilities\n \n- Establish IV cannulation in the antecubital fossa, external jugular vein, internal jugular vein or subclavian vein. \n- Commence rapid infusion of 1 litre Normal Saline. \n- Administer drugs as directed by the team leader. \n- Perform other procedures & tasks as directed.\n\n SCRIBE\n \nRecords all interventions and the times they were performed, including the doses of drugs, DC shocks and other procedures.','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (122,0,0,'N','Central line','Avoid subclavian veins if patient likely to need thrombolysis','ED','emerg-med','','','','Protocol','QCOL QDIA QCAR QGIB QMUL QODP QSOB QUAD QTRU CVC venous catheter CVP','','','','','','','','Indications','- To monitor central venous pressure\n- For insertion of a transvenous pacemaker or Swan Ganz\n(pulmonary artery) catheter\n- Administration of phlebitic drug infusions or hypertonic solutions\n- For urgent venous access\n- For fluid resuscitation in extremis (fluid flow down a tube is inversely proportional to\n- the length of the tube\n- the fourth power of the radius','','','','','','','','','','','Contraindications','- Bleeding diathesis including thrombolysis (relative- can use high approach jugular)\n- Infection or cellulitis over the proposed insertion site\n- Untreated pneumothorax on opposite side\n- Uncooperative patient','','','','','','','','','','','','Technique','','Video of central line insertion (jugular)','documents/CVPjug.mpg','','','','','Video of central line insertion (subclavian)','documents/CVPsubclav.mpg','','','Complications','- Arrhythmia\n- Arterial puncture / laceration\n- Thoracic duct laceration\n- Pneumothorax\n- Haemopericardium\n- Malplacement ,ie. internal jugular or contralateral subclavian veins, subclavian artery, pleural space, pericardial space, knotting or kinking\n \nA chest X- ray should always be obtained following insertion of  a central line, to look for complications and to check the positioning of the line.','','','','','','','','','','','','','','','','','','','','','','Monitoring','Equipment','- ECG rhythm monitor\n- Pulse oximeter\n- Intubation equipment\n- Defibrillator\n- Intercostal catheter equipment should be available','','','','','','','','','','','','','','','','Equipment list','','Gloves/ Gown\nSkin prep.\nLarge Tagaderm x1\nNormal saline 10 ml & 500 ml\nSyringe 5 ml x1, 10 ml x1\nNeedles : 	25G x1, 23G x1\n		blunt drawing up x1\nScalpel disposable size 15 blade\nInflatable pressure bag x1\nPressure monitor & cable x1\nTransducer & tubing (M/N CMS 311L, P/N 42-000423-00 REV.A) x1 \nLignocaine 1% 5 ml x1\nSuture 3.0 nylon on cutting needle x1\nAntibacterial ointment x1\n Arrow percutaneous sheath introducer kit or Triple Lumen CVC \n Chest Tray :	Hand huck towel x1\nGown x1\nMedium drapes x2\nHuck towels x2\nMedium bowl x1\nMedium kidney dish x1\n\nNeedle holder x1\nToothed forceps x1\nSuture scissors x1\nSponge holders x1\nStraight artery forceps x1\nWhite gauze 7.5 cm2 x 10','','','');
INSERT INTO `MedHelp` VALUES (123,0,0,'N','DC cardioversion','Emergency cardioversion of unstable non-fasted patients needs rapid sequence induction and intubation','ED','emerg-med','','','','Protocol','QCOL QCHP QCAR QODP','','','','','','','','','','','','','','Indications','Urgent cardioversion is indicated if haemodynamic compromise e.g. hypotension, syncope, ischaemia or CCF\n1. Atrial flutter\n2. Paroxysmal atrial fibrillation (AF) when duration < 3 days\n3. Atrial fibrillation (AF) when duration < 6 months & anticoagulated\n4. Narrow complex tachycardia when drug therapy has failed and/or cardiac output is severely compromised\n5. Broad complex tachycardia when cardiac output is severly compromised or patient is unconscious (otherwise drug therapy first)','','','','','Contraindications','Relative contra-indications\n1. Digoxin toxicity - induced arrhythmias\n- These arrhythmias do not respond well to cardioversion and serious ventricular irritability can be induced eg ventricular fibrillation.\n2. Severe conduction system disease eg heart block\n3. Paroxysmal AF of over 3 days duration and not anticoagulated carries a 5% risk of embolic phenomena on cardioversion to sinus rhythm\n4. AF of over 6 months duration, associated with thyrotoxicosis, sick sinus syndrome, cardiomyopathy myocarditis/pericarditis, markedly enlarged left atrium, or a slow ventricular rate in the absence of drugs','','','','','Equipment','- Check the function of the defibrillator. Ensure gel pads are available.\n- Ensure emergency drugs and resuscitation/intubation equipment is readily available.\n- Check function of bagging circuit.\n- Check suction and connect yanker sucker.\n- Ensure the patient has secure i.v. access and make sure that fluid runs in freely for administration of drugs.','','','','','','','','','','','','Preparation','Unless an emergency procedure, the patient should be fasted for at least 6 hours. If they are not fasted, use rapid sequence induction and ventilation. Use low doses of drugs if the patient\' s BP is low, however fentanyl is safe in normal doses.\n\n- Move patient to resuscitation room.\n- Explain procedure to the patient and obtain informed written consent\n- If the patient is in chronic AF (> 3 days) or has a dilated cardiomyopathy, the patient should have been anticoagulated for 2-3 weeks/ or had a Transoesophageal Echochardiogram prior to cardioversion to prevent systemic embolisation.\n- Record baseline observations.\n- Document arrhythmia on rhythm strip and obtain a 12 lead ECG.\n- Check serum K+ and record. Give K+ if indicated i.e. serum K+ <4.0.\n- Record if digoxin has been given in previous 48 hours. Check serum digoxin level.\n- Apply chest electrodes and select a lead which clearly displays the QRS complex.\n- Activate synchronisation on the defibrillator and ensure the spike is falling on each R wave.','Rapid sequence induction','#####134','','','','','','','','','Technique','2 senior doctors and 2 Critical Care trained nursing staff are necessary\n- Pre-oxygenate patient with 100% O2 for 5 minutes\n- Ensure the patient is adequately sedated (fentanyl 1 mg/kg and midazolam 2.5-10 mg or propofol 2 mg/kg). Use LOW doses of propofol in compromised patients i.e. 50mg max.\n- Expose the patient\'s chest and apply gel pads.\n- Obtain continuous rhythm strip during cardioversion.\n- Ensure synchroniser activated and the spike is falling on each R wave.\n- Charge the paddles to desired joules, normally 50-200 joules, and apply firmly to chest.\n- Ensure no conductive gel or pads between the paddles allowing an alternative low resistance pathway across the chest wall\n- Ensure all staff are away from bed and equipment and that patient is not contacting any person or metal object.\n- Discharge paddles (expect a brief delay) during expiration (trans-thoracic impedance less).\n- Observe response. If no reversion, increase amount of joules to be delivered\n- Note that synchroniser will deactivate after each discharge and will need to be reset\n \nPost Cardioversion\n\n- Do not leave the patient until he/she regains consciousness. If patient remains heavily sedated, place in a coma position and insert naso-pharyngeal airway.\n- Record observations 1/2 hourly for 4 hours.\n- Document reversion with rhythm strip and 12 lead ECG.\n- Document procedure on observation chart e.g. rhythm strip of defibrillation with date, time and amount of joules delivered.\n- Patient should be nil orally until fully conscious.\n\nDefibrillation\n\nThere is no organised cardiac electrical activity so the defibrillator should be in the non-synchronised mode.\n \nSuggested Initial Energies\n\nVentricular fibrillation (VF)			200 joules\nAtrial fibrillation (AF)			100 joules\nAtrial flutter					30-50 joules\nSustained ventricular tachycardia (VT)	100 joules\nSupraventricular tachycardia (SVT)	30-50 joules','','','','','Complications','1. Arrhythmias- may be worse than original!\n2. Skin burns\n3. Regurgitation and aspiration\n4. Embolic episodes, e.g. stroke, PE\n5. Pulmonary oedema\n6. Failure to revert arrhythmia.','','','','','','','','','','Special Situations','Comments','Pacemakers\n\n- Patients with pacemakers can be safely defibrillated, but the pacemaker or the junction between the tip of the pacing wire and the myocardium may be damaged\nMinimise the risk of damage by:\n- using the a lower energy setting to start with- the pacing wires act like ariels and will conduct the defbrillation pulse, delivering more energy.\n- When the pacemaker is in the pectoral region and the lead is in the right ventricular apex, an antero-posterior paddle placement is theoretically safer\n- Facilities for backup pacing should be available - eg external pacemaker.\n- After defibrillation, the pacemaker should be checked\n\nPregnancy\n\n- Defibrillation safe in pregnancy with conventional paddle placement\n- Foetal ECG should be monitored if possible, or else auscultation of foetal heart before and after cardioversion\n \nImplanted defibrillators\n\n- The device continuously monitors the heart rhythm and automatically delivers a cardioverting or defibrillating shock when a malignant tachyarrhythmia is identified\n- Contact supervising physician if patient presents\n- Deactivation of device may be indicated to prevent premature depletion of batteries\n- Trans-thoracic defibrillation can be performed','','','','','','','Cardiac Arrest','#####121','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (124,0,0,'N','Eye examination','Preservation of vision is if the utmost importance. The most important test is the easiest to do- visual acuity\nOnly analgesia & irrigation should precede a formal eye exam. \n','ED','emerg-med','','','','Protocol','QEYE','','','','','','','','Preparation','If topical anaesthesia is necessary, tetracaine (amethocaine) 1% is used. The eye needs to be padded until it becomes painful again, to prevent inadvertant damage while it is anaesthetised.','','','','1. Visual acuity','Examination','Snellen chart, counting fingers at 1 metre\n','','','','2. External eye','',' - bruises, lacerations, fractures etc.','','','','3. Eye movements','','Put one hand on the patient\'s head to keep it still.\nAsk the patient to tell you if they see double.\nMove your finger about 50cm from their face in a cross shape, first up and down, and side to side, then the diagonals.\n- look for tethering, pain on movement and diplopia','','','','','4. Pupils','','Light - bring a light in from the side, so the patient does not focus on it.\nAccomodation - hold finger 10cm from nose - \"look into the distance\" then \"now look at my finger\"\n - size and shape, direct and consensual light reflexes ','','','','5. Visual fields','','Sit opposite the patient and bring in a wiggly finger from the diagonals.','','','','6. Evert upper lids','',' - Foreign body, lacerations','','','','7. Slit lamp','','See separate instructions for slit lamp use. Use fluorescin, and topical anaesthetia as necessary.\n- hyphaema, foreign body','','','','8. Ophthalmoscopy','','Use the best ophthalmoscope you can find. It does make a difference.\nIf you need to dilate the eyes, use tropicamide 1% drops, and warn the patient not to drive etc. for the next 2-3 hours. ','','','','','','','','','','','','','','','','','','','','','','','Treatment','1. Review all eye conditions at 48 hours\n2. Do not prescribe steroid drops unless directed by an ophthalmologist\n3. Do not give the patient local anaesthetic drops to take at home\n4. Pad an anaesthetised eye for at least 4 hours\n5. Advise against driving if an eye is padded\n6. Remember tetanus prophylaxis in eye injuries\n7. Use antiemetic in penetrating eye conditions\n8. Beware of the unilateral red eye: (FIGUT) \n- Foreign body\n- Iritis/ episcleritis\n- Glaucoma\n- Ulcer (especially dendritic)\n- Trauma','The red eye- NEJM review','documents/rredeye.pdf','','','','','','','');
INSERT INTO `MedHelp` VALUES (125,0,0,'N','Near patient testing','','ED','emerg-med','','','','Protocol','QHIN QMUL QCOL QDIA QTRU QODP test i stat i-stat ABG U+E K arterial blood gas urgent ','','','','','','','','Staff','Eligible Patients\n1. Any patient out of hours to avoid a pathology call-back\n2. Triage category 1 & 2 patients\n\nEligible Users\n1. Senior ED Nursing Staff\n2. Night Duty Co-ordinators (Nursing)\n3. ED Consultants','','','','','','','','','','','Description','Cartridge Types\nG3+	\n- pH, pCO2, pO2, Bic, tCO2, BE, SpO2\n- must be out of refrigerator 4 hours before use\n\n6+\n- Na, K, Cl, U, Glc, Ht, Hb\n- must be out of refrigerator 5 minutes before use\n\nCartridge Storage\n- Store all cartridges in the drug room fridge\n- Keep a total of 4 cartridges of each type out of the fridge with the i-STAT analyser\n- When replacing a used cartridge, write a use by date (14 days from current date) and a time out of fridge on the cartridge packaging','','','','','','','','','','','','Technique','1. Ensure simulator is run when required (once a day)\n2. Check cartridge time out and use by date\n3. Tear pouch at tear symbol w/\n4. Remove cartridge from pouch - handle from sides, don\'t touch electrodes nor squeeze cardboard\n5. Take blood & mix syringe thoroughly (roll between hands and invert 12 times)\n6. If not heparinized syringe then use blood within 3 minutes\n7. Expel 2 drops of blood into waste\n8. Run blood into well of cartridge until fill mark is reached\n9. Fold snap cover over using clear side of cover\n10. Push cartridge into analyser, i-STAT sign up. DO NOT try to remove until a result is displayed (LCK message displayed until then) or else analyser will break \n11. Enter operator ID and push ENT, patient ID & push ENT, repeat patient ID & push ENT\n12. Enter patient temperature eg 38*1 & push ENT until get to Sample\n13. Enter blood sample type eg 	1 = ART, 2 = VEN & then push ENT\n14. Push up arrow s to move through pages to view results\n15. Print results as required','','','','','Information','Printing i-STAT Results\n1. Line up printer to the i-STAT infrared port\n2. Switch printer on (red light shines)\n3. Press PRT on i-STAT\n\n Common Causes of Errors\n- Over- or under-filling cartridge well\n- Squeezing cartridge in middle\n- Air bubbles or blood clots','','','','','Remember','i-STAT will not detect blood haemolysis','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (126,0,0,'N','Body fluid exposure','If high risk source AND significant exposure, consult.\nChronic hepatitis C IS preventable. \nDiscuss these cases discuss with the Infectious Diseases physician on call.','ED','emerg-med','','','','Protocol','QEXP Needlestick ','','Advice','Early agressive interferon regimes prevents chronic Hepatitis C. Therefore any patient with a high risk exposure to Hepatitis C needs very careful monitoring. Consult an ID physician for advice about this.','Preventing chronic hepatitis C (NEJM)','','','Definitions','History','Recipient/ affected person	= person exposed to blood or body fluid\nSource/ donor = person whose blood or body fluid was inoculated or splashed onto the affected person. May be unknown.','','','','','','','','','','1. Determine if significant parenteral exposure','Treatment','- superficial or penetrating injury with an object contaminated with blood or body fluid\n- prior or recent wound or skin lesion contaminated with blood or body fluid\n- mucous membrane or conjunctival contact with blood','','','','2. Perform initial decontamination if not already done','','- skin - wash affected area well with soap & water\n- eyes	- rinse gently but thoroughly with water or normal saline\n- mouth - rinse with water several times','','','','','3. Determine recipient\'s Hep B immunisation status','','Dates of immunisations and antibody levels, if done.','','','','4. Contact source individual\'s treating doctor','','- determine source risk for HIV, Hep B, Hep C\n- ask source\'s treating doctor to get consent and take blood for HIV, Hep B, & Hep C serology (pre-typed pathology request in \"Needlestick Injury Kit\")','','','','5. Contact pathology department','','- inform to expect specimens from source and recipient\n- determine when results will be available in order to organise next appointment','','','','6. Counsel recipient','','- risk of contracting HIV from blood contaminated needlestick is very low, 0.3%\n- risk of contracting Hep B & Hep C is a bit higher\n- anti-viral therapy against HIV is reserved for high risk source exposures at < 8 hours, preferably < 2 hours, as it has significant side effects including aplastic anaemia\n- Hep B immunoglobulin will be administered within 48 hours if there are inadequate protective levels of Hep B s Ab (< 10 IU/L) & source Hep B +ve or unknown\n- blood taken today for Hep B s Ab, and serum held for 12 months for HIV & Hep C, as these tests only tell your status prior to the exposure\n- if source positive or unknown, further tests will need to be done at 3 & 6 months to be totally reassured safe\n- blood test results will only be given in person, not over the telephone\n- until results are available, best to practice safe sex for partners sake\n- state when will see next, who will see, results will be given, & further counseling\n- ensure recipient has copy of staff information sheet from \"Needlestick Injury Kit\"','','','','7. Take blood from recipient','','- pre-typed pathology request in \"Needlestick Injury Kit\"','','','','8. Consider','','- Tetanus prophylaxis\n- Hep B Immunoglobulin & vaccination\n- HIV antiviral therapy (only after consultation with infectious disease consultant - can cause death/ hepatic failure)\n- Discussing case with Emergency Physician','','','','','','','','','','','','','Infectious disease referrals','#####172','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (127,0,0,'N','Temporary pacemaker - transvenous','','ED','emerg-med','','','','Protocol','QCHP QCOL QCAR QODP QDSH','','Indications','1. A bradycardia which is sustained and does not respond to drug treatment and is decompensating (syncope, hypotension, cardiac failure, or angina) or predisposing to malignant ventricular arrhythmias.\n  \nThe commonest bradyarrhythmia requiring pacing is third degree heart block.','','','','','','2. Some cases of ventricular tachyarrythmias (eg: Torsades ) in which the heart may be overdriven by temporary pacing. This will be rarely if ever performed in the ED.','','','','','','In patients with bradyarrhythmias, always try atropine before pacing. Adrenaline may also be tried, but isoprenaline is not recommended as it tends to cause hypotension. If there is haemodynamic decompensation with no response to drug therapy, use transcutaneous pacing whilst setting up for a transvenous pacing wire.','Transthoracic pacing','','','','','','','','','','Equipment','- 2 insulated conducting wires\n- convertible to a unipolar system should one lead of the bipolar system fail\n(functioning electrode is attached to the positive terminal of the pulse generator and a skin electrode is attached to the negative terminal).\n- a small distal balloon \"floats\" the electrode into the correct position (if you are lucky...)','','','','','Medtronics 5375 pacing generator unit','','This is one of the most common pacing units for ED use. While not particularly modern, it is robust and easy to use. \nAny pacemaker should be stored with a fresh battery.','','','','Pacemaker modes','','A 3 letter code describes a pacemaker\'s operational modes:\n\n1st letter - Chamber which is PACED\n A = Atrium, V = Ventricle, D = Dual		\n2nd letter - Chamber which is SENSED	\n A = Atrium, V = Ventricle, D = Dual, 0 = None	\n3rd letter - MODE or RESPONSE\n I = Inhibited,	T = Triggered, D = Dual, R = Reverse, 0 = None\n\nIn temporary pacing, two basic modes are used:\nVVI = Demand mode: the pacemaker senses and paces the ventricle. The output is inhibited if ventricular activity is detected.\nV00 = Fixed rate:  the pacemaker produces a pacing output irrespective of ventricular activity.\n\nRATE: Sets pacing rate (pulses per minute)\n\nSENSITIVITY: Sets the level (in millivolts) of spontaneous cardiac electrical activity which the unit is able to detect. Thus at lower mV values, the unit is more sensitive - ie: it can sense weaker cardiac electrical signals.\n\nOUTPUT:	The magnitude of the generator\'s pacing output in milliamps. Note that this differs to other units where the output (amplitude) may be measured in volts\n\nPACE Light:		Blinks synchronously (red) with generator\'s output.\n\nSENSE Light:	Blinks (red) when spontaneous cardiac signals are sensed.','','','','','','','','','','Central venous cannulation and insertion of catheter sheath','Technique','- preferentially use the right internal jugular vein or left subclavian vein.\n- locate the vein with a needle\n- pass a guidewire though the needle into the vein (never let go of the wire)\n- withdraw the needle leaving the guidewire in situ\n- make a stab incision in the skin at the point of wire entry\n- slide a vessel dilator and sheath together over the guidewire into the vein\n- Remove the guidewire and dilator leaving the sheath in situ\n- Attach a catheter / sheath adaptor (to accommodate a size 5 to 6 Fr catheter)\n- Suture the sheath into place and cover with large clear plastic dressing. \n- Ensure blood can be easily aspirated and then flush ','','','','Preparation of pacing wire and pulse generator','','- Insert the pacing wire through the catheter shield \n- Check the balloon - use the supplied syringe and a specified volume of air (0.7-1.2 mL)\n- Attach the catheter shield to the sheath adaptor and expand the clear plastic protective cover along the pacing wire\n- Program initial settings on Pulse Generator but do not turn the unit on at this stage	\n			\nMode: O	\nRate:	80 ppm	\nSensitivity: 20 mV	\nAmplitude: 3.0 mA','','','','Insertion of wire and setting up pacing','','- Insert the pacing wire into the sheath to a distance of 20 cm (markings are 10 cm apart)\n- Attach the external pulse generator to the pacing wire, ensuring correct attachment of the positive and negative terminals. \n- Ensure that the MODE dial is in the O position (OFF).\n- Inflate the balloon and float slowly to 30 cm (should be in Right Ventricle)\n- Deflate the balloon\n- Switch external transcutaneous pacing off (if present)  \n- Turn the generator on for VVI. The unit now generates a pacing output.\n- Whilst watching the ECG monitor, advance the pacing wire slowly until capture occurs OR the 45-50 cm mark is reached\n- If no capture occurs by 50 cm, withdraw the pacing wire to 30 cm.\n- Increase OUTPUT to 5 milliamps and try again\n- If capture still not achieved, repeat withdrawing back to 30 cm, increasing the OUTPUT by 1 milliamp each time and advancing to a maximum of 50 cm.\n**These distances refer to an average patient using the right internal jugular route- other routes may require additional distance.','','','','Pacing threshold and output','','Output (mA) \n- Once capture is consistently achieved, determine the output threshold. Gradually decrease the output to find the minimum amperage that consistently paces the heart.\n- Now set the output setting to twice the value of this threshold plus 1 mA.\n Sensitivity\n NOTE: Increased sensitivity means that the pacing wire\'s sensor is able to detect weaker electrical signals. Thus on the sensitivity dial, the lower the setting in mV, the more sensitive is the detection of spontaneous cardiac activity.\n \n- Reduce pacemaker rate to less than the patient\'s spontaneous rate.\n- Gradually reduce the mV setting of the SENSITIVITY dial (thus increasing the unit\'s sensitivity) until the pacemaker starts to detect the patient\'s own electrical activity. When this occurs the red SENSE light will flash in synchrony with spontaneous heart beats.\n- Further increase the sensitivity by setting the dial to half the threshold value (mV).\n- Return pacemaker\'s rate to desired rate.\n\nDocument measurements: \n (1) Distance wire inserted (2) pacing threshold (3) sensitivity threshold\n- Document settings:	\n- (1) Pacing mode (2) output (mA)  (3) sensitivity setting (mV)\n- Chest X-Ray to exclude pneumothorax & confirm position (wire should be relatively   straight without loops & tip should be located in endocarium of right ventricle).','','','','Failure to pace','','- Increase the pacemaker\'s output amplitude to maximum\n- Try VOO mode - prevents over sensing of electrical signals & pacemaker inhibition\n- Check all leads and connections (most common cause)\n- Consider replacing pacemaker unit or batteries\n- Check pacing wire insertion distance and consider adjusting','','','','','Complications','1. Complications associated with any CVC line insertion\n2. Arrhythmias\n3. Failure to capture \n4. Oversensing (with inappropriate inhibition of pacemaker\'s output)\n5. Undersensing (potential for dangerous R on T if pacemaker generates an impulse soon after a spontaneous heartbeat)\n6. Ventricular perforation ( cardiac tamponade, diaphragmatic pacing)\n7. Thrombus formation','','','','\'Overdrive\' pacing of ventricular arrhythmias','Technique','Indications:\n1. Failure of drug therapy\n2. Recurrence of arrhythmias\n3. Contraindications for cardioversion eg digoxin intoxication\n\nTechnique:\n1. Underdrive ventricular pacing at rates less than that of the tachycardia may occasionally be successful\n2. Timed ventricular premature beats may be effective but is complex\n3. Ventricular \"burst\" pacing is simple and effective\n- ventricle is paced at 120% of the spontaneous VT rate for 5 to 10 beats.\n\n- complications include:\n - entrainment ie \"speeding up\" of the VT\n -  precipitation of VF','','','');
INSERT INTO `MedHelp` VALUES (128,0,0,'N','Temporary pacemaker - transthoracic','','ED','emerg-med','','','','Protocol','QCAR QCHP QDSH QODP cutaneous ','','','','','','','','Indications','1. Any sustained symptomatic (syncope, hypotension, cardiac failure, or angina) bradycardia of any origin which does not respond to prompt medical treatment\n2. If bradycardia predisposes to malignant ventricular arrhythmias','','','','','Background','TRANSCUTANEOUS PACEMAKERS\nDesigned to deliver a current across the chest sufficient to pace the heart.\nSpecial pads and careful placement are required to ensure maximal current flow through the heart while minimising side-effects.\nThese pads are placed either:\n- Normal defibrillator position, along the axis of the heart, as indicated on the packet containing the pads, OR\n- Anterior/ posterior on the left chest, over the heart/ on the back, between scapula and paraspinal muscles\nThe usual current needed to capture is in the range of 40-120 mA. \nHigher current/ different pad positions may be tried. Emphysematous, or grossly obese patients may be difficult.','','','','','','','','','','Pacemaker modes','','Two modes are used commonly in temporary pacing:\n1. VVI = ventricular demand = paces the ventricle, senses ventricular activity, ventricular impulses inhibit the pacemaker\n2. VOO = fixed rate, asynchronous = paces the ventricle with no sensing','','','','','Using the defibrillator / external pacing unit','Technique','1. Apply pads correctly and connect to the defibrillator with the pacing unit.\n2. Connect monitor to pacing unit (varies with different units)\n3. Check \"sensing\" \n- sensitivity may need adjustment\n- indicator light or display on monitor to show that it is sensing\n4. Choose demand mode and set rate at 70-100 per/min.\n5. Set current - start at 30-50 mA, increase as required.\n6. Commence pacing\n7. Adjust current \n- increasing by 10 mA until capture occurs\n- maintain at lowest necessary to pace\n','','','','','','','','','','','','','','','','Failure to capture','Comments',' Consider:\n- pads and placement\n- faulty connections\n- \"sensing\" problems or insufficient current\n- incorrect technique or indication','','','','Side effects','','1. Painful muscular contractions and twitching common, and becomes pronounced toward 100 mA. (minimise by correct pad placement and lowest necessary current.) \nCautious use of conscious sedation e.g. morphine/ fentanyl and midazolam are useful.\n2. Vomiting and hiccoughs - due to pacing of the diapragm - may be eased by sedation/ repositioning of electrodes\n3. Arrhythmia\'s (?due to pacing ?due to underlying disease)','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (129,0,0,'N','Chest drain','NEVER USE A SHARP-ENDED TROCHAR- THROW IT AWAY','ED','emerg-med','','','','Protocol','QMUL QSOB QTRU QAST QCAR QDIS intercostal catheter haemothorax pneumothorax effusion ','','Background','Spectacular damage including multiple organ perforation and instant death has been acheived with sharp-ended trochar. Do not use the trochar. \nDescribed below is the ATLS (EMST) technique which is safe.','','','','','Indications','- Pneumothorax - large (>50%) or traumatic\n- Haemothorax\n-  Large pleural effusion','','','','','','','','','','','Contraindications','','','','','THROW THE TROCHAR AWAY','Technique','- Aseptic technique\n- 14 to 24 G ICC in non-traumatic pneumothorax, 28-32 G ICC in trauma\n- 5th intercostal space (nipple level)\n- Mid axillary line (lateral border of pectoralis major)\n- Above the rib below\n- Incision is 11/2 times diameter of tube, 2 cm below insertion interspace (bigger than you think you will need)\n- Blunt dissection through intercostal muscles with large artery forceps\n- Consider inserting finger through hole to ensure in thorax and lung not palpable\n- Advance ICC until last side hole is 5 cm inside chest wall\n- Ensure correct connection to drainage device\n- Never clamp an intercostal catheter\n- Always perform a CXR post ICC insertion','','','','','','Complications','Perforation of any thoracic or upper abdominal organ.','','','','','','','','','','','','','','','','','','','','','','','','','Pneumothorax','','','','','','Needle thoracostomy','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (130,0,0,'N','Needle thoracostomy','Don\'t wait for a CXR - Just Do It','ED','emerg-med','','','','Protocol','QSOB QAST QCOL QCAR QDIS QTRU QMUL tension pneumothorax ','','','','','','','','','- 14G/ 16G i.v. cannula\n- Affected side - the side the trachea is pushed away from.\n- 2nd intercostal space\n- Mid-clavicular line\n- Above the rib below\nShould hear a hiss of gas, as it is released under pressure. Leave the cannula in place, repeat your ABC, and prepare to put a chest drain in.','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','Pneumothorax','#####46','','','','','Chest drain','#####129','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (131,0,0,'N','Pleural aspiration','Different sites for fluid or for air','ED','emerg-med','','','','Protocol','QSOB QUAD QAST QSOC pneumothorax effusion ','','Background','An ultrasound may help decide where the optimum place is for tapping an effusion','','','','','','','','','','','Indications',' - Pleural effusions which do not need a chest drain.\n - Pneumothorax that is not large enough (>40%) that a chest drain is needed, but is large enough (>10%) to be worth draining','','','','','','','','','','','Preparation','Prepare the patient\n- explain what is going to be done\n- explain why, and outline complications - lung/ vessel/ nerve damage.\nRecruit a nurse who will be able to be able to stay with the patient throughout the procedure.\n?pre-medicate with fentanyl or midazolam if anxious','','','','','','Equipment','Either use:\na long standard 16G cannula, a three way tap, and some standard i.v.i. tubing OR \nA specially designed pleural aspiration kit, with a guarded (spring loaded) needle.','','','','Positioning the patient','','Good positioning is critical to the success of the procedure, and the comfort of the patient.\n\nFor an effusion, have the patient sitting on the side of the bed, leaning forward with their elbows out, and their head and elbows supported by a pillow on a table. This expands the ribs, and moves the scapulae out of the way.\n\nFor a pneuthorax, have the patient reclining comfortably at 45 degrees.','','','','','','Percuss the chest on both sides to work out the site of entry. Remember that the liver pushes the diapragm up on the right.\nFor air, use the mid-clavicular line, second intercostal space anteriorly.\nFor fluid, use the posterior axilliary line. The long thoracic nerve runs in the mid-axillary line\nInfiltrate local anaesthetic 5-10mls of 1% lidocaine (lignocaine). Aspirate to check that the placement is correct.','','','','','','','','','','','','Assemble the needle/ 3 way tap/ and a syringe for air. For fluid, use tubing and a collection bag/ jug','','','','','','Insert cannula and hold in place.\nWhile the patient is breathing out slowly, extract the needle, so that cannula is left in place.\nAspirate fluid/ air to check positioin','','','','','','','','','','Post aspiration','','Repeat CXR in expiration.','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (132,0,0,'N','Involuntary psychiatric treatment','Be aware of safeguards, both for you and the patient.','ED','emerg-med','','','','Information','QBEH QDSH QMEN QODP psychiatric commiting certify recommend','','Background','There are plenty of examples of abuse of the power to detain people who are assessed as psychiatrically incompetent to remain in the community. \nYou need to take your responsibility to the community and the patient seriously. \nIn the emergency department we do not have to worry about ongoing assessment, but the question should be \n\"if I let this patient go, will he/she be likely to harm themselves or others?\".\nIf you cannot answer \"no\", then the patient needs an opinion from the psychiatric liaison team (see link below), and should be restrained, physically or chemically, until this is possible.','','','','','','','Suicide risk assessment','#####114','','','','','','','','Involuntary psychiatric admission','','A doctor may regulate a patient if in his opinion the patient is at risk either to himself or to others and requires treatment in a psychiatric institution. Every attempt must be made to persuade the patient to come into hospital as a voluntary patient. \n\nThe regulatory process requires 2 forms. The request (schedule 1) is to be completed by a relative or \"authorised person\" (nurses, doctors, etc). Schedule 2 is the medical recommendation which supports this. The recommendation (schedule 2) cannot be completed with information solely gained from others and the certifying doctor must record evidence of mental illness he has observed in the patient himself. Do not be pressurised into recommending a patient by the police or any other agency, even if a Schedule 1 has been completed. You must make up your own mind as to whether or not a patient is indeed mentally ill and just because a person acts \"strangely\" or abusively is not grounds for regulation under the mental health act. Other forms of documentation exist but little relevance to ED practice.','','','','','','','','','','','Voluntary psychiatric admission','','Voluntary admission usually require the authorisation of the consultant psychiatrist or registrar on call. ED medical staff should liaise with the Psychiatry Registrar or the multi-disciplinary psyciatry assessment team. It may be necessary to communicate directly with the consultant. A medical examination is mandatory prior to patients going to the psychiatry ward. In the ED it is only necessary to screen out any significant medical illness which is either coexistent with or contributory to the psychiatric condition. Occasionally it is not possible to medically examine the patient. The reasons for this must be recorded in the notes. ','Multi-disciplinary psyciatry assessment team','#####158','','','','','','','','','','','','','','Dealing with the aggressive unco-operative patient','','Sometimes a patient refuses treatment which is deemed necessary on medical grounds. This may include the management of drug overdoses or the administration of medications. The law is unclear on the issues involved for medical staff. A doctor performing an invasive or restraining procedure against a patient\'s expressed wishes may be liable to charges including assault and battery or trespass against the person. The question is whether the patient is mentally competent to rationally give or withhold consent. It is likely (but not certain) that a doctor will be protected in law if a procedure is performed in good faith in order to prevent likely significant morbidity, injury or death. \n\nThe converse may also arise - a doctor may be liable if he fails to administer necessary life saving medical treatment if the patient was not mentally competent to give or withhold consent. A prudent course of action, therefore, is to proceed with treatment if it is absolutely necessary to prevent death or significant morbidity. This last statement does not apply to blood transfusions in adult Jehovah\'s Witnesses.\n\nIt is essential to have very good documentation in these circumstances and if at all possible, a second medical opinion must be obtained and also written into the notes. If the patient is uncooperative due to a drug induced delirious state, the fact that the patient is not lucid and therefore not in a condition where he/she is mentally capable of giving or refusing informed consent should be clearly indicated in the notes. This should also be corroborated by another doctor if possible.\n\nA significantly suicidal or acutely psychotic patient must be regulated under the mental health act. Again, a decision whether to proceed with medical treatment against a regulated patient\'s wishes is unclear in law. If the patient\'s psychotic state is such that he/she cannot give or withhold informed consent, document the fact in the notes and have another doctor corroborate it if possible. Then use all reasonable means to proceed with necessary treatment. If, however, he is otherwise lucid and refuses treatment, it is advisable to seek the advice of the consultant psychiatrist on call before proceeding with invasive or restraining procedures and to notify the medical administrator on call.','Physical and chemical restraint','#####170','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (133,0,0,'N','Discharge against medical advice','Manage the risk - safety first, then aim for patient satisfaction ','ED','emerg-med','','','','Protocol','QDSH QMEN QODP QBEH','','','','','','','','Background','Discharge against medical advice should not be regarded as a failure of treatment. It is the patient\'s right to leave, if they are competent to make that decision.\nYour aim should be to present the facts, and let the patient make the decision. Try to understand it from the patient\'s perspective.\nEither way, the patient should leave the department satisfied.','','','','Who cannot self-discharge','','Patients who are not legally competent to make this decision include:\n- patients whose mental state does not permit them to make rational decisions.\n- patients under the age of 16.','','','','Cultural/ behavioural factors','','Be alert for patients who are unlikely to want to stay in hospital. Offer specific assistance if you think it might help e.g. medicated withdrawl for alcoholics, use of an interpreter, specific ethnic liaison teams.','','','','','','The patient should leave the department aware that they can return to the department if their condition deteriorates, or they are worried.\nReassure the patient that they will not be discriminated against if they return.\n\ne.g. if the patient does not want to come into hospital for i.v. therapy, arrange oral antibiotics and early review.','','','','','','','','','','','','','','','','','','','','Multi-disciplinary psyciatry assessment team','#####158','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (134,0,0,'N','Rapid sequence induction','Don\'t panic! If saturations dropping, use bag and mask','ED','emerg-med','','','','Protocol','QMUL QTRU QDIS QCAR QCOL anaesthetic emergency  ','','Background','The most reliable means to ensure a patent airway, provide ventilation & oxygenation, and prevent aspiration is endotracheal intubation.','','','','Who is going to be difficult to intubate? - Get Help','','1. Immobilised trauma patient\n- Prevents optimal head & neck positioning\n- Continuous in-line axial stabilisation by an asssistant required\n2. Children\n- Larynx is higher in neck\n- Epiglottis is high & very soft\n- Prominent occiput brings mouth too far anterior to larynx\n- Airway in child is shorter\n3. Short neck\n- Visualisation of cords more difficult\n4. Prominent upper incisors\n- Limits space for airway equipment to pass\n5. Receding mandible\n- More difficult to negotiate the angles\n- Desirable to have 3 fingerbreadths between mandibualr symphysis & hyoid bone\n6. Limited jaw opening\n- Idealy need 2 to 3 fingerbreadths diameter\n7. Limited cervical mobility\n- Commonly in elderly & in patients with rheumatoid arthritis or similar conditions\n8. Upper airway conditions\n- Angioneurotic oedema, peritonsillar abscess, burns, penetrating neck injury, epiglottitis\n9. Facial trauma\n10. Laryngeal trauma\n- Closed injuries or separation of trachea from larynx serious\n- Avoid paralysis especially if patient maintaining any airway at all\n- Consider an awake intubation under local anaesthesia','','','','','Staff','Ensure adequate assistance:\n- Airway assistant for cricoid & equipment\n- Assistant for manual in-line axial stabilisation (if required)\n- Assistant to administer induction drugs','','','','','Equipment','Check adequate minimum monitoring equipment:\n- NIBP\n- ECG\n- SpO2\n- EtCO2\n\nCheck intubation equipment:\n- Laryngoscope: preferably fibre-optic, bright white light, appropriate blade size\n\nEndotracheal tube sizing:\n- female adult  7.5 \n- male adult 8.0 \n- child  4+( age /4)\n\n- cuff intact\n- adapter not loose\n- high volume, low pressure cuff for > 6.0 ETT\n- lubricant\n- Suction working and placed under pillow or mattress\n- Self inflating reservoir type bag ventilating device\n- Oxygen supply\n- Pillow (not if suspected cervical spine injury)\n- Syringe\n- Tape for securing ETT once inserted','','','','','Preparation','Ensure i.v. access and i.v. fluid line running freely\n\nCheck drugs and instruct on doses\n\nPre-induction\n- Lidocaine (may reduce increase in intracerebral pressure)\n- Fentanyl\n\nInduction\n- Thiopentone\n- Etomodate\n- Ketamine\n- Propofol \n\nParalysis\n- Suxamethonium\n- Rocuronium/ Vecuronium\n\nOther\n- Atropine\n- Ephedrine\n- Metaraminol','','','','','Cricoid pressure (Sellick\'s manoeuvre)','','Ensure assistant knows how to perform cricoid pressure & instruct not to let go until told to.\nThe pressure used should be enough to dent a tennis ball.\nThe trachea should be pushed Back, Up, Right and Posterior (BURP) for maximum ease of intubation.','','','','','','','','','','','','','','','','Pre-oxygenation','','Pre-oxygenate for 5 minutes (if possible) with self inflating reservoir type bag (do not ventilate unless apnoeic).\nPre-oxygenation is very helpful, as it gives you a lot of time to achieve successful intubation. \nA reservoir bag gives nearly 100% inspired oxygen concentration, compared with 60% with a normal Hudson mask.','','','','','','','','','','Induction','','Induce anaesthesia (rapid injection of induction agent e.g. thiopentone).\nApply cricoid pressure.\nInject suxamethonium.','','','','Intubation','','Intubate and inflate balloon\nCheck ETT placement\n- EtCO2 trace\n- Bladder syringe aspirates freely\n- Proprietry detection devices.\n- Stethoscope check of air entry to both sides of chest.\nLength of  ETT at teeth should be 15+(Age/2) in children. Usually 22-23 cm in adults.\nRelease cricoid pressure once ETT placement confirmed\nSecure ETT with tape','','','','Ventilation','','A ballpark figure for Tidal Volume is 10mls/kg ','','','','Other points','','Insert OGT (if facial trauma) or NGT \nProtect the body\n- tape eyes\n- pad pressure areas- elbows/ occiput\nCXR','','','','Maintenance of sedation','','bolus doses/ infusions of opiate and benzodiazepines OR propofol OR ketamine AND a paralysing agent need to be used.','','','');
INSERT INTO `MedHelp` VALUES (135,0,0,'N','Conscious sedation','Know how to cope if it goes wrong. \nDo not sedate a patient without the senior doctor in the department being aware of what you are doing.','ED','emerg-med','','','','Protocol','QLIM QWOU','','','','','','','','Background','Sedation for diagnostic and surgical procedures (with or without local anaesthesia) includes the administration by any route or technique of all forms of drugs which result in depression of the central nervous system. \n\nThe objective of these techniques is to produce a degree of sedation of the patient, with minimal loss of consciousness, so that uncomfortable diagnostic and surgical procedures may be facilitated.\n\nThese techniques are not without risk because of: \n- The depression of protective airway reflexes.\n- The depression of respiration.\n- The depression of the cardiovascular system.\n- The wide variety of drugs and combinations of drugs which may be used.\n- The difficulty in predicting absorption, distribution and efficacy of drugs when administered orally or rectally.\n- The possibility of excessive amounts of these drugs being used to compensate for inadequate local analgesia.\n- The individual variations in response to the drugs used particularly in the elderly or infirm.\n- The wide variety of procedures performed.\n\nThus it is important to understand the variability of effects which may occur with sedative drugs, however administered, and that over-sedation or airway obstruction may occur at any time. To ensure that standards of patient care are satisfactory, equipment and staffing of the area in which the patient is being managed should satisfy certain requirements.','','','','','Preparation','The patient should be assessed before the procedure and this assessment should include: \n- A concise medical history and examination, especially of the airway & cardiovascular system\n- time fasted\n- Informed consent.\n- Any instructions for preparation for the procedure (including the importance of fasting), the recovery period, and discharge of the patient (including avoidance of driving, other dangerous activities, undertaking responsible business).\n\nIf the patient has any serious medical condition or danger of airway compromise, or is a young child or is elderly, then an emergency physician or  aneaesthetist should be present to monitor the patient during the procedure.','','','','','','','','','','Who can perform conscious sedation','Indications','The person giving these drugs requires sufficient basic knowledge to be able to:\n- Understand the actions of the drugs being given, and how these may be affected by the patient\'s medical condition.\n- Detect and manage appropriately any complications. Doctors administering sedation must be skilled in airway management and cardiovascular resuscitation. ','','','','','Records','','A written record of the dosages of drugs and the timing of their administration must be kept as a part of the patient\'s records. Such entries should be made as near the time of administration of the drugs as possible. This record should also note the readings from the monitored variables, and should contain other information such as:\n- Documentation of the pre-anaesthetic assessment of the patient\n- summary of general medical status by relevant systems and diseases\n- concurrent therapy and any known drug and other sensitivities\n- the history of previous anaesthesia and relevant surgery.\n- assessment of the airway, dental condition and risk of gastric reflux.\n- results of relevant laboratory data and other investigations.\n- the pre-medicant drugs, time given, route of administration and a description of any unusual response (if not recorded elsewhere).\n- The anaesthetic technique used','','','','','Staff','There must be an assistant present during the procedure appropriately trained in resuscitative measures who shall monitor the level of consciousness and cardio-respiratory function of the patient.\n- The operator may provide the sedation and be responsible for care of the patient provided that rational communication to and from the patient is continuously possible during the procedure.\n- If at any time such rational communication is lost, then the operator must cease the procedure and devote his/her entire attention to monitoring and treating the patient until such time as another practitioner becomes available to monitor the patient and take responsibility for any further sedation, analgesia or resuscitation.','','','','Heavy sedation','','Techniques which compensate for anxiety or pain by means of heavy sedation must not be used unless an emergency physician or anaesthetist is present. e.g. dislocated hips.','','','','','','','','','','','Equipment','The procedure must be performed in a location which is adequate in size and staffed and equipped to deal with a cardiopulmonary emergency. The resuscitation rooms fulfill all requirements. These must include:\n- An operating table or trolley which can be readily tilted.\n- Adequate uncluttered floor space to perform resuscitation should this prove necessary.\n- Adequate suction and room lighting.\n- A supply of oxygen and suitable devices for the administration of oxygen to a spontaneously breathing patient. Note that all patients receiving sedation should receive oxygen at 6 l/min via mask.\n- A means of inflating the lungs with oxygen (eg a range of  oral/ pharyngeal airways and self-inflating bag suitable for artificial ventilation).\n- Appropriate drugs for cardiopulmonary resuscitation and a range of intravenous equipment. (see Appendix)\n- A pulse oximeter.\n- Ready access to a defibrillator.\n- Intubation equipment and difficult intubation equipment','','','','Monitoring','','All patients undergoing intravenous sedation must be monitored continuously with pulse oximetry. This equipment must be set to alarm when the saturation is less than 91%.\n\nOther monitoring equipment which should be available:\n- non-invasive blood pressure\n- continuous ECG monitor','','','','','Technique','The technique used is at the discretion of the supervising doctor.\nDrugs which can be used without senior supervision include:\nfentanyl +/- nitrous oxide 50%\nmorphine and nitrous oxide\nmidazolam alone\nmidazolam and nitrous oxide 50%\nnitrous oxide alone\n\nDrugs which can be used only by accredited ED registrars, consultants, and anaesthetic personnel only include\nketamine\npropofol\nmidazolam in combination with opiates. ','','','','','Disposition','The patient should be discharged only after an appropriate period of recovery and observation in the procedure room or resuscitation area which is adequately equipped and staffed.\nDischarge of the patient should be authorised by the practitioner who administered the drugs, or another appropriately qualified practitioner. The patient should be discharged into the care of a responsible adult to whom instructions should be given.\n\nAdequate facilities must be available in the recovery area for managing patients who have become unconscious or who have suffered some medical mishap. These facilities should be similar to those listed under C and D above.','','','','','Comments','Emergency drugs should include at least the following:\n- epinephrine\n- atropine\n- dextrose 50%\n- lidocaine\n- naloxone\n- flumazenil (never to be used routinely)','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (136,0,0,'N','Swan-Ganz catheter','','ED','emerg-med','','','','Protocol','QCOL QDIA QCAR QGIB QMUL QODP QSOB QUAD','','','','','','','','Indications','- To monitor CVP, PCWP, CO, SVR, mixed venous sampling\n- For insertion of a transvenous pacemaker ','','','','','','','','','','','Contraindications','- Those of central venous catheterisation','','','','','','','','','','','','Equipment','- As for central venous catheterisation\n- Pressure transducer monitoring equipment\n- Percutaneous sheath introducer kit \n- Swan-Ganz Catheter\n- Pressure transducer & lead to monitor','','','','','','','','','','','','','','','','','Technique','1. Insert percutaneous sheath (see CVC protocol)\n2. Prime all ports with normal saline\n3. Connect transducer to PA port & zero on monitor\n4. Insert SGC through plastic protector\n5. Test balloon with the recommended amount of air\n6. With balloon deflated, insert SGC to 20 cm\n7. Attach plastic protector to percutaneous sheath & expand over SGC\n8. Inflate the balloon with the recommended amount of air\n9. Recording the pressure tracings & readings while advancing the catheter will identify the individual right heart chambers & the pulmonary artery','','','','','','','','','','','Complications','- As for central venous catheterisation\n- Entanglement of SGC','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (137,0,0,'N','Glue ','','ED','emerg-med','','','','Protocol','QWOU superglue wound laceration ','','Background','Glue is quick and can produce good cosmetic results if correctly used. The glue we use now is a new formulation (octyl- cyanoacrylite) which is flexible when it has set. \nThe previous glue was similar to standard cyanoacrylite glues (e.g. Superglue) that you can buy at hardware stores. The older style glue is brittle when it has set, which can increase the risk of it flaking off/ being picked at.\nLike suturing, the final result is dependant on the skill of the operator.','','','','','','','','','','','Indications','Glue is often used in children. It has the advantage of not requiring injections of local anaesthetic. Topical local anaesthesia may be helpful, and also contains vasoconstrictors, which make the wound dry, and more easy to glue.','','','','','Contraindications','Complex, deep or dirty/ infected wounds are better treated with other techniques. \nDo not use glue over an area of tension e.g. extensor surfaces of limbs.','Wound care','#####141','','','Preparation','Explain what you are going to do, and why you are doing it.\nProtect vulnerable areas - e.g. eyes - with gauze padding.\nWear gloves - it is not a good idea to glue yourself to the patient.\n\nTopical local anaesthesia is a good idea. Topical anaesthesics include\nAmethocaine - Lignocaine - Adrenaline/ Tetracaine - Lidocaine - Epinephrine) OR\nCocaine - Adrenaline\nThese need to be applied to the wound using a small amount of cotton wool, and left in place for 20 minutes.','','','','','','','','','','','','Technique','Clean and dry the wound.\nStretch the skin along the axis of the wound.\nApply a thin film of glue on the surface.\nHold the tension along the wound until it is dry.\nRepeat several times.\nMany thin layers is much better than one or two thick ones.\nThe glue dries (polymerises) exothermically, which commonly causes some pain on the first or second layer. It is a good idea to warn patients that this will occur, and that it is a good sign.\nThe glue takes about 3 minutes to reach full strength, but the surface may remain sticky for up to 5 minutes.','','','','','','','','','','','','Give the parent a handout','Glue handout','#####150','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (138,0,0,'N','Staples','','ED','emerg-med','','','','Protocol','QWOU QMUL wound laceration ','','Background','Quick and effective way of closing wounds.\nExpensive\nDifficult to use well.\nDo not need local anaesthetic, although sometimes necessary for adequate cleaning.\nVery useful in patients apt to pick at sutures e.g. deliberate self harm','','','','','','','','','','','Indications','Large linear lacerations in an area where a perfect scar not particularly important (scalp, back)\nClean wound','','','','','Contraindications','Wounds on face, complex or dirty/ infected wounds.','Wound care','#####141','','','Technique','After cleaning thoroughly, use a pair of toothed forceps to pull the skin together, and evert slightly.\nStaple firmly, and check that the staple is in a good position, centred over the middle of the wound.','Video of stapling technique','documents/staples.mpg','','','','','','','','','','','','','','','Removal','','Patients can go to their local doctor to have staples removed. Give the patient a staple removal tool for this.','','','','','','','','','','','','Give the patient a handout about staples','Staples handout','#####151','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (139,0,0,'N','Suturing a wound','','ED','emerg-med','','','','Protocol','QWOU QMUL stitch laceration ','','Background','See also\n-Wound care\n-Tetanus','Wound care','#####141','','','','','Tetanus','#####142','','','Preparation','Must be performed under sterile conditions. The use of excessive numbers of sutures is associated with increased risks of wound infections therefore use as few sutures as possible and avoid the use of subcutaneous sutures unless absolutely necessary. ','','','','','','','','','','','Technique','Use monofilament sutures in all locations apart from the scalp where Silk or Vicryl may be used. Make sure that sutures are not too close nor are tied too tight. Use 4/0 for most situations but 5/0 on the face, 6/0 for delicate structures and 3/0 occasionally on the trunk or over joints. \n\nInterns are not to suture faces except under supervision. Extensor tendon repairs may be undertaken if you have the appropriate knowledge and skills. Flexor tendons are never to be repaired in the ED. Injuries involving the medial half of the eyelid are for ophthalmologists only.','Basic interupted sutures (video)','documents/sutinterupt.mpg','','','','','','Deep sutures (video)','documents/sutdeep.mpg','','','','','Vertical mattress sutures (video)','documents/vertmattress.mpg','','','','','Horizontal mattress sutures (video)','documents/suthorizmattress.mpg','','','','','Suturing corners (shown while rotating a flap) (video)','documents/sutrotflapcorner.mpg','','','Disposition','Some sutured wounds should be reassessed after 3 or 4 days, otherwise arrange for removal of sutures by a GP at an appropriate time. \n\nAs a GUIDE to Removal of sutures: \n\nface: 3-5 days, \nscalp: 7-10 days, \nupper limbs: 7 -8 days, \nlower limbs: 8-10 days, \nsole of foot: 14 days (often not necessary to suture), \nextensor joint surface: 10-14 days, \ntrunk: 8-10 days, \nback: 14 days, \ndelayed closure: 8-12 days. \n\nAlways consider application of Steri-strips following removal of sutures to spread the tension across the wound.','','','','','','Give the patient a suture handout','Suture handout','#####149','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (140,0,0,'N','Thrombolysis','Make sure they have had an aspirin.\nIf indicated, the sooner the better','ED','emerg-med','','','','Protocol','QCHP QUAD QDIA','','','','','','','','Indications','1. > 30 minutes (but < 12 hours) of ischaemic cardiac pain and\n2. Any of the following ECG changes thought to be of acute onset\n- at least 1 mm ST segment elevation in at least 2 adjacent limb leads or\n- at least 2 mm ST segment elevation in V1 & V2 leads or\n- at least 1 mm ST segment elevation in 2 other adjacent precordial leads or\n- new complete bundle branch block\n3. Pulmonary embolism (see separate protocol)','','','','','Contraindications','Absolute contraindications\n1. Aortic dissection\n2. Acute pericarditis\n3. Active internal bleeding or active peptic ulceration\n4. Previous cerebral haemorrhage, intracerebral vascular disease (aneurysm, A-V malformation), cerebral neoplasm\n\nRelative contraindications\n1. Potential haemorrhagic focus:\n- < 6 months - gastro-intestinal or genitourinary haemorrhage or stroke\n- <4 weeks - major surgery, organ biopsy, puncture of a noncompressible vessel, prolonged CPR, major trauma, minor head injury\n- Diabetic proliferative retinopathy\n- Severe uncontrolled HT (SBP > 180 mmHg or DBP > 100 mmHg) - control with GTN infusion first\n2. Bleeding diathesis, hepatic dysfunction\n3. Pregnancy\n4. Therapeutic levels of anticoagulation.','','','','','','','','','','Choice ','Dose','reteplase or alteplase if\n1. Prior streptokinase or\n2. < 75 years old and < 4 hours pain duration and anterior infarct with haemodynamic compromise\nOtherwise use streptokinase (SK)','','','','','Requirements before thrombolysis','','1. Aspirin 300mg (soluble or chewed) unless truly allergic or ACTIVE ulcer - consider glycoprotein IIb/IIIa inhibitor. Remember that aspirin gives as much benefit as thrombolysis.\n2. i.v. access.\n3. Diagnostic ECG with ongoing pain.\n4. Absence of contraindications.','','','','','Treatment','Angioplasty\n- Urgent PTCA are the alternative when thrombolytic therapy is contraindicated/ there is cardiogenic shock AND/OR is possible within 1 hour of hospital presentation by individuals skilled in these procedures and with appropriate surgical backup.\n\nStreptokinase\n1. Streptokinase 1.5 million units in 100 ml 0.9% saline\n2. Infuse over 1 hour (100 ml/hr)\n3. Side effects:\n- Haemorrhage\n- Hypotension (common)\n- Allergy\n- Reperfusion arrhythmias\nIf the patient becomes hypotensive, stop the infusion for a few minutes and then restart. If hypotension persists, repeat and restart at a lower rate.\n \nRecombinant Plasminogen Activator (r-PA) (Reteplase)\n1. Give Heparin 5000 units bolus IV\n2. Reconstitute 2 vials (10 units/vial) of r-PA using the sterile H2O supplied\n3. Give two 10 unit boluses IV over 2 minutes, 30 minutes apart\n4. Commence Heparin infusion at 1000 units/hr\n5. Side effects:\n- Haemorrhage\n- Reperfusion arrhythmias \n- Allergy\n\nRecombinant Tissue Plasminogen Activator (rt-PA) (Alteplase)\n1. Commence heparin therapy simultaneously\n2. Reconstitute 2 vials (50 mg/vial) of rt-PA using the sterile H2O supplied (strength will be 1 mg/ml)\n3. Give 15 mg (15 ml) bolus i.v.\n4. Infuse 0.75 mg/kg RT-PA (maximum 50 mg) over 30 min\n5. Then infuse 0.5 mg/kg RT-PA (maximum 35 mg) over 1 hour\n6. Side effects:\n- Haemorrhage\n- Reperfusion arrhythmias \n- Allergy','','','','','','','','','','','','','','','','','Tests','Baseline pathology (you do not need the results before begining thrombolysis):\n- Cardiac enzymes/ Troponin\n- FBC\n- U&E\n- Coagulation profile\n- Blood group & save','','','','','','','','','','Heparin','','- To be used when thrombolysis with reteplase or alteplase\n- 5000 unit bolus i.v.\n- 1000 unit/hr i.v. infusion\n- APTT to be performed 6 hours after starting infusion as per protocol.','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (141,0,0,'N','Wound care','Only close wounds less than six hours old (unless on face).','ED','emerg-med','','','','Protocol','QWOU QABI QMUL','','','','','','','','Background','All patients with wounds requiring any surgical manipulation are to be treated in the ED Operating Theatre wherever possible.\nSurgical sterile technique is to be observed. This includes the wearing of sterile gloves and the creation of a sterile operating field by the use of skin preps and sterile drapes.','','','','','','','','','','Clean and contaminated wounds','History','All accidental wounds are, by definition, contaminated. The degree of contamination is a function of the nature of the injury and the time since injury. Even in wounds which are not grossly soiled with bacterially laden material, contamination is progressive. ','','','','Wound classification','','Clean  =  no contamination	\nMinimal contamination :	0 - 6 hours\nModerate contamination : 	6 - 12 hours\nHeavily contaminated : > 12  Hours\n\nOnly surgically clean wounds may be surgically closed. A minimally contaminated wound may be converted into a clean wound by excising necrotic and contaminated material and evacuating blood clot.','','','','','Types of closure','','Primary Closure: Suturing within 6 hours of injury\n\nDelayed Primary Closure: A class 2 or 3 wound is cleaned and debrided and then left for 3-5 days by which time local wound immunological defences are optimal. If there is then no clinical evidence of infection, the wound may be closed. \n\nSecondary Closure: Delayed closure of a wound several days or weeks after the injury and implies the formation of some granulation tissue between the wound edges. It is often necessary to excise the wound margins and closure may involve grafting or other plastic techniques.\n\nHealing by Secondary Intention: Wound is allowed to heal by granulation.','Glue wound closure','#####137','','','','','Suture wound closure','#####139','','','','','Staple wound closure','#####138','','','','','','','','Six hour rule','','A wound becomes colonised and contaminated and shall not be primarily closed if > 6 hours have elapsed since the time of injury. The only exception is for wounds to the face which may be closed up to 24 hours post injury following careful cleaning, debridement and irrigation. ','','','','Dirty wounds','','Patients with dirty wounds less than 6 hours old should be given an intravenous dose of antibiotic prior to manipulation of the wound (penicillin or ceflalexin). \nIf the wound can be scrubbed clean, primary closure may be proceeded with. Otherwise leave open and consider admitting the patient to hospital or review in dressing clinic. \nBeware of permanent tattooing by gravel, bitumen etc, due to inadequate wound cleaning and debridement. If > 6 hours have elapsed since injury, the wound is treated as if it is contaminated (see below).','','','','Contaminated wounds','','[ > 6 hours, dirty wounds which cannot be adequately scrubbed clean and animal bites]\nWhen a wound is identified as contaminated, treatment comprises systemic antibiotics and surgical debridement of the wound. Give antibiotics as an i.v. bolus dose prior to manipulation of the wound. Benzyl penicillin, flucloxacillin or a second generation cephalosporin are appropriate.\nFollowing the stat dose of i.v. antibiotic, perform a \"surgical scrub\" and debridement under local anaesthesia and apply a sterile \"non-adherent\" dressing applied. The patient should reviewed by a plastic surgeon in 4 days for reassessment. At this visit a decision is made whether to perform delayed primary closure, secondary closure or to allow healing by secondary intention. It is important to record in the notes the PLAN for such wounds.','','','','','','','','','','','','WOUND DRESSINGS\nThe correct choice of wound dressing plays a significant role in the healing of a wound and the prevention of complications. The evidence supporting the advantages of newer (and more expensive) dressings is often poor.\n\nSUTURED WOUNDS\nUse simple \"non-adherent\" dressing (Adaptic and gauze/combine or Melolin) with a crepe bandages to keep the dressing in place and add compression as required. Dressings should be left intact by the patient. \n\nOPEN WOUNDS\nThe trend is towards a moist healing environment and the use of semi-occlusive dressings which promote this.\n\nNON OCCLUSIVE DRESSINGS\nThese are permeable to fluids and gases and create a dry wound. This may be an advantage for wounds which are excessively weeping and discharging, however it has been shown that healing of clean open wounds is retarded by the use of dry dressings. In addition, adherent dressings (eg: gauze, combine) may pull off the surface of a healing wound when the dressing is removed. So-called non adherent dressings are not much better (eg: Tulle gras, Bactigras, Adaptic, Melolin, Primapore, Inadine).\n\nSEMI OCCLUSIVE DRESSINGS\nPOLYURETHANE FILMS: Superficial wounds and burns may be covered with Opsite or Tagaderm. These dressings also relieve pain. Wound exudate often collects under these dressings and can be released by making a nick in the dressing or the dressing can be replaced every couple of days. Being transparent, these dressings also give good visibility of the wound.\n\n HYDROCOLLOIDS: A number of specialised dressings (eg: DuoDerm, Allevyn, IntraSite Gel) actively adsorb exudate from the wound and promote a moist healing environment. Ideally, after the first couple of days, these dressings should be left intact for up to 10 days. The dressings interact with the wound and a yellowish gel forms over the surface of the wound which is not pus, even though it smells foul. However, there is also an increased incidence of wound infections when semi-occlusive dressings are used.\n\nCALCIUM ALGINATE (Kaltostat). This is an interesting sea weed derived material which has several uses in wound care. The dressing actively interacts with the wound and there is an exchanger of calcium ions which is said to have something to do with promoting healing and haemostasis. Whatever the theory, Kaltostat is particularly useful for bleeding and oozing wounds. ','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (142,0,0,'N','Tetanus','','ED','emerg-med','','','','Protocol','QWOU QABI QMUL immunisation ','','','','','','','','','','','','','','Indications','Tetanus prophylaxis should be updated routinely every ten years. \nA tetanus prone wound 5 years since the previous injection does not require a booster. \nA tetanus prone wound occurring 5 years since the previous injection requires a booster: ','','','','','','','','','','','Dose',' Adults and children 10 years give Adult Diphtheria and Tetanus toxoid (ADT 0.5 ml IM). \nChildren 10 years give CDT. \n\nIf the patient\'s immunisation status is unknown and it is a dirty wound, give tetanus immunoglobulin and ADT (first of a course).','','','','','','','','','','','','Contraindications','Allergy, or previous reaction to tetanus toxoid.','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (143,0,0,'N','Paediatric blood sampling','Have two goes, then get someone else to try','','emerg-med','','','','Protocol','QUCH QIRR QWOR QCRY QDIA QMUL QTRU','','','','','','','','Background','- invasive testing in children can be traumatic ( for child, parents & doctor) and samples can be difficult to obtain\n- before embarking on an invasive test ask yourself :\n- how necessary is the test & will it change my management ?\n- how urgent is the test : can it be deferred to allow time for appropriate topical anaesthesia prior ? - in many cases pertaining to the ED, the answer is no.\n- is it likely that i.v. access will be needed ? - if so do this at the same time & take blood from the cannula.\n- are there any other tests that should be done ? - liaise with senior medical staff so that these can be done at the same time.','','','','','','','','','','','Preparation','- prepare appropriately : have all the necessary equipment at hand\n- use universal precautions\n- have an experienced assistant : do not utilise parents to restrain the child\n- explain to parents the reason for the test & ensure that they consent/assent to the procedure\n- explain the procedure to the child if of an appropriate age\n- allow parents the option of remaining with the child or leaving the room during the procedure\n- approach child in a calm non threatening manner, attempt to gain the child\'s trust & be prepared to use methods to distract the child','','','','','','','','','','','Venepuncture','Technique','- use 25-21G needle. A butterfly needle with tubing is often better in young children as it allows for possible movement by the child.\n- a 2.5ml syringe will suffice for most tests if the appropriate paediatric pathology tubes are used (refer to wall charts in the department as to the correct tube for each test)\n- select site : the cubital fossa is often the most appropriate\n- restrain child adequately with the limb to be used exposed\n- the assistant can often act as a tourniquet in smaller children & infants\n- prep skin with alcohol swab\n- pierce skin with needle, at an angle almost flush to the skin & advance needle to enter vein whilst gently aspirating\n- do not apply too much suction to the syringe as this may cause the vein to collapse\n- after blood has been collected, remove tourniquet & apply pressure','','','','','','','','','','Capillary blood sampling - heel prick','','Useful in small infants & neonates\n- can be used for all tests except for blood culture\n- up to 1-2ml of blood can be collected in this manner\n- technique :\n- warm foot prior to procedure\n- have pathology tubes ready & open\n- grasp heel in one hand, encircling the heel\n- use smear of vaseline under the puncture area to assist drops to form for easier blood collection\n- cleanse skin with alcohol swab\n- pierce skin with sterile lancet\n- allow blood to drip into tubes or collect into a capillary tube & then place in pathology tube','','','','Butterfly/ broken needle technique','','- use veins on dorsum of hand\n- grasp the wrist between your index & middle fingers, with your thumb over the fingers flexing the wrist (this achieves both compression & immobilisation)\n- cleanse skin with alcohol swab\n- using either a 25G butterfly or a 23G needle with the hub broken cleanly off, pierce skin & cannulate vein\n- blood is then allowed to drip directly into opened pathology tubes\n- once enough has been collected, release tourniquet, remove needle & apply pressure','','','','','','','','','','','','','','','','','','','','','','Arterial blood gas','','Rarely indicated\n- indicated if there is suspected hypoxia, hypercapnia or severe acidosis with poor peripheral perfusion\n- acid/ base status alone can be assessed on capillary blood\n- use the brachial or the radial artery\n- never use the ulnar artery & only use the femoral artery in cases of extreme emergencies.','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (144,0,0,'N','Paediatric fluid management','','ED','emerg-med','','','','Protocol','QUCH QDIR QVOM QWOR QBUR fluids ','','','','','','','','','For specific situations e.g. burns/ diabetic ketoacidosis, refer to specific recommed ','','','','Electrolyte Requirements','','Sodium : 2 mmol/kg/day\nPotassium : 2 mmol/ kg/day\n \nFluid & electrolyte balance can generally be maintained by use of a solution such as 1/5 isotonic saline in 4% dextrose with 20mmol/L of potassium chloride.\n\nOther solutions such as 1/2 isotonic saline with 5% or 2.5% dextrose or isotonic saline in 5% dextrose are used when replacing an existing deficit as well as providing for maintenance requirement.\n \nN.B. These (e.g. 5% dextrose) solutions do not provide any significant energy.','','','','','','','','','','','','- when commencing intravenous therapy in children it is advisable to check rates and choice of fluid with senior medical staff','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (145,0,0,'N','Intraosseus infusion','The fluid will not flow in- you have to use a syringe to push it in','ED','emerg-med','','','','Protocol','QABC QCOL QCAR QMUL QTRU QODP QDIS i.v. QCRY QIRR iv venous access blood ','','','','','','','','Background','A safe and reliable method for rapidly establishing a route for administration of:\n- drugs\n- fluids\n- blood products\n \n- Used as a temporary measure during the resuscitation of children when intravenous access may be difficult or impossible.\n- Useful in children 6 years and under [can be used in adults if using special needle for harder cortex]\n- Can be reliably achieved in 30-60 seconds, even with minimal experience\n- Any intravenous drug or fluid used for resuscitation can be safely administered by the intraosseous route\n- Onset of action and drug levels are comparable to those after intravenous administration\n- Fluids for rapid volume resuscitation should be administered under pressure\n- Temporary measure only, replace when other vascular sites become available','','','','','','','','','','','Indications','Use in the collapsed child needing resuscitation where unable to achieve intravenous access in 30-90 seconds.\nProlonged attempts at intravenous access are probably futile.\nIntraosseous access may be replaced with i.v. access when child is more stable.','','','','','','','','','','','','Contraindications','Do not put intraosseus needle into a broken bone\nAvoid bones with a more proximal limb bone fracture if possible.\nAvoid making more than one hole in the bone','','','','','','','','','','','Technique','Identify tibial tuberosity, then insert 1-3cm below and just medial to tuberosity\nUse as aseptic technique as possible while being quick.\n- clean skin over insertion site with antiseptic.\n- check needle ; ensure the bevels are properly aligned, and that the stylet is locked into the main needle. \n- hold knee and stabilise the tibia, but do not allow any portion of your hand to rest directly behind insertion site\n- use a gentle but firm twisting or drilling motion and direct the needle nearly perpendicular to the skin, away from the epiphysis.\n- stop advancing when a sudden decrease in resistance is felt\n- remove stylet\n- aspirate bone marrow - this can be used for culture, Hb, U&E and glucose and Blood Cross match\n- stabilise needle and slowly inject 5-10ml of normal saline\n- watch for signs of extravasation\n- if test injection successful, join infusion set and syringe to needle\n- secure needle and tubing with tape and support with a bulky dressing\n- Successful insertion is indicated by :\n- sudden decrease in resistance as needle passes through bony cortex into marrow\n- the needle can remain upright without support\n- marrow can be aspirated\n- if intraosseous needle not readily available, a short, wide gauge spinal needle can be used','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','Complications','- occur in less than 1%\n- local effects on bone marrow and bone growth are minimal\n- common reported complications are :\n- tibial fracture\n- compartment syndrome\n- skin necrosis\n- osteomyelitis','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (146,0,0,'N','Paediatric i.v. cannulation','Have enough people to ensure success','ED','emerg-med','','','','Protocol','QUCH QDIR QDIA QVOM QMUL QTRU QCRY QIRR intravenous iv ','','','','','','','','Equipment','The necessary equipment should be assembled BEFORE you start the procedure.\n\nYou will need :\n- an assistant- sometimes two\n- a trolley with a clean working area and sharps container\n- alcohol swabs for skin prep\n- dry swabs\n- appropriate sized cannulae : 22G or 24G in small children, 20G may be used in older children\n- i.v. bung & 3-way tap with extension tubing\n- 2.5 or 5ml syringe\n- normal saline for flushing\n- appropriate sized splinting\n- pre-cut tapes for securing cannula :\n- 3 x steri-strips or strips of sleek - 0.5 x 6cm\n- Elastoplast for securing limb to splint : 3 strips of appropriate size\n- small transparant film dressing\n- syringe & appropriate pathology tube for blood collection if blood is to be taken at the same time\n- gloves (universal precautions to be used at all times)','','','','','','','','','','','Preparation',' Before you start :\n- ensure adequate explanation given to parents & to child (if able to comprehend) - even very young children will be reassured by an explanation of what is about to happen\n- give parents the option of remaining with the child or leaving the room temporarily','','','','','','','','','','','','Comments','Site selection :\n Be patient and take the time to look carefully for the best site, if you cannot identify a suitable vein it is best to seek more experienced help early.\n Suitable sites include :\n- dorsum of hand\n- cubital fossa\n- anatomical snuff box\n- volar aspect of forearm\n- dorsum of foot\n- great saphenous vein at the ankle\n- scalp veins should be only used as a last resort','','','','','','','','','','','','','','','','','Technique','- always use universal precautions\n- flush bung, three-way tap & extension tubing\n- select site & apply tourniquet\n- appropriately restrain child - it is sometimes helpful to wrap small children in a sheet\n- often , in small children the assistant can act as both restrainer & tourniquet\n- if vascular access is not required immediately, apply topical local anaesthetic (EMLA) but remember, this takes one hour to work\n- prep skin with alcohol swab\n- insert cannula just distal to the vein and at an angle of 10-15% with the skin\n- when a large vein is entered, a \"flash\" of blood will enter the hub of the needle\n- at this point, ensure cannula lies flush with the skin & advance a further 1-2mm along the line of the vein\n- remove the needle & advance the cannula along the vein up to the hub\n- correct placement is indicated by backflow of blood from the cannula\n- if blood samples are needed, take them now\n- connect bung or extension tubing\n- clean spilt blood from skin with alcohol swab & allow to dry\n- strap cannula securely :\n- use steristrips or 0.5cm width strips of sleek \n- initially use two inverted crossover straps and another over the top (note that Tegaderm or Opsite alone are generally not suitable for securing cannulae in small children, but may be placed over secured cannula)\n- flush cannula with normal saline to confirm placement\n- splint limb to an appropriately sized, padded board using Elastoplast or similar tape, keeping thumb free\n- wrap limb in crepe bandage','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (147,0,0,'N','Lumbar puncture','An experienced assistant is the most important ingredient!','ED','emerg-med','','','','Protocol','QUCH QDIR QVOM QWOR QFIT QCOL QUAD QCRY QIRR LP meningitis subarachnoid','','','','','','','','Indications','Indications :\n- fever with no obvious clinical focus in an infant or toddler\n- fever with headache &/or meningism\n- fever and prolonged seizures\n- possible subarachnoid haemorrhage','','','','','','','','','','','Contraindications','- depressed conscious state, focal neurological signs or coma\n- thrombocytopaenia, known or suspected clotting defect or bleeding diathesis\n \n If there is any doubt regarding conscious state or the stability of the child, \n treat empirically for meningitis & omit lumbar puncture. \n If still needed, this can be done once the child is more stable.','','','','','Equipment','- an experienced assistant\n- sterile dressing tray\n- sterile drapes\n- chorhexidine &/or betadine skin prep\n- gauze squares\n- sterile CSF collecting tubes x 3 : labelled 1-3\n- CSF manometer : older children\n- local anaesthetic : 1% lignocaine 5ml \n- 5ml syringe & 25G needle for infiltration of local anaesthetic\n- appropriate size spinal needle 22-25G :\n- length : 30mm for neonates & infants, 40mm for 1-4yo, 50mm for 4-10yo & 60mm for older children\n- occlusive dressing','','','','','','','','','','','','Preparation','- assemble equipment\n- explain procedure to patient/ parents & obtain consent (verbal)\n- give parents the option of remaining with the child or leaving the room while the procedure is performed (NB LP can be distressing, especially if it does not go to plan)\n- explain procedure to child as appropriate if able to comprehend\nWarn about risk of headache (30%), infection.','','','','','','','','','','','Technique','- use universal precautions & strict aseptic technique\n- if time permits, topical anaesthesia with EMLA may be applied but this requires one hour to work. \n**Do not delay an urgent procedure in order to wait for this**.\n- position child & use assistant to maintain child\'s position, note that adequate positioning is crucial to the success of the procedure. The correct position is :\n- patient in lateral position with hips & shoulders flexed\n- spine should be manually flexed without compromising the airway : note that flexion of the neck in small infants may cause airway obstruction & apnoea\n- the back should be perpendicular to the horizontal axis of the bed and should be as close to the edge of the bed as possible\n- identify landmarks :\n- palpate the iliac crests - they lie at the level of the L3-L4 interspace\n- palpate this space in the midline','','','','','','- use this space or the space below for the lumbar puncture\n- wash hand & put on gloves\n- open CSF tubes & have ready\n- cleanse skin with chlorhexidine or betadine\n- place sterile drapes around site\n- infiltrate site with local anaesthetic : raise skin bleb then infiltrate more deeply; aspirate before injecting to avoid accidental intravascular or spinal injection of local anaesthetic\n- recheck patient position\n- grasp spinal needle with bevel facing upwards\n- insert needle into skin at selected site, ensure needle is perpendicular to the back\n- aiming towards the umbilicus, slowly advance needle until loss of resistance signifies passage through the ligamentum flavum','Video of lumbar puncture','documents/lp.mpg','','','','','','','','','','','','','','','','- withdraw stylet & wait for CSF to appear in the hub\n- if no CSF appears :\n- advance needle slowly until CSF appears\n- try rotating needle through 90-180 degrees\n- if this does not work, withdraw needle, recheck position & try again\n- the presence of blood rather than CSF in the hub signifies :\n- traumatic tap : should clear with time, collect fluid & will need to account for this when interpreting results\n- entry into epidural or spinal veins : does not clear over time - withdraw needle & try again\n- to collect CSF :\n- ensure patient remains still\n- place labelled tubes in order under hub of needle & allow CSF to drip into tubes\n- collect 8-10 drops per tube\n- be patient : do not rush this stage. NEVER ATTEMPT TO ASPIRATE FLUID FROM NEEDLE\n- note colour of fluid : turbid fluid indicates bacterial meningitis\n- once fluid is collected, remove needle , apply pressure at site for 30-60 seconds & cover site with a light dressing\n- send tubes to pathology; request :\n- CSF glucose (normal = 1/2-2/3 that of serum glucose) & protein (normal = 0.15-0.45gm/L)\n- CSF microscopy\n- cell counts : red cells, white cells (polymorphs & lymphocytes); note that the differential red cell count between the 1st & the 3rd tube is important in distinguishing a traumatic tap - the red cell count should be lower in the final tube if tap was traumatic\n- the ratio of WBC to RBC in the CSF should be no more than 1 WBC to 500 RBC. A higher ratio signifies an infective process\n- CSF gram stain\n- antigen testing\n- presence of xanthochromia\n- culture & sensitivities\n- ensure that you notify the lab & request that the results be processed urgently, have the result phoned to you directly','','','','','','','','','','','','','','','');
