INSERT INTO `MedHelp` VALUES (149,0,0,'N','Care of your sutured wound','','','','','','','Handout','QWOU stitch ','When to remove the sutures','','Sutures in areas in which scars may show should be removed soon- 5 days or less.\nSutures in areas subject to mechanical stress - elbows/ knees should be removed in 10-14 days, to allow more strength to develop','','','','','','','','','','Bathing/ Showering','','Sutures should be kept dry','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
