INSERT INTO `MedHelp` VALUES (152,0,0,'N','Major Head Injury','Hypotension and hypoxia kill head injured patients','ED','emerg-med','','','','Guideline','QHIN QMUL QASS QBEH QCOL QHED QNEK QVOM QDIS trauma skull CT ','','Cautions','These protocols are concerned with the management of head injury only. It is assumed that in all cases a full primary and secondary survey is performed and that there is appropriate management of co-existing conditions.\nIn ALL CASES:\n - Remember the ABC\'s\n - Protect the cervical spine\n - Don\'t neglect other injuries ','','','','','','','','','','','History','- Time and mechanism of injury. \n- Trends of patient\'s level of consciousness. \n- Concomitant symptoms and other medical conditions (especially epilepsy, diabetes). \n- Alcohol or drugs?','','','','','Examination','Head and Neck\n- Examine scalp and skull for clinical evidence of compound or depressed fracture. \n- Check ears and nose for bleeding or CSF leaks (fractured base of skull). Note that Battle\'s sign & raccoon eyes are LATE signs of fractured base of skull.\n- Examine facial bones including orbits, middle third. \n- Check the cervical spine for local tenderness, deformity and abnormal neurology.\n \nNeurological Assessment\n- Glasgow Coma Scale - repeat often - the motor component is the most important.\n- Assess whether alcohol or other CNS depressants likely.\n\nEyes\n- Pupils - size and reactivity (unequal pupils are probably insignificant if the patient is GCS 15 but of grave significance in the deeply comatose)\n\nSpinal cord\n- Look for lateralising neurological long tract signs . Assess power, tone, reflexes and all sensory modalities. Compare right side vs left, upper body vs lower.\n- Check for priapism and anal tone \n- There may be anaesthesia below the level of a spinal lesion therefore look for facial grimacing in response to a painful stimulus above the clavicles as this may be the only indication of spinal injury.\n- Low BP and inappropriately low pulse rate indicates cervical sympathetic disruption in spinal injury, but look for hidden causes of bleeding. \n \n Up to 15% of comatose head injured patients have an associated spinal injury','','','','Skull X-rays','Tests','Skull X-Rays are not sensitive or specific for significant head injury and NOT to be performed routinely. They should ONLY be ordered for the following :\n - Suspected compound fracture	\n- Possible intracranial foreign body\n- Possible depressed fracture	\n- Suspected child abuse','','','','','Computerised tomography','','Indications\n- Major head injury\n- Minor head injury (see below)\n- Prior to theatre for multiply injured patients. However, if immediate lifesaving surgery is required, CT is delayed until after theatre.\n\nThe timing of CT depends on clinical circumstances. Unless clinical decisions are immediately dependent on the result, the scan can wait until the following day. ','','','','1. Trivial head injury','Treatment','There has been no loss of consciousness or amnesia. GCS = 15.\n- Most of these patients may be discharged home after careful clinical examination. \n- If there is headache, dizziness or vomiting, admit and reassess after 6 hours. \n- CT scan is not indicated unless clinical problems are persistent or deteriorating.','','','','2. Minor head injury','','There has been definite LOC or significant post traumatic amnesia. GCS is 13, 14 or 15 on presentation to the ED. There may be vomiting, dizziness and mild headache but no other abnormal clinical symptoms or signs.\n- Treatment depends on whether there are associated complicating factors. \n- Minor head injuries have the potential to become major head injuries and the fundamental principle of management is repeated meticulous clinical examination (particularly neurological).\n- There is a significant rate of CT abnormalities in this group and CT scanning is now indicated in all patients in whom there has been loss of consciousness or significant post traumatic amnesia. Thus in general the principle to be followed in this group is\n \nCT scanning followed by selective admission.\n \nADMIT: \n \"Moderate Risk\" Group = Minor Head Injury + Alcohol, Progressive Headache, # Base Of Skull, Facial #\'s or Convulsions.\n \"High Risk\" Group = Minor Head Injury + Deteriorating Level of Consciousness, Palpable Depressed Skull #, Compound Skull #.','Indications for CT in minor head injury','','','3. Major head injury','','Definition: The GCS is less than 13 on presentation to hospital.\n\nOxygen should be administered to all head injured patients.\n- If GCS <9, needs rapid sequence induction and ventilation. \n- Urgent CT.\n- Inform surgeons and ICU.\n \n Rising intracranial pressure \n- This is a neurosurgical EMERGENCY and must be recognised and managed urgently. \n- The important CLINICAL SIGNS are:\n- Deteriorating GCS\n- Unequal pupils - larger pupil is ipsilateral to an expanding haematoma. The pressure on the IIIrd nerve is due to the uncus herniating through the tentorium cerebelli.\n- Abnormal respiratory pattern - The exact pattern does not matter but recognition that breathing is abnormal IS important. (Exclude obstructed upper airway or chest trauma).\n- Cushing\'s reflex - High BP is needed to maintain cerebral perfusion (as the blood has to overcome the intracerebral pressure). Lowering the blood pressure (i.e. hypotension due to too much induction agent) kills the patient by stopping cerebral perfusion. \n\nMonitoring TRENDS in clinical signs is important.\n \nNOTE: Despite the urgency of this condition, always obtain a CT prior to theatre. Blind burr holes are only indicated if there is a significant delay in obtaining CT.\n\nIf CT shows an operable lesion, urgent transfer is indicated, unless the patient has a \'classic\' extradural with rapid deterioration when drainage will be done before transfer..','','','','Intubation and ventilation','','Patients with head trauma and a GCS of 8 or less must be intubated and ventilated. In addition intubation may be required for indications independent of the head injury.  All head injured and ventilated patients require CT scan ASAP.\n\nExcept in the moribund patient who is multiply traumatised, NEVER INTUBATE WITHOUT DRUGS. Even in comatose patients, laryngoscopy and intubation without adequate sedation may raise the intracranial pressure significantly for several hours. This may make the difference between a good and poor outcome.\n\nA rapid sequence induction with cricoid pressure is used but one should still aim to induce anaesthesia and to intubate as smoothly and as gently as possible. If the patient is not hypovolaemic, use \n- Fentanyl 1.5 mcg/kg followed by \n- Thiopental (thiopentone) 4 mg/kg and \n- Suxamethonium 1.5 mg/kg. \nMaintain neuromuscular blockade with Rocuronium 0.5 mg/kg initially and thereafter with 0.25 mg/kg increments prn. Maintain sedation with increments or infusions of fentanyl (100 - 300 mcg/hour) or morphine (4 - 6 mg/hour). Supplement as required with midazolam (2 - 5 mg/hour) or propofol (100 - 200 mg/hour). \n\nAll doses should be reduced in the elderly or hypovolaemic patient.\n\nIt is VITAL to avoid hypotension, therefore in the hypovolaemic or otherwise hypotensive patient, use fentanyl as the sole induction agent or together with markedly reduced doses of thiopentone. Note that Ketamine is contraindicated in head injuries.\n\nVENTILATION\nVentilate adequately but DO NOT HYPERVENTILATE initially unless there are signs of rising intracranial pressure (vide supra). Aim to maintain a PaCO2 of around 35 mmHg and ensure good oxygenation. Do not add PEEP unless absolutely necessary to maintain PaO2. An adequate starting regime is a MINUTE VOLUME of 100 mL/kg at a RATE of 10/minute. Check the ABG\'s after 5 - 10 minutes.\n\nHyperventilation is the main treatment of raised intracranial pressure prior to getting the patient to theatre, but is of only temporary benefit as compensation of cerebral blood flow to hypocarbia occurs after a few hours. Thus hyperventilation should be held in reserve until it is actually needed.','','','','Mannitol','','Mannitol 20% should only be given on the advice of a neurosurgeon.','','','','Discharge','Comments','The decision to discharge home a head injured patient\nA patient to be discharged home must be under the supervision of a responsible adult care giver. Head injury instructions are to be given to the care giver in writing. The care giver must have immediate access to transport. If any of these conditions cannot be fulfilled, admit the patient to hospital.\n\nJunior medical staff should not discharge a head injured patient without first seeking the advice of a registrar or consultant','','','','The combative patient','','Combativeness may be due to head injury, hypoxia, hypercarbia, alcohol etc. Control must be gained but a combative, non lucid patient must not be forcibly fought and restrained. Sedative drugs have little role as they confuse the clinical signs of head injury. Be prepared to anaesthetise and intubate (but then obtain CT scan ASAP).','','','','Analgesia','','Head injury is NOT a contraindication to analgesia.\nA patient who is awake enough to be distressed by pain needs analgesia which must NOT be withheld. Narcotic analgesia should be titrated i.v. as usual.','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (153,0,0,'N','Trauma team','','ED','emerg-med','','','','Protocol','QMUL QTRU QDIS','','','','','','','','Background','Studies have shown improved survival for patients managed in hospitals with formal \"trauma teams\" as compared with those without. Similarly, survival is improved in those hospitals that have formal trauma teams and use them as compared with those that don\'t. \n\nTraditional criteria for activation of trauma teams have led to a \"false alarm rate\" of 40-50 %. The introduction of a two-tiered response system may allow a reduction in this false alarm rate, with little influence on the sensitivity of the system to identify all major trauma victims. \n\nThe \"trauma team\" and its response should be akin to the \"cardiac arrest team\" and its response. Members of the team should be familiar with its makeup, their responsibilities and the criteria for its activation. Switchboard staff need to know of the mechanisms involved in initiating a trauma response, and surgical consultant and anaesthetic staff need to know of the responsibilities of their registrars to the team.','','','','Trauma team activation','','A three -tiered response is suggested.\n\nIf patient fits \"mechanism of injury criteria\" ONLY, AND an ED consultant will be in the ED as the patient arrives to meet and assess the patient, do not activate.  Otherwise activate Trauma response.\n1. Trauma response activated upon notification from ambulance service according to set physiological and anatomical criteria.\n2. Extended trauma response if two or more patients expected that fit anatomical or physiological criteria\n\nActivated with single phone call to switchboard.\n- Switchboard to group page all members via beepers.\n- Overhead page, \"respond trauma, X minutes\" should also be made.\n\n Team Members\n\nTrauma Response\n- ED consultant on call for the department.\n- Surgical registrar on call for the day.\n- Anaesthetic registrar on call for the day.\n- ICU registrar / resident.\n- Emergency Department Nurses.\n- ICU nurse ( attend at own discretion )\n- Nursing Supervisor ( attendance not required )\n- Radiographer.\n\nExtended Trauma Response\n\n- As for Trauma Response PLUS\n- Anaesthetic consultant\n- Intensive care consultant\n- Consultant surgeon \n \n Team Response\n \n Should be immediate from all staff. (As for cardiac arrest call)\n Surgical registrar expected to leave theatre, outpatients etc.\n Surgeon to be aware and accepting of registrar\'s responsibilities.\n Registrars responsible for involvement of respective consultant staff.','','','','Physiological criteria','Indications','- Glasgow Coma Score < 13.\n- Systolic BP < 90 mmHg.\n- Pulse rate < 50 or > 130 bpm.\n- Respiratory rate < 10 or > 29 breaths per minute.','','','','Anatomical criteria','','- Flail or crushed chest.\n- Significant injury to abdomen, head or neck.\n- Limb paralysis.\n- Two or more proximal long bone fractures.\n- Obvious pelvic fracture.\n- Amputation proximal to wrist or ankle.\n- Penetrating injury to head, neck or trunk.\n- Burns > 20% BSA or respiratory burn','','','','','Mechanism of injury criteria','','- High speed road crash > 60 km/hr.\n- Cyclist (pedal or motor) crash at > 30 km/hr.\n- Major automobile deformity.\n- Ejection from car.\n- Death of same car occupant.\n- Rollover.\n- Extrication time > 20 minutes.\n- Pedestrian / cyclist thrown or hit.\n- Fall more than 5 metres.','','','','','','','','','','','','','','','','','','','','','','Who is on the trauma team?','Staff','Team Leader\n \nThe team leader will be the ED consultant, Emergency Registrar, Surgeon or Surgical registrar by consensus.\n \n Role:\n- Obtain handover from Ambulance\n- Primary survey\n- Assign tasks\n- Decide priorities of care and investigation\n- Secondary survey to be performed by the Surgical Registrar\n \nScribe Nurse\n \n A registered or Enrolled Nurse (appointed by the nurse in charge for the day).\n \nRole:\n \n- Maintain a written record of:\n - the details of all interventions and the times they were performed\n - the doses and times of administration of drugs.\n \nAirway Doctor\n \n The airway doctor will be the Anaesthetist or Anaesthetic Registrar.\n \nRole:\n- Clear and maintain upper airway\n- Administer oxygen\n- As required, ventilate and/or intubate, insert OGT/NGT.\n \nAirway Nurse\n \n A Registered Nurse experienced in assisting with the intubation and ventilation of patients (appointed by the nurse in charge for the day).\n \nRole:\n- Be solely responsible for assisting the airway doctor until the airway is secured and the airway doctor no longer requires continuous assistance.\n\nProcedure Doctor(s)\n \n Procedure doctors will be resourced from Emergency Physicians, Emergency Registrars, Surgeons, Surgical Registrars, ICU Registrar/resident or other doctors as tasked.\n \nRole:\n- Establish i.v. access x 2 (at least 18 gauge, preferably 16 gauge)\n- Draw off blood for:\n - Police blood alcohols\n - Hb\n - U&E\n - Gp & Save / X match\n- Perform other procedures as directed by the Team Leader\n \nProcedure Nurses (2)\n \n Two suitably experienced Registered Nurses (appointed by the nurse in charge for the day).\n \nRole:\n- Assist Procedure Doctor(s) with procedures\n- Prepare equipment including i.v. lines and fluids\n- Draw up drugs to be administered\n- Other duties as required and directed by the Team Leader\n \nED Technician\n \n Must be immediately available for tasks as directed by the Team Leader.\n \nRadiographer\n \n Must be immediately available to perform portable CXR, cervical spine and pelvis XRs.','','','','','','','','','','','','','','','','','','','','','','Education and audit','Comments','At the commencement of each 6 month term, a seminar will be held to familiarise all staff with the protocol. Speakers will include the senior specialists involved in trauma management.\n \n Attendance will be compulsory for:\n- Surgical registrars\n- Anaesthetic registrars\n- Emergency registrars\n- Intensive Care registrars\n \nThe ATLS course is recommended for all members of the Trauma Team as it emphasises a system of trauma management.\n\nAudit\n\nReview of all Trauma Response activations will be conducted bi-monthly. ','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (154,0,0,'N','Child abuse','Even if you\'re not sure - ALWAYS ADMIT','ED','emerg-med','','','','Paediatric Guideline','QUCH QIRR QCRY QLIM','','','','','','','','Background','- occurs when an adult responsible for the care of a child either harms the child or fails to protect the child from harm\n- four main areas :\n1. physical abuse\n2. sexual abuse\n3. emotional abuse including behaviour towards the child that impairs their emotional development\n4. neglect including failure to provide adequate shelter, clothing, nourishment & medical care\n\n- all medical staff working in the Emergency Department must be aware of the possibility of child abuse\n- if abuse is suspected staff must be able and prepared to act appropriately\n- of prime concern must be the safety of the child\n- note that there is a legal obligation upon both medical & nursing staff to notify the Department of Health & Community Services if there is an opinion that a child may be a victim of abuse or at risk of further harm\n- priorities in dealing with child abuse in the Emergency Department are :\n- diagnosis, treatment & accurate documentation of the child\'s injuries\n- interpretation of a pattern of injury or behaviour leading to a suspicion of abuse\n- to involve the duty paediatrician EARLY in the management of children in whom abuse is suspected\n- to notify Health & Community Services as appropriate : there is a legal obligation upon medical staff for mandatory reporting if there is a suspicion of abuse; there does not have to be absolute proof of abuse for a report to be made\n ','','','','','','','','','','','',' Recognition of Abuse :\n \n A high index of suspicion & careful evaluation are crucial to identify the child at risk & to prevent further abuse.\n \n The possibility of abuse should be considered if any of the following are noted on history or examination :\n \n','','','','','','','','','','','','History',' HISTORY\n- discrepancy between the history of injury & the degree of physical injury\n- the history given is not consistent with the child\'s developmental status\n- a prolonged interval has passed between the time of injury & the seeking of medical advice\n- the history includes repeated trauma, treated by different practitioners &/or emergency facilities\n- parents respond inappropriately to or fail to comply with medical advice\n- the history of injury changes or differs between parents &/or guardians\n- no history of trauma is given\n- a threat or confession of abuse is obtained\n \n ','','','','','','','','','','','','','','','','','Examination','- subdural haematoma, especially in the absence of skull fractures\n- retinal haemorrhages on fundoscopy\n- perioral & frenular injuries\n- ruptured internal viscera without history or evidence of antecedent major blunt trauma\n- vaginal bleeding &/or trauma to genital or perianal areas\n- evidence of sexually transmitted disease\n- evidence of frequent injuries typified by multiple old scars or fractures of differing age on Xray\n- long bone fractures in children under 3 years\n- bizarre injuries : bites, cigarette burns, rope marks, belt marks, hand prints\n- injuries in unusual areas or unusual pattern of injury\n- bruising of varying ages, wounds in different stages of healing\n\n\nImportant Points\n1. If you suspect that a child is a victim of abuse or is at risk ALWAYS discuss with senior medical staff.\n2. The child MUST be reviewed by a registrar or consultant prior to admission or discharge. \n3. The paediatric unit should be involved EARLY in management & are always happy to discuss individual cases. \n4. If in any doubt as to the ongoing safety of the child, arrange admission.\n\n\n','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (155,0,0,'N','Epiglottitis','Very rare in children vaccinataed with Hib','ED','emerg-med','','','','Paediatric Guideline','QSOB QSOC QUCH','','Background','Medical staff must be prepared at all times to manage the airway in the event of progression to total obstruction, either in the ED or en route to OT:\n- Bag valve mask ventilate with 100% O2\n- If able to do this, continue until more experienced help arrives\n- If unable to bag valve mask ventilate :\n- Attempt orotracheal intubation, use ETT one size smaller than that ordinarily used\n- If that fails, create surgical airway by needle cricothyrotomy\n- Arrange for definitive surgical airway (formal tracheostomy)','','','','','Examination','Suspect acute epiglottitis if child is :\n - pale/unwell\n- febrile\n- drooling\n- \"sniffing position\"\n- stridor\n- increased work of breathing\n- no spontaneous cough or speech','','','','','','','','','','','','','','','','','','','Croup','','','','','Treatment','Observe in a fully equipped resuscitation area\n \nAlert ED consultant or registrar immediately\n \nLiaise early with paediatrician on call\n \nDo NOT further distress child by :\n- separation from caregivers\n- inspection of throat\n- taking blood\n- attempting intravenous access\n \nAim to observe closely with minimal interference\n \nNever ask for lateral neck Xray\n \nTrial of oxygen if tolerated noting that :\n- Administration of oxygen is NOT a substitute for the relief of the obstruction or the provision of a secure airway\n\nSecure the airway :\n- Urgent liaison with consultant anaesthetist and paediatrician\n- Senior medical escort to accompany patient to theatre\n- Gaseous inhalation induction of anaesthesia in theatre\n- Direct laryngoscopy and intubation\n- May need ENT standby for tracheostomy if intubation impossible\n\nAfter securing airway :\n- Obtain intravenous access\n- Draw blood for culture & FBE\n- Give IV antibiotics : ceftriaxone 100mg/kg','','','','','','','ENT referrals','#####175','','','','','','','','','','','','','','','','','','','','','Disposition','Arrange transport to a hospital with a PICU','Paediatric retrieval service','','','','','','','','','','','','','','','','','','','','','','','','','','');
