INSERT INTO `MedHelp` VALUES (164,0,0,'N','Criteria for giving anti-d','','','','','','','Information','QGYN QPRG QSEX ','','','Anti-d is given to Rhesus negative women who have a significant exposure to Rhesus positive blood. The usual situation is in early pregnancy/ obstetric situations, where a foetus may be Rhesus positive.\nThe aim of the treatment is to prevent the patient forming their own anti-d antibodies. If this happens, in future pregnancies the antibodies cross the placenta, and can cause hydrops foetalis.','','','','','','','','','','','','Anti-d is a blood product, and has all of the risks associated with blood products.\nIt needs to be ordered through the blood transfusion service.','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
