INSERT INTO `MedHelp` VALUES (169,0,0,'N','Family Planning Clinic','Particularly valuable to young women who do not want to go to their GP for contraception.','','','','','','Information','QSEX QGYN QOBS contraception teenager pill ','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (170,0,0,'N','Restraint of the agressive/ unco-operative patient','Should not be used without consulting most senior doctor available. Patients undergoing restraint need a nurse monitoring them at all times. The need for restraint must be carefully recorded in the notes','','','','','','Protocol','QBEH QDSH QMEN QODP physical chemical psychiatric commiting certify recommend','','','','','','','','Background','Physical or chemical restraint is sometimes necessary to enable an aggressive or unco-operative patient to receive the medical care they need.\nThe emergency department can be a violent and dangerous place, and the first rule is to look after yourself.','','','','Medical causes','','It may only be possible to look for medical causes e.g. hypoxia, brain injury  once the patient is restrained. These patients are often very difficult to assess, and a senior doctor should see the patient.','','','','Physical restraint','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','Chemical restraint','','The mainstay of ED chemical restraint are the benzodiazepines and the phenothiazines, which may be used alone or together.\nThe ideal is to give a patient who is rousable, but co-operative, however this is often difficult to acheive quickly.','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (171,0,0,'N','Patients who abscond','Manage the risk - safety first, then aim for patient satisfaction ','ED','emerg-med','','','','Protocol','QDSH QMEN QODP QBEH','','','','','','','','Background','Discharge against medical advice should not be regarded as a failure of treatment. It is the patient\'s right to leave, if they are competent to make that decision.\nYour aim should be to present the facts, and let the patient make the decision. Try to understand it from the patient\'s perspective.\nEither way, the patient should leave the department satisfied.','','','','Who cannot self-discharge','','Patients who are not legally competent to make this decision include:\n- patients whose mental state does not permit them to make rational decisions.\n- patients under the age of 16.','','','','Cultural/ behavioural factors','','Be alert for patients who are unlikely to want to stay in hospital. Offer specific assistance if you think it might help e.g. medicated withdrawl for alcoholics, use of an interpreter, specific ethnic liaison teams.','','','','','','The patient should leave the department aware that they can return to the department if their condition deteriorates, or they are worried.\nReassure the patient that they will not be discriminated against if they return.\n\ne.g. if the patient does not want to come into hospital for i.v. therapy, arrange oral antibiotics and early review.','','','','','','','','','','','','','','','','','','','','Multi-disciplinary psyciatry assessment team','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
INSERT INTO `MedHelp` VALUES (172,0,0,'N','Infectious Diseases Referrals','','','','','','','Information','QEXP','','','','','','','','','Infectious disease physicians are there as a resource. They are usually quite user-friendly, and can give you up-to-date relevant advice.','','','','Exposure to body fluids','','Their advice should be sought in all cases of definite significant exposure to high-risk sources of infection e.g. hepatitis B / C / HIV. The protocols in this area change frequently, and it is important that staff and patients get the benefit of an expert opinion.','','','','','','','','','','Who to phone?','','The Alfred Hospital (03) 92762000 and ask for the Infectious Diseases registrar/ consultant on call.','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
