INSERT INTO `Medicare` VALUES (65,00193,000,'1','A7','','S','N','Professional attendance by a general practitioner at a place other than a hospital, on one occasion, involving either: (i) taking a selective history, examination of the patient with implementation of a management plan in relation to 1 or more problems; or (ii) a professional attendance of less than 20 minutes duration involving components of a service to which item 36, 37, 38, 40, 43, 44, 47, 48, 50 or 51 applies and at which acupuncture is performed by the medical practitioner by the application of stimuli on or through the surface of the skin by any means; including any consultation on the same occasion and any other attendance on the same day related to the condition for which the acupuncture was performed','Professional attendance by a general practitioner at a place other than a hospital, on one occasion, involving either: (i) taking a selective history, examination of the patient with implementation of a management plan in relation to 1 or more problems; or (ii) a professional attendance of less than 20 minutes duration involving components of a service to which item 36, 37, 38, 40, 43, 44, 47, 48, 50 or 51 applies and at which acupuncture is performed by the medical practitioner by the application of stimuli on or through the surface of the skin by any means; including any consultation on the same occasion and any other attendance on the same day related to the condition for which the acupuncture was performed','',29.45,22.10,25.05,0);
INSERT INTO `Medicare` VALUES (66,00195,000,'1','A7','','S','D','Professional attendance by a general practitioner on 1 or more patients at a hospital, on one occasion, involving either: (i) taking a selective history, examination of the patient with implementation of a management plan in relation to 1 or more problems; or (ii) a professional attendance of less than 20 minutes duration involving components of a service to which item 36, 37, 38, 40, 43, 44, 47, 48, 50 or 51 applies and at which acupuncture is performed by the medical practitioner by the application of stimuli on or through the surface of the skin by any means; including any consultation on the same occasion and any other attendance on the same day related to the condition for which the acupuncture was performed \r[The fee for item 193, plus $20.60 divided by the number of patients seen, up to a maximum of six patients. For seven or more patients - the fee for item 193 plus $1.45 per patient]','Professional attendance by a general practitioner on 1 or more patients at a hospital, on one occasion, involving either: (i) taking a selective history, examination of the patient with implementation of a management plan in relation to 1 or more problems; or (ii) a professional attendance of less than 20 minutes duration involving components of a service to which item 36, 37, 38, 40, 43, 44, 47, 48, 50 or 51 applies and at which acupuncture is performed by the medical practitioner by the application of stimuli on or through the surface of the skin by any means; including any consultation on the same occasion and any other attendance on the same day related to the condition for which the acupuncture was performed','The fee for item 193, plus $20.60 divided by the number of patients seen, up to a maximum of six patients. For seven or more patients - the fee for item 193 plus $1.45 per patient',0.00,0.00,0.00,0);
INSERT INTO `Medicare` VALUES (67,00197,000,'1','A7','','S','N','Professional attendance by a general practitioner at a place other than a hospital, involving either:(i)taking a detailed history, an examination of multiple systems, arranging any necessary investigations and implementing a management plan in relation to 1 or more problems, and lasting at least 20 minutes; or(ii)a professional attendance of less than 40 minutes duration involving components of a service to which item 44, 47, 48, 50 or 51 applies and at which acupuncture is performed by the medical practitioner by the application of stimuli on or through the surface of the skin by any means; including any consultation on the same occasion and any other attendance on the same day related to the condition for which the acupuncture was performed','Professional attendance by a general practitioner at a place other than a hospital, involving either:(i)taking a detailed history, an examination of multiple systems, arranging any necessary investigations and implementing a management plan in relation to 1 or more problems, and lasting at least 20 minutes; or(ii)a professional attendance of less than 40 minutes duration involving components of a service to which item 44, 47, 48, 50 or 51 applies and at which acupuncture is performed by the medical practitioner by the application of stimuli on or through the surface of the skin by any means; including any consultation on the same occasion and any other attendance on the same day related to the condition for which the acupuncture was performed','',55.95,42.00,47.60,0);
