INSERT INTO `Medicare` VALUES (185,00900,000,'1','A17','','S','N','Participation by a medical practitioner (including a general practitioner, but not including a specialist or consultant physician) in a Domiciliary Medication Management Review (dmmr) for patients living in the community setting, where the medical practitioner: -, assesses a patient\'s medication management needs, and following that assessment, refers the patient to a community pharmacy for a dmmr, and provides relevant clinical information required for the review, with the patient\'s consent; and -, discusses with the reviewing pharmacist the results of that review including suggested medication management strategies; and -, develops a written medication management plan following discussion with the patient. Benefits under this item are payable not more than once in each 12 month period, except where there has been a significant change in the patient\'s condition or medication regimen requiring a new dmmr.','Participation by a medical practitioner (including a general practitioner, but not including a specialist or consultant physician) in a Domiciliary Medication Management Review (dmmr) for patients living in the community setting, where the medical practitioner: -, assesses a patient\'s medication management needs, and following that assessment, refers the patient to a community pharmacy for a dmmr, and provides relevant clinical information required for the review, with the patient\'s consent; and -, discusses with the reviewing pharmacist the results of that review including suggested medication management strategies; and -, develops a written medication management plan following discussion with the patient. Benefits under this item are payable not more than once in each 12 month period, except where there has been a significant change in the patient\'s condition or medication regimen requiring a new dmmr.','',123.00,92.25,104.55,0);
