INSERT INTO `Medicare` VALUES (355,12203,000,'2','D1','10','S','N','Overnight investigation for sleep apnoea for a period of at least 8 hours duration, for an adult aged 18 years and over where: (a) , continuous monitoring of oxygen saturation and breathing using a multi-channel polygraph, and recording of eeg, eog, submental emg, anterior tibial emg, respiratory movement, airflow, oxygen saturation and ecg are performed;(b) a technician is in continuous attendance under the supervision of a qualified sleep medicine practitioner; (c)the patient is referred by a medical practitioner; (d)the necessity for the investigation is determined by a qualified adult sleep medicine practitioner prior to the investigation; (e) polygraphic records are analysed (for assessment of sleep stage, arousals, respiratory events and assessment of clinically significant alterations in heart rate and limb movement) with manual scoring, or manual correction of computerised scoring in epochs of not more than 1 minute, and stored for interpretation and preparation of report ; and(f) interpretation and report are provided by a qualified adult sleep medicine practitioner based on reviewing the direct original recording of polygraphic data from the patient - payable only in relation to each of the first 3 occasions the investigation is performed in any 12 month period.','Overnight investigation for sleep apnoea for a period of at least 8 hours duration, for an adult aged 18 years and over where: (a) , continuous monitoring of oxygen saturation and breathing using a multi-channel polygraph, and recording of eeg, eog, submental emg, anterior tibial emg, respiratory movement, airflow, oxygen saturation and ecg are performed;(b) a technician is in continuous attendance under the supervision of a qualified sleep medicine practitioner; (c)the patient is referred by a medical practitioner; (d)the necessity for the investigation is determined by a qualified adult sleep medicine practitioner prior to the investigation; (e) polygraphic records are analysed (for assessment of sleep stage, arousals, respiratory events and assessment of clinically significant alterations in heart rate and limb movement) with manual scoring, or manual correction of computerised scoring in epochs of not more than 1 minute, and stored for interpretation and preparation of report ; and(f) interpretation and report are provided by a qualified adult sleep medicine practitioner based on reviewing the direct original recording of polygraphic data from the patient - payable only in relation to each of the first 3 occasions the investigation is performed in any 12 month period.','',476.75,357.60,419.65,0);
INSERT INTO `Medicare` VALUES (356,12207,000,'2','D1','10','S','N','Overnight investigation for sleep apnoea for a period of at least 8 hours duration, for an adult aged 18 years and over where:(a) continuous monitoring of oxygen saturation and breathing using a multi-channel polygraph, and recordings of eg, eog, submental emg, anterior tibial emg, respiratory movement, airflow, oxygen saturation and ecg are performed;(b) a technician is in continuous attendance under the supervision of a qualified sleep medicine practitioner; (c) the patient is referred by a medical practitioner; (d), the necessity for the investigation is determined by a qualified adult sleep medicine practitioner prior to the investigation;(e) polygraphic records are analysed (for assessment of sleep stage, arousals, respiratory events and assessment of clinically significant alterations in heart rate and limb movement) with manual scoring, or manual correction of computerised scoring in epochs of not more than 1 minute, and stored for interpretation and preparation of report; and (f), interpretation and report are provided by a qualified adult sleep medicine practitioner based on reviewing the direct original recording of polygraphic data from the patient where it can be demonstrated that a further investigation is indicated in the same 12 month period to which item 12203 applies for the adjustment and/or testing of the effectiveness of a positive pressure ventilatory support device (other than nasal continuous positive airway pressure) in sleep, in a patient with severe cardio-respiratory failure, and where previous studies have demonstrated failure of continuous positive airway pressure or oxygen - each additional investigation','Overnight investigation for sleep apnoea for a period of at least 8 hours duration, for an adult aged 18 years and over where:(a) continuous monitoring of oxygen saturation and breathing using a multi-channel polygraph, and recordings of eg, eog, submental emg, anterior tibial emg, respiratory movement, airflow, oxygen saturation and ecg are performed;(b) a technician is in continuous attendance under the supervision of a qualified sleep medicine practitioner; (c) the patient is referred by a medical practitioner; (d), the necessity for the investigation is determined by a qualified adult sleep medicine practitioner prior to the investigation;(e) polygraphic records are analysed (for assessment of sleep stage, arousals, respiratory events and assessment of clinically significant alterations in heart rate and limb movement) with manual scoring, or manual correction of computerised scoring in epochs of not more than 1 minute, and stored for interpretation and preparation of report; and (f), interpretation and report are provided by a qualified adult sleep medicine practitioner based on reviewing the direct original recording of polygraphic data from the patient where it can be demonstrated that a further investigation is indicated in the same 12 month period to which item 12203 applies for the adjustment and/or testing of the effectiveness of a positive pressure ventilatory support device (other than nasal continuous positive airway pressure) in sleep, in a patient with severe cardio-respiratory failure, and where previous studies have demonstrated failure of continuous positive airway pressure or oxygen - each additional investigation','',476.75,357.60,419.65,0);
INSERT INTO `Medicare` VALUES (357,12210,000,'2','D1','10','S','N','Overnight paediatric investigation for a period of at least 8 hours duration for a child aged 0 - 12 years, where:continuous monitoring of oxygen saturation and breathing using a multi- channel polygraph, and recording of eeg (minimum of 4 eeg leads with facility to increase to 6 in selected investigations), eog, emg submental +/- diaphragm, respiratory movement must include rib and abdomen (+/- sum) airflow detection, measurement of co2 either end-tidal or transcutaneous, oxygen saturation and ecg are performed; a technician or registered nurse with sleep technology training is in continuous attendance under the supervision of a qualified paediatric sleep medicine practitioner;the patient is referred by a medical practitioner;the necessity for the investigation is determined by a qualified paediatric sleep medicine practitioner prior to the investigation;polygraphic records are analysed (for assessment of sleep stage, and maturation of sleep indices, arousals, respiratory events and the assessment of clinically significant alterations in heart rate and body movement) with manual scoring, or manual correction of computerised scoring in epochs of not more than 1 minute, and stored for interpretation and preparation of report; the interpretation and report to be provided by a qualified paediatric sleep medicine practitioner based on reviewing the direct original recording of polygraphic data from the patient.payable only in relation to the first 3 occasions the investigation is performed in a 12 month period.','Overnight paediatric investigation for a period of at least 8 hours duration for a child aged 0 - 12 years, where:continuous monitoring of oxygen saturation and breathing using a multi- channel polygraph, and recording of eeg (minimum of 4 eeg leads with facility to increase to 6 in selected investigations), eog, emg submental +/- diaphragm, respiratory movement must include rib and abdomen (+/