INSERT INTO `Medicare` VALUES (378,12533,000,'2','D2','','S','N','Carbon-labelled urea breath test using oral C-13 or C-14 urea, performed by a specialist or consultant physician, including the measurement of exhaled 13CO2 or 14CO2, for either:- (a)the confirmation of Helicobacter pylori colonisation, where: (i) suitable biopsy material for diagnosis cannot be obtained at endoscopy in patients with peptic ulcer disease, or where the diagnosis of peptic ulcer has been made on barium meal; or (ii)in patients with past history of duodenal ulcer, gastric ulcer or gastric neoplasia, where endoscopy is not indicated, or (b) the monitoring of the success of eradication of Helicobacter pylori in patients with peptic ulcer disease - where any request for the test by another medical practitioner who collects the breath sample specifically identifies in writing one or more of the clinical indications for the test','Carbon-labelled urea breath test using oral C-13 or C-14 urea, performed by a specialist or consultant physician, including the measurement of exhaled 13CO2 or 14CO2, for either:- (a)the confirmation of Helicobacter pylori colonisation, where: (i) suitable biopsy material for diagnosis cannot be obtained at endoscopy in patients with peptic ulcer disease, or where the diagnosis of peptic ulcer has been made on barium meal; or (ii)in patients with past history of duodenal ulcer, gastric ulcer or gastric neoplasia, where endoscopy is not indicated, or (b) the monitoring of the success of eradication of Helicobacter pylori in patients with peptic ulcer disease - where any request for the test by another medical practitioner who collects the breath sample specifically identifies in writing one or more of the clinical indications for the test','',68.55,51.45,58.30,0);
