INSERT INTO `Setup` VALUES (2,'Message','Patients are seen in order of clinical priority - the sickest patients are seen first. Please do not have anything to eat or drink while you are waiting to be seen. The initials of patients waiting to be seen are listed here. The closer to the top of the list - the sooner you will be seen. IF YOU HAVE AN INFLUENZA-LIKE ILLNESS, PLEASE GO HOME AND PHONE YOUR GP.',NULL,NULL,NULL);
INSERT INTO `TriageDiagnosis` VALUES (1,'QABD{Abdominal pain','7{Airway compromised?\nInadequate breathing?\nShock?{1{Category 1','7{Severe pain?\nPain radiating to the back?\nAcutely vomiting blood?\nAcutely passing fresh or altered blood PR?{2{Category 2','7{Moderate pain?\nShoulder tip pain?\nPossible pregnancy?\nBlack or redcurrent stools?\nPersistant vomiting?{3{Category 3','7{Vomiting?\nRecent problem?{4{Category 4','5{Category 5{{','','\"coffee ground\" vomiting is oftern loosely used, and is rarely helpful - it is better to use the terms \"fresh blood\" and \"changed blood\".\n\nIn the context of lower abdominal pain, any woman of childbearing age is pregnant until proven otherwise.');
INSERT INTO `TriageDiagnosis` VALUES (2,'QABC{Abdominal pain (child)','7{Airway compromised?\nInadequate breathing?\nShock?{1{Category 1','7{Signs of severe pain?\nAcutely vomiting blood?\nAcutely passing fresh or altered blood PR?{2{Category 2','7{Signs of moderate pain?\nInconsolable by parents?\nInappropriate history?\nVisible abdominal mass?\nBlack or redcurrent stools?\nPersistent vomiting{3{Category 3','7{Vomiting?\nRecent problem?{4{Category 4','5{Category 5{{','','Constipation is the most common cause of chronic abdominal pain in children.\n\nSigns of severe pain include pallor, sweating and inconsolable crying.\nSigns of moderate pain include intermittant crying.\n\nRedcurrent stool is a characteristic dark red jelly-like stool, which is classically seen in intusussception.');
INSERT INTO `TriageDiagnosis` VALUES (3,'QAPP{Apparently drunk','7{Airway compromised?\nInadequate breathing?\nUnresponsive child?\nFitting?\nHypoglycaemic?\nShock?{1{Category 1','7{Altered conscious state not wholly attributable to alcohol?\nInadequate history?\nCold?{2{Category 2','7{Altered conscious state wholly attributable to alcohol?\nInappropriate history?\nHistory of unconsciousness?\nHead injury{3{Category 3','7{Pain?\nInjury?{4{Category 4','5{Category 5{{','','See also\n- Behaving strangely\n- Head injury\n- Collapsed adult\n\nInadequate history \nIf there is not a clear and unequivocal history of alcohol ingestion, and if head injury, drug ingestion, underlying medical condition etc. cannot be definitely excluded.\n\nHistory of unconsciousness\nWithout a reliable witness, a patient with memory loss should be assumed to have been unconscious. \n\nInappropriate history\nIf  the alleged mechanism does not explain the apparant injury or illness then the history is inappropriate.\n\nWholly attributable to alcohol\nA clear history of alcohol ingestion and exclusion beyond all reasonable doubt of all other causes of symptoms and signs');
INSERT INTO `TriageDiagnosis` VALUES (4,'QAST{Asthma/ COAD','7{Airway compromised?\nInadequate breathing?\nUnresponsive child\nShock?{1{Category 1','7{Unable to talk in sentances?\nHR > 120 (adult)?\nPEFR < 30% normal?\nSat < 90% room air?\nAltered conscious state?{2{Category 2','7{PEFR < 50% normal?\nSat <95% room air?\nPrevious ICU admission?\nNo improvement with own meds?{3{Category 3','7{Wheeze?\nChest infection?\nRecent problem?{4{Category 4','5{Category 5{{','','See also\n- shortness of breath\n\nSignificant history of asthma - any admission to intensive care/ need for ventilation.\nWheeze may be absent in the most severe cases of asthma.\nMake sure the senior doctor on the floor is aware of any asthmatic triaged above 3');
INSERT INTO `TriageDiagnosis` VALUES (5,'QASS{Assault (proven/ alleged)','7{Airway compromised?\nInadequate breathing?\nUncontrolled major bleeding?\nShock?{1{Category 1','7{Severe pain?\nMechanism of injury?\nAcutely short of breath?\nMajor bleeding?\nAltered conscious state{2{Category 2','7{Moderate pain?\nUncontrolled minor bleeding?\nHistory of LOC?\nNew neuro symptoms/ signs{3{Category 3','7{Pain/ swelling/ deformity?\nRecent problem?{4{Category 4','5{Category 5{{','','Mechanism of injury - high risk\n- penetrating injury\n- falls from height >5m \n- Road crash >40 mph (60kmh)');
INSERT INTO `TriageDiagnosis` VALUES (6,'QBAK{Back pain','7{Airway compromised?\nInadequate breathing?\nShock?{1{Category 1','7{Severe pain?\nAbdominal pain?\nHot child?\nVery hot?{2{Category 2','7{Moderate pain?\nLeg pain > back pain?\nNew neuro symptoms/ signs?\nDirect trauma to back?\nUnable to walk?\nHot?{3{Category 3','7{Recent problem?{4{Category 4','5{Category 5{{','','See also\n- neck pain\n- abdominal pain\n\nPeople with chronic back pain should not be encouraged to attend the emergency department: a general practioner or a chronic pain specialist is the best person to provide ongoing care .');
INSERT INTO `TriageDiagnosis` VALUES (7,'QBIT{Bites/ stings/ anaphylaxis','7{Airway compromised?\nInadequate breathing?\nMajor uncontrolled bleeding?\nShock?{1{Category 1','7{Severe pain?\nSignificant history of allergy?\nAcutely short of breath?\nWheeze?\nMinor uncontrolled bleeding?\nOedema of tongue/ face?\nKnown venemous snake{2{Category 2','7{Moderate pain?\nControlled bleeding?\nWidespread discharge or blistering?{3{Category 3','7{Pain?\nLocal inflammation/ sweating?\nLocal infection?\nRecent problem?{4{Category 4','5{Category 5{{','','See also\n- Asthma/ COAD\n\nA significant history of allergy is a patient known to have severe/ life threatening reaction to the stimulant.\n\nKnown venemous snake depends on the local snake population. If the bite looks like a snake bite, then assume to be venomous.\n\nSnake bites tend to be painless, spider bites tend to be painful.');
INSERT INTO `TriageDiagnosis` VALUES (8,'QBEH{Behaving strangely','7{Airway compromised?\nInadequate breathing?\nHypoglycaemia?\nShock?{1{Category 1','7{Altered conscious level?\nHistory of overdose or poisoning?\nHigh risk of harm to others?\nHigh risk of harm to self?{2{Category 2','7{Head injury?\nRisk of harm to others?\nRisk of harm to self?\nHistory of LOC?\nNew neuro symptoms/ signs?\nFocal/ progressive loss of function?\nSignificant psychiatric history{3{Category 3','4{Category4{{','','','See also\n- apparently drunk\n- mental illness\n\nRisk of  harm to others/ self-harm - if in doubt, assume a high risk\n\nRisk of harm to others indicated by:\n- posture - tense, clenched.\n- speech - loud, threatening words.\n- motor behaviour - pacing, restless.\nHigh risk should be assumed if weapons and potential victims present.\nSecurity and or police presence may be required.\n\nPhysical violence or threats to healthcare workers are not acceeptable, and will not be tolerated.\n\nRisk of harm to self indicated by\n- history of significant self-harm.\n- actively trying to harm self.\n- actively trying to leave with intent of harming themselves.');
INSERT INTO `TriageDiagnosis` VALUES (9,'QCAR{Cardiorespiratory arrest','1{Category 1\n{{','','','','','','');
INSERT INTO `TriageDiagnosis` VALUES (10,'QCHP{Chest pain','7{Airway compromised?\nInadequate breathing?\nShock?{1{Category 1','7{Severe pain?\nAcutely short of breath?\nCardiac pain?\nHR >120 or < 60 or irregular{2{Category 2','7{Moderate pain?\nPleuritic pain?\nPersistent vomiting?{3{Category 3','7{Vomiting?\nRecent problem?{4{Category 4','5{Category 5{{','','All patients whose pain is likely to be cardiac should be triaged 2. Others should be triaged 3.\nAn ECG should be  performed immediately before any further history is taken.\n\nThe ECG should be shown to a senior doctor.\nAspirin 300mg should be given unless there are contraindications.');
INSERT INTO `TriageDiagnosis` VALUES (11,'QCOL{Collapsed adult','7{Airway compromised?\nInadequate breathing?\nFitting?\nShock?{1{Category 1','7{Severe pain?\nCardiac pain?\nAcutely short of breath?\nAbnormal pulse?\nAltered conscious state?\nPurpura or unrecognised rash?\nVery hot?\nCold?{2{Category 2','7{Moderate pain?\nInappropriate history?\nSignificant history of allergy?\nHistory of LOC?\nFocal or progressive loss of function?\nHot?{3{Category 3','7{Pain?\nWarmth?\nRecent problem?{4{Category 4','5{Category 5{{','','See also\n- Fits\n- Unwell adult\n- Apparently drunk\n\nUnrecognised rash means any other rash not positively identified.\nPurpuric rashes are caused by small areas of bleeding under the skin -they do not blanch (go white) when pressure is applied.\n\nInappropriate history is if the alleged mechanism does not explain the apparent injury or illness.\n\nHistory of unconsciousness - without a reliable witness, a patient with memory loss should be assumed to have been unconscious. \n\nSignificant history of allergy means a previous serious allergic reaction.');
INSERT INTO `TriageDiagnosis` VALUES (12,'QCRY{Crying baby','7{Airway compromised?\nInadequate breathing?\nUnresponsive?\nShock?{1{Category 1','7{Signs of severe pain?\nResponds to voice or pain only?\nUnrecognised/ purpuric rash?\nFloppy/ not interactive?\nHot{2{Category 2','7{Signs of moderat pain?\nHistory of LOC?\nInappropriate history?\nInconsolable by parents?\nCrying > 2 hours?\nUnable to feed?{3{Category 3','7{Pain?\nWarmth?\n\"Not normal self\"?\nRecent problem?{4{Category 4','5{Category 5{{','','Unrecognised rash means any other rash not positively identified.\nPurpuric rashes are caused by small areas of bleeding under the skin -they do not blanch (go white) when pressure is applied.\n\nSigns of severe pain include pallor, sweating and inconsolable crying.\nSigns of moderate pain include intermittant crying.');
INSERT INTO `TriageDiagnosis` VALUES (13,'QDSH{Deliberate self harm','7{Airway compromised?\nInadequate breathing?\nShock?\nFitting?\nUncontrolled major bleeding?{1{Category 1','7{Severe pain?\nAcutely short of breath?\nUncontrolled minor bleeding?\nAltered conscious state?\nSignificant history?\nSignificant mechanism of injury?\nHigh risk of further self harm?{2{Category 2','7{Moderate pain?\nInappropriate history?\nControlled bleeding?\nRisk of further self harm?\nMarked distress?{3{Category 3','4{Category 4{{','','','See also\n- overdose and poisoning\n\nSignificant history includes falls from height > 5 metres, ejection from vehicle, death of another person in same accident, significantly deformed vehicle, or high speed road traffic accidents (> 60 km/h / 40 mph)\n\nSignificant mechanism of injury includes asphyxiation/ hanging/ penetrating injuries such as knife or gunshot.');
INSERT INTO `TriageDiagnosis` VALUES (14,'QDOA{Dead on arrival','6{Dead on arrival{{','','','','','','');
INSERT INTO `TriageDiagnosis` VALUES (15,'QDEN{Dental problems','7{Airway compromised?\nInadequate breathing?\nShock?{1{Category 1','7{Severe pain?\nUncontrolled bleeding?\nAcutely avulsed tooth?\nHot child?{2{Category 2','7{Moderate pain?\nControlled bleeding?\nHot?{3{Category 3','7{Pain?\nWarmth?\nFacial swelling?{4{Category 4','5{Category 5{{','','Acutely avulsed tooth - complete tooth avulsed within the past 4 hours');
INSERT INTO `TriageDiagnosis` VALUES (16,'QDIA{Diabetes related','7{Airway compromised?\nInadequate breathing?\nUnresponsive child?\nBlood glucose < 3 mmol/l?\nShock?{1{Category 1','7{Ketosis and blood glucose > 17mmol/l?\nAltered conscious state?\nHot child?\nVery hot?{2{Category 2','7{Blood glucose > 17mmol/l?\nPersistent vomiting?\nHot?\n{3{Category 3','7{Warmth?\nVomiting?\nRecent problem?{4{Category 4\n','5{Category 5{{','','');
INSERT INTO `TriageDiagnosis` VALUES (17,'QEAR{Ear problems','7{Airway compromised?\nInadequate breathing?\nShock?{1{Category 1','7{Severe pain?\nUncontrolled bleeding?\nAltered conscious state?\nHot child?\nVery hot?{2{Category 2','7{Moderate pain?\nHistory of head injury?\nInappropriate history?\nControlled bleeding?\nAuricular haematoma?\nDizziness?\nHot?{3{Category 3','7{Pain?\nWarmth?\nAcute hearing loss?\nRecent problem?{4{Category 4','5{Category 5{{','','An auricular haematoma is a tense haematoma over the outer pinna (which will need drainage).\n\nAcute loss of hearing - loss of hearing in one or both ears in the previous 24 hours');
INSERT INTO `TriageDiagnosis` VALUES (18,'QREV{Review - ED patient','5{Category 5{{','','','','','','');
INSERT INTO `TriageDiagnosis` VALUES (19,'QEXP{Exposure to chemicals/ body fluids','7{Airway compromised?\nInadequate breathing?\nEye injury?\nShock?\nStridor?{1{Category 1','7{Severe pain?\nHigh lethality - inc needlestick?\nFacial/ tongue oedema?\nAltered conscious state?\nInhalation chemical injury?\nSat < 90%{2{Category 2','7{Moderate pain?\nModerate lethality?\nInappropriate history?\nWidespread discharge or blistering?\nSat < 90%{3{Category 3','7{Pain?\nInjury?\nRecent problem?{4{Category 4','5{Category 5{{','','See also \n- shortness of breath\n- overdose and poisoning');
INSERT INTO `TriageDiagnosis` VALUES (20,'QEYE{Eye problems','7{Chemical eye injury?{1{Category 1','7{Severe pain?\nPenetrating trauma?\nSudden complete loss of vision?{2{Category 2','7{Moderate pain?\nReduced visual acuity?\nInappropriate history?{3{Category 3','7{Pain?\nRed eye?\nRecent problem?{4{Category 4','5{Category 5{{','','Red eye- red eye may be painful or painless, and may be complete or partial.');
INSERT INTO `TriageDiagnosis` VALUES (21,'QFAL{Falls','7{Airway compromised?\nInadequate breathing?\nFitting?\nShock?{1{Category 1','7{Severe pain?\nSignificant incident history?\nPulse <60 or >120 or irreg?\nUncontrolled bleeding?\nAltered conscious state?\nCold?{2{Category 2','7{Moderate pain?\nInappropriate history?\nControlled bleeding?\nHistory of LOC?\nFocal or progressive loss of function?\nGross deformity?\nOpen fracture?{3{Category 3','7{Pain?\nDeformity?\nSwelling?\nRecent problem?{4{Category 4','5{Category 5{{','','See also\n- Collapse\n- Limb problems\n- Unwell\n\nOpen fracture - wounds near a fracture should be assumed to mean that the fracture is open (= compound). \n\nInappropriate history is if the alleged mechanism does not explain the apparent injury or illness.\n\nHistory of unconsciousness - without a reliable witness, a patient with memory loss should be assumed to have been unconscious.\n\nSignificant injury criteria\n\nPedestrian/ cyclist thrown or hit\nFall > 5 metres\nHigh speed car crash >60 km/h\nCyclist (pedal or motor) crash >30km/h\nMajor deformity to car\nEjection from car\nDeath of same car occupant\nRollover\nExtrication time >20 minutes');
INSERT INTO `TriageDiagnosis` VALUES (22,'QFIT{Fits','7{Airway compromised?\nInadequate breathing?\nUnresponsive child?\nFitting?\nShock?\nHypoglycaemia{1{Category 1','7{Altered conscious state?\nHistory of overdose or poisoning?\nSigns of meningism?\nNew rash?\nHot child?\nVery hot?{2{Category 2','7{History of head injury?\nInappropriate history?\nFocal or progressive loss of functions?\nNew neuro symptoms?\nHot?{3{Category 3','7{Pain?\nWarmth?\nHeadache?\nRecent problems?{4{Category 4','5{Category 5{{','','See also:\n- Head injury\n- Headache\n- Overdose and poisoning\n\nInappropriate history is if the alleged mechanism does not explain the apparent injury or illness.');
INSERT INTO `TriageDiagnosis` VALUES (23,'QADM{For admission','7{Airway compromised?\nInadequate breathing?\nShock?{1{Category 1','7{Severe pain?\nUncontrolled bleeding?{2{Category 2\nCall Registrar of unit urgently','4{{4{Call Registrar of admitting unit','','','','If the patient does not need immediate attention (e.g. analgesia) call the registrar of the admitting unit. \n\nIt is a good idea for the senior doctor to look after these patients, as it prevents inpatient unit registrars ED junior doctors to do their work.');
INSERT INTO `TriageDiagnosis` VALUES (24,'QFOB{Foreign body','7{Airway compromised?\nInadequate breathing?\nUncontrolled major bleeding?\nStridor?\nShock?{1{Category 1','7{Severe pain?\nMechanism of injury?\nSignificant history?\nUncontrolled minor bleeding?\nPenetrating eye trauma?{2{Category 2','7{Moderate pain?\nInappropriate history?\nControlled bleeding?\n{3{Category 3','7{Pain?\nLocal inflammation?\nLocal infection?\nRecent injury?{4{Category 4','5{Category 5{{','','Mechanism of injury criteria\n\nHigh speed car crash >60 km/h\nCyclist (pedal or motor) crash >30km/h\nMajor deformity to car\nEjection from car\nDeath of same car occupant\nRollover\nExtrication time >20 minutes\nPedestrian/ cyclist thrown or hit\nFall > 5 metres');
INSERT INTO `TriageDiagnosis` VALUES (25,'QGIB{GI bleeding','7{Airway compromised?\nInadequate breathing?\nShock?{1{Category 1','7{Severe pain?\nAcutely voming blood?\nAcutely passing fresh or altered blood PR?{2{Category 2','7{Moderate pain?\nBlack or redcurrent stool?\nHistory of vomiting blood?\nPersistant vomiting?{3{Category 3','7{Pain?\nVomiting?\nRecent problem?{4{Category 4','5{Category 5{{','','See also\n- Diarrhoea\n- Vomiting\n- Abdominal pain\n\nRedcurrent stool is a characteristic dark red jelly-like stool, which is classically seen in intusussception.\n\n\"coffee ground\" vomiting is oftern loosely used, and is rarely helpful- it is better to use the terms \"fresh blood\" and \"changed blood\".');
INSERT INTO `TriageDiagnosis` VALUES (26,'QGYN{Gynae/ PV bleed','7{> 23 weeks pregnant{7{Triage under \"Pregnancy\"','7{Airway compromised?\nInadequate breathing?\nUncontrolled bleeding?\nShock?{1{Category 1','7{Severe pain?\nHeavy PV bleeding?\nLikely or known to be pregnant <23 weeks?\n{2{Category 2','7{Moderate pain?\nVaginal trauma?\nInappropriate history?\nPossibly pregnant?{3{Category 3','7{Pain?\nNormal menstruation?{4{Category 4','5{Category 5{{','See also \n- Pregnancy - use for pregnancy more than 22 weeks\n\n- Likely pregnancy means any woman who has symptoms of pregnancy e.g. missed period, nausea, particularly if unprotected sex.\n- Possible pregnancy means any woman of childbearing age .\n- Heavy PV loss means continuous bleeding, large clots, or more than one pad per 4 hours.');
INSERT INTO `TriageDiagnosis` VALUES (27,'QHAE{Haematology/ oncology','7{Airway compromised?\nInadequate breathing?\nUncontrolled bleeding?\nShock?{1{Category 1','7{Severe pain?\nSignificant previous history?\nVery hot?\nAltered conscious state?\nHot child?{2{Category 2','7{Moderate pain?\nKnown immunosuppression?\nChemo 7-14 day ago?\nHot?\n{3{Category 3','7{Warmth?\nPain?\nRecent problem?{4{Category 4','5{Category 5{{','','Significant previous history \n- a history of rapid deterioration, or significant complications.');
INSERT INTO `TriageDiagnosis` VALUES (28,'QHED{Headache','7{Airway compromised?\nInadequate breathing?\nFitting?\nShock?{1{Category 1','7{Severe pain?\nSudden onset?\nAltered conscious state?\nSudden loss of vision?\nSigns of meningism?\nNew rash?\nHot child?\nVery hot?{2{Category 2','7{Moderate pain?\nInappropriate history?\nHistory of LOC?\nFocal or progressive loss of function?\nNew neuro symptoms/ signs?\nReduced visual acuity?\nScalp tenderness?\nHot?{3{Category 3','7{Pain?\nWarmth?\nRecent?{4{Category 4','5{Category 5{{','','Unrecognised rash means any other rash not positively identified.\n\nSigns of meningism include headache, stiff neck and photophobia.\n\nPurpuric rashes are caused by small areas of bleeding under the skin -they do not blanch (go white) when pressure is applied.');
INSERT INTO `TriageDiagnosis` VALUES (29,'QHIN{Head injury','7{Airway compromised?\nInadequate breathing?\nShock?\nUncontrolled bleeding?\nFitting?{1{Category 1','7{Severe pain?\nMechanism of injury?\nSignificant history?\nControlled bleeding?\nAltered conscious state?{2{Category 2','7{Moderate pain?\nHistory of unconsciousness?\nInappropriate history?\nFocal or progressive loss of function?\nNew neuro symptoms or signs?\nPersistent vomiting?{3{Category 3','7{Pain?\nHeadache?\nScalp haematoma?\nVomiting?\nRecent problem?{4{Category 4','5{Category 5{{','','See also\n- headache\n- fits\n- neck pain\n\nMechanism of injury - high risk\n- penetrating injury\n- falls from height >5m \n- Road crash >40 mph (60kmh)\n\nInappropriate history is if the alleged mechanism does not explain the apparent injury or illness.\n\nHistory of unconsciousness - without a reliable witness, a patient with memory loss should be assumed to have been unconscious.');
INSERT INTO `TriageDiagnosis` VALUES (30,'QHIH{Hospital in home patient','7{Airway compromised?\nInadequate breathing?\nShock?{1{Category 1','7{Severe pain?\nUncontrolled bleeding?{2{Category 2\nCall Registrar of unit urgently','4{Call Registrar of unit looking after patient{{','','','','');
INSERT INTO `TriageDiagnosis` VALUES (31,'QIRR{Irritable child','7{Airway compromised?\nInadequate breathing?\nUnresponsive?\nShock?{1{Category 1','7{Severe pain?\nHistory of overdose or poisoning?\nResponds to voice or pain only?\nNew rash?\nHot child?{2{Category 2','7{Moderate pain?\nNot distractible?\nProlonged or uninterrupted crying?\nInappropriate history?\nNot feeding?{3{Category 3','7{Pain?\n\"Not normal self\"?\nWarmth?\nRecent problem?{4{Category 4','5{Category 5{{','','Unrecognised rash means any other rash not positively identified.\nPurpuric rashes are caused by small areas of bleeding under the skin -they do not blanch (go white) when pressure is applied.\n\nSigns of severe pain include pallor, sweating and inconsolable crying.\nSigns of moderate pain include intermittant crying.\n\nInappropriate history is if the alleged mechanism does not explain the apparent injury or illness.');
INSERT INTO `TriageDiagnosis` VALUES (32,'QMED{Medication/ script','5{Wanting script{{','','','','','','');
INSERT INTO `TriageDiagnosis` VALUES (33,'QMUL{Multiple trauma','7{Airway compromised?\nInadequate breathing?\nShock?\nMajor uncontrolled bleeding?\nUnresponsive child?{1{Category 1','7{Severe pain?\nSignificant history?\nMechanism of injury?\nAcutely short of breath?\nUncontrolled minor bleeding?\nAltered conscious level?{2{Category 2','3{Moderate pain?\nSignificant medical history?\nControlled bleeding?\nHistory of LOC?\nNew neuro symptoms/ signs?{{','','','','Call the trauma team if  the patient has:\n\n- anatomical criteria OR \n- physiological criteria OR \n- mechanism of injury criteria AND there is not a ED Physician/ Reg/ Surg Reg in the department.\n\nPhysiological Criteria\n\nGCS<13\nSystolic BP < 90 mmHg\nPulse < 50 or >130 \nResp Rate <10 or >29\n\nAnatomical Criteria\n\nFlail or crushed chest\nSignificant injury to abdomen, head or neck\nLimb paralysis\nTwo or more proximal long bone fractures\nObvious pelvic fracture\nAmputation proximal to wrist or ankle\nPenetrating injury to head, neck or trunk\nBurn >20% BSA or respiratory\n\nMechanism of Injury Criteria\n\nCar crash >40mph / >60 kmh\nCyclist (pedal or motor) crash >30km/h\nMajor deformity to car\nEjection from car\nDeath of same car occupant\nRollover\nExtrication time >20 minutes\nPedestrian/ cyclist thrown or hit\nFall > 5 metres');
INSERT INTO `TriageDiagnosis` VALUES (34,'QLIM{Limb problems','7{Uncontrolled major bleeding?\nShock?{1{Category 1','7{Severe pain?\nVascular compromise?\nUncontrolled minor bleeding?\nCritical skin?{2{Category 2','7{Moderate pain?\nInappropriate history?\nControlled bleeding?\nGross deformity?\nOpen fracture?{3{Category 3','7{Pain?\nDeformity?\nSwelling?\nRecent injury?{4{Category 4','5{Category 5{{','','- Critical skin - if a fracture or dislocation tents the skin, and if the fracture is not reduced the skin can become unviable.\n- Vascular compromise is indicated by a cold, pale, pa.inful or pulseless distal limb.');
INSERT INTO `TriageDiagnosis` VALUES (35,'QDIR{Diarrhoea','7{Airway compromised?\nInadequate breathing?\nShock?{1{Category 1','7{Severe pain?\nAcutely vomiting blood?\nAcutely passing fresh or altered blood PR?\nAltered conscious state?{2{Category 2','7{Moderate pain?\nBlack or redcurrent stool?\nHistory of vomiting blood?\nSigns of dehydration?\nPersistent vomiting?{3{Category 3','7{Pain?\nVomiting?\nRecent problem?{4{Category 4','5{Category 5{{','','See also\n- GI bleeding\n- vomiting\n- abdominal pain\n\nRedcurrent stool is a characteristic dark red jelly-like stool, which is classically seen in intusussception.\n\n\"coffee ground\" vomiting is oftern loosely used, and is rarely helpful- it is better to use the terms \"fresh blood\" and \"changed blood\".\n\nSigns of dehydration include dry tongue/ sunken eyes/ low urine output.');
INSERT INTO `TriageDiagnosis` VALUES (36,'QNKP{Neck pain','7{Airway compromised?\nInadequate breathing?\nShock?{1{Category 1','7{Severe pain?\nSigns of meningism?\nNew rash?\nHot child?\nVery hot?{2{Category 2','7{Moderate pain?\nDirect trauma to neck?\nNew neuro symptoms/ signs?\nHot?{3{Category 3','7{Recent problem?{4{Category 4','5{Category 5{{','','Neck means anything above the clavicles except the head.\nDirect trauma means any force directly applied to the head or neck - includes hanging.');
INSERT INTO `TriageDiagnosis` VALUES (37,'QRVN{Review - Non ED patient','5{Category 5{{','','','','','','');
INSERT INTO `TriageDiagnosis` VALUES (38,'QPRG{Pregnancy >22weeks','7{Airway compromised?\nInadequate breathing?\nMajor uncontrolled bleeding?\nPresenting foetal parts?\nProlapsed umbilical cord?\nFitting?\nShock?{1{Category 1','7{Severe pain?\nHistory of fitting?\nIn active labour?\nHeavy PV blood loss?\nAltered conscious state?\nBlood loss > 24 weeks?{2{Category 2','7{Moderate pain?\nShoulder tip pain?\nInappropriate history?\nHistory of trauma?\nHigh blood pressure?\nPV bleeding?{3{Category 3','4{Pain?\nWarmth?{{','','','See also \n- Gynae/ PV bleeding - use for pregnancy less than 23 weeks\n\n- Active labour means regular painful contractions >1 /5 mins.\n- History of fitting means a fit within the last 6 hours.\n- Heavy PV loss means continuous bleeding, large clots, or more than one pad per 4 hours.');
INSERT INTO `TriageDiagnosis` VALUES (39,'QABI{Local infection/ abcess','7{Airway compromised?\nInadequate breathing?\nShock?{1{Category 1','7{Severe pain?\nSubcutaneous gas?\nVascular compromise?\nHot child?\nVery hot?{2{Category 2','7{Moderate pain?\nPain on joint movement?\nHot joint?\nHot?{3{Category 3','7{Pain?\nWarmth?\nRecent problem?{4{Category 4','5{Category 5{{','','- Vascular compromise is indicated by a cold, pale, painful or pulseless distal limb.');
INSERT INTO `TriageDiagnosis` VALUES (40,'QODP{Overdose/ poisoning','7{Airway compromised?\nInadequate breathing?\nFitting?\nShock?{1{Category 1','7{Altered conscious level?\nHigh lethality?\nHigh risk of further self harm?{2{Category 2','7{Moderate lethality?\nRisk of further self-harm?\nInappropriate history?\nMarked distress?{3{Category 3','4{Category 4{{','','','- Lethality is the potential of the poison to cause death.\n- Particularly lethal substances include paraquat, colchicine, cardiac drugs, tricyclic antidepressants and insulin.\n- If in doubt, consult a Poisons Centre, or assume high lethality.');
INSERT INTO `TriageDiagnosis` VALUES (41,'QPOP{Plaster related','7{Vascular compromise?\nBlue digits?\nCold extremities?{3{Category 3','7{Pain?{4{Category 4','5{Category 5{{','','','','- Vascular compromise is indicated by a cold, pale, painful or pulseless distal limb.');
INSERT INTO `TriageDiagnosis` VALUES (42,'QLIC{Limping child','7{Airway compromised?\nInadequate breathing?\nShock?{1{Category 1','7{Severe pain?\nVascular compromise?\nNew rash?\nHot child?{2{Category 2','7{Moderate pain?\nPain on joint movement?\nInability to bear weight?\nInappropriate history?\nHot joint?{3{Category 3','7{Pain?\nWarmth?\nRecent problem?{4{Category 4','5{Category 5{{','','- Vascular compromise is indicated by a cold, pale, painful or pulseless distal limb.');
INSERT INTO `TriageDiagnosis` VALUES (43,'QMEN{Mental illness','7{Airway compromised?\nInadequate breathing?\nShock?{1{Category 1','7{Altered conscious state?\nHigh risk of harm to others?\nHigh risk of harm to self?{2{Category 2','7{Risk of harm to others?\nRisk of self-harm?\nSignificant psychiatric history?\nDisruptive?\nMarked distress?{3{Category 3','4{Category 4{{','','','Risk of harm to others indicated by:\n- posture - tense, clenched.\n- speech - loud, threatening words.\n- motor behaviour - pacing, restless.\nHigh risk should be assumed if weapons and potential victims present.\nSecurity and or police presence may be required.\n\nPhysical violence or threats to healthcare workers are not acceeptable, and will not be tolerated.\n\nRisk of harm to self indicated by\n- history of significant self-harm.\n- actively trying to harm self.\n- actively trying to leave with intent of harming themselves.');
INSERT INTO `TriageDiagnosis` VALUES (44,'QRAS{Rash','7{Airway compromised?\nInadequate breathing?\nShock?\nStridor?{1{Category 1','7{Severe pain/itch?\nSignificant history of allergy?\nFacial/ tongue oedema?\nAcutely short of breath?\nHot child?\nPurpura?\nVery hot?{2{Category 2','7{Moderate pain/ itch?\nInappropriate history?\nWidespread discharge or blistering?\nHot?{3{Category 3','7{Pain/ itch?\nWarmth?\nRecent problem?{4{Category 4','5{Category 5{{','','Significant history of allergy is a known history of severe reaction e.g. to nuts.\nA purpuric rash does not blanch (go white) under pressure, and is due to small bleeds into the skin.');
INSERT INTO `TriageDiagnosis` VALUES (45,'QSEX{Sexually acquired infection','7{Airway compromised?\nInadequate breathing?\nShock?{1{Category 1','7{Severe pain?\nAltered conscious state?\nPurpuric rash?\nVery hot?{2{Category 2','7{Moderate pain?\nTesticular pain?\nKnown immunosuppressant?\nWidespread cutaneous discharge or blistering?\nHot?{3{Category 3','7{Pain?\nWarmth?\nRecent problem?{4{Category 4','5{Category 5{{','','A purpuric rash does not blanch (go white) under pressure, and is due to small bleeds into the skin.\nWidespread discharge or blistering is more than 10% body surface area.');
INSERT INTO `TriageDiagnosis` VALUES (46,'QNOS{Nasal problem','7{Airway compromised?\nInadequate breathing?\nUncontrolled major bleeding?\nShock?{1{Category 1','7{Severe pain?\nUncontrolled minor bleeding?\nAltered conscious level?{2{Category 2','7{Moderate pain?\nSignificant history?\nInappropriate history?\nControlled bleeding?\nGross deformity?{3{Category 3','7{Pain?\nDeformity?\nBleeding disorder?\nRecent problem?{4{Category 4','5{Category 5{{','','');
INSERT INTO `TriageDiagnosis` VALUES (47,'QSOB{Short of breath','7{Airway compromised?\nInadequate breathing?\nShock?{1{Category 1','7{Cardiac pain?\nAcute onset after injury?\nUnable to talk in sentences?\nSat < 90%\nAltered conscious state\nHR >120 or <60 or irregular\nExhaustion\nPEFR < 30% normal{2{Category 2','7{Pleuritic pain?\nSignificant history of asthma?\nSat < 95%\nPEFR < 50% normal{3{Category 3','7{Pain?\nWheeze?\nChest infection?\nChest injury?\nRecent problem?{4{Category 4','5{Category 5{{','','See also \n- Asthma/COAD\n- Short of breath\n\nSignificant history of asthma - any admission to intensive care/ need for ventilation.\nWheeze may be absent in the most severe cases of asthma.');
INSERT INTO `TriageDiagnosis` VALUES (48,'QSOC{Short of breath (child)','7{Airway compromised?\nInadequate breathing?\nUnresponsive?\nDrooling?\nStridor?\nShock?{1{Category 1','7{Acute onset after injury?\nIncreased work of breathing?\nUnable to talk in sentances?\nResponds to voice or pain only?\nPEFR < 30% normal\nSat < 95%\nExhaustion{2{Category 2','7{Significant history of asthma?\nInappropriate history?\nPEFR < 50% normal\nSat < 95%{3{Category 3','7{Pain?\nWheeze?\nChest infection?\nChest injury?\nRecent problem?{4{Category 4','5{Category 5{{','','See also \n- Asthma/COAD\n- Short of breath\n\nSignificant history of asthma - any admission to intensive care/ need for ventilation.\nWheeze may be absent in the most severe cases of asthma.');
INSERT INTO `TriageDiagnosis` VALUES (49,'QTHR{Sore throat','7{Airway compromised?\nInadequate breathing?\nDrooling?\nStridor at rest?\nShock?{1{Category 1','7{Severe pain?\nStridor when distressed?\nAltered conscious state?\nVery hot?\nHot child?{2{Category 2','7{Moderate pain?\nHot?\nHistory of foreign travel?\nRapid onset?{3{Category 3','7{Pain?\nWarmth?\nRecent problem?{4{Category 4','5{Category 5{{','','Stridor - may be inspiratory, expiratory, or both. Best heard when breathing through open mouth.\n\nRapid onset - <12 hours\nForeign travel - travel in last 3 months to an area with endemic diptheria (whooping cough)');
INSERT INTO `TriageDiagnosis` VALUES (50,'QWOU{Wounds/ soft tissue injury','7{Airway compromised?\nInadequate breathing?\nMajor uncontrolled bleeding?\nShock?{1{Category 1','7{Severe pain?\nMinor uncontrolled bleeding?\nVascular compromise?{2{Category 2','7{Moderate pain?\nInappropriate history?\nSignificant blood loss?\nNew neuro signs/ symptoms\n{3{Category 3','7{Pain?\nLocal inflammation?\nLocal infection?\nRecent injury?{4{Category 4','5{Category 5{{','','- Vascular compromise is indicated by a cold, pale, painful or pulseless distal limb');
INSERT INTO `TriageDiagnosis` VALUES (51,'QSTF{Staff','5{Category 5{{','','','','','','');
INSERT INTO `TriageDiagnosis` VALUES (52,'QTES{Testicular pain','7{Airway compromised?\nInadequate breathing?\nShock?{1{Category 1','7{Severe pain?\nHot child?\nVery hot?\nAge < 25 years?\nScrotal gangrene?{2{Category 2','7{Moderate pain?\nColicky pain?\nHot?\nScrotal cellulitis?\nPersistent vomiting?{3{Category 3','7{Vomiting?\nScrotal trauma?\nRecent problem?{4{Category 4','5{Category 5{{','','See also\n- abdominal pain');
INSERT INTO `TriageDiagnosis` VALUES (53,'QURO{Urinary','7{Airway compromised?\nInadequate breathing?\nShock?{1{Category 1','7{Severe pain?\nPriapism?\nVery hot?\nHot child?{2{Category 2','7{Moderate pain?\nColicky pain?\nVisible blood in urine?\nRetention of urine?\nPersistent vomiting?{3{Category 3','7{Pain?\nVomiting?\nSwelling?\nPain on urination?\nRecent problem?{4{Category 4','5{Category 5{{','','See also\n- abdominal pain\n- testicular pain\n\nPriapism is a painful sustained erection.\n');
INSERT INTO `TriageDiagnosis` VALUES (54,'QVOM{Vomiting','7{Airway compromised?\nInadequate breathing?\nFitting?\nShock?{1{Category 1','7{Severe pain?\nAcutely vomiting blood?\nAcutely passing fresh blood PR?\nAltered conscious state?{2{Category 2','7{Moderate pain?\nHistory of vomiting blood?\nSigns of dehydration?\nPersistent vomiting{3{Category 3','7{Pain?\nRecent problem?{4{Category 4','5{Category 5{{','','See also\n- GI bleeding\n- Abdominal pain\n- Diarrhoea\n\nVomited blood may be fresh (bright or dark red) or old (black). Avoid the term \"coffee grounds\" as it is used indiscriminately.\n\nSigns of dehydration - include dry tongue, sunken eyes/ fontanelle, low output of concentrated urine.');
INSERT INTO `TriageDiagnosis` VALUES (55,'QWOR{Worried parent','7{Airway compromised?\nInadequate breathing?\nUnresponsive?\nShock?{1{Category 1','7{Floppy?\nSevere pain?\nResponds to voice or pain only?\nFails to react to parent/ surroundings?\nHistory of overdose or poisoning?\nNew rash/ purpuric rash?\nHot child?{2{Category 2','7{Moderate pain?\nProlonged/ uninterrupted crying?\nInconsolable by parent?\nInappropriate history?\nNot passing urine?\nNot feeding?{3{Category 3','7{Pain?\nWarmth?\n\"Not normal self\"?\nRecent problem?{4{Category 4','5{Category 5{{','','A purpuric rash does not blanch (go white) under pressure, and is due to small bleeds into the skin.\n\nFailure to react to parent - lack of response / abnormal response to parent or surroundings. This is a highly significant indicator of a very sick child.\n\nProlonged continuous crying is >2 hours.');
INSERT INTO `TriageDiagnosis` VALUES (56,'QDIS{Disaster triage','7{Walking?{3{Category 3','7{Not breathing after airway opened?{6{Dead','7{Unsurvivable injury?{6{Dead/ Hopeless','7{Resp rate > 29\nResp rate <10{1{Category 1','7{Pulse > 120\nCapilliary refill > 2 seconds{1{Category 1','2{Category 2{{','The key is to do the greatest good for the greatest number.\nTriage should take 15 seconds.\n\n\nUnsurvivable injury - e.g. 80 year old patient with 50% burns. \nThe point of triageing patients to this category is to avoid heroic efforts being made to resuscitate someone who will not survive. A yellow card with a diagonal line through it is used for these patients. Palliative care e.g. morphine is humane, but medical and nursing care should not be diverted from the potentially salvagable.');
INSERT INTO `TriageDiagnosis` VALUES (57,'QTRU{Chest/ abdo injury','7{Airway compromised?\nInadequate breathing?\nUncontrolled major bleeding?\nShock?{1{Category 1','7{Severe pain?\nMechanism of injury criteria (see below)?\nSignifcant history?\nUncontrolled minor bleeding?\nAcutely short of breath?\nExternalisation of organs?{2{Category 2','7{Moderate pain?\nInappropriate history?\nControlled bleeding?{3{Category 3','7{Pain?\nLocal inflammation?\nLocal infection?\nRecent injury?{4{Category 4','5{Category 5{{','','See also\n- multiple injury\n\nCall the trauma team if  the patient has:\n\n- physiological criteria OR \n- anatomical criteria OR \n- mechanism of injury criteria AND there is not a ED Physician/ Reg/ Surg Reg in the department.\n\nPhysiological Criteria\n\nGCS<13\nSystolic BP < 90 mmHg\nPulse < 50 or >130 \nResp Rate <10 or >29\n\nAnatomical Criteria\n\nFlail or crushed chest\nSignificant injury to abdomen, head or neck\nLimb paralysis\nTwo or more proximal long bone fractures\nObvious pelvic fracture\nAmputation proximal to wrist or ankle\nPenetrating injury to head, neck or trunk\nBurn >20% BSA or respiratory\n\nMechanism of Injury Criteria\n\nHigh speed car crash >60 km/h\nCyclist (pedal or motor) crash >30km/h\nMajor deformity to car\nEjection from car\nDeath of same car occupant\nRollover\nExtrication time >20 minutes\nPedestrian/ cyclist thrown or hit\nFall > 5 metres');
INSERT INTO `TriageDiagnosis` VALUES (58,'QRET{Retrieval by doctor','1{Category 1{{','','','','','','');
INSERT INTO `TriageDiagnosis` VALUES (59,'QUAD{Unwell adult','7{Airway compromised?\nInadequate breathing?\nFitting?\nShock?{1{Category 1','7{Severe pain?\nHR > 120 or <60 or irreg?\nSpecial risk of infection?\nAltered conscious state?\nSigns of meningism?\nNew/ purpuric rash?\nVery hot?{2{Category 2','7{Moderate pain?\nRapid onset?\nForeign travel <3 months?\nWidespread discharge or blistering?\nHot?{3{Category 3','7{Warmth?\nPain?\nRecent problem?{4{Category 4','5{Category 5{{','','See also\n- Collapsed adult\n- Falls\n\nA purpuric rash does not blanch (go white) under pressure, and is due to small bleeds into the skin.\n\nSpecial risk of infection - exposure to known high risk of infection OR particular susceptability to infection (immune disease/ steroids/ diabetes).\n\nSigns of meningism - stiff neck, photophobia and headache.');
INSERT INTO `TriageDiagnosis` VALUES (60,'QUCH{Unwell child','7{Airway compromised?\nInadequate breathing?\nFitting?\nUnresponsive?\nShock?{1{Category 1','7{Severe pain?\nResponds to voice or pain only?\nFails to react to parent?\nSpecial risk of infection?\nAltered conscious state?\nSigns of meningism?\nNew rash?\nVery hot?{2{Category 2','7{Moderate pain?\nInappropriate history?\nNot passing urine?\nNot feeding?\nHot?\nCold?{3{Category 3','7{Pain?\nWarmth?\n\"Not normal self\"?\nRecent problem?{4{Category 4','5{Category 5{{','','Unrecognised rash means any other rash not positively identified.\nPurpuric rashes are caused by small areas of bleeding under the skin -they do not blanch (go white) when pressure is applied.\n\nSigns of severe pain include pallor, sweating and inconsolable crying.\nSigns of moderate pain include intermittant crying.');
